INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (5,'Áo thun dài tay form xuông rộng Lili Orange áo thu đông nữ HLFashion','[\"Áo thun dài tay form xuông rộng basic, áo thu đông nữ HLFashion\\nZalo hỗ trợ: 0949253062\\nÁo thun tay dài unisex nam nữ\\n\\nTên SP: Áo thun dài tay màu trơn form xuông rộng basic, áo thu đông nữ HLFashion\\nÁo thun tay dài form rộng thêu đặc biệt, không ra màu\\nÁo thun thu đông chất liệu thun cotton mịn mềm, không mỏng, không xù lông, hàng đẹp\\nKích thước (cm):\\n+ Size M: Từ 30Kg - 42kg, <1m5 (Ngang 50cm - Dài 65 - Dài Tay 52)\\n+ Size L: Từ 43kg - 60kg, <1m62 (Ngang 52cm - Dài 70 - Dài Tay 53)\\n+ Size XL: Từ 61Kg - 75kg, <1m75 (Ngang 54cm - Dài 75 - Dài Tay 55)\\nCHUẨN form rộng tay lỡ dáng unisex\\nÁo thu đông dài tay được may chuẩn, không lỗi bỏ mũi hay thiếu\\nÁO HÌNH THẬT GIỐNG MẪU\\n\\nHƯỚNG DẪN GIẶT VÀ SỬ DỤNG:\\nLần giặt áo tay dài đầu tiên bạn nên vò bằng tay, giặt bằng nước lã và không sử dụng xà phòng. Bạn không nên giặt chung với các đồ dùng có khác màu đặt biệt là màu trắng vì đối với các loại áo thun có màu đậm như (đỏ đô, cam, xanh đen…) rất dễ ra màu ảnh hưởng đến các đồ khác.\\nKhông đổ trực tiếp các loại xà phòng, nước tẩy lên hình in. Không nên sử dụng các loại xà phòng có tính giặt tẩy cao và tuyệt đối không dùng thuốc tẩy cho các áo màu.\\nKhông nên vắt áo thun sau khi giặt vì điều này khiến áo bạn bị giản ra và chảy xệ mất đi vẻ đẹp của áo. Tốt nhất bạn nên gập áo lại khi phơi và vỗ nhẹ lên áo giúp áo bạn mau khô và không bị nhăn\\nKhi phơi áo dài tay bạn nên lộn trái áo phơi mặt ngoài và phơi chỗ mát vì ánh nắng mặt trời chiếu trực tiếp sẽ làm áo phai màu. Và để áo không bị chảy xệ, bạn nên phơi ngang trên dây vì cấu tạo của sớ vải dễ bị dài ra khi phơi bằng móc làm form áo bạn dài ra hơn lúc đầu.\\nĐối với áo có hình in lớn hoặc có 2 hình in thì không nên gấp chúng dính lại với nhau, tốt nhất nên treo hoặc gấp đôi áo lại.\\n\\nHỖ TRỢ SAU KHI NHẬN HÀNG:\\nÁo thun dài tay HLFashion được kiểm tra kỹ càng từng áo, cắt chỉ cẩn thận, tư vấn nhiệt tình trước khi giao hàng cho khách ạ. Đặc biệt nếu phát hiện hàng lỗi dù chỉ là bỏ mũi chỉ cũng không bao giờ gửi cho khách. \\nHoàn Lại Tiền 100% Nếu Hàng Lỗi Không Giống Ảnh - Sai Mẫu - Màu Nên Cứ An Tâm mua sắm tại HLFashion. \\nHỗ trợ đổi trả trong vòng 3 ngày theo quy định của Shopee\\n\\nÁo thun thu đông tay dài form rộng, áo dài tay nam nữ tay phồng HLFashion siêu chất, siêu xinh, siêu đẹp \\nChỉ mặc áo thun thôi nhưng vẫn rất hấp dẫn người nhìn vì chiếc áo thun với phom dáng rộng chất quá đẹp và tôn dáng. Mặc kết hợp với quần bò đóng thùng mang đến cho người mặc cảm giác năng động. Áo rất dễ mặc phối đồ với quần bò đóng thùng độ rộng vừa phải chất đẹp hoặc kết hợp với quần jean là một lựa chọn hoàn hảo. Nếu các bạn đang có dự định đi du lịch cùng bạn bè, mặc nhóm, café họp nhóm thì hãy đến với Shop HLFashion để có được những mẫu áo thật xinh mà không cần tốn công ra ngoài tìm kiếm nhé!!!\\n\\nCám ơn quý khách đã ủng hộ ạ !\\n\\n#ao #thu #dong #phong \\n#ao #thun #tay #dai #in #unisex #nam #nu #form #hlfashion\"]',NULL,68,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/102fd0451c79bb36466d7c20ce739ac7_tn\",\"https://down-vn.img.susercontent.com/file/69fc694e891a5176b8fd6352b30e5b6c_tn\",\"https://down-vn.img.susercontent.com/file/8338fb5d21715c8661ec2bab7e5ff972_tn\",\"https://down-vn.img.susercontent.com/file/c294497ae74bd6b1397b99c662915f7a_tn\",\"https://down-vn.img.susercontent.com/file/797e56961dfcf18f1e1d00eba4bacb22_tn\"]',2454,NULL,520,'2024-02-11 14:59:19','2024-02-11 14:59:19');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (6,'Quần ống rộng thắt dây nơ vải Ruby cao cấp dài 100cm siêu hot M015','[\"XƯỞNG MAY MINH PHƯỢNG 88\\nSỈ LH: 0962701771\\n\\nMÔ TẢ SP: Quần ống rộng thắt dây nơ vải Ruby cao cấp siêu hot - dài 100cm\\n\\nQuần được làm bằng chất liệu Ruby cao cấp, siêu rũ vải, mềm, mịn, kiểu dáng vô cùng trẻ trung xinh sắn. \\n- Quần ống rộng cạp chun phong cách hàn quốc rất hot tại hàn và trung, với thiết kế lạ mắt ôm eo tạo cảm giác thon gọn eo, có chun dãn giúp lên form và dễ mặc hơn, những bạn có vòng eo hơn lớn vẫn có thể mặc thoải mái mà không khó chịu nha\\n\\n- Quần ống rộng nữ Chất vải Ruby cao cấp nên đảm bảo không nhăn nhàu, lên form đứng dáng\\n- Quần Form rộng Chuẩn\\n- Quần ống suông dễ phối đồ: sơmi,thun, 2 dây, croptop đều đẹp\\n- Quần tây ống rộng có thể mặc đi học sinh đi làm (quần công sở) hoặc đi chơi đều rất đẹp cho người phụ nữ hiện đại.\\n\\n- Màu sắc: ĐEN, NÂU ,KEM\\n\\n-Thiết kế : cạp cao ken bụng,tôn dáng kéo dài đôi chân cho cô nàng tạo vẻ bề ngoài cực sang chảnh\\n- Kiểu dáng : Quần ống rộng cách điệu- quần ống rộng đi học, đi làm - quần vải ống rộng - quần đen ống suông\\n\\nBẢNG SIZE : QUẦN ỐNG RỘNG LƯNG CAO\\n- Size S (40-45kg) Eo 66-67cm, mông 86cm dài 99-100cm\\n- Size M (46-50 kg) Eo 68-69cm, mông 88-90cm dài 99-100cm\\n- Size L (51-55kg) Eo 71-73cm, mông 91-93cm dài 99-100cm\\n- Size: XL (55-60) Eo 74-76cm, mông 94-96cm dài 99-100cm\\n-Size: 2XL(61-65kg) Eo 77-78cm, mông 98-100cm dài 99-100cm\\nTất cả quần nhà shop đều tính số đo eo trên rốn 2cm nên các bạn đo chính xác để tránh bị chật hoặc rộng eo nhé\\n- CAM KẾT\\n- Chính sách đổi trả miễn phí khi sản phẩm không giống hình, xưởng giao nhầm mẫu, nhầm size.\\n- Luôn hỗ trợ khách hàng chu đáo, cố gắng trả lời hết thắc mắc xoay quanh sản phẩm.\\n- Thời gian chuẩn bị hàng và giao hàng NHANH NHẤT vì luôn CÓ SẴN.\\n\\n#quần_ống_rộng #quần #quần_ống_rộng_tuyết_mưa #quần_ống_rộng_đẹp #ống_rộng #sỉ #lẻ #quần_ống_rộng_giá_rẻ_đẹp #quần_ống_rộng_dài_siêu_xinh #quầnốngrộng#quầncullotes\\n#quầnốngrộng #quanongrong #quầnốngrộngcạpcao #quanongrongcapcao #quầnốngrộngnữ #quanongrongnu #quầnsuôngốngrộng #quansuongongrong #quầntâyốngrộng #quầnvảiốngrộng #quanvaiongrong #quầntâynữốngrộng #quầnnữốngrộng #quannuongrong #quầnsuông #quansuong #quầnốngrộngcạpcao #quanongrongcapcao #quầnốngrộnglưngcao #quầnữốngsuông #quầnốngrộngcôngsở #quanongrongcongso #quầnsuôngốngrộngnữ\"]',NULL,176,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/bedcc17b45ace07722db1bc5cd937124_tn\",\"https://down-vn.img.susercontent.com/file/5805599ed6af77b9529e9ad1a554d76b_tn\",\"https://down-vn.img.susercontent.com/file/62b7475fc7af824f08e7f84aaede4644_tn\",\"https://down-vn.img.susercontent.com/file/f6ff46be00d17993240880e73e7d2da7_tn\",\"https://down-vn.img.susercontent.com/file/76c841adead52ddade5a340b25dc7509_tn\"]',7226,NULL,290,'2024-02-11 14:59:19','2024-02-11 14:59:19');
