INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (8,'Bộ Áo Sơ Mi Dài Tay Kèm Áo Khoác Ghi Lê Họa Tiết Hoa Thời Trang Cho Nữ','[\"💗Kính gửi quý khách hàng 💗 ：\",\"▼ Hướng dẫn cách giặt\",\"◆ Nên giặt sản phẩm bằng tay, không cho vào máy giặt\",\"◆ Sản phẩm bị phai màu sau khi giặt là điều bình thường, vui lòng giặt riêng\",\"◆ Để tránh bạc màu và phai màu, vui lòng không tiếp xúc với ánh nắng mạnh\",\"【🌿Lưu ý 1 ”\",\"Do màn hình và hiệu ứng ánh sáng khác nhau, màu sắc thực tế của mặt hàng có thể hơi khác so với hình ảnh. Vui lòng cho phép lỗi (± 3 cm) do đo lường thủ công\",\"【🌿Lưu ý 2 \\\"\",\"Trước khi đặt hàng, vui lòng kiểm tra xem thông tin có chính xác không. Vui lòng chọn đúng kích thước, màu sắc và sản phẩm. Vui lòng ghi rõ họ tên, địa chỉ, số điện thoại của người nhận khi đặt hàng ~\"]',NULL,100,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbnk-lprghxu87ngke6_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbk5-lpoqr9i1sudt5b_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbn2-lpoqra5cuqxye5_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbmi-lpoqrau1um0676_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbmk-lpoqrbgsxb8wf8_tn\"]',4378,NULL,939,'2024-02-11 14:59:19','2024-02-11 14:59:19');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (9,'Set áo khoác ghi lê + áo sơ mi kèm quần jean lưng cao thời trang cho nữ','[\"Thời gian giao hàng dự kiến cho sản phẩm này là từ 7-9 ngày\\n\\nPhong cách: văn học và nghệ thuật retro/ tươi mát nhỏ nhắn;\\nCác yếu tố phổ biến: kiểu bạc màu;\\nKiểu dáng: set quần áo;\\nChiều dài tay áo: dài tay;\\nVải/ chất liệu: khác/ polyester (sợi polyester);\\nHàm lượng thành phần: 51% (bao gồm) -70% (bao gồm);\\nĐộ tuổi phù hợp: thanh niên (18-25 tuổi);\\nCó thêm cashmere không: không có cashmere;\\nMùa ra mắt: mùa thu năm 2021;\"]',NULL,112,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/c1e1d95c2e5f556de49dfe872ff8d19b_tn\",\"https://down-vn.img.susercontent.com/file/7b3996232caa8f26043987abaa1e8051_tn\",\"https://down-vn.img.susercontent.com/file/a483b1370526a6d3b003c5aad9d2d3c5_tn\",\"https://down-vn.img.susercontent.com/file/3d28b13bc3c637b3cd2c1ba302527c0d_tn\",\"https://down-vn.img.susercontent.com/file/6ac727e0611f0c3755608ab8ca3ec47a_tn\"]','6565',NULL,'3096','2024-02-11 14:59:19','2024-02-11 14:59:19');
