INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (22,'Quần Kaki trơn cạp cao ống xuông, Quần Kaki Baggy lưng cao Ống Suông Rộng Trẻ Trung Năng Động BeUshop Q12','[\"Quần Kaki trơn cạp cao ống xuông, Quần Kaki Baggy lưng cao Ống Suông Rộng Trẻ Trung Năng Động BeUshop Q12\",\"\\n\",\"1. THÔNG TIN SẢN PHẨM\",\"- Tên sản phẩm: Quần Kaki trơn, Quần Baggy Nam Nữ jean Ống Suông Rộng Trẻ Trung Năng Động:\",\"- Size: S-M-L-XL\",\"- Chất liệu: Kaki jean cao cấp\",\"- Kiểu dáng: Ống Baggy, ống suông, cạp cao.\",\"- Đường may chuẩn chỉnh, tỉ mỉ, chắc chắn.\",\"\\n\",\"Sản phẩm Quần Kaki trơn, Quần Baggy Nam Nữ jean Ống Suông Rộng mang lại vẻ trẻ trung, năng động, thoải mái cho bạn nữ trong cả ngày hè và ngày đông.\",\"\\n\",\"2. THÔNG SỐ SẢN PHẨM:\",\"- Size S: Eo (60-64), Mông (85-90), Cân nặng 40kg - 45kg\",\"- Size M: Eo (65-68), Mông (91-94), Cân nặng 46kg - 50kg.\",\"- Size L: Eo (68-72), Mông (95-97), Cân nặng 51kg - 57kg.\",\"\\n\",\"3. HƯỚNG DẪN SỬ DỤNG & BẢO QUẢN:\",\" Sử dụng đi học, đi làm, đi chơi,... \",\"- Giặt tay hoặc giặt máy ở nhiệt độ thường \",\"- Không ngâm chung với chất tẩy rửa \",\"- Nên lật mặt trái của quần khi phơi để tránh tình trạng phai, bạc màu\",\"\\n\",\"4. CHÍNH SÁCH BẢO HÀNH:\",\"- BeUshop hỗ trợ đổi size với tất cả đơn hàng.\",\"- Thời hạn bảo hành 02 tháng nếu lỗi do nhà sản xuất.\",\"\\n\",\"5. HỆ THỐNG CỬA HÀNG Neeko:\",\"- 65A Chùa Láng, Đống Đa, Hà Nội ( Cạnh Đại học Ngoại Thương)\",\"- 256 Nguyễn Trãi, Thanh Xuân, Nam Từ Liêm, Hà Nội ( Cạnh Đại Học Hà Nội)\",\"#quanongrong #quanbaggy #baggy #baggykaki #jeansbaggy #quanjeansnu #jeansnu #quanbaggy #quanbo #quandenim #quan #nu #jean #jeans #bonu #baggynu #baggyjeannu #baggygiare #baggyrach #quanjeandep #baggybo #tdshopnt#kakiốngrộngnữ #kakiốngrộngnữ #kakiốngrộngnữ #quầnkakinữốngsuông #kakiốngrộngnữ #quầnsuôngnữkaki #kakiốngrộngnữ #kakinữ #kakiốngrộngnữ #quầnkakirộng #q