INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (23,'Áo thun nữ , áo form vừa đẹp kiểu dáng trẻ trung chất liệu cotton co giãn bốn chiều mềm mại thoải mái khi mặc mỗi ngày','[\"- Áo thun nữ , áo form vừa  đẹp kiểu dáng trẻ trung chất liệu cotton co giãn bốn chiều mềm mại thoải mái khi mặc mỗi ngày\\n1.\\tGIỚI THIỆU SẢN PHẨM :\\n-\\tChất liệu vải : 70%cotton và 30%polly\\n+ Chất liệu : Thun cotton co giản 4 chiều , mềm mại ,thoáng mát thấm hút mồ hôi\\n+ Đường chỉ may kỹ lưỡng ,tinh tế\\n+ form áo form vừa thoả mái khi mặt hằng ngày\\n+Màu sắc : \\n-\\tCó các size : S , M , L , XL\\n-\\tSản xuất : sản xuất trực tiếp tại xưởng – hàng Việt Nam xuất khẩu\\n2 . BẢNG HƯỚNG DẪN CHỌN SIZE :\\n+ Size S : 40kg - 50kg\\n+ Size M : 51 kg - 60kg\\n+ Size L: 61kg - 67kg\\n+ Size XL : 68kg -75kg\\n 3 . CHÍNH SÁCH BÁN HÀNG :\\n-\\tFREESHIP cho mọi đơn hàng trên 50K\\n-\\tShop còn tặng thêm mã voucher hoặc hoàn xu cho toàn bộ đơn hàng\\n-\\tVề sản phẩm : shop cam kết đúng như mô tả \\n-\\tVề dịch vụ : Shop sẽ cố gắng trả lời thắc mắc cho các bạn trong thời gian nhanh nhất\\n-\\tSản phẩm mới sản xuất tại xưởng 100%\\n-\\tCam khách có quyền đổi trả khi sản bị lỗi trong vòng 2 ngày  \\n4. HÂN HẠNH ĐƯỢC PHỤC VỤ QUÝ KHÁCH\\n                             ----------------------------------------------------------------------------------------------------\\n#aothunnu#aothunformrong#aothunnudep#aothunnuhanquoc#aothunnutrungnien#aothunnuhanghieu#aothunnudongian\\n#aothunnuxin#aokieudep#aonudepnhat#aothunnuformronghanghieu#aoformnucotton#aothunnucotron#aothunnucotronnho\\n#aothunnucotroninchu#aothunnucotrontim#aothunnucotronadidas#aothunnutayngan#aothuninhinh#aothunnuformvua\\n#aothunnutayngan\\n\"]',NULL,147,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/b15b3f35057aa7dd4f2fd8ccc76c9be2_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-liqsmdrrh