INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (24,'Sét áo thun chữ crt mix quần kaki xuông túi hộp xinh lắm DN66','[\"Shop: Loan định chuyên sỉ lẻ kính chào quý khách\",\"\\n\",\"Thông tin chi tiết sản phẩm sản phẩm\",\"\\n\",\"- Hình ảnh : Kèm video ảnh thật trải sàn shop chụp\",\"\\n\",\"- Màu sắc: áo tăm trắng quần hồng\",\"- Màu ảnh có thể chênh lệch đậm nhạt 1 chút do ánh sáng, y ảnh tới 98% nên các bạn yên tâm nhé ạ.\",\"\\n\",\"- Các bạn nên hỏi tư vấn kĩ trước khi đặt hàng nha để nhận dc sản phẩm phù hơp nhất với mình\",\"\\n\",\"LƯU Ý KHI SỬ DỤNG CÁC SẢN PHẨM CỦA SHOP\",\"\\n\",\"- Trong quá trình đóng gói và vận chuyển sản phẩm có thể bị nhàu, quý\",\"\\n\",\"khách vui lòng giặt trước khi sử dụng để cảm nhận sản phẩm tốt nhất\",\"\\n\",\"- Đối với sản phẩm đa dạng về chất liệu, kiểu dáng cách bảo quản sản\",\"\\n\",\"phẩm tốt nhất là giặt tay với bột (nước) giặt nhẹ để giữ được độ bền của\",\"\\n\",\"vải, tránh bị phai màu từ các loại quần áo khác.\"]',NULL,178,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-li63llj6dcr6f7_tn\",\"https://down-vn.img.susercontent.com/file/d50819a7e8490342ab7bbaf09c0fd8ac_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-ljca40wpdr6ab2_tn\",\"https://down-vn.img.susercontent.com/file/b3a3fc55aad4d2a266ba592964d345bd_tn\",\"https://down-vn.img.susercontent.com/file/e5f7cc49dfbe718746f3dfbbdc086642_tn\"]',5124,NULL,1739,'2024-02-11 14:59:19','2024-02-11 14:59:19');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (25,'Quần baggy nữ – Basic Baggy – ufo.thebasic','[\"𝗤𝘂𝗮̂̀𝗻 𝗕𝗔𝗦𝗜𝗖 𝗕𝗔𝗚𝗚𝗬 𝗺𝗮𝗱𝗲 𝗯𝘆 𝘂𝗳𝗼.𝘁𝗵𝗲𝗯𝗮𝘀𝗶𝗰\\r\\n🍊 Chất liệu: vải vitex cao cấp, khá dày dặn, mềm mượt, không nhăn/xù khi mặc\\r\\n🍊 Kiểu dáng: ống thẳng basic vừa vặn theo chân, thoải mái, không ôm bó sát\\r\\n🍊 Màu sắc: Đen\\r\\n🍊 Size: S M L XL XXL\\r\\n\\r\\n📌 Bảng size chi tiết: (Bảng size quần Baggy nhà 𝘂𝗳𝗼 nhỏ hơn so với bình thường)\\r\\n(vòng bụng ngang rốn)\\r\\n𝗦: 40-43kg (bụng 65cm / mông 85cm / đùi 52cm / độ dài 89cm)\\r\\n𝗠: 44-46kg (bụng 68cm / mông 87cm / đùi 53cm / độ dài 89cm)\\r\\n𝗟: 47-50kg (bụng 71cm / mông 91cm / đùi 54cm / độ dài 90cm)\\r\\n𝗫𝗟: 51-54kg (bụng 74cm / mông 94cm / đùi 55cm / độ dài 91cm)\\r\\n𝗫𝗫𝗟: 55-58kg (bụng 77cm / mông 98cm / đùi 56cm / độ dài 91cm)\\r\\n\\r\\n🌈 Trường hợp các bạn không chắc về số đo của mình, thì hãy ưu tiên lựa chọn theo cân nặng, vì đấy là kinh nghiệm tư vấn size nhiều năm nay của chúng mình, chính xác đến 99%.\\r\\n\\r\\n📌 Các bạn tham khảo kĩ bảng size, đừng ngần ngại nhắn tin cho chúng mình để được tư vấn cụ thể hơn,hạn chế trường hợp mua bị rộng hoặc chật nhé. Nếu lỡ mua quần chưa vừa size, đừng ngần ngại  liên hệ với chúng mình để được hỗ trợ đổi size phù hợp 😍\\r\\n\\r\\n📌 Thời gian ship sẽ từ 2-4 ngày tùy vào Shopee. Các bạn iu chủ động theo dõi đơn hàng để biết rõ hơn về thời gian giao hàng nha. Nếu có vấn đề về đơn hàng thì đừng ngần ngại liên hệ chúng mình để nhận hỗ trợ tận tình ạ.\\r\\n\\r\\n🌈 Toàn bộ hình ảnh đều là ảnh thật do @ufothebasic tự chụp tại studio\\r\\n(Info bạn mẫu: m58 - 46kg, đang mặc quần size M) \\r\\n\\r\\n#ufo #ufothebasic #quanbaggy #quanvai #ufobasic #quanbaggynu #quần_baggy_nữ #quần_baggy\"]',NULL,99,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/7321bdfc09555a246aab61f976bf18e0_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-l