INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (26,'Set đồ nữ cộc tay, Bộ ngủ nữ quần đùi mix áo phông tay lỡ thêu mặt cười cute, mặc mùa hè, ở nhà phong cách','[\"\\n**Thông tin Set đồ nữ cộc tay, Đồ bộ nữ quần đùi mix áo phông tay lỡ thêu mặt cười cute, mặc mùa hè, ở nhà phong cách, ulzzang Green 365 fashion\\n\\n- Màu sắc: Bee, Đen, Ghi\\n\\n- Chất liệu: Thun tổ ong cao cấp \\n\\n- Bảng size tham khảo:\\n\\n\\n\\n   👉 Size S: 1m40-1m55 (38-44kg) ; Dài áo: 64cm ; Dài quần : 36cm\\n\\n   👉 Size M: 1m50-1m65(45-50kg) ; Dài áo: 66cm ; Dài quần: 38cm\\n\\n   👉 Size L: 1m60-1m70 ( 51-56kg) ; Dài áo 68cm ; Dài quần: 40cm\\n\\n\\n\\n*Lưu ý: Cân nặng chỉ mang tính tham khảo, tuỳ thuộc vào dáng của từng người nữa ạ \\n\\n*Thông số có thể lệch 1-2cm do chất liệu vải không đáng kể nhé ạ.\\n\\n- Kiểu Dáng : Quần đùi mix áo phông tay lỡ cực đơn giản, dễ thương, dễ mặc\\n\\n- Họa tiết trơn màu dễ mặc, không bai xù khi giặt\\n\\n- Sản Xuất : Sản xuất trực tiếp tại xưởng chất liệu tốt giá hợp lí nên mọi người yên tâm mua hàng nha\\n\\n\\n\\n**CHI TIẾT\\n- Set đồ nữ cộc tay, Đồ bộ nữ quần đùi mix áo phông tay lỡ thêu mặt cười cute, mặc mùa hè, ở nhà phong cách ulzzang\\n\\n- Set đồ nữ cộc tay, Đồ bộ nữ quần đùi mix áo phông là một set đồ không thể thiếu trong tủ đổ của các chị em, với thiết kế basic, dễ mặc dễ phối đồ, lên form siêu xinh, chị em có thể mặc đi chơi, đi ngủ cực kì thoải mái và dễ chịu.\\n\\n- Set đồ nữ cộc tay, Đồ bộ nữ quần đùi mix áo phông  à mẫu thiết kế đơn giản, theo style trẻ trung, năng động, hình mặt cười là mặt cười thêu-điểm nhấn đơn giản nhưng không kém phần xinh xắn\\n\\n- Với Set đồ nữ cộc tay, Đồ bộ nữ quần đùi mix áo phông tay lỡ mặc mùa hè , là lựa chọn hàng dầu của các chị em, vậy nên hãy nhanh tay mua sắm cho mình một set cực xinh nha\\n\\n- Chất liệu thun tổ ong giãn 4 chiều cao cấp được xử lý bề mặt, không bai, xù qua nhiều lần giặt\\n\\n- Set đồ nữ cộc tay, Đồ bộ nữ quần đùi mix áo phông tay lỡ được may tại xưởng vải mềm mại và thoáng mát tuyệt đối,đường may cẩn thận, tỉ mỉ, chắc chắn chất lượng tốt, giá cả phù hợp với tất cả khách hàng, nên đang được bán rất chạy\\n\\n**HDSD Set đồ nữ cộc tay, Đồ bộ nữ quần đùi mix áo phông tay lỡ thêu mặt cười cute, mặc mùa hè, ở nhà phong cách ulzzang\\n\\n- Tốt nhất nên giặt tay và không nên chà mạnh bằng bàn chải có sợi cứng. \\n\\n- Nếu giặt máy, nên chọn chế độ giặt nhẹ và sản phẩm có chất vải phù hợp để bảo quản được lâu. \\n\\n- Không nên sử dụng chất giặt tẩy. \\n\\n- Không nên ngâm chung với trang phục ra bị màu\\n\\n\\n\\n**ĐỔI TRẢ theo đúng quy định\\n\\n Điều kiện áp dụng (trong vòng 3 ngày kể từ khi nhận sản phẩm): \\n\\n- Hàng hoá vẫn còn mới, chưa qua sử dụng, còn tem mác sản phẩm\\n\\n- Hàng hóa bị giao nhầm, giao thiếu hoặc lỗi do nhà sản xuất.\\n\\n\\n\\n#setdonu #dobonu #coctay #quandui #quanduinu #aothuntaylo #aothunmatcuo #aophong  #aophongtaylo #aophongmatcuoi  #set #do #nu #do #bo #nu #quan #dui #ao #mix #muahe #dichoi #cute #cogian #giare #dobothethao #vintage #aothun #taylo #setdo #donu #bonu #ulzzang #xinh #dep #bigsize #giare #green365fashion\"]',NULL,128,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/1304fc4df64bdb1c430fe050c5e35fdb_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-ljt7ww00tibm5d_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-ljt7ww00uww242_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-ljt7ww00johgd8_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-ljt7ww00i9x06a_tn\"]',4492,NULL,1994,'2024-02-11 14:59:19','2024-02-11 14:59:19');
