INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (29,'Giày Thể Thao Đế Dày Phối Lưới Thoáng Khí Phong Cách Hàn Quốc Thời Trang Mùa Hè Mới TYT106','[\"Nó được làm bằng vật liệu chất lượng cao, đủ bền để bạn mặc hàng ngày!\\nNó là một món quà tốt cho người yêu của bạn hoặc chính bạn.\\nTheo dõi chúng tôi và nhận được nhiều voucher hơn trước khi bạn mua.\\nNếu bạn có bất kỳ câu hỏi nào, xin vui lòng liên hệ với chúng tôi.\\nSau khi bạn đặt hàng Bạn luôn có thể liên hệ với dịch vụ khách hàng của chúng tôi nếu bạn có bất kỳ câu hỏi nào. Chúng tôi sẽ trả lời và giải đáp thắc mắc của bạn trong thời gian sớm nhất. sau khi nhận hàng Nếu bạn có bất kỳ câu hỏi nào hoặc không hài lòng về sản phẩm, bạn có thể liên hệ trực tiếp với chúng tôi. cung cấp cho bạn một giải pháp thỏa đáng ngay lần đầu tiên. Nếu bạn hài lòng với sản phẩm của chúng tôi Đừng quên đánh giá tốt và chúng tôi sẽ giảm giá cho bạn nhiều hơn!\"]',NULL,123,'GNN',NULL,'[\"https://down-vn.img.susercontent.com/file/a5eda6b1b5358ae284efd8f1e63ce4c1_tn\",\"https://down-vn.img.susercontent.com/file/64a07a36beb506d909be0ecdefb6a14f_tn\",\"https://down-vn.img.susercontent.com/file/201d9aba6cad78f2c9a9745c0073dc53_tn\",\"https://down-vn.img.susercontent.com/file/e181504e977d7b11fb02b2d76b87c974_tn\",\"https://down-vn.img.susercontent.com/file/bdd64b6be748452e65e2a99725e8de0c_tn\"]',1849,NULL,588,'2024-02-11 15:00:44','2024-02-11 15:00:44');
