INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (31,'Giày 𝐉𝐨𝐫𝐝𝐚𝐧 1 hồng đen nữ, Giày thể thao JD 1 cổ thấp Black Guava Ice hồng đen bản đẹp full box bill','[\"Giày 𝐉𝐨𝐫𝐝𝐚𝐧 1 hồng đen nữ, Giày thể thao JD 1 cổ thấp Black Guava Ice hồng đen bản đẹp full box bill\\n\\n- Shop mới hoạt động trên sàn nhưng đã dựa trên những xưởng sản xuất và cửa hàng hoạt động lâu năm, vậy nên shop luôn cam kết về chất lượng sản phẩm, giá thành và đặc biệt là thái độ phục vụ cũng như các hậu mãi sau khi mua hàng tại shop.\\n\\n🔥  Mẫu Giày 𝐉𝐨𝐫𝐝𝐚𝐧 1 hồng đen nữ giày đang cực kì hot và năng động với mẫu cổ cao cổ thấp các màu, sản phẩm dễ phối đồ và đeo cực kì êm chân.. mọi người không cần bỏ ra số tiền quá lớn mà vẫn sở hữu được sản phẩm ưng í khi đến với shop mình. \\n\\n\\n🎁Cam Kết :\\n✔️ Quý khách được đổi trả thoải mái nếu sản phẩm Giày 𝐉𝐨𝐫𝐝𝐚𝐧 1 hồng đen nữ có vấn đề cũng như chuyện lỡ đặt không vừa size.\\n✔️Nhận hàng hàng TRƯỚC - Thu tiền SAU.\\n----------------------------------------------------------------------------------------------------------\\n🎁 [HÌNH ẢNH và MÔ TẢ ]\\n✔️ Giày đẹp, nhẹ, bền. Giá phải chăng phù hợp với các bạn học sinh, sinh viên. Có thể làm giày đôi, giày nhóm. Thích hợp đi chơi, du lịch, chạy bộ, gym, đi học, đi làm... \\n✔️ Dễ phối đồ, có thể kết hợp với váy, jeans, sooc…. Phù hợp với mọi thời tiết từ đông sang hè.\\n---------------------------------------------------------------------------------------------------------------\\n🎁 LỜI MUỐN NÓI: \\nCảm ơn các bạn đã đến với chúng tôi. Sau khi nhận giày xong nếu có vấn đề nào bạn chưa vừa lòng làm ơn hãy liên hệ ngay với chúng tôi để được hỗ trợ và giải quyết .các bạn hãy vui lòng dành chút thời gian đánh giá sản phẩm để shop lấy động lực phục vụ các bạn tốt hơn nhé !!\\nCảm ơn bạn đã quan tâm. Đừng quên theo dõi shop! Bạn sẽ được cập nhật những mẫu giày mới nhất trên thị trường!!!\\n\\n#giayjodan1 #giay_jordan_co_cao #giay_the_thao_jodan\\n#giaythethao #giaynam #giaynu #giayfullbox #giaythethaonamnu #giayulzzang #giayhocsinh #giaysinhvien  #sneaker #freeship #fullbox #giaynamnu #giaygiare #ulzzang #giaysneaker #giaytheduc #suc #dapgot #sục_nữ #sục_thể_thao_nữ #giày_thể_thao #giày_sneaker #giày_thể_thao_nữ #giày_thể_thao_nam #giày_nam  #giày_nữ  #giày_sneaker_nữ #SuperStar #giày_sneaker_nam #giầy_thể_thao_nữ #giày_nữ_thể_thao #giầy_nữ #giày_nữ_sneaker #giày_thể_thao_trắng #giày_sneaker_trắng #giày_thể_thao_nữ_1\"]',NULL,166,'GNN',NULL,'[\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lnwrdo1vpgj1fd_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lnwrdo1vv2st04_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lnwrdo1vqv3hf8_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lnwrdo1vs9nx29_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lnwrdo1vto8d1d_tn\"]',8001,NULL,890,'2024-02-11 15:00:44','2024-02-11 15:00:44');
