INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (36,'[NOWSHIP] Giày LOLITA Nữ Da Bóng, Da Lì ulzzang phong cách Hàn quốc mary quai cài đế cao cá tính năng động mới hot','[\"ＵＭＩ ＳＨＯＥＳ － ＨÀＮＧ ＣÓ ＳẴＮ － ＴỐＩ ƯＵ ＴＨỜＩ ＧＩＡＮ ＮＨẬＮ ＨÀＮＧ \",\"-----------------------------\",\"GIÀY MJ HORSE\",\"\\n\",\"\\n\",\"\\n\",\"𝗕𝗔̉𝗡𝗚 𝗦𝗜𝗭𝗘 \",\" EU 35 = Chiều dài chân 22cm\",\" EU 36 = Chiều dài bàn chân 22.5cm\",\" EU 37 = Chiều dài chân 23cm\",\" EU 38 = Chiều dài bàn chân 23.5cm\",\" EU 39 = Chiều dài chân 24cm\",\" EU 40 = Chiều dài bàn chân 24.5 - 25cm\",\"-------------------------------\",\"𝐌𝐎̂ 𝐓𝐀̉ 𝐒𝐀̉𝐍 𝐏𝐇𝐀̂̉𝐌 𝐂𝐎̛ 𝐁𝐀̉𝐍 - 𝐔𝐌𝐈 𝐒𝐇𝐎𝐄𝐒\",\" -Chất liệu thân giày: Da simili mềm - Ôm sát cổ chân\",\" -Màu sắc: da bóng/ da lì\",\" -Kích thước: 35, 36,37,38,39\",\" -Chất liệu đế: Cao su lưu hóa\",\" -Chất liệu trong giày bốt: Lót lvải mềm - tiện lợi sử dụng cả 4 mùa xuân/hạ/thu/đông\",\" -Hình dạng của mũi giày: Mũi tròn\",\" -Chất liệu phần thân giày: Da PU tráng mịn chống nhăn/móp\",\" -Cách mang: cài quai\",\" -Chất keo: ép nhiệt quanh giày (có thể sử dụng đi trời mưa, không lo bong, hở keo)\",\"----------------------------------\",\"𝐌𝐎̂ 𝐓𝐀̉ 𝐒𝐀̉𝐍 𝐏𝐇𝐀̂̉𝐌 𝐂𝐇𝐈 𝐓𝐈𝐄̂́𝐓 - 𝐔𝐌𝐈 𝐒𝐇𝐎𝐄𝐒\",\"- Phần thân trên\",\"chất liệu da simili mềm mịn cao cấp đi rất êm chân, mang thoải mái đi lại cả ngày \",\"- Phần Midsole (đế giữa)  rất êm, phủ lông mịn\",\"- Phần Outsole (đế ngoài) là điểm quyết định của em giày này. Đế cao su đặc có độ bám dính, chống trơn trượt, ma sát tối đa, tạo độ êm ái thoải mái nên sản phẩm hết sức tuyệt vời cho những cô nàng có tính chất công việc phải đi lại cả ngày. Đế cao 5cm lên chân tạo dáng cực xinh là 1 trong những siêu phẩm cực kì hack dáng lun nha\",\"-------------------------\",\"𝐒𝐔̛̉ 𝐃𝐔̣𝐍𝐆\",\"Giày oxford  ulzzang da mềm nhà UMI SHOES có thể sử dụng như giày ulzzang đi học, giày bốt ulzzang đi chơi, giày ulzzang du lịch dự tiệc, giày ulzzang thông dụng sử dụng hàng ngày, giày ulzzang chụp ảnh chụp hình pose dáng, giày ulzzang đi làm văn phòng, giày ulzzang dạo phố, giày  ulzzang đi chơi các dịp Tết, ngày lễ Noel, hallowin, giày bốt ulzzang đi các kiểu các kiểu vân vân mây mây...\",\"Đấy, UMI SHOES mới liệt kê sơ sơ thui đó cả nhà, thực sự thì ẻm GIÀY BỐT ULZZANG CỔ CAO ZIP KHÓA KÉO SAU này lên đồ mix match đỉnh kout\",\"\\n\",\"Tiêu chí ĐẸP + DỄ MIX ĐỒ + THOẢI MÁI CHẤT LƯỢNG + GIÁ RẺ\",\"▪︎ Sản phẩm phù hợp đi chơi, đi tiệc đi học, du lịch, dạo phố, \",\"#re #boot #bot #oxford #giaymoi #buocday #giaydeto  #ulzzang #botulzzang #giay #giaybot #botnu #nu #botnumoi #botxinh #xinh #botdep #dep #moi #hot #trend #botmoi #anhquoc #hanquoc #phongcachanhquoc #phongcach #thoitrang #tretrung #nangdong #tre #catinh #dihoc #dichoi #botda #damem #debang #decao #martin #umishoes #botmartin #daybot #day #kieumoi #botnuxinh #mauden #botden #botkeokhoa #botthapco #thapco #quatangsinhnhat #quatang #giaynu #freeship #mienphiship #giare #re #giamgia #giam #banchay #yeuthich #gotvuong #muitron #muivuong #botmuitron #botdethap #phongcahhanquoc #uytin #chatluong #bendep #giaybotnuulzzang  #shopee #moinhat #giaybitmui #giaydebang #debang #cosan #nowship #hanoi #order #quangchau #muitron #xinh #cothap #botcothap #thapco #debang\",\"#giaymarry #maryjane #giaydecao #decao #dabong #dali #ulzzang #nangdong #tretrung #catinh #nangdong #xinh \"]',NULL,131,'GNN',NULL,'[\"https://down-vn.img.susercontent.com/file/vn-11110105-7r98o-lqhdus68s9oz83_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lmvuqq047jkv0e_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lmumh54gp1b321_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-lkdv64w2x09od1_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lm73gq04f9pba8_tn\"]',309,NULL,53,'2024-02-11 15:00:44','2024-02-11 15:00:44');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (37,'XUXIAOYAN Giày Thể Thao Nữ Đế Dày Thoáng Khí Retro Thời Trang Đa màu sắc Độc đáo Cá tính Đàn hồi FLF23C0KM7 51Z231223','[\"🌈 Chào mừng đến với cửa hàng của chúng tôi.\",\"\\n\",\"  🌈 Theo dõi cửa hàng để nhận phiếu giảm giá ”◕‿◕｡\",\"\\n\",\"  🌈 Nếu bạn hài lòng với sản phẩm và dịch vụ của chúng tôi Lời khen ngợi năm sao\",\"\\n\",\"  🚚 Sản phẩm đến từ Trung Quốc và mất một thời gian để vận chuyển\",\"\\n\",\"  💕 Phải mặc! Phổ biến vào năm 2023!\",\"\\n\",\"  💕Được làm bằng chất liệu cao cấp, đủ bền để bạn mặc hàng ngày!\",\"\\n\",\"  💕 Thật thoải mái Chất liệu vải mềm mại, hình dáng đẹp, chất lượng tốt.\",\"\\n\",\"  💕 Thiết kế đẹp, sang trọng, độc đáo.\",\"\\n\",\"  💕 Nó là một món quà tốt cho người yêu của bạn hoặc chính bạn.\",\"\\n\",\"  ❣️ Chất lượng và giá cả như thế này không thể tìm thấy ở bất kỳ nơi nào khác, rất đáng đồng tiền. ️\",\"\\n\",\"  ❣️Do các thiết bị hiển thị và chiếu sáng khác nhau, hình ảnh có thể không phản ánh màu sắc thực tế của tất cả các sản phẩm. Cảm ơn bạn đã thông cảm ❣️\",\"\\n\",\"  ❣️ Đánh giá 1 hoặc 2 sao không có lý do / hình minh họa. hoặc đặt điều gì đó không đúng sự thật làm hỏng danh tiếng của shop shop sẽ không giúp gì cả vì bạn được coi là đang vào vì lợi ích của Shop, đặc biệt cảm ơn quý khách hàng đã có nhu cầu vui lòng đặt hàng hoặc yêu cầu thêm thông tin tin tin nhé ️\"]',NULL,97,'GNN',NULL,'[\"https://down-vn.img.susercontent.com/file/vn-11110105-7r98o-lpo1bree022f63_tn\",\"https://down-vn.img.susercontent.com/file/cn-11134207-7r98o-lq1kfbh41mph2f_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rblf-loxxzfwd6iiud6_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbn1-lplwre7jw85fac_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbkv-lplwrc4mxutf54_tn\"]',8985,NULL,4311,'2024-02-11 15:00:44','2024-02-11 1