INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (38,'Giày Da Mũi Tròn Phong Cách Nhật Bản Xinh Xắn Cho Nữ','[\"Một số lý do để chọn chúng tôi📌\",\"\\n\",\"Thông tin kích thước chính xác phía sau hình ảnh chính\",\"\\n\",\"🟧Các vấn đề về chất lượng sẽ được giải quyết nghiêm túc và kịp thời\",\"\\n\",\"🟨Hình ảnh giống nhau nhưng chất lượng của chúng tôi sẽ tốt hơn\",\"\\n\",\"🟩Sản phẩm Wukong có thể đeo lâu và thoải mái\",\"\\n\",\"🟦Sản phẩm Wukong còn hàng, bạn có thể yên tâm mua hàng\",\"\\n\",\"Chúng tôi đã chuẩn bị một phiếu giảm giá bất ngờ cho bạn, bạn có thể tự nhận hoặc trò chuyện riêng với bộ phận chăm sóc khách hàng của chúng tôi để nhận hàng💌\",\"\\n\",\"🧸Đó là một trải nghiệm thú vị từ khi nhìn thấy sản phẩm đến khi nhận sản phẩm, bạn sẽ thích shop của tôi\",\"\\n\",\"Mỗi sản phẩm của chúng tôi được mô tả chi tiết\",\"\\n\",\"📔Thích hợp cho mọi lứa tuổi\",\"\\n\",\"📒Phần trên được thiết kế vừa vặn với đôi chân của bạn, hỗ trợ tác động và trọng lượng của người mặc.\",\"\\n\",\"📕Thiết kế đế dưới có thể bám dính tốt trên mọi bề mặt.\",\"\\n\",\"📗Dễ dàng làm sạch và nhanh khô\",\"\\n\",\"📘Có thể mặc bất cứ lúc nào\",\"\\n\",\"Sản phẩm mới trong cửa hàng\",\"\\n\",\"🔺Shop mình sẽ có số lượng lớn hàng mới lên kệ hàng tuần\",\"\\n\",\"🔻Theo dõi cửa hàng của tôi để nhận phiếu giảm giá\",\"\\n\",\" Do thiết bị hiển thị và ánh sáng khác nhau, hình ảnh có thể không phản ánh màu sắc thực tế của tất cả các sản phẩm. Cảm ơn bạn cho sự hiểu biết của bạn.\",\"\\n\",\"Nếu bạn gặp sự cố hoặc lỗi sản phẩm, chúng tôi nói chuyện trước. Đừng ấn tượng với các đánh giá. chúng tôi rất vui khi sửa chữa nó.\",\"\\n\",\"Vui lòng đánh giá cửa hàng 5 sao. ⭐  ⭐  ⭐  ⭐  ⭐ Cảm ơn bạn. mọi đánh giá là rất quan trọng đối với cửa hàng.\",\"\\n\",\"Cảm ơn bạn đã hỗ trợ của bạn. chúng tôi sẽ phục vụ khách hàng của chúng tôi tốt nhất. \",\"\\n\"]',NULL,178,'GNN',NULL,'[\"https://down-vn.img.susercontent.com/file/vn-11110105-7r98o-loz6z4y9156o39_tn\",\"https://down-vn.img.susercontent.com/file/cn-11134207-7r98o-lpg0jlm50zmk47_tn\",\"https://down-vn.img.susercontent.com/file/cn-11134207-7r98o-lpg0jlm52e70ce_tn\",\"https://down-vn.img.susercontent.com/file/cn-11134207-7r98o-lpg0jlm53srg97_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7qvea-lgyq95jxers3ff_tn\"]',511,NULL,181,'2024-02-11 15:00:44','2024-02-11 15:00:44');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (40,'Giày Thể Thao Nữ Độn Đế 5p, Giày CV cổ thấp đế cao 5cm Đi Học, Đi Chơi Cực Năng Động, M78','[\"Giày Thể Thao Nữ Độn Đế 5p, Giày CV cổ thấp đế cao 5cm Đi Học, Đi Chơi Cực Năng Động, M78\\n\\n👑Chào mừng bạn đến với cửa hàng nhỏ của Lisa shop\\nChúng mình chuyên cung cấp giày thể thao nữ, quần, áo theo mùa cực năng động và trẻ trung\\nCam kết của T.rex Store:\\n-\\tChỉ bán hàng chất lượng ko bán hàng loại 2, hàng nhái.\\n-\\tCam kết đổi trả cho quý khách trong vòng 7 ngày kể từ ngày nhận được hàng nếu hàng bị lỗi do nhà sản xuất\\n-\\tBảo hành chất lượng sản phẩm đến 6 tháng\\n-\\tHỗ trợ khách hàng đổi size nếu ko vừa.\\n\\n✅Hệ Thống Chuỗi Cửa Hàng \\n- Tòa Vp5  Nguyễn Duy Trinh,  Hoàng Mai, Hà Nội \\n- Số 14 Trần Hưng Đạo, thành phố Thái Bình\\n\\n 👑 Hotline: 0974.544.678\\n\\n✅ THÔNG TIN SẢN PHẨM:\\n- Chất liệu : Vải , đế cao su\\n- Màu sắc: Trắng, Đen\\n- Kiểu dáng: Sneaker năng động \\n - Size 35-39\\n- Giày full hộp, vận chuyển đến tay khách hàng đều được đóng gói kỹ bằng xốp nổ và hộp carton cứng cáp đảm bảo chuẩn form\\n✅ HƯỚNG DẪN SỬ DỤNG\\n- Không giặt tẩy bằng các chất tẩy rửa mạnh, có thể dùng ( vỏ chuối, sữa tươi , giấm... )\\n- Không ngâm nước quá lâu\\n- Với các sàn phẩm sáng màu, nên vệ sinh thường xuyên\\n- Tránh cất giữ giày khi còn ướt, ẩm..\\n\\n✅ Bảo hành 𝐂𝐒𝐊𝐇 :  \\n- Bảo hành 1 đổi 1 miễn phí trong vòng 7 ngày nếu sản phẩm có lỗi do nhà sản xuất.\\n- Bảo hành chất lượng sản phẩm 6 tháng.\\n- Chăm sóc & tư vấn trọn đời.\\n- Sản phẩm quý khách nhận được bị lỗi, không hài lòng về chất lượng xin vui lòng ibox chat cho shop để được hỗ trợ\\n \\n   Cảm ơn quý khách đã ghé thăm và ủng hộ Lisa shop\\nVui lòng ấn \\\"Theo dõi\\\" để cập nhật những sản phẩm chính hãng, giá rẻ mới nhất nhé!\\n\\n#giay #giaynu #giaythethaonu #giaydep #giaysneaker #sneakernu #giaydondecao #giaydihoc #giaydichoi #giaythethaosneaker #giaythethaohanquoc #giaydecaomuaodau #giaynuhanquoc #giaythethao #giaybata #giaynudep #giayhanquoc #giaythethaonu #giaysneakernutrang  #giàynunangđe #giaynuchinhhang  #giaynudonde #giàynucaocap #giaynugiare #giaytheducnu #giaynudep #giayhoctheduc #giaysportnu #giayhotnu #giaychonulun #giaynuthoitrang #giaynuemchan #giaynumautrang \"]',NULL,151,'GNN',NULL,'[\"https://down-vn.img.susercontent.com/file/3c25f2e5fb3be730e619686833199836_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-llkrtlw6bhdoe4_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-llkrtlw5w14s70_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-llkrtlvvxu1b0d_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-llkrtlvvz8lr3a_tn\"]',3122,NULL,1535,'2024-02-11 15:00:44','2024-02-11 15:00:44');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (43,'Giày búp bê thiết kế mới vào năm 2023 guốc nữ dép sandal nữ giày mary jane','[\"🌸 Vui lòng đọc trước khi đặt hàng.\",\"🍁 Vận chuyển từ Trung Quốc, thời gian giao hàng là khoảng 7-15 ngày.\",\"🍁 Nếu bạn có bất kỳ câu hỏi nào, bạn có thể tìm thấy dịch vụ khách hàng trực tuyến và dịch vụ khách hàng sẽ trả lời bạn một cách kiên nhẫn.\",\"🍁 Tất cả các loại hàng tồn kho đều có sẵn. Nếu hết hàng, thì hết hàng.\",\"💬 Không thể chỉnh sửa đơn hàng qua trò chuyện và lưu.\",\"💬 Nếu khách hàng muốn sửa đổi đơn hàng, hãy hủy đơn hàng. Khách hàng chỉ có thể hủy đơn hàng mới và đơn hàng mới.\",\"🌸 Chỉ hủy nếu không có số gói. 🌸\",\"💐 Bảo HÀNH sản phẩm\",\"💐 Sản phẩm được cung cấp miễn phí mà không có bất kỳ đảm bảo nào.\",\"💐 Màu sắc / kích thước / mẫu có thể thay đổi một chút.\",\"💐 Thứ Hai 24, 5:17 giờ tối, tùy thuộc vào tình trạng sẵn có\",\"💓 Bạn có thể đến cửa hàng để nhận 💓 Phiếu giảm giá.\",\"💓 Có giảm giá 50% cho mỗi sản phẩm và bạn cũng có thể nhận được một phiếu giảm giá sau khi đặt hàng 💓.\"]',NULL,63,'GNN',NULL,'[\"https://down-vn.img.susercontent.com/file/sg-11134201-23030-lsko992mhlov25_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-23030-5tof5ab4h5nv47_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-23030-00yu0ob4h5nv4c_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134201-23030-vu8vx7pofeov4b_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134201-23030-vez3wqqofeov4c_tn\"]',9846,NULL,4619,'2024-02-11 15:00:44','2024-05-06 19:41:54');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (44,'Giày nữ thời trang mùa hè giày đế cao thoáng khí, tạo cảm giác thoải mái khi mang giày đạp gót-AA0141','[\"Chào mừng đến với cửa hàng của chúng tôi 😊😊😊\",\"🌄  Chất lượng cao và giá cả hữu nghị. 🌄  \",\"Trước khi đặt hàng, bạn sẽ nhận được phiếu giảm giá trên trang chủ của cửa hàng, để bạn có thể nhận được giá rẻ hơn.\",\"⚡  Đặt hàng trong 1 giờ mà không cần nhấn \\\"Hủy\\\" ⚡\",\"Đối với sản phẩm trong hình, sử dụng màn hình khác có thể khiến màu sắc thực của sản phẩm hơi đậm hơn hoặc phai màu hơn hình ảnh.\",\"Sản phẩm của chúng tôi đến từ nước ngoài. Khoảng 7-12 ngày để giao hàng. 🚚🚚🚚\",\"🔥  Điều rất quan trọng là đảm bảo rằng số điện thoại và địa chỉ của bạn là chính xác trước khi nhấp vào \\\"Đặt hàng\\\". Nếu có lỗi, chúng tôi không thể thay đổi hoặc sửa chữa bất kỳ nội dung nào. 🔥\",\"Chúng tôi có kinh nghiệm phong phú và sản phẩm chất lượng cao.\",\"Cung cấp cho bạn trải nghiệm mua sắm tốt nhất\",\"Sản phẩm của chúng tôi là thương hiệu mới 100%.\",\"Chúng tôi chú ý đến chất lượng và giá cả!\",\"Nếu Bạn Thích Sản Phẩm Của Chúng Tôi, Vui Lòng Đặt Giỏ Hàng Trong Giỏ Hàng Và Giúp Anh Nhấp Vào 👍👍👍 💖💖💖\",\"Cửa hàng của chúng tôi cung cấp dịch vụ khách hàng trực tuyến, vì vậy nếu vấn đề do cửa hàng gây ra, vui lòng trả lời câu hỏi của bạn. Nó cho thấy rằng sản phẩm có khuyết tật. Bạn có thể tìm thấy cửa hàng thông qua trò chuyện. Cửa hàng sẵn sàng chịu trách nhiệm.\",\"💕💕  Nếu sản phẩm không có vấn đề gì theo bất kỳ cách nào, đó là điều bình thường. Đừng quên khen ngợi và đánh giá cửa hàng của chúng tôi. Chúng tôi mong muốn được đánh giá năm sao của bạn. ⭐⭐⭐⭐⭐⭐⭐⭐\",\"Mỗi điểm đều có giá trị đối với cửa hàng của chúng tôi. Cảm ơn bạn đã đưa ngón tay cái lên. 💕💕💕\",\"Chúng tôi luôn có sản phẩm mới. Hãy cập nhật những tin tức mới nhất trong cửa hàng của chúng tôi. Chúng tôi sẽ gửi cho bạn phiếu giảm giá và chiết khấu.\"]',NULL,152,'GNN',NULL,'[\"https://down-vn.img.susercontent.com/file/sg-11134201-23030-rt6wnqzxboov9a_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-23030-navy5c1xboov30_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-23030-r2f7jw1xboove6_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-23030-hcjuat2xboovfe_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-23030-tmh1td3xboov99_tn\"]',1024,NULL,290,'2024-02-11 15:00:44','2024-02-11 15:00:44');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (45,'Dép Cao Gót 5cm Đế Dày Chống Trượt Thời Trang Mới 2023 Cho Phụ Nữ Trung Niên','[\"🖍️ Một số lý do để chọn chúng tôi 📌\",\"🔔 Thông tin kích thước chính xác nằm sau hình ảnh chính\",\"📌 Kiểm tra cẩn thận mọi sản phẩm sẽ được vận chuyển\",\"📌 Các vấn đề về chất lượng sẽ được xử lý nghiêm túc và kịp thời\",\"📌 Hình ảnh giống nhau, nhưng chất lượng của chúng tôi sẽ tốt hơn\",\"📌 Sản phẩm có thể đeo trong thời gian dài và thoải mái\",\"📌 Sản phẩm còn hàng và có thể tự tin mua\",\"🎫 Chúng tôi đã chuẩn bị một phiếu giảm giá bất ngờ cho bạn và bạn có thể tự mình thu thập hoặc trò chuyện trực tiếp với bộ phận chăm sóc khách hàng của chúng tôi để thu thập 💌\",\"🛒🛒 Chúng tôi thường bắt đầu các hoạt động để nhận quà tặng tinh tế và phiếu giảm giá lớn miễn phí ngưỡng 🛍️🛍️\",\"🎁 Từ khi nhìn thấy sản phẩm đến khi nhận được là một trải nghiệm thú vị, và bạn sẽ thích cửa hàng của tôi 🎁\",\"📖 Mỗi sản phẩm của chúng tôi đều có phần giới thiệu chi tiết\",\"📔 Chất liệu: PU\",\"📒 Phong cách: dép\",\"📕 Phong cách: Giản dị\",\"📗 Chức năng: Nâng cao\",\"📘 Màu đen\",\"📙 Kích thước: 35-40\",\"📣📣📣 Sản phẩm mới trong cửa hàng\",\"🔺 Cửa hàng mình có số lượng lớn sản phẩm mới ra mắt hàng tuần\",\"🔻 Theo dõi cửa hàng của tôi và nhận phiếu giảm giá\",\"🌈 Mang giày của chúng tôi, dù bạn đi nhiều mỗi ngày cũng không cảm thấy mệt mỏi ✨\"]',NULL,151,'GNN',NULL,'[\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbkf-lof20by8vlt694_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbm1-lodte0ki7jocaa_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbk5-lodte11zhykd1e_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbkx-lodte1iwt7i73a_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbng-lodte2182epoff_tn\"]',4312,NULL,39,'2024-02-11 15:00:44','2024-02-11 15:00:44');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (46,'Dép Đế Dày Tăng Chiều Cao Hợp Thời Trang Và Dễ Mang Giày Lười Vải Thời Trang Cho Nữ','[\"Chào mừng đến với cửa hàng của chúng tôi 😊😊😊\",\"🌄   Chất lượng thượng thừa, giá cả thân dân. 🌄\",\"Bạn sẽ nhận được phiếu giảm giá trên trang chủ của cửa hàng trước khi đặt hàng để bạn có thể nhận được mức giá rẻ hơn.\",\"⚡   Đặt hàng 1 giờ mà không nhấn \\\"Hủy\\\" ⚡\",\"Đối với các sản phẩm trong hình ảnh, việc sử dụng một màn hình khác có thể dẫn đến màu sắc thực của sản phẩm hơi tối hoặc mờ hơn so với hình ảnh.\",\"Sản phẩm của chúng tôi đến từ nước ngoài. Khoảng 7-12 ngày giao hàng. 🚚🚚🚚\",\"🔥   Điều quan trọng là phải đảm bảo rằng số điện thoại và địa chỉ của bạn là chính xác trước khi nhấp vào \\\"Đặt hàng\\\". Nếu có lỗi, chúng tôi sẽ không thể thay đổi hoặc sửa chữa bất cứ điều gì. 🔥\",\"Chúng tôi có nhiều kinh nghiệm và sản phẩm chất lượng cao.\",\"Trải nghiệm mua sắm tốt nhất cho bạn\",\"Sản phẩm của chúng tôi là 100% thương hiệu mới.\",\"Chúng tôi chú trọng đến chất lượng và giá cả!\",\"Nếu bạn thích sản phẩm của chúng tôi, xin vui lòng đặt giỏ hàng vào giỏ hàng và giúp anh ta nhấp vào 👍👍👍 💖💖💖\",\"Cửa hàng của chúng tôi cung cấp dịch vụ khách hàng trực tuyến, vì vậy nếu vấn đề là do cửa hàng gây ra, vui lòng trả lời câu hỏi của bạn. Điều này cho thấy sản phẩm bị lỗi. Bạn có thể tìm thấy cửa hàng thông qua trò chuyện. Cửa hàng sẵn sàng chịu trách nhiệm.\",\"💕💕   Nếu sản phẩm không có vấn đề gì, đó là bình thường. Đừng quên khen ngợi và đánh giá cửa hàng của chúng tôi. Chúng tôi mong đợi đánh giá 5 sao của bạn. ⭐⭐⭐⭐⭐⭐⭐⭐\",\"Mỗi điểm đều có giá trị đối với cửa hàng của chúng tôi. Cảm ơn vì đã giơ ngón tay cái lên. 💕💕💕\",\"Chúng tôi luôn có sản phẩm mới. Luôn cập nhật những tin tức mới nhất trong cửa hàng của chúng tôi. Chúng tôi sẽ gửi cho bạn phiếu giảm giá và giảm giá.\"]',NULL,128,'GNN',NULL,'[\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbmw-lmmxy3ab1edh36_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbmw-lmmxy3s2bf4p93_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbm2-lmmxy499m8gp31_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbm6-lmmxy51kgtk956_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbmr-lmeg1k1texju7f_tn\"]',2914,NULL,686,'2024-02-11 15:00:44','2024-02-11 15:00:44');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (47,'Giày Da Đế Dày Đính Hạt Ngọc Trai Thời Trang Mùa Hè 2023 Cho Nữ','[\"Kích thước: 35-40 kích thước bình thường (Theo phản hồi của người mua, nếu loại chân mỏng, bạn có thể chọn một kích thước nhỏ hơn. Nếu nghi ngờ, vui lòng liên hệ với bộ phận chăm sóc khách hàng của chúng tôi)\",\"Kích thước Chiều dài bàn chân\",\"35 = 22,5 cm = 8,9 inch\",\"36 = 23,0 cm = 9,1 inch\",\"37 = 23,5 cm = 9,3 inch\",\"38 = 24,0 cm = 9,4 inch\",\"39 = 24,5 cm = 9,6 inch\",\"40 = 25,0 cm = 9,8 inch\",\" \",\"Hướng dẫn: kiểu bàn chân rộng, mập hoặc mu bàn chân cao, vui lòng cân nhắc có tăng một size tùy theo kiểu bàn chân hay không.\",\"Do sự khác biệt về độ phân giải của màn hình, có thể có sự khác biệt về màu sắc giữa hình ảnh và đồ thật, đó là điều bình thường và không phải là cơ sở để đổi trả.\"]',NULL,188,'GNN',NULL,'[\"https://down-vn.img.susercontent.com/file/vn-11134201-23020-ffvyx6pjnsnve7_tn\",\"https://down-vn.img.susercontent.com/file/36703ddbb150f11370209db58e588e76_tn\",\"https://down-vn.img.susercontent.com/file/5a3d99f2866a72c04615a6135be1c24c_tn\",\"https://down-vn.img.susercontent.com/file/7f2e670747b6b0ec5cadba6958f3a935_tn\",\"https://down-vn.img.susercontent.com/file/9c8c3bc665e8f82f886630ddeff8ba73_tn\"]',341,NULL,130,'2024-02-11 15:00:44','2024-02-11 15:00:44');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (48,'Dép Cao Gót Hở Ngón Họa Tiết Kẻ Sọc Thời Trang Mùa Hè 2023 Cho Nữ','[\"Mang bên ngoài Tính khí Giày cao gót Dép nữ 2023 Mùa hè Thời trang mới Mở ngón chân Dày Giày thời trang Dép kẻ sọc\"]',NULL,117,'GNN',NULL,'[\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbmk-lp21tb0mmslzb0_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbkp-lp21tbmtrpxa9a_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbm2-lp21tcfelwr2c3_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rblh-lp21tczdr9bye1_tn\"]',9904,NULL,1002,'2024-02-11 15:00:44','2024-02-11 15:00:44');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (49,'Giày lolita ulzzang đế cao 6cm siêu đẹp 3 màu đen bóng đen nhám trắng (SẴN ĐEN)','[\"GIÀY NỮ ULZZANG HÀN QUỐC－ ＨÀＮＧ ＣÓ ＳẴＮ\\n BÁN HÀNG BẰNG SỰ TỬ TẾ\\nSản phẩm mình bán được nhập trực tiếp từ Trung Quốc về, hàng Quảng Châu các bạn nha. Với phương châm BÁN ĐÚNG SẢN PHẨM- ĐÚNG GIÁ TRỊ (nghĩa là số tiền bạn bỏ ra sẽ đúng giá trị sản phẩm bạn nhận lại hoặc có thể là tốt hơn, do mình trực tiếp nhập số lượng lớn nên giá rẻ hơn-hihi). \\nMình sẽ luôn cố gắng để mang trải nghiệm mua hàng tốt nhất cho các bạn, nếu trong trường hơp các bạn chưa hàng lòng, các bạn có thể ib để mình giải quyết ạ, có những lúc mình chưa rep ngày đc thì các bạn thông cảm nha, nhưng sẽ không có 1 khách nào không được giải quyết ạ. Với các khách hàng của mình, mình cam kết không để bất cứ một khách nào thiệt, đã bỏ tiền ra là hàng phải dùng được và đúng với số tiền mình bỏ ra (không là rất tiếc đúng ko ạ, vì mình là người bán nhưng mình cũng là người mua, mà mua ko dùng được sẽ rất ức chế ).\\nCảm ơn tất cả các bạn đã chọn sản phẩm bên mình và chọn mình để tin tưởng. Mình sẽ không làm các bạn thất vọng. \\n-----------------------------\\n 𝗕𝗔̉𝗡𝗚 𝗦𝗜𝗭𝗘 \\nEU 36 = Chiều dài bàn chân 23cm \\nEU 37 = Chiều dài chân 23.5cm \\nEU 38 = Chiều dài bàn chân 24cm \\nEU 39 = Chiều dài chân 24.5cm \\n𝐌𝐎̂ 𝐓𝐀̉ 𝐒𝐀̉𝐍 𝐏𝐇𝐀̂̉𝐌 𝐂𝐎̛ 𝐁𝐀̉𝐍\\n -Chất liệu: da mềm \\n-Màu sắc: đen nhám, đen bóng, trắng\\n-Kích thước: 36,37,38,39 \\n- Đế cao: 6cm \\n-Chất liệu đế: Cao su lưu hóa \\n-Hình dạng của mũi giày: Mũi tròn \\n-Cách mang: cài quai ngang \\n-Chất keo: ép nhiệt quanh giày (có thể sử dụng đi trời mưa, không lo bong, hở keo)\\n𝐒𝐔̛̉ 𝐃𝐔̣𝐍𝐆 \\nGiày vintage của shop có thể sử dụng đi học, đi chơi, đi du lịch dự tiệc. Giày có thể thông dụng sử dụng hàng ngày, chụp ảnh chụp hình pose dáng hay đi làm văn phòng, dạo phố.Giày vintage trắng đen đi chơi các dịp Tết, ngày lễ Noel, hallowin, giày bốt ulzzang đi các kiểu các kiểu vân vân mây mây... Đấy, shop mới liệt kê sơ sơ thui đó cả nhà, thực sự thì ẻm này lên đồ mix match đỉnh kout lắm lunnnn Tiêu chí ĐẸP + DỄ MIX ĐỒ + THOẢI MÁI CHẤT LƯỢNG + GIÁ RẺ ▪︎ Sản phẩm phù hợp đi chơi, đi tiệc đi học, du lịch, dạo phố, #giaynu #giare #maumoi #ulzzang #hot #giaydecao #giaynu #giaydeto #tangchieucao #5cm #xinh #donde #nangde #nu #tondang #nangdong #giaytrang #giay #mem#dongian #gonchan #rangcua #giayden #giaydentron\"]',NULL,174,'GNN',NULL,'[\"https://down-vn.img.susercontent.com/file/c3607cd78c820d7b732cf84e21fde4c4_tn\",\"https://down-vn.img.susercontent.com/file/ea7b764edc11f068afe74bf0983984be_tn\",\"https://down-vn.img.susercontent.com/file/123da02e37a8231cde114b257102670b_tn\",\"https://down-vn.img.susercontent.com/file/ed0adc03e56ea34b55ca75fc0eb728e8_tn\",\"https://down-vn.img.susercontent.com/file/aa3388b7fe29de324c427a07205991df_tn\"]',9208,NULL,3685,'2024-02-11 15:00:44','2024-02-11 15:00:44');
