INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (51,'JIBEISI thể thao nữ giày giày thể thao nữ 2023 NEW Thoải mái Đế linh hoạt Điều chỉnh được Thời trang FYD23B0YK4 48Z231130','[\"🌈 Chào mừng đến với cửa hàng của chúng tôi.\",\"\\n\",\"  🌈 Theo dõi cửa hàng để nhận phiếu giảm giá ”◕‿◕｡\",\"\\n\",\"  🌈 Nếu bạn hài lòng với sản phẩm và dịch vụ của chúng tôi Lời khen ngợi năm sao\",\"\\n\",\"  🚚 Sản phẩm đến từ Trung Quốc và mất một thời gian để vận chuyển\",\"\\n\",\"  💕 Phải mặc! Phổ biến vào năm 2023!\",\"\\n\",\"  💕Được làm bằng chất liệu cao cấp, đủ bền để bạn mặc hàng ngày!\",\"\\n\",\"  💕 Thật thoải mái Chất liệu vải mềm mại, hình dáng đẹp, chất lượng tốt.\",\"\\n\",\"  💕 Thiết kế đẹp, sang trọng, độc đáo.\",\"\\n\",\"  💕 Nó là một món quà tốt cho người yêu của bạn hoặc chính bạn.\",\"\\n\",\"  ❣️ Chất lượng và giá cả như thế này không thể tìm thấy ở bất kỳ nơi nào khác, rất đáng đồng tiền. ️\",\"\\n\",\"  ❣️Do các thiết bị hiển thị và chiếu sáng khác nhau, hình ảnh có thể không phản ánh màu sắc thực tế của tất cả các sản phẩm. Cảm ơn bạn đã thông cảm ❣️\",\"\\n\",\"  ❣️ Đánh giá 1 hoặc 2 sao không có lý do / hình minh họa. hoặc đặt điều gì đó không đúng sự thật làm hỏng danh tiếng của shop shop sẽ không giúp gì cả vì bạn được coi là đang vào vì lợi ích của Shop, đặc biệt cảm ơn quý khách hàng đã có nhu cầu vui lòng đặt hàng hoặc yêu cầu thêm thông tin tin tin nhé ️\"]',NULL,158,'GNN',NULL,'[\"https://down-vn.img.susercontent.com/file/cn-11134207-7r98o-lpj1x6pacr5re8_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbkv-lop91dwzg26g43_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbl7-lop91cv8z9wdda_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbkd-lop91eri7dxz15_tn\",\"https://down-vn.img.susercontent.com/file/cn-11134207-7r98o-lp4x4m71stzr36_tn\"]',7585,NULL,1498,'2024-02-11 15:00:44','20