INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (53,'Giày Nữ Đạp Gót Chất Liệu Vải Mềm Có 2 Màu Đen và Trắng, Kiểu Dáng Mới Lạ Độc Đáo - Mã Sản Phẩm: GN11','[\"Giày Nữ Đạp Gót Chất Liệu Vải Mềm Có 2 Màu Đen và Trắng, Kiểu Dáng Mới Lạ Độc Đáo - Mã Sản Phẩm: GN11\\n\\n   Giày nữ đạp gót là sản phẩm sở hữu phong cách cá tinh, năng động phù hợp với các bạn trẻ. Bất kỳ bạn trẻ nào cũng nên có 1 đôi. Được thiết kế với chất liệu đế là cao su đúc, mang lại cảm giác êm chân và nhẹ cho mỗi bước đi. Sản phẩm phù hợp với mọi trang phục và là mẫu giày nữ không thể thiếu. \\n\\n\\n1. Thông tin sản phẩm giày nữ đạp gót GN11\\n\\n   + Mã sản phẩm: GN11\\n   + Kiểu dáng: Giày nữ\\n   + Chất liệu: \\n       - Thân giày: Vải thể thao thoáng khí, Kết hợp da\\n       - Kiểu đế: Đế đúc cao su non có rãnh chống trượt\\n   + Màu: Đen - Trắng\\n   + Size: 35 - 36 - 37 - 38 - 39 - 40\\n   + Đế cao: 3 cm\\n   + Lưu ý: Để chọn size chân chính xác các bạn đo chiều dài bàn chân giống như bảng size của shop.\\n\\n2. Hướng dẫn vệ sinh giày.\\n\\n   - Nên vệ sinh giày vào ban ngày hạn chế vệ sinh giày vào buổi tối\\n   - Không để giày ngâm nước quá lâu hoặc mang giày khi đi trời mưa. \\n   - Định kỳ vệ sinh giày, không sử dụng thuốc tẩy để giặt\\n   - Quấn khăn giấy kín quanh giày và đem đi phơi khô dưới ánh mặt trời hoặc bóng râm.\\n   - Trong thời gian dài không mang, nên vệ sinh giày sạch sẽ và gói giày lại bằng giấy.\\n\\n3. Chính sách đổi hàng và bảo hành sản phẩm.\\n\\n   + Chấp nhận đổi hàng trong các trường hợp hàng bị lỗi, không đúng mẫu, không vừa size\\n   + Hỗ trợ đổi size và đổi mẫu trong vòng 7 ngày kể từ khi nhận sản phẩm.\\n   + Hỗ trợ phí vận chuyển để khách hàng đổi sản phẩm mới nếu vì lý do lỗi kĩ thuật\\n\\n4. Gợi ý nhỏ cho bạn nhé !\\n\\n   - Tận dụng tối đa các mã miễn phí vận chuyển, mã giảm giá của Shopee và mã giảm giá của Shop.\\n\\n   - Theo dõi hành trình giao hàng, nếu có vấn đề phát sinh như thu phí sai, sai số điện thoại, địa chỉ nhận hàng hay thời gian vận chuyển quá lâu hãy báo lại shop nhé. \\n\\nPhương Ngọc Store - Thế Giới Giày Nữ - Luôn Tự Hào Về Chất Lượng Sản Phẩm\\n\\n🎁 LỜI MUỐN NÓI! Nhận giày xong mong các bạn sẽ có những phản hồi tích cực như Feedback hình ảnh hoặc đánh giá 5 sao nếu cảm thấy OK. Mọi vấn đề bạn chưa vừa long xin hãy inbox để được hỗ trợ trước khi đánh giá nhé. Cảm ơn bạn đã đặt giày. Đừng quên nhấn theo dõi nha! \\n\\nShop luôn dẫn đầu trong việc đáp ứng nhanh chóng những trào lưu xu hướng thời trang mới nhất châu Á. mang đến làn gió mới với xu hướng thời trang năng động, hiện đại và cá tính. Chúng tôi liên tục đổi mới chính mình và cam kết luôn cập nhật những mẫu mới nhất để đáp ứng nhu cầu và làm hài lòng tất cả khách hàng thân thiết của Shop\\n\\n#giaynu #giaytheothaonu #giaynuthethao #sneakernu #giaysneakernu #giaynudep #giaynugiare #giaynucaocap #giaynutot #giaythethaonusneaker #giaydilam #giaydichoi #sneakernuthethao #giaynuthoitrang #giaynusneaker #giaynusneakerthethao\"]',NULL,94,'GNN',NULL,'[\"https://down-vn.img.susercontent.com/file/574646f8b2e2fd099ce542d30f1a6e7f_tn\",\"https://down-vn.img.susercontent.com/file/e6f6c3aada149924e689fdb1d697fd40_tn\",\"https://down-vn.img.susercontent.com/file/bbaebdb38b519e6785752651b8213947_tn\",\"https://down-vn.img.susercontent.com/file/3ded9907fbdca178fcc2551cde2d91ea_tn\",\"https://down-vn.img.susercontent.com/file/f6e8a75b8b3c6c374d2dc21a82471e87_tn\"]',4139,NULL,1107,'2024-02-11 15:00:44','2024-02-11 15:00:44');
