INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (56,'GIÀY NỮ TĂNG CHIỀU CAO 6 - 7 CM SIÊU NHẸ VÀ ÊM','[\"Lưu ý1: Giày size hơi rộng1 chút so với size chuẩn khoảng 0,5, tức là size 35 chuẩn sẽ là 35,5 nhé. Các bạn liên hệ với shop để tư vấn kỹ nhé\\nLưu ý 2: Giày nhà e cam kết giống hình 100%, nếu nhận hàng không giống shop hoàn tiền và miễn phí vận chuyển kèm phí hoàn tiền\\n \\nĐể vệ sinh giày quý khách lưu ý:\\n1. Không cho giày vào máy giặt, giày da cho vào máy giặt sẽ rất nhanh hỏng\\n2. Giặt giày bằng nước rửa giày chuyên dụng (Shop có tặng kèm)\\n3. Khi sử dụng xong nếu có vết bẩn thì hãy rửa luôn và lau bằng khăn sạch.\\n==> Để sử dụng lâu nhất có thể quý khách hàng nhớ vệ sinh giày thường xuyên nhé, Hạn chế để giày ướt, giày bẩn, để lâu sẽ rất khó vệ sinh\\n1. Mô tả \\nGiày nữ tăng chiều cao 6 - 7 cm siêu nhẹ và êm là một sản phẩm giày thời trang được thiết kế để giúp phái đẹp tăng thêm chiều cao một cách tự nhiên và thoải mái khi đi lại.\\n\\nDo các bạn đi vào chân nữa nên mình sẽ bù trừ khi lót giày bị đè nặng sẽ xuống khoảng 1cm, vì vậy giày sẽ tăng chiều cao từ 6-7cm nha.\\n\\nA. Bảng kích thước size\\nSize 35 chiều dài bàn chân 225mm\\nSize 36 chiều dài bàn chân 230mm\\nSize 37 chiều dài bàn chân 235mm\\nSize 38 chiều dài bàn chân 240mm\\nSize 39 chiều dài bàn chân 245mm\\n\\n2. Thông số chung và các phụ kiện kèm theo\\nA. Thông số\\nChất liệu: Da\\nMàu sắc: Trắng - Đen\\nChiều cao đế: 7 phân\\nThiết kế cổ sát mắt ca chân\\nĐế giày: Cao su\\nKích cỡ: 35-39\\n\\nB. Các phụ kiện kèm theo khi mua giày\\nHộp đựng giày: giúp bảo quản giày tốt hơn và dễ dàng mang đi khi cần thiết\\nChống móp giày: Đây là bộ phận giúp shop ship đến tay khách hàng mà giày vẫn giữ được vóc dáng ban đầu\\nNước rửa giày mini (áp dụng theo chương trình khuyến mãi tặng kèm)\\n\\n3. Ưu điểm của giày\\nTạo độ cao cho người mang: Giày tăng chiều cao 6cm giúp người mang tạo được độ cao, giúp cho dáng đi của bạn trở nên thon gọn, quyến rũ hơn.\\n\\nThiết kế siêu nhẹ: Với thiết kế siêu nhẹ, giày giúp bạn thoải mái vận động, đi lại trong thời gian dài mà không bị mỏi chân.\\n\\nĐế êm ái: Đế giày êm ái giúp giảm thiểu va đập và giảm tác động lên khớp chân, giúp bạn luôn cảm thấy thoải mái khi sử dụng.\\n\\nChất liệu đa dạng: Giày được làm từ các chất liệu khác nhau như da, vải, nỉ, phù hợp với nhiều phong cách thời trang và sự kiện khác nhau.\\n\\nKiểu dáng trẻ trung, thời trang: Thiết kế giày tăng chiều cao 6cm cho nữ thường có kiểu dáng trẻ trung, thời trang và đa dạng, phù hợp với nhiều phong cách thời trang khác nhau.\\n\\nTăng sự tự tin: Với độ cao tạo ra và thiết kế trẻ trung, giày giúp tăng sự tự tin cho người mang, giúp bạn cảm thấy tự tin và thoải mái trong mọi hoàn cảnh.\\n\\n4. Chế độ bảo hành và đổi trả\\nGiày có chính sách đổi trả trong vòng 7 ngày nếu sản phẩm có lỗi kỹ thuật hoặc không đúng với mô tả trên trang web. Ngoài ra, các chính sách bảo hành thường áp dụng cho những lỗi do sản xuất và không bao gồm lỗi người dùng gây ra\\n\\nTuy nhiên, để được đổi trả sản phẩm, bạn cần đảm bảo sản phẩm vẫn trong tình trạng hoàn toàn mới và chưa qua sử dụng, cùng với đầy đ\"]',NULL,52,'GNN',NULL,'[\"https://down-vn.img.susercontent.com/file/bf8d77925aaac301c5784073bb50bbf9_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lm2whcq5mrq79b_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lm2whcq5ld5r3f_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lm2whcq5wli77f_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lm2whcq5tskf48_tn\"]',4689,NULL,590,'2024-02-11 15:00:44','2024-02-11 15:00:44');
