INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (59,'Giày thể thao nữ chất vải canvas bản dây xoắn đế tăng chiều cao hot trend - C07','[\"Giày thể thao nữ chất vải canvas bản dây xoắn độn đế tăng chiều cao hot trend - C07\",\"2 PHIÊN BẢN: VIP và THƯỜNG ( PHIÊN BẢN VIP ĐẾ SẼ DÀY HƠN VÀ CHẮC CHẮN HƠN PHIÊN BẢN THƯỜNG)\",\"THÔNG TIN SẢN PHẨM\",\"✔️ Size: 36 - 39 \",\"✔️ Giá Siêu cạnh tranh. \",\"✔️ Kiểu dáng hot trend của năm nay và còn kéo dài trong những năm tiếp theo. Đế giày được thiết kế chịu ma sát tốt, tăng chiều cao, nhẹ, êm, cân bằng và thoáng khí\",\"✔️ Giày đẹp, nhẹ, bền. Giá phải chăng phù hợp với các bạn học sinh, sinh viên. Có thể làm giày đôi, giày nhóm. Thích hợp đi chơi, du lịch, chạy bộ, gym, đi học, đi làm...\",\"✔️ Dễ phối đồ, có thể kết hợp với váy, jeans, sooc…. Phù hợp với mọi thời tiết từ đông sang hè. \",\"✔️ Giao hàng Toàn Quốc\",\"✔️ Kiểm tra hàng trước khi thanh toán\",\"HƯỚNG DẪN CHỌN SIZE GIÀY\",\" Chiều dài bàn chân -> Size số:\",\"- 22.5cm đến 23cm ---> size 36 \",\"- 23cm đến 23.5cm ---> size 37 \",\"- 23.5cm đến 24cm ---> size 38 \",\"- 24cm đến 24.5cm ---> size 39 \",\"👉 HƯỚNG DẪN BẢO QUẢN GIÀY 🤭\",\"- Thường xuyên lau chùi bụi bẩn, mồ hôi cho giày\",\"- Bảo quản giày nơi khô thoáng để đạt độ bền cao nhất\",\"- Không giặt giày bằng máy giặt, chất tẩy rửa mạnh\",\"📢 LƯU Ý 🔔\",\"- Màu của giày có thể sẽ chênh lệch thực tế một phần nhỏ, do ảnh hưởng về độ lệch màu của ánh sáng nhưng vẫn đảm bảo chất lượng\",\"- Shop chỉ giải quyết những khiếu nại của khách hàng khi có bằng chứng rõ ràng (Quay video khi nhận hàng bóc hàng, phiếu giao hàng của bên shop..) \",\"Sau khi nhận giày xong nếu có vấn đề nào bạn chưa vừa lòng làm ơn hãy liên hệ ngay với chúng tôi để được hỗ trợ và giải quyết .các bạn hãy vui lòng dành chút thời gian đánh giá sản phẩm để shop lấy động lực phục vụ các bạn tốt hơn nhé !! Cảm ơn bạn đã quan tâm. Đừng quên theo dõi shop! Bạn sẽ được cập nhật những mẫu giày mới nhất trên thị trường!!!\",\"♥️ Cảm ơn bạn đã ủng hộ ♥️\",\"Chúc các bạn mua sắm vui vẻ ^-^\",\" #giaynu #giaythethao #giayullzang #thoangkhi #phongcach #thoitrang #hanquoc #nangdong #giaydaytron #giaytrang #giayvai #giaydichoi #giayhot #giaydayxoan\"]',NULL,56,'GNN',NULL,'[\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-llyamom8b2lbd2_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-llyamom8faan56_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lm2sekt3xf4vdc_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lm2sekt3ytpb0f_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lm2sekt41mu71a_tn\"]',6595,NULL,2674,'2024-02-11 15:00:44','2024-02-11 15:00:44');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (60,'GUDETU❤Giày Thể Thao Dệt Kim Thời Trang Hàn Quốc Cho Nữ','[\"“Một vài lý do để chọn chúng tôi ”\",\"🔥Chúng tôi đã chuẩn bị một phiếu giảm giá bất ngờ cho bạn, bạn có thể tự nhận hoặc trò chuyện riêng với bộ phận chăm sóc khách hàng của chúng tôi để nhận hàng🔥\",\"🌠Đó là một trải nghiệm thú vị từ khi nhìn thấy sản phẩm đến khi nhận sản phẩm, bạn sẽ thích shop của tôi🌠\",\"————————————————\",\"🎁Shop mình sẽ có số lượng lớn hàng mới lên kệ hàng tuần\",\"🎁Theo dõi cửa hàng của tôi để nhận phiếu giảm giá\",\"————————————————\",\"🌟Mỗi sản phẩm của chúng tôi được mô tả chi tiết\",\"🌟Thích hợp cho mọi lứa tuổi\",\"🌟Phần trên được thiết kế vừa vặn với đôi chân của bạn, hỗ trợ tác động và trọng lượng của người mặc.\",\"🌟Thiết kế đế dưới có thể bám dính tốt trên mọi bề mặt.\",\"🌟Dễ dàng làm sạch và nhanh khô\",\"🌟Có thể mặc bất cứ lúc nào\",\"————————————————\",\"🌴Chất lượng sản phẩm được đảm bảo và sẽ được kiểm tra trước khi xuất xưởng.\",\"🌴Mọi thắc mắc vui lòng tham khảo cửa hàng.\",\"🌴Sản phẩm có xuất xứ từ Trung Quốc và sẽ mất một thời gian để vận chuyển.\",\"🌴Nếu bạn cần sản phẩm của chúng tôi, vui lòng thêm chúng vào giỏ hàng của bạn, cảm ơn bạn rất nhiều.\",\"🌟[Rất quan trọng, rất quan trọng]🌟\",\"🚩Vui lòng kiểm tra xem số điện thoại và địa chỉ của bạn có chính xác không trước khi nhấp vào đơn đặt hàng.\",\"🚩Sản phẩm của chúng tôi là thương hiệu mới.\",\"🚩Chúng tôi nhấn mạnh chất lượng và giá cả thấp!\",\"🚩Sau khi nhận được gói hàng, nếu bạn hài lòng với mặt hàng, xin vui lòng cho nó một 5 sao⭐⭐⭐⭐⭐ Đánh giá và chào mừng bạn đến thăm chúng tôi một lần nữa🤩🤩\"]',NULL,190,'GNN',NULL,'[\"https://down-vn.img.susercontent.com/file/vn-11110105-7r98o-lqmtz9dh6x8ae7_tn\",\"https://down-vn.img.susercontent.com/file/cn-11134207-7r98o-lqftr3bdkunp97_tn\",\"https://down-vn.img.susercontent.com/file/sg-111342