INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (62,'Dép Crocs Đế Mềm Dày 5cm Tăng Chiều Cao Thời Trang Cho Nữ','[\"Một số lý do để chọn chúng tôi📌\",\"\\n\",\"🔔Thông tin kích thước chính xác phía sau hình ảnh chính\",\"🟧Các vấn đề về chất lượng sẽ được giải quyết nghiêm túc và kịp thời\",\"🟨Hình ảnh giống nhau nhưng chất lượng của chúng tôi sẽ tốt hơn\",\"🟩Sản phẩm Wukong có thể đeo lâu và thoải mái\",\"🟦Sản phẩm Wukong còn hàng, bạn có thể yên tâm mua hàng\",\"\\n\",\"🎫Chúng tôi đã chuẩn bị một phiếu giảm giá bất ngờ cho bạn, bạn có thể tự nhận hoặc trò chuyện riêng với bộ phận chăm sóc khách hàng của chúng tôi để nhận hàng💌\",\"🧸Đó là một trải nghiệm thú vị từ khi nhìn thấy sản phẩm đến khi nhận sản phẩm, bạn sẽ thích shop của tôi🎁\",\"\\n\",\"📖Mỗi sản phẩm của chúng tôi được mô tả chi tiết\",\"📔Thích hợp cho mọi lứa tuổi\",\"📒Phần trên được thiết kế để chứa \",\"Bàn chân của bạn, hỗ trợ tác động và trọng lượng của người mặc.\",\"📕Thiết kế đế dưới có thể bám dính tốt trên mọi bề mặt.\",\"📗Dễ dàng làm sạch và nhanh khô\",\"📘Có thể mặc bất cứ lúc nào\",\"\\n\",\"📣📣📣Sản phẩm mới trong cửa hàng\",\"🔺Shop mình sẽ có số lượng lớn hàng mới lên kệ hàng tuần\",\"🔻Theo dõi cửa hàng của tôi để nhận phiếu giảm giá\",\"\\n\",\"🌈 Do thiết bị hiển thị và ánh sáng khác nhau, hình ảnh có thể không phản ánh màu sắc thực tế của tất cả các sản phẩm. Cảm ơn bạn cho sự hiểu biết của bạn.\",\"🌈Nếu bạn gặp sự cố hoặc lỗi sản phẩm, chúng tôi nói chuyện trước. Đừng ấn tượng với các đánh giá. chúng tôi rất vui khi sửa chữa nó.\",\"🌈Vui lòng đánh giá cửa hàng 5 sao. ⭐  ⭐  ⭐  ⭐  ⭐ Cảm ơn bạn. mọi đánh giá là rất quan trọng đối với cửa hàng.\",\"🌈Cảm ơn bạn đã hỗ trợ của bạn. chúng tôi sẽ phục vụ khách hàng của chúng tôi tốt nhất. \",\"\\n\"]',NULL,169,'GNN',NULL,'[\"https://down-vn.img.susercontent.com/file/ea97f609a484daaa8607cedfdccb4521_tn\",\"https://down-vn.img.susercontent.com/file/cn-11134207-7r98o-ll4f4s5gz3f832_tn\",\"https://down-vn.img.susercontent.com/file/cn-11134207-7r98o-ll4f4s5h0hzofe_tn\",\"https://down-vn.img.susercontent.com/file/cn-11134207-7r98o-ll4f4s5h1wk4eb_tn\",\"https://down-vn.img.susercontent.com/file/cn-11134207-7r98o-ll4f4s5h3b4k36_tn\"]',5832,NULL,1469,'2024-02-11 15:00:44','2024-02-11 15:00:44');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (63,'[HOT HIT] Giày Sục Đạp Gót Thể Thao Nữ Ny, Form Cực Ôm Chân','[\"☘️Giày Sục đạp gót với kiểu dáng vô cùng trẻ trung, năng động sẽ mang lại cho bạn một cảm giác tuyệt vời khi đi lên chân ☘️\\n\\n💋Đặc điểm sản phẩm:\\n- Được làm từ chất liệu vải cao cấp với các đường nét vô cùng tinh tế, có Logo THÊU TAY nổi bật tạo điểm nhấn. \\n- Được thiết kế với kiểu dáng bít mũi và hở gót đầy phong cách và cá tính, thuận tiện cho việc mang hằng ngày. \\n- Màu sắc cơ bản dễ phối với bất kỳ loại trang phục nào.\\n- Đế ngoài bằng cao su, chống trượt tạo cảm giác linh hoạt khi di chuyển\\n- Logo thương hiệu được trang trí nổi bật, sang trọng mang phong cách bóng chày. \\n- Đây là loại giày phù hợp với nhiều lứa tuổi và dáng người. \\n\\nHƯỚNG DẪN CHỌN SIZE\\n✔️ Khách hàng chọn size theo bảng size shop đã cung cấp vì mẫu form chuẩn nhé khách yêu.\\nNếu quý khách muốn biết rõ hơn về sản phẩm Xin vui lòng CHAT với Shop để được tư vấn trước khi đặt hàng \\n✅Kích thước ( SIZE) 35,36,37,38,39,40\\n✅Chiều cao đế 3,5cm\\n✅Ôm chân, thon gọn, tuyệt xinh\\n                    BẢNG CHỌN\\nChiều dài chân 👉👉👉Size số \\n22-->22.5cm.                   35\\n22,5-->23cm.                   36\\n23--->23,5cm.                  37\\n23,5-->24cm.                   38\\n24---> 24,5cm.                 39\\n24.5---> 25cm.                 40\\n\\nQUYỀN LỢI KHI MUA HÀNG TẠI ZANNO\\n✔ ZANNO luôn cung cấp ảnh thật của sản phẩm kèm với video để khách hàng yên tâm lựa chọn\\n✔ ĐƯỢC ĐỔI TRẢ MIỄN PHÍ nếu lỗi từ phía shop hoặc nhà sản xuất\\n✔ Hỗ trợ khách hàng đổi size, mẫu và trong trường hợp này Khách hàng vui lòng thanh toán ship đổi trả 2 chiều\\n✔ LƯU Ý:  Quý Khách nhận hàng vui lòng quay video bóc sản phẩm theo đúng quy định và tiêu chuẩn của shopee. Shop sẽ xử lý các khiếu nại nếu có video bóc hàng. Mọi sản phẩm nếu không có video khui hàng sẽ khó được xử lý khiếu nại.\\n\\n\\n✔ Nếu có điều gì CHƯA HÀI LÒNG về sản phẩm và dịch vụ. KHOAN vội đánh giá shop, HÃY nhắn tin hoặc gọi điện theo hotline: 0399533000 để được xử lý nhanh nhất.\\n✔ Mua sắm là để thư giãn - Trải nghiệm khách hàng là điều chúng tôi luôn đặt lên hàng đầu.\\n\\nCẢM ƠN QUÝ KHÁCH ĐÃ TỚI VỚI ZANNO SHOP, CHÚC QUÝ KHÁCH THẬT NHIỀU SỨC KHỎE !\"]',NULL,140,'GNN',NULL,'[\"https://down-vn.img.susercontent.com/file/4ac25ff36fd449e359d0b2603e2481d8_tn\",\"https://down-vn.img.susercontent.com/file/3cb5edd3fcbbed15d524d9e4ea9c5647_tn\",\"https://down-vn.img.susercontent.com/file/2074fc779fb0696e72052036eff056ea_tn\",\"https://down-vn.img.susercontent.com/file/ee7f15a156c0f7b47fce18c13d2dbec4_tn\",\"https://down-vn.img.susercontent.com/file/d57b62187ec0c864d4bf939de0104eb5_tn\"]',3547,NULL,1424,'2024-02-11 15:00:44','2024-02-11 15:00:44');
