INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (65,'Dép Sandal EVA Mềm Đế Dày Hai Dây Màu Trơn Thời Trang Mùa Hè Cho Nữ','[\"Giới thiệu sản phẩm:\",\"Đôi Dép Hoạt Hình EVEANOBQY này có thiết kế Sáng tạo và thời trang, Thích hợp để mặc khi đi nghỉ bởi Biển Đông, Thiết kế dày dặn rất thoải mái và bảo vệ đế bàn chân tốt. Sử dụng chất liệu EVA, không chỉ nhẹ và thoải mái, nhưng cũng Có khả năng chống trơn trượt tốt, cải thiện đáng kể độ an toàn khi mang. Dép có khả năng thấm khí tốt, đặc biệt thích hợp cho trang phục mùa hè và có ba kiểu dép và dép, giày lỗ và dép xỏ ngón cho bạn Chọn để đáp ứng các ưu đãi cá tính khác nhau.\",\"Đặc điểm sản phẩm:\",\"Dép hoạt hình này có sẵn trong nhiều mẫu hoạt hình, và hình thức dễ thương phù hợp với mắt. Đáy dày cung cấp sự hỗ trợ đệm chân thoải mái, giúp bàn chân của bạn cảm thấy thoải mái và an toàn hơn. Dép nhẹ và bền, thiết kế đáy không trơn trượt tránh trượt khi đi bộ, vì vậy bạn có thể cảm thấy thoải mái hơn khi đi lại.\"]',NULL,144,'GNN',NULL,'[\"https://down-vn.img.susercontent.com/file/6dd09807214eb85b95b6ceda96078ea1_tn\",\"https://down-vn.img.susercontent.com/file/cn-11134211-7qukw-lftiknpzvo5k67_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7qvf0-lftfq09j5c5f86_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7qve7-lftfq0t8ci6e08_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7qvd2-lftfq19lojdx82_tn\"]',7204,NULL,1694,'2024-02-11 15:00:44','2024-02-11 15:00:44');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (66,'Mistery GiàY Thể Thao Nữ Đế Cao Thời Trang MIS-1234','[\"💖💖Chào mừng bạn đến với cửa hàng chính thức Mistery💖💖\",\"\\n\",\"\\n\",\"Thương hiệu: Mistery\",\"Số mặt hàng:MIS-1234\",\"Chất liệu trên: vải\",\"Dành cho: nữ\",\"Chiều cao trên: Thấp trên\",\"Màu: đen, trắng, đỏ, xanh\",\"Kích thước: 35-40\",\"Thông tin kích thước:\",\"\\n\",\"35【22.5cm】、36【23cm】\",\"37【23.5cm】、38【24cm】\",\"39【24.5cm】、40【25cm】\",\"Nếu bạn có bàn chân mỏng hoặc bình thường, vui lòng mua ở kích thước bình thường của bạn. Nếu bạn có bàn chân mập, nên mua kích thước lớn hơn.\",\"\\n\",\"⭐ Tất cả các sản phẩm đều được lấy bằng sản phẩm thực tế, không sửa đổi thêm, bạn cứ yên tâm mua hàng.\",\"\\n\",\"⭐ Tất cả các sản phẩm đều hỗ trợ tiền mặt khi giao hàng và sau khi bán. Nếu có vấn đề với sản phẩm nhận được Vui lòng liên hệ với bộ phận chăm sóc khách hàng ngay khi có thể.\",\"\\n\",\"⭐ Thời gian giao hàng khoảng 24 giờ và thời gian vận chuyển khoảng 5-7 ngày.\",\"\\n\",\"⭐ Cửa hàng được cập nhật thường xuyên và các sự kiện được tổ chức theo thời gian. Hãy theo dõi chúng tôi nhé.\",\"\\n\",\"Về chúng tôi:\",\"\\n\",\"📣 Đội ngũ phát triển độc lập và nhà máy để mang đến cho bạn những sản phẩm tốt hơn và tiết kiệm chi phí hơn.\",\"\\n\",\"📣 Đội ngũ dịch vụ chăm sóc khách hàng chất lượng cao để mang đến cho bạn trải nghiệm mua sắm tốt hơn.\",\"\\n\",\"📣 Quản lý liêm chính. Hy vọng sẽ xây dựng một mối quan hệ đáng tin cậy và hài hòa với khách hàng.\"]',NULL,180,'GNN',NULL,'[\"https://down-vn.img.susercontent.com/file/f3e7a8e769e3a551268d90dc40038083_tn\",\"https://down-vn.img.susercontent.com/file/cn-11134207-7qukw-li9xsb6sqhyub7_tn\",\"https://down-vn.img.susercontent.com/file/cn-11134207-7qukw-lgnjfeh9i0rga9_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-23030-r7o49nc49xovb9_tn\",\"https://down-vn.img.sus