INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (67,'Giầy búp bê nữ da mềm quai xích đôn đế cao 4cm, giày nữ đi học ULZZANG SHOES phong cách hàn quốc','[\"Giầy búp bê nữ da mềm quai xích đôn đế cao 4cm, giày nữ đi học ULZZANG SHOES phong cách hàn quốc 2022\\nGiày búp bê nữ - một thiết kế đơn giản đem lại một cảm giác thoải mái nhất đối với người sử dụng. Để lựa chọn một đôi giày oxford nữ linh hoạt có thể sử dụng cho mọi hoạt động như đi học đi dạo phố hay đi shopping thì giày nữ đế bằng sẽ là một lựa chọn cực kỳ đúng đắn cho bạn. Bạn là một cô nàng yêu thích sự đơn giản và luôn tự tin trên những bước đi của mình khi ra đường hay xuống phố. Giày búp bê nữ đế  sẽ giúp bạn ở điều đó. Để giúp bạn lựa chọn cho mình một đôi giày nữ phù hợp nhất hãy cùng ULZZANG SHOES khám phá về bộ sưu tập giày búp bê của shop nhé.\\n Với thiết kế khá đơn giản gọn nhẹ đem lại cho người dùng cảm giác thoải mái nhưng vẫn đảm bảo sức khỏe cho đôi chân của bạn.\\nGIày oxford nữ đế cao\\nĐôi giày mang lại cho người dùng cảm giác thoải mái và tự tin bước đi khi làm việc. Bên cạnh đó việc sử dụng giày bệt chúng ta có thể phối với rất nhiều loại đồ khác nhau từ những bộ váy đầm cho đến những bộ vest công sở thì giày bệt mũi nhọn sẽ đảm đương hết những việc đó cho chúng ta.\\nGiày nữ đế bằng\\nVới những đôi giày nữ đế bằng chúng ta vẫn luôn biết rằng nó sẽ không lỗi thời trong bất cứ hoàn cảnh nào hay theo năm tháng. Đôi giày búp bê nữ vẫn là những sản phẩm ưa chuộng của các cô nàng bởi sự tiện lợi thoải mái của nó\\nGiày thể thao nữ\\n Là một đôi giày với thiết kế khá đơn giản dễ dàng bắt gặp ở trên đường với những cô nàng học sinh khoác lên mình bộ áo dài cùng với đôi giày thể thao nữ mang lại cảm giác thoải mái và xinh đẹp nhất của các cô gái ở tuổi đôi mươi. Đặc điểm nổi bật hơn ở dép sandal nữ là kiểu dáng đơn giản, với thiết kế ôm chân nhưng rất thoải mái và thoáng cho đôi chân trong việc di chuyển với chất liệu  giúp mang lại cảm giác êm ái và mềm mại cho đôi chân của bạn\\ngiày búp bê nữ\\nVới thiết kế thanh thoát có thể kết hợp được các trang phục khác nhau phù hợp với nhiều hoàn cảnh khác nhau. Đôi giày oxford nữ phù hợp với những cô nàng theo đuổi phong cách thời trang thanh lịch trẻ trung. Đây là một trong những sản phẩm dễ mặc và dễ phối đồ nhất cho các cô nàng của chúng ta. Những đôi giày thể thao nữ sẽ đồng hành cùng bạn giúp bạn tự tin hơn trong việc phối đồ và trong cả những bước đi khi xuống phố.\\n\\n\\n♥️  CHUẨN LỰA CHỌN SIZE PHÙ HỢP :\\nChiều dài bàn chân         👉👉👉 Size số :\\n ==> 22   đến  22.5 cm    👉👉👉   35\\n ==>22.5 đến  23 cm       👉👉👉   36\\n ==>23   đến  23.5 cm     👉👉👉   37\\n ==>23.5 đến  24 cm       👉👉👉   38\\n ==> 24   đến  24.5 cm    👉👉👉   39\\n  =======================\\nMọi thắc mắc và khiếu nại vui lòng liên hệ : 0936342450\\n#giaynu #giaybupbenu #giayoxfordnu #giaythethaonu ##giaydebang #giaynudebang #giaythethaonudebang #giaysandalnudebang #giayoxfordnuvintage #xangdandebang #giaylolita #giaylolitadecao #giaylolitabanhmi #depditrongnha #giaycaogotdebang #giaysucnu #giaysandalnu #giaydap\"]',NULL,171,'GNN',NULL,'[\"https://down-vn.img.susercontent.com/file/vn-11134201-7r98o-lq74g4d3yh4ne7_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134201-7r98o-lq74g4am24eq84_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134201-7r98o-lpyvjqh3nodz10_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134201-7r98o-lq74g4c003lj92_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134201-7r98o-lq74g4ctyvgy58_tn\"]',3080,NULL,996,'2024-02-11 15:00:44','2024-02-11 15:00:44');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (68,'Giày Cao Gót Màu Đen Đế Xuồng Phong Cách retro mary jane Anh Quốc Giày Oxford Nữ giày asia nữ giày đạp gót','[\"Chào mừng bạn đến với cửa hàng của chúng tôi 😊😊😊\",\"🌄     Chất lượng cao và giá cả hữu nghị. 🌄\",\"Trước khi đặt hàng, bạn sẽ nhận được phiếu giảm giá trên trang chủ cửa hàng để có giá rẻ hơn.\",\"⚡     Đặt hàng trong vòng 1 giờ mà không cần nhấp vào Hủy ⚡\",\"Đối với các sản phẩm trong hình, sử dụng các màn hình khác nhau có thể làm cho màu sắc thực của sản phẩm đậm hoặc mờ hơn hình ảnh.\",\"Sản phẩm của chúng tôi đến từ nước ngoài. Khoảng 7-12 ngày để giao hàng. 🚚🚚🚚\",\"🔥     Vui lòng đảm bảo số điện thoại và địa chỉ của bạn là chính xác trước khi nhấp vào đặt hàng. Nếu lỗi xảy ra, chúng tôi không thể thay đổi hoặc sửa chữa bất cứ điều gì. 🔥\",\"Chúng tôi có kinh nghiệm phong phú và sản phẩm chất lượng cao.\",\"Cung cấp cho bạn trải nghiệm mua sắm tốt nhất\",\"Sản phẩm của chúng tôi là thương hiệu mới 100%.\",\"Chúng tôi chú ý đến chất lượng và giá cả!\",\"Nếu bạn thích sản phẩm của chúng tôi, vui lòng cho giỏ hàng của bạn vào giỏ hàng và giúp bạn nhấp vào 👍👍👍 💖💖💖\",\"Cửa hàng của chúng tôi cung cấp dịch vụ khách hàng trực tuyến, vì vậy nếu vấn đề do cửa hàng gây ra, vui lòng trả lời câu hỏi của bạn. Điều này cho thấy rằng sản phẩm bị lỗi. Bạn có thể tìm thấy cửa hàng thông qua trò chuyện. Cửa hàng đã sẵn sàng chịu trách nhiệm.\",\"💕💕     Nếu không có vấn đề gì với sản phẩm, điều này là bình thường. Đừng quên khen ngợi và đánh giá cửa hàng của chúng tôi. Chúng tôi mong muốn cung cấp cho bạn một xếp hạng năm sao. ⭐⭐⭐⭐⭐⭐⭐⭐\",\"Mỗi điểm đều có giá trị lớn đối với cửa hàng của chúng tôi. Cảm ơn bạn đã đưa ngón tay cái lên. 💕💕💕\",\"Chúng tôi luôn có sản phẩm mới. Hãy cập nhật những tin tức mới nhất trong cửa hàng của chúng tôi. Chúng tôi sẽ gửi cho bạn phiếu giảm giá và chiết khấu.\"]',NULL,163,'GNN',NULL,'[\"https://down-vn.img.susercontent.com/file/791a4101a5e25ba65102c3a4254813fe_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-23030-njv6nhcx3mov37_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-23030-bp4btobx3movbb_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-23030-scgd41cx3movdf_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-23030-7887xtdx3mov5a_tn\"]',4133,NULL,1307,'2024-02-11 15:00:44','2024-02-11 15:00:44');
