INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (71,'Giày đế đốc nữ chất da mềm êm chât phong cách hàn quốc quynh vy shop maz 1042','[\" Ưu điểm:\\n✔️ Hàng đẹp, chất lượng\\n✔️ Giá cả hợp lý\\n✔️ Giày rất nhẹ, đi êm và bền theo thời gian\\n✔️ Giày dễ phối đồ thích hợp cho các hoạt động đi lại hằng ngày, chạy bộ\\n✔️ Thích hợp với các mùa trong năm: Xuân - Hè - Thu - Đông\\n♥️ \\n- Để giày ở nơi khô ráo thoáng mát để giữ giày được bền đẹp hơn\\n- Vệ sinh giày, dùng khăn hay bàn chải lông mềm để chải sạch giày cùng với nước tẩy rửa giày chuyên dụng với da hay da Pu\\n- Có thể giặt giày cùng với chất tẩy rửa nhẹ\\n♥️ KHUYẾN CÁO\\n- Không dùng hóa chất hay bột giặt có hoạt tính tẩy rửa mạnh\\n- Không dùng bàn chải cứng để vệ sinh giày sẽ làm hư \\n- Không đi mưa ngâm nước lâu, không phơi giày trực tiếp dưới ngoài trời nắng gắt\\n♥️ Quy định đổi trả hàng :\\n  Quý khách có quyền đổi trả hàng trong vòng 07 ngày kể từ ngày nhận hàng cho những trường hợp sau ( Sản phẩm chưa qua sử dụng  )\\n1. Hàng lỗi do sản xuất.\\n2. Hàng giao sai .\\n3. Hàng không giống với mô tả của shop, .\\n4. Các trường hợp phát sinh khác quý khách có thể liên hệ trực tiếp với shop\"]',NULL,117,'GNN',NULL,'[\"https://down-vn.img.susercontent.com/file/f11cab3fe6b54a22b04873f93da87564_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-22110-8bek2oc0z9jv4a_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-22110-y64p8ic0z9jv36_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-22110-mxaprjc0z9jv90_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-22110-4wbtxic0z9jv9f_tn\"]',2718,NULL,119,'2024-02-11 15:00:44','2024-02-11 15:00:44');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (72,'Giày Sục Thêu Hình Gấu Đạp Gót Bản Đẹp, Form Ôm Chân 2022','[\"🛒ZANNO XIN KÍNH CHÀO QUÝ KHÁCH !\\n\\n  Tất cả sản phẩm trong cửa hàng này đều có giá cả phải chăng và chất lượng tuyệt vời, hãy yên tâm mua hàng!\\n  ♥ Đảm bảo hài lòng 100% và đảm bảo chất lượng, mang đến cho bạn trải nghiệm mua sắm và dịch vụ tốt nhất\\n\\nGiày Sục Thêu Hình Gấu Đạp Gót Bản Đẹp, Form Ôm Chân 2023 với kiểu dáng màu sắc vô cùng trẻ trung, năng động sẽ mang lại cho bạn một cảm giác tuyệt vời khi đi lên chân\\n\\nĐặc điểm sản phẩm:\\n- Được làm từ chất liệu vải cao cấp với các đường nét vô cùng tinh tế, có Logo hình GẤU nổi bật tạo điểm nhấn. \\n- Được thiết kế với kiểu dáng bít mũi và hở gót đầy phong cách và cá tính, thuận tiện cho việc mang hằng ngày. \\n- Màu sắc cơ bản dễ phối với bất kỳ loại trang phục nào.\\n- Đế ngoài bằng cao su, chống trượt tạo cảm giác linh hoạt khi di chuyển\\n- Đây là loại giày phù hợp với nhiều lứa tuổi và dáng người. \\n\\nHƯỚNG DẪN CHỌN SIZE\\n✔️ Khách hàng chọn size theo bảng size shop đã cung cấp vì mẫu form chuẩn nhé khách yêu.\\nNếu quý khách muốn biết rõ hơn về sản phẩm Xin vui lòng CHAT với Shop để được tư vấn trước khi đặt hàng \\n✅Kích thước ( SIZE) 35,36,37,38,39,40\\n✅Chiều cao đế 3cm\\n✅Ôm chân, thon gọn, tuyệt xinh\\n                    BẢNG CHỌN\\nChiều dài chân 👉👉👉Size số \\n22-->22.5cm.                   35\\n22,5-->23cm.                   36\\n23--->23,5cm.                  37\\n23,5-->24cm.                   38\\n24---> 24,5cm.                 39\\n24.5---> 25cm.                 40\\n\\nQUYỀN LỢI KHI MUA HÀNG TẠI ZANNO\\n✔ ZANNO luôn cung cấp ảnh thật của sản phẩm kèm với video để khách hàng yên tâm lựa chọn\\n✔ ĐƯỢC ĐỔI TRẢ MIỄN PHÍ nếu lỗi từ phía shop hoặc nhà sản xuất\\n✔ Hỗ trợ khách hàng đổi size, mẫu và trong trường hợp này Khách hàng vui lòng thanh toán ship đổi trả 2 chiều\\n✔ LƯU Ý:  Quý Khách nhận hàng vui lòng quay video bóc sản phẩm theo đúng quy định và tiêu chuẩn của shopee. Shop sẽ xử lý các khiếu nại nếu có video bóc hàng. Mọi sản phẩm nếu không có video khui hàng sẽ khó được xử lý khiếu nại.\\n✔ Nếu có điều gì CHƯA HÀI LÒNG về sản phẩm và dịch vụ. KHOAN vội đánh giá shop, HÃY nhắn tin hoặc gọi điện theo hotline: 0399533000 để được xử lý nhanh nhất.\\n✔ Mua sắm là để thư giãn - Trải nghiệm khách hàng là điều chúng tôi luôn đặt lên hàng đầu.\\n\\n #giaythethao #giaynam #giaynu #giayfullbox #giaythethaonamnu #giayulzzang #giayhocsinh #giaysinhvien  #sneaker #freeship #fullbox #giaynamnu #giaygiare #ulzzang #giaysneaker #giaytheduc#giare  #sale #giamgia #depnu #sandal #nu #giaysandal #sandalnu #quaingang#quaihau #xangdan #deple #depnuthoitrang #giare #deplenuhot #depdimua #dimua #bendep #moi #depnumoi #deple #depdibien #depdihoc #depthoitrang  #quaicheo #depquaingang #sandalnuxinh #dongian #nhenhang #depxangdan  #dibien #dihoc #dichoi #depnuthoitrang #depquaingang #deplequaingang #depnhe  #depvanphong #congso #depdinhom #depnhom #depnudebet #depnudethap #depnuhanquoc #depnudep #depquainganghanquoc #depnu2020 #depthoitrangnu #depdichoinu #sandal #depxangdan  #trend #depdibien #depsanhdieu\\n\\nCẢM ƠN QUÝ KHÁCH HÀNG !!\"]',NULL,78,'GNN',NULL,'[\"https://down-vn.img.susercontent.com/file/050f96b06f125d8a9806a71802fa3ff6_tn\",\"https://down-vn.img.susercontent.com/file/d9856b9fa5959254f9339598d3e60896_tn\",\"https://down-vn.img.susercontent.com/file/9d38ae4db6dfcfc1dd51f137797ff376_tn\",\"https://down-vn.img.susercontent.com/file/be4a7bf2c8f591d7186fea47231dc09f_tn\",\"https://down-vn.img.susercontent.com/file/7ea35b4ead7d79f85272396211fd9cb4_tn\"]',4316,NULL,1234,'2024-02-11 15:00:44','2024-02-11 15:00:44');
