INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (75,'Giày Thể Thao Đế Dày Màu Trắng dopamine Thời Trang Cho Nữ','[\"Cam KẾT SHOP\\r\",\"👉Hình ảnh sản phẩm là ảnh thật do shop tự chụp 100% đảm bảo chất lượng\\r\",\"👉Sản phẩm được vận chuyển từ Trung Quốc. Thời gian giao hàng là khoảng 7-15 ngày.\\r\",\"👉Dép đi trong nhà được kiểm tra cẩn thận, tư vấn cẩn thận và nhiệt tình trước khi gói hàng được giao cho bạn\\r\",\"👉 Còn hàng, giao hàng ngay sau khi nhận được đơn đặt hàng\\r\",\"👉Hoàn tiền nếu sản phẩm không khớp với mô tả\\r\",\"👉 Chấp nhận đổi khi kích thước không vừa\\r\",\"👉Giao hàng toàn quốc, nhận hàng thanh toán\\r\",\"👉Hỗ trợ đổi trả theo quy định của Shopee\\r\",\"💥Vì mẫu này quá hot nên số lượng có hạn, nhanh tay đặt hàng ngay để sở hữu đôi xăng đan xinh xắn cho mình nhé\\r\",\"❤️ Cảm ơn quý khách hàng đã luôn tin tưởng và ủng hộ, nếu có thắc mắc vui lòng nhắn tin Shop để được ủng hộ❤️\\r\"]',NULL,63,'GNN',NULL,'[\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbk6-lobcmjpcqcs615_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbm5-lobcmkb9u9lra2_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbky-lobcmlmfx91f77_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbm4-loqa4k42dyg5d0_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbnk-lobcmn8fkdkgc5_tn\"]',3671,NULL,1394,'2024-02-11 15:00:44','2024-02-11 15:00:44');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (76,'Giày vải nền tảng của phụ nữ macaron màu tấm giày phiên bản hàn quốc gót hai giày thường','[\"🎶 Chào mừng đến với cửa hàng của chúng tôi. 🎶\",\"🔖 Kích thước sản phẩm và kiểu dáng như hình ảnh, vui lòng đọc kỹ\",\"\\n\",\"Phúc lợi Xin lưu ý 📣📣📣\",\"✨ Theo dõi cửa hàng của chúng tôi để nhận phiếu giảm giá cửa hàng Nhịp tim ít hơn hành động, vui lòng nhấp vào theo dõi để thử. ✨\",\"\\n\",\"📫 Có câu hỏi về mua sắm? Xin vui lòng liên hệ với chúng tôi, chúng tôi sẽ cung cấp cho bạn câu trả lời thỏa đáng nhất.\",\"✔ Chúng tôi có kinh nghiệm phong phú và sản phẩm chất lượng cao. Nó sẽ cung cấp trải nghiệm mua sắm tốt nhất.\",\"✔ Sản phẩm của chúng tôi là 100% mới.\",\"✔ Chúng tôi tìm kiếm chất lượng cao và giá thấp.\",\"✔ Chúng tôi sẽ luôn có những sản phẩm mới. Hãy theo dõi những tin tức mới nhất trong cửa hàng của chúng tôi. Chúng tôi sẽ gửi cho bạn phiếu giảm giá và giảm giá sản phẩm.\",\"\\n\",\"🛒 Thích sản phẩm của chúng tôi? Hãy đặt chúng vào giỏ hàng và lấy chúng đi!!\",\"⭐ Chúng tôi mong đợi xếp hạng năm sao của bạn.\",\"\\n\",\"❗ Do các thiết bị hiển thị và chiếu sáng khác nhau. Hình ảnh có thể không phản ánh màu sắc thực tế của tất cả các sản phẩm. Cảm ơn bạn cho sự hiểu biết của bạn.\",\"❕ Nếu có bất kỳ câu hỏi nào, xin vui lòng liên hệ với chúng tôi, chúng tôi sẽ trả lời câu hỏi của bạn trong thời gian sớm nhất và cố gắng hết sức để giải quyết vấn đề của bạn.\",\"\\n\",\"💗 Mong các bạn chú ý và mua sắm 💗.\"]',NULL,74,'GNN',NULL,'[\"https://down-vn.img.susercontent.com/file/b72f78b2bb2d650a7c732a14d7741552_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7qvfk-lkg6uurjsmmi36_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7qvfm-ljnuwke5gd3qbc_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7qvf4-ljo6i3ij87pa13_tn\",\"https://down-vn.img.susercontent.co