INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (82,'Giày Cao Gót Đế Dày Chống Mòn Thoải Mái Thời Trang Mùa Hè Cho Nữ','[\"✨ Tiết kiệm hơn bằng cách thu thập phiếu giảm giá trước khi mua sắm ✨\",\"Độ dày đơn-6-8cm\",\"Chất liệu - PU\",\"Tính năng » Thời trang , Thiết kế\",\"💖 Kiểm tra quy trình đóng gói cẩn thận để đảm bảo sản phẩm được hoàn thiện đầy đủ trước khi đến tay khách hàng\",\"💖 Giá đảm bảo cạnh tranh nhất trên thị trường\",\"💖 Xác định hình ảnh hoặc quảng cáo .\",\"💖Cam kết đảm bảo chất lượng vượt trội\",\"Vui lòng đọc trước khi đặt hàng .\",\"Sản phẩm được vận chuyển từ Trung Quốc . Thời gian giao hàng là khoảng 7-15 ngày .\",\"1. Nếu bạn có bất kỳ câu hỏi nào , bạn có thể tìm kiếm dịch vụ khách hàng trực tuyến . Dịch vụ khách hàng sẽ trả lời bạn một cách kiên nhẫn .\",\"1.1 Tất cả các loại sản phẩm có thể được vận chuyển trong kho. Nếu sản phẩm hết hàng có nghĩa là sản phẩm đã hết hàng .\",\"1.2 Không thể chỉnh sửa đơn đặt hàng qua trò chuyện và ghi chú .\",\"🌹Chúng tôi luôn cập nhật các mẫu mã mới và đa dạng - cửa hàng hứa hẹn sẽ luôn mang đến cho bạn những sản phẩm thời trang ưng ý và hoàn hảo nhất . Chúng tôi không bán rẻ nhất nhưng chất lượng tốt nhất .\"]',NULL,68,'GNN',NULL,'[\"https://down-vn.img.susercontent.com/file/sg-11134201-7qve1-lgwfpni6z4y39d_tn\",\"https://down-vn.img.susercontent.com/file/cn-11134207-7r98o-loukxcdf4k8c54_tn\",\"https://down-vn.img.susercontent.com/file/cn-11134207-7r98o-loukxcdf7dd85f_tn\",\"https://down-vn.img.susercontent.com/file/cn-11134207-7r98o-loukxcdf8rxo17_tn\",\"https://down-vn.img.susercontent.com/file/cn-11134207-7r98o-loxguzucu9uk2d_tn\"]',9275,NULL,447,'2024-02-11 15:00:44','2024-02-11 15:00:44');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (83,'UETEEY Giày cao gót Thoải Mái Xinh Xắn Thời trang Lịch lãm Phù hợp Đệm êm FLF23A0ADW 41Z231013','[\"🌈 Chào mừng đến với cửa hàng của chúng tôi.\",\"\\n\",\"  🌈 Theo dõi cửa hàng để nhận phiếu giảm giá ”◕‿◕｡\",\"\\n\",\"  🌈 Nếu bạn hài lòng với sản phẩm và dịch vụ của chúng tôi Lời khen ngợi năm sao\",\"\\n\",\"  🚚 Sản phẩm đến từ Trung Quốc và mất một thời gian để vận chuyển\",\"\\n\",\"  💕 Phải mặc! Phổ biến vào năm 2023!\",\"\\n\",\"  💕Được làm bằng chất liệu cao cấp, đủ bền để bạn mặc hàng ngày!\",\"\\n\",\"  💕 Thật thoải mái Chất liệu vải mềm mại, hình dáng đẹp, chất lượng tốt.\",\"\\n\",\"  💕 Thiết kế đẹp, sang trọng, độc đáo.\",\"\\n\",\"  💕 Nó là một món quà tốt cho người yêu của bạn hoặc chính bạn.\",\"\\n\",\"  ❣️ Chất lượng và giá cả như thế này không thể tìm thấy ở bất kỳ nơi nào khác, rất đáng đồng tiền. ️\",\"\\n\",\"  ❣️Do các thiết bị hiển thị và chiếu sáng khác nhau, hình ảnh có thể không phản ánh màu sắc thực tế của tất cả các sản phẩm. Cảm ơn bạn đã thông cảm ❣️\",\"\\n\",\"  ❣️ Đánh giá 1 hoặc 2 sao không có lý do / hình minh họa. hoặc đặt điều gì đó không đúng sự thật làm hỏng danh tiếng của shop shop sẽ không giúp gì cả vì bạn được coi là đang vào vì lợi ích của Shop, đặc biệt cảm ơn quý khách hàng đã có nhu cầu vui lòng đặt hàng hoặc yêu cầu thêm thông tin tin tin nhé ️\"]',NULL,58,'GNN',NULL,'[\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbnk-lmsuu6iy8qh171_tn\",\"https://down-vn.img.susercontent.com/file/169aeaddfbad004b41be191999cca1d1_tn\",\"https://down-vn.img.susercontent.com/file/cn-11134207-7r98o-lrcvu0fxxx3x10_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbmg-llsoc85jy7tvd0_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbn6-lmsuu7ue9wkj9d_tn\"]',560,NULL,277,'2024-02-11 15:00:44','2024-02-11 15:00:44');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (84,'CHZK Giày Thể Thao Thời Trang 5Cm Dành Cho Nữ dép đế dày giầy thể thao nữ sneaker nữ','[\"Vui lòng chọn kích thước theo bảng kích thước. Thích hợp cho đi chơi, mua sắm, tụ tập, v.v.\\nThiết kế hiện đại, tay nghề thủ công hạng nhất\\nHoàn toàn phù hợp với trang phục bình thường, mềm mại và thoải mái.\\nSau khi bạn đặt hàng Bạn luôn có thể liên hệ với dịch vụ khách hàng của chúng tôi nếu bạn có bất kỳ câu hỏi nào. Chúng tôi sẽ trả lời và giải đáp thắc mắc của bạn trong thời gian sớm nhất. sau khi nhận hàng Nếu bạn có bất kỳ câu hỏi nào hoặc không hài lòng về sản phẩm, bạn có thể liên hệ trực tiếp với chúng tôi. cung cấp cho bạn một giải pháp thỏa đáng ngay lần đầu tiên. Nếu bạn hài lòng với sản phẩm của chúng tôi Đừng quên đánh giá tốt và chúng tôi sẽ giảm giá cho bạn nhiều hơn!\"]',NULL,86,'GNN',NULL,'[\"https://down-vn.img.susercontent.com/file/3b9c764ebaa47e9285cc9157b9cfbac5_tn\",\"https://down-vn.img.susercontent.com/file/cf1cb72421239d07a486b7fe557df3d5_tn\",\"https://down-vn.img.susercontent.com/file/12485560151db74f4b39b91a79bcc4da_tn\",\"https://down-vn.img.susercontent.com/file/30a7719ad9a8ffa6978ec389d1173ae5_tn\",\"https://down-vn.img.susercontent.com/file/f81ef0856c0279f7e6bf9f9ea180f942_tn\"]',1359,NULL,464,'2024-02-11 15:00:44','2024-02-11 15:00:44');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (85,'Giày Nữ, Giày Thể Thao Da Mềm Độn Đế 5cm Kiểu Dáng Hàn Quốc Nhỏ Gọn, Xinh Xắn,FULL BOX M63 -- Lisa','[\"Giày Nữ, Giày Thể Thao Da Mềm Độn Đế 5cm Kiểu Dáng Hàn Quốc Nhỏ Gọn, Xinh Xắn\\n\\n👑Lisa Shop- Chuyên cung cấp thời trang giày thể thao hàng loại 1 cao cấp nhất thị trường\\n\\n Cam kết tại Lisa shop\\n- Tất cả các sản phẩm của shop đều là hàng cao cấp loại 1, không bán hàng nhái, kém chất lượng, uy tín được đảm bảo qua hàng vạn đơn hàng trên khắp cả nước\\n- Đổi trả trong vòng 7 ngày nếu hàng lỗi, sai mẫu cho quý khách.\\n- Cam kết giá tốt nhất thị trường, chất lượng đảm bảo.\\n✅Hệ Thống Chuỗi Cửa Hàng \\n- Số 1 Nguyễn Duy Trinh, Tòa nhà Nơ 9b  Hoàng Mai, Hà Nội \\n- Số 14, Nguyễn Văn Huyên, Đà Nẵng\\n- Số 192 Lê Trọng Tấn, Nha Trang, Khánh Hòa\\n- Số 66, Nguyễn Bá Tuyển, Tân Bình, HCM.\\n 👑 Hotline: 0974.544.678\\n\\n✅ THÔNG TIN SẢN PHẨM:\\n- Chất liệu : Da Pu mềm mại, đế cao su đi chắc chắn\\n- Màu sắc: trắng, kem\\n- Kiểu dáng: năng động, gọn nhẹ êm chân\\n- Đế cao 5cm\\n - Size 35-39\\n- Giày full hộp, vận chuyển đến tay khách hàng đều được đóng gói kỹ bằng bóng khí và hộp carton cứng cáp đảm bảo chuẩn form\\n💢 Lưu ý: \\n- Toàn bộ ảnh là ảnh chụp thật 100% tại shop nên các bạn cứ yên tâm nhé\\n- Hỗ trợ đổi sang mẫu khác bằng hoặc giá cao hơn khi nhận sản phẩm không hợp. - Nếu nhận sản phẩm bị lỗi hoặc có vấn đề gì khách vui lòng giữ nguyên hiện trạng ban đầu (tem, mác, bao bì,...) và liên hệ với Lisa shop để được hỗ trợ tốt nhất thông qua tin nhắn Shopee hoặc hotline: 0974.544.678 bạn nhé\\n Hãy ĐÁNH GIÁ cho Lisa shop khách sẽ nhận được MÃ GIẢM GIÁ cho lần mua tiếp theo và nhiều ưu đãi khác.\\n\\n#giay_the_thao_nu #giay_don_de #giay_nu #giay_di_lam_nu #giay_nu_nang_dong #giay_thoi_trang_nu #giay_nu_dep #giay_the_thao_nu_don_de #giay_the_thao_nu_trang #giay_the_thao_nu_ulzzang #giay_the