INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (87,'Dép Sandal EVA Mềm Đế Dày Hai Dây Màu Trơn Thời Trang Mùa Hè Cho Nữ','[\"Giới thiệu sản phẩm:\",\"Đôi Dép Hoạt Hình EVEANOBQY này có thiết kế Sáng tạo và thời trang, Thích hợp để mặc khi đi nghỉ bởi Biển Đông, Thiết kế dày dặn rất thoải mái và bảo vệ đế bàn chân tốt. Sử dụng chất liệu EVA, không chỉ nhẹ và thoải mái, nhưng cũng Có khả năng chống trơn trượt tốt, cải thiện đáng kể độ an toàn khi mang. Dép có khả năng thấm khí tốt, đặc biệt thích hợp cho trang phục mùa hè và có ba kiểu dép và dép, giày lỗ và dép xỏ ngón cho bạn Chọn để đáp ứng các ưu đãi cá tính khác nhau.\",\"Đặc điểm sản phẩm:\",\"Dép hoạt hình này có sẵn trong nhiều mẫu hoạt hình, và hình thức dễ thương phù hợp với mắt. Đáy dày cung cấp sự hỗ trợ đệm chân thoải mái, giúp bàn chân của bạn cảm thấy thoải mái và an toàn hơn. Dép nhẹ và bền, thiết kế đáy không trơn trượt tránh trượt khi đi bộ, vì vậy bạn có thể cảm thấy thoải mái hơn khi đi lại.\"]',NULL,196,'GNN',NULL,'[\"https://down-vn.img.susercontent.com/file/6dd09807214eb85b95b6ceda96078ea1_tn\",\"https://down-vn.img.susercontent.com/file/cn-11134211-7qukw-lftiknpzvo5k67_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7qvf0-lftfq09j5c5f86_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7qve7-lftfq0t8ci6e08_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7qvd2-lftfq19lojdx82_tn\"]',7684,NULL,2199,'2024-02-11 15:00:44','2024-02-11 15:00:44');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (88,'Giày sục thể thao nữ độn đế 5p vải canvas basic năng động đi học đi làm đi chơi, Lisa M98','[\"Giày sục thể thao nữ độn đế 5p vải canvas basic năng động đi học đi làm đi chơi, Lisa M98\\n\\nChúng mình chuyên cung cấp giày thể thao nữ, quần, áo theo mùa cực năng động và trẻ trung\\nCam kết của Lisa Store:\\n-\\tChỉ bán hàng chất lượng ko bán hàng loại 2, hàng nhái.\\n-\\tCam kết đổi trả cho quý khách trong vòng 7 ngày kể từ ngày nhận được hàng nếu hàng bị lỗi do nhà sản xuất\\n-\\tBảo hành chất lượng sản phẩm đến 6 tháng\\n-\\tHỗ trợ khách hàng đổi size nếu ko vừa.\\n\\n✅Hệ Thống Chuỗi Cửa Hàng \\n- Tòa Vp5  Nguyễn Duy Trinh,  Hoàng Mai, Hà Nội \\n- Số 14 Trần Hưng Đạo, thành phố Thái Bình\\n\\n 👑 Hotline: 0974.544.678\\n\\n✅ THÔNG TIN SẢN PHẨM:\\n- Chất liệu : Vải canvas phối da mềm, đế cao su đi chắc chắn\\n- Màu sắc: Đen\\n- Kiểu dáng: Sneaker năng động \\n- Đế cao 5cm\\n - Size 35-39\\n- Giày full hộp, vận chuyển đến tay khách hàng đều được đóng gói kỹ bằng xốp nổ và hộp carton cứng cáp đảm bảo chuẩn form\\n\\n✅ HƯỚNG DẪN SỬ DỤNG\\n- Không giặt tẩy bằng các chất tẩy rửa mạnh, có thể dùng ( vỏ chuối, sữa tươi , giấm... )\\n- Không ngâm nước quá lâu\\n- Với các sàn phẩm sáng màu, nên vệ sinh thường xuyên\\n- Tránh cất giữ giày khi còn ướt, ẩm..\\n\\n✅ Bảo hành 𝐂𝐒𝐊𝐇 :  \\n- Bảo hành 1 đổi 1 miễn phí trong vòng 7 ngày nếu sản phẩm có lỗi do nhà sản xuất.\\n- Bảo hành chất lượng sản phẩm 6 tháng.\\n- Chăm sóc & tư vấn trọn đời.\\n- Sản phẩm quý khách nhận được bị lỗi, không hài lòng về chất lượng xin vui lòng ibox chat cho Lisa để được hỗ trợ\\n \\n   Cảm ơn quý khách đã ghé thăm và ủng hộ Lisa\\nVui lòng ấn \\\"Theo dõi\\\" để cập nhật những sản phẩm chính hãng, giá rẻ mới nhất nhé!\\n\\n#Suc_the_thao_nu_don_de #giay_suc_nu #suc_nu #giay_dap_got #suc_nu_de_cao #suc_nu_the_thao #giay_suc_the_thao_nu_don_de #giay_suc_the_thao_nu #suc_da_nu #suc_nu_cao_got #suc_nu_don_de #giay_suc_don_de #giay_suc_da_nu #giay_suc_nu\"]',NULL,106,'GNN',NULL,'[\"https://down-vn.img.susercontent.com/file/sg-11134201-22100-h0f2pmn0heiv95_tn\",\"https://down-vn.img.susercontent.com/file/4fa27d9f3ee4701fd2469d66262acb2a_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-22100-mcpx5d40heiv63_tn\",\"https://down-vn.img.susercontent.com/file/efd62b60c9ab514a3ed7c01eabfe1f96_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-22100-dyo6cg40heiv0c_tn\"]',9238,NULL,1639,'2024-02-11 15:00:44','2024-02-11 15:00:44');
