INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (92,'Giày sục hở gót quai ngang Mary Vá Mũi đen đế bệt êm ái','[\"Thông tin sản phẩm:\\nGiày sục hở gót quai ngang MaryJane vá mũi đen đế bệt êm ái\\n\\nMàu sắc: Đen, Trắng\\nSize: 35-39 (form chuẩn vừa chân )\\nChất liệu: Da bóng mịn, ko trầy xước\\nĐế bệt, có ma sát dưới đế\\n\\nGiày sục hở gót quai ngang Mary Vá Mũi đen đế bệt êm ái \\nTrangbihue Store luôn mang đến cho khách hàng những sản phẩm chất lượng, thời trang mà lại hợp túi tiền. Đảm bảo hàng lỗi 1 đổi 1, kể cả hàng không lỗi shop vẫn hỗ trợ đổi màu đổi size cho khách hàng. Cần tư vấn inbox shop nhé!\"]',NULL,57,'GNN',NULL,'[\"https://down-vn.img.susercontent.com/file/vn-11134201-7r98o-lnbsp3pq33i2eb_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-22110-6ru4r9qokxjv72_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-22110-tzdztbrokxjv33_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-22110-k1n588qokxjvf1_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-22110-9v0d0htg9djv20_tn\"]',1014,NULL,110,'2024-02-11 15:00:44','2024-02-11 15:00:44');
