INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (94,'Giày Sục Đạp Gót - Dép Nữ Thể Thao Buộc Dây Vải Hở Mũi Thời Trang Họa Tiết Đế Bánh Mì GH03 2023','[\"Dép Quai Ngang Nữ Thể Thao, Giày Sục Nữ Đạp Gót Buộc Dây Vải Hở Mũi Thời Trang Họa Tiết Đế Bánh Mì GH03 2023\",\"\\n\",\"Thoải mái, tiện lợi. Đó là những ấn tượng mà SỤC đem lại. Bạn có thể tha hồ cởi ra, xỏ vào dễ dàng bất cứ lúc nào mà không sợ vướng víu  như một đôi DÉP SỤC NỮ. Đối với những ngày giao mùa từ hè sang thu nhẹ nhàng, việc kết hợp giày sục với trang phục mùa thu rất tuyệt vời.\",\"Bên cạnh ưu điểm về thời trang, SỤC NHỌN  còn tôn dáng đáng kể. Những cô nàng “nấm lùn” có thể trông cao hơn hẳn vì thiết thiết kế SỤC CAO GÓT của giày giúp tạo hiệu ứng kéo dài chân khá hữu hiệu.\",\"Không dừng lại ở đôi SỤC CAO GÓT, các nhà thiết kế đã \\\"tiến hóa\\\" mẫu giày này với gót cao và nhiều kiểu dáng khác nhau.\",\"Giày Sục Nữ - Giày Đạp Gót Nữ Buộc Dây Hở Mũi Cao Cấp Hottrend 2023\",\"•\\tHay giày sục mang dáng dấp của những đôi giày thể thao năng động, cá tính.\",\"•\\tNhững đôi GIẦY SỤC CAO GÓT tôn dáng\",\"•\\tHay SỤC NƠ đáng yêu\",\"•\\tSỤC NỮ MŨI NHỌN\",\"Phối đồ với GIÀY SỤC NỮ MŨI NHỌN sao cho đẹp?\",\"•\\tGiày sục + Quần jean. Bộ đôi hoàn hảo này sẽ làm tăng thêm vẻ cá tính cho người mặc rất nhiều\",\"•\\tGiày sục + Quần tây. Quần tây kiểu ống suông, ống rộng, quần baggy mix cùng giày sục trông bạn sẽ vô cùng sành điệu\",\"•\\tGiày sục + Chân váy. Vừa điệu đà nữ tính, vừa cá tính ấn tượng\",\"\\n\",\"THÔNG TIN SẢN PHẨM\",\"✔️ Dép quai ngang thắt dây dáng thể thao chất vải dày dặn, họa tiết in phun k sợ phai màu\",\"✔️ Đế dép siêu nhẹ, êm chân làm từ cao su non và nhựa EVA cao cấp không gây tiếng ồn khi di chuyển\",\"✔️ Thiết kế theo phong cách kết hợp sục và dép, thắt dây năng động tự tin và cá tính\",\"✔️ Size dép: 35-39\",\"✔️Màu sắc: Đen thêu, Kẻ sọc Caro\",\"✔️Chiều cao đế 3cm êm ái, phù hợp đi học, đi chơi, đi làm hoặc đi du lịch.\",\"✔️ Kết hợp với váy hoa, váy vintage, maxi đi biển, phong cách cute hay tiểu thư đều rất xinh luôn ạ\",\"\\n\",\"=======================\",\"  ♥️  CHUẨN LỰA CHỌN SIZE PHÙ HỢP :\",\"Chiều dài bàn chân         👉👉👉 Size số :\",\" ==> 22   đến  22.5 cm    👉👉👉   35\",\" ==>22.5 đến  23 cm       👉👉👉   36\",\" ==>23   đến  23.5 cm     👉👉👉   37\",\" ==>23.5 đến  24 cm       👉👉👉   38\",\" ==> 24   đến  24.5 cm    👉👉👉   39\",\"  =======================\",\"\\n\",\"#depsucnu #sucno #sucnhon #succaogot #giaysucnu #depsucno #sucdapgot #sucnugiare #sucnu3p #sục_đạp_gót, #giaysucnumuinhon #sucmuinhon #depsuc #giaysuc #sucnumuinhon #depsucmuinhon #sucthatno, #suchomui #sucquaicheo,#depvintage; #deplenu, #depnuthatday, #depthethaonu\"]',NULL,174,'GNN',NULL,'[\"https://down-vn.img.susercontent.com/file/94cdb1b12d23710b0945fcb3e41fe16c_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-22100-jgw2v1mlu9iv4d_tn\",\"https://down-vn.img.susercontent.com/file/afca89961896f07bd5d3c93734ca883a_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lnjij1bbv88qcd_tn\",\"https://down-vn.img.susercontent.com/file/6a2a12e2e042fe7396177c4616a3cfb2_tn\"]',2234,NULL,58,'2024-02-11 15:00:44','2024-02-11 15:00:44');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (95,'Giày thể thao đế cao tôn dáng mũi tròn chất vải, Giày độn đế nữ cao 5p mẫu mới hot trend','[\"Là mẫu giày đang được các bạn nữ rất ưa chuộng hiện nay bởi những đặc tính nổi trội:\\nKiểu dáng thời trang, năng động,trẻ trung dễ phối đồ\\nChất liệu đẹp, êm và dễ làm sạch; đế cao su tổng hợp nên dẻo và rất êm chân.\\n\\n- Size 36-40\\n\\n- GiàyThích hợp khi tham gia các hoạt động thể thao, đạp xe, leo núi , trượt ván...\\n- GIÀY ulzzang nữ Dễ dàng kết hợp với hầu hết các phong cách thời trang như:đi học,đi chơi,đi du lịch. giày đôi, giày nhóm....\\n_ Toàn bộ ảnh và video là shop tự chụp\\nDưới đây là cách đo giày size giày sandal dành cho nàng nha.\\n* Bước 1: Chuẩn bị một cái bút chì, thước kẻ và một tờ giấy A4\\n* Bước 2: Đứng thẳng người và đặt bàn chân lên trên tơ giấy A4, sau đó dùng bút chì vẽ một đường bao quanh bàn chân.\\n* Bước 3: Sau khi đã có hình vẽ bàn chân, dùng thước kẻ đo chiều dài của bàn chân ( chiều dài bàn chân tính từ ngón chân cao nhất đến gót chân)\\n* Bước 4: Đem kết quả đo được đối chiếu với bảng đo size giày và lựa chọn size giày phù hợp.\\n* Hãy áp dụng cách đo size giày trên để có được một đôi giày ưng ý nhất nàng nhé!\\n\\nCam kết của shop\\n🌸 \\n+ Hỗ trợ đổi trả sản phẩm không giống hình \\n+ Hỗ trợ đổi size nếu ko vừa\\n+ Ảnh thật shop chụp + quay\\n+ Ship COD toàn quốc \\n\\n----------------------------------------------------- \\nINBOX ĐỂ ĐƯỢC TƯ VẤN TẬN TÌNH TỪ A - Z NHÉ\\n#giaynu #giaythethao #sneaker #giaythethaonu #giare  #maumoi #sneakerulzzang #ulzzang  #hot #giaydecao #giaynu #giaydeto #tangchieucao #5cm #giaynuthethao #xinh #donde #nangde #nu #tondang #sneakers #nangdong #giaytrang #giay #mem #thethao #giaysneakers #dongian #gonchan #rangcua #giayden #giaydentron #giaythe #thethao #dep #giaythethaodep #giayhottrend #hottrend #hot #maumoi #moi #g