INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (103,'Clemine Giày Thể Thao Đế Dày 4.5cm Thoải Mái Nhiều Màu Sắc Cho Nữ','[\"🖍️Một số lý do để chọn chúng tôi📌\",\"🔔Thông tin kích thước chính xác phía sau hình ảnh chính\",\"\\n\",\"🟥Kiểm tra cẩn thận mọi sản phẩm sẽ được gửi đi\",\"🟧Các vấn đề về chất lượng sẽ được giải quyết nghiêm túc và kịp thời\",\"🟨Hình ảnh giống nhau nhưng chất lượng của chúng tôi sẽ tốt hơn\",\"🟩Sản phẩm có thể đeo trong thời gian dài và thoải mái\",\"🟦Sản phẩm còn hàng, các bạn yên tâm mua nhé\",\"\\n\",\"🎫Chúng tôi đã chuẩn bị phiếu giảm giá bất ngờ cho bạn, bạn có thể tự mình thu thập hoặc trò chuyện riêng với bộ phận chăm sóc khách hàng của chúng tôi để nhận chúng💌\",\"🛒🛒 Chúng tôi thường xuyên khởi động các hoạt động để nhận được những món quà tinh tế và phiếu giảm giá lớn không có ngưỡng 🛍️🛍️\",\"🧸Đó là một trải nghiệm thú vị từ khi nhìn thấy sản phẩm đến khi nhận sản phẩm, bạn sẽ thích cửa hàng của tôi🎁\",\"\\n\",\"📖 Mỗi sản phẩm của chúng tôi đều có phần giới thiệu chi tiết\",\"📒Chất liệu trên: PU\",\"📕Đóng cửa: Ren\",\"📘Chiều cao gót: gót giữa (4,5 cm)\",\"📙Kích thước: 35,36,37,38,39,40\",\"\\n\",\"📣📣📣Sản phẩm mới trong cửa hàng\",\"🔺Cửa hàng mình có rất nhiều sản phẩm mới mỗi tuần\",\"🔻Theo dõi cửa hàng của tôi để nhận phiếu giảm giá\",\"\\n\",\"🌈 Mang giày của chúng tôi sẽ không cảm thấy mệt mỏi ngay cả khi bạn đi bộ nhiều mỗi ngày✨\"]',NULL,135,'GNN',NULL,'[\"https://down-vn.img.susercontent.com/file/2c080281aa8f45361856ef246924e205_tn\",\"https://down-vn.img.susercontent.com/file/cn-11134207-7r98o-lkw1bkb6h48dd6_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbk0-lkw6dz0ungpzc0_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbk0-lkw6th0643yw17_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbk0-lkw6em4eukp45d_tn\"]',5179,NULL,1754,'2024-02-11 15:00:44','2024-02-11 