INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (104,'[Có sẵn] Dép sục Nam Nữ Cross EVA - Tặng kèm sẵn hình gắn sticker dễ thương','[\"🌵 DÉP Cross nữ tăng chiều cao 4cm, tặng kèm Full hình gắn sticker dễ thương\",\"👉 Thông tin sản phẩm:\",\"\\n\",\"- Sản xuất từ chất liệu EVA có tính kháng khuẩn, khử mùi nên không tạo ra mùi hôi ở chân, rất nhẹ, êm, tạo sự thoải mái khi mang.\",\"- Dép sục đế cao 4cm tăng chiều cao vừa phải rất dễ phối đồ, trong lòng dép có thiết kế các chấm ma sát, giúp cho bàn chân được thoải mái, không bị đau khi đi lại nhiều. \",\"- Dép sục Cross thiết kế các lỗ thông hơi, giúp bàn chân không bị nóng khi đi mùa hè. Ngoài ra các lỗ thông hơi này có thể gắn thêm vào các hình gắn trang trí tuỳ theo sở thích của chủ nhân, tạo nên 1 đôi dép vừa có tác dụng tốt, lại vừa mang tính thời trang.\",\"\\n\",\"Form dép chuẩn nên các cậu lấy size theo size giày bình thường 98% là mang vừa (Trường hợp chân cậu nào khó mang dép cứ inbox mình tư vấn size kỹ hơn nha).\",\"\\n\",\"👉  Mua ngay đi, bởi vì:\",\"🌵 Shop đang giảm giá và tặng kèm rất nhiều hình gắn dép dễ thương\",\"🌵 Shop chuyên sỉ, nên giá siêu hời.\",\"🌵 1 trong những mẫu Sục Crocss siêu êm hot nhất .\",\"🌵 Chất lượng và siêu đẹp, nhẹ êm chịu nước.\",\"🌵 Mang thoải mái, sang xịn và dễ phối đồ.\",\"\\n\",\"🍄 Sandal Việt Nam\",\"Store: 67 Phùng Khoang - Hà Nội\",\"Time: 8-12h or 14-18h\",\"\\n\",\"🍄 Lưu ý: Có bất kỳ câu hỏi, cần hỗ trợ và xử lý đơn hàng. Các cậu cứ inbox nha, shop sẽ phản hồi lại lun trong ca làm ạ.\",\"\\n\",\"#depsuc, #sucdrew, #drewhouse, #drew #dépsục #sụccrocs #crocsdrew #dépsụcdrew #depcross #dépcross #dépcrossnữ #dépcrossnữtăngchiềucao #dépcrosstăngchiềucao #déptăngchiềucao #dépđộnđế #dépcrocsnữđếcao\"]',NULL,135,'GNN',NULL,'[\"https://down-vn.img.susercontent.com/file/sg-11134201-22110-0ubmtut9zijv22_tn\",\"https://down-vn.img.susercontent.com/file/9000b3b