INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (105,'【Doris diary】Giày Thể Thao Mềm Chống Trượt Thoải Mái Phong Cách Hàn Quốc Cho Nữ','[\"💕 Chào mừng đến với cửa hàng của chúng tôi 🎗\",\"💕  Các kích thước chi tiết được hiển thị bên dưới. Hãy đọc chúng một cách cẩn thận.\",\"💕  Sản phẩm này có trong kho và có thể được giao cho bạn sớm nhất.\",\"💌 Nếu bạn có bất kỳ câu hỏi nào về việc mua hàng của mình, vui lòng liên hệ với chúng tôi và chúng tôi sẽ trả lời dựa trên sự hài lòng của bạn.\",\"✅ Sản phẩm của chúng tôi là 100% mới.\",\"✅ Tôi hy vọng sẽ mang lại cho bạn trải nghiệm mua sắm tốt nhất.\",\"🔹🔸🔹🔸🔹🔸🔹🔸🔹🔸🔹🔸🔸🔸🔹🔸🔸🔸🔸🔸🔸🔸🔸🔸🔸🔸🔸🔸🔸🔸🔸🔸🔸🔸🔸🔸🔸🔸🔸🔸🔹🔸\",\"Loại sản phẩm: giày thường\",\"Phong cách: giản dị, thời trang, phong cách Hàn Quốc, xu hướng sáng tạo\",\"Chất liệu trên: Lưới\",\"Chất liệu duy nhất: Cao su\",\"Màu trắng\",\"Chức năng: Thoải mái, thoáng khí, chống trượt\",\"Thời gian sử dụng: Mỗi ngày\",\"🔹🔸🔹🔸🔹🔸🔹🔸🔹🔸🔹🔸🔸🔸🔹🔸🔸🔸🔸🔸🔸🔸🔸🔸🔸🔸🔸🔸🔸🔸🔸🔸🔸🔸🔸🔸🔸🔸🔸🔸🔹🔸\",\"✅ Chúng tôi có nhiều kinh nghiệm và sản phẩm chất lượng cao.\",\"✅ Chúng tôi tập trung vào các sản phẩm chất lượng cao và giá thành rẻ!\",\"✅ Luôn có sản phẩm mới. Vui lòng theo dõi các bản cập nhật mới nhất của chúng tôi.\",\"💕  Nếu bạn thích sản phẩm của chúng tôi, vui lòng thêm nó vào giỏ hàng của bạn. Cảm ƠN!!!\",\"🍻  Chúng tôi mong đợi xếp hạng năm sao của bạn.\",\"Bạn có thể ghé thăm cửa hàng và xem hàng trăm sản phẩm khác cho bạn lựa chọn. Chúng tôi hy vọng bạn có một trải nghiệm mua sắm thú vị tại cửa hàng của chúng tôi. （^___^）\"]',NULL,175,'GNN',NULL,'[\"https://down-vn.img.susercontent.com/file/cn-11134207-7r98o-lngkx2td9nygf1_tn\",\"https://down-vn.img.susercontent.com/file/cn-11134207-7r98o-lngkx2tdb2iwb0_tn\",\"https://down-vn.img.susercontent.com/file/cn-11134207-7r98o-lngkx2tdch3cb6_tn\",\"https://down-vn.img.susercontent.com/file/cn-11134207-7r98o-lngkx2tddvns1a_tn\",\"https://down-vn.img