INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (106,'GIÀY THỂ THAO NỮ DÂY XOẮN ĐẾ CAO MŨI TRÒN PHÙ HỢP CHO NỮ ĐI CHƠI, ĐI HỌC','[\"GIÀY THỂ THAO NỮ DÂY XOẮN ĐẾ CAO MŨI TRÒN PHÙ HỢP CHO NỮ ĐI CHƠI, ĐI HỌC DÁNG BATA CỰC ĐẸP\",\"\\n\",\"Hàng Chuẩn , Đẹp , Và Bao Giá Toàn Quốc Cho Bạn Shop Giầy Dép Của Tớ Đảm Bảo Chất Lượng , Mẫu Mã Đa Dạng\",\"Nhận Sỉ Toàn Quốc Size Đầy Đủ\",\"Thông Tin Sản Phẩm : \",\"Xuất sứ : Hongkong \",\"✔️ Đế giày được thiết kế chịu ma sát tốt, , nhẹ, êm, cân bằng và thoáng khí \",\"✔️ Kiểu dáng hottrend của năm nay. ️ Giày đẹp, nhẹ, bền. Có thể làm giày cặp, giày nhóm. Thích hợp đi chơi, chạy bộ, gym, đi học, đi làm... \",\"✔️ Có thể kết hợp Đồ, jeans, sooc, Ngố vv…. Đều phù hợp \",\"CAM KẾT CỦA SHOP : \",\"- Bán đúng chất lượng về sản phẩm như mô tả \",\"- Chuyển đúng hàng , đúng mẫu mã và size \",\"- Màu sắc đúng với đơn đặt hàng \",\"- Trả hàng hoàn tiền 100% nếu giày không đúng với mô tả \",\"Do màn hình và điều kiện ánh sáng khác nhau, màu sắc thực tế của sản phẩm có thể chênh lệch khoảng 3-5% đế cao su đúc chất liệu cao cấp mới về tại SHOP\",\" #dep #quaicheo #depnam #chaco #depdep #deptong #depnam #depquaingan #saldannam #saldannu #depnu #depquaihau #depthoitrang #depre #depquaingangnam \",\"Sản xuất bởi Xưởng giày Mi Bantang, Quận Taijiang Địa chỉ: Mặt tiền cửa hàng 17, Tầng 1, Tòa nhà 1#, Tòa nhà Thương mại Liwei, Số 488, Đường Liuyi Middle, Phố Yingzhou, Quận Taijiang, Phúc Châu, Phúc Kiến, Trung Quốc\"]',NULL,97,'GNN',NULL,'[\"https://down-vn.img.susercontent.com/file/37cbae0fece7e654b444c54c464c794a_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-ln18g3mi1yyb1b_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-ln18g3mhmipf65_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-ln18g3mh72gj9f_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-ln18