INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (108,'UOUO dép đi trong nhà Dép Lê Thời Trang Đơn Giản Cho Nữ dép bánh mì TX041003','[\"🌈 Chào mừng bạn đến với cửa hàng của chúng tôi.\",\"\\n\",\"🌈 Theo dõi cửa hàng để nhận phiếu giảm giá。◕‿◕｡\",\"🌈 Nếu bạn hài lòng với sản phẩm và dịch vụ của chúng tôi Khen ngợi Năm sao\",\"\\n\",\"🚚 Sản phẩm đến từ Trung Quốc và mất một thời gian để vận chuyển\",\"\\n\",\"💕 Phải mặc! Phổ biến vào năm 2023!\",\"\\n\",\"💕Được làm bằng chất liệu cao cấp, đủ bền để bạn mặc hàng ngày!\",\"\\n\",\"💕 Vì vậy, thoải mái Chất liệu vải mềm mại, hình dạng đẹp, chất lượng tốt.\",\"\\n\",\"💕 Thiết kế đẹp, sang trọng, độc đáo.\",\"\\n\",\"💕 Nó là một món quà tốt cho người yêu của bạn hoặc chính bạn.\",\"\\n\",\"❣️ Chất lượng và giá cả như thế này không thể tìm thấy ở bất cứ đâu khác, rất đáng để tiền.\",\"\\n\",\"❣️Do các thiết bị hiển thị và ánh sáng khác nhau, hình ảnh có thể không phản ánh màu sắc thực tế của tất cả các sản phẩm. Cảm ơn bạn đã thông cảm cho chúng tôi! ❣️\",\"\\n\",\"❣️ Xếp hạng 1 hoặc 2 sao mà không có lý do / hình minh họa. hoặc đặt một cái gì đó không có gì đó để làm hỏng danh tiếng của cửa hàng. Cửa hàng sẽ không trợ giúp chút nào vì bạn được coi là đang tham gia vào mục đích của Shop, đặc biệt cảm ơn các bạn đã đặt hàng hoặc yêu cầu thêm thông tin tin tưởng ️\"]',NULL,109,'GNN',NULL,'[\"https://down-vn.img.susercontent.com/file/1cf12c86d5cb62cdc837e40f0276776c_tn\",\"https://down-vn.img.susercontent.com/file/cn-11134207-7qukw-lgvwuue41ly439_tn\",\"https://down-vn.img.susercontent.com/file/cn-11134207-7qukw-lgvwuue430ik4a_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134201-7qukw-lepj4w8ng1pv24_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7qvfa-lf55b8dymjqr5c_tn\"]',611,NULL,283,'2024-02-11 15:00:44','2024-02-11 15:00:44');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (109,'Giày thể thao nữ basic Giày nữ đi học giày vải vanvas phối da lộn màu xám hàng loại 1 FULLBOX giấy gói Kichi Shoes','[\"LƯU Ý:\",\"- Dây giày làm từ vải sợi bông nên dễ xù, nếu bạn không thích chất vải xù của dây giày thì có thể thay thế bằng dây khác nhé.\",\"- Do hộp đựng giày làm từ chất bìa cartoon nên thỉnh thoảng trong quá trình vận chuyển đi xa thì bìa cartoon màu nâu bên trong sẽ dây chút bẩn ra gót giày. Nếu bạn đồng ý mua thì hoan hỉ vệ sinh giúp shop nhé. Vì sự cố này shop cũng ko lường trước được :(((\",\"\\n\",\"HƯỚNG DẪN CHỌN SIZE GIÀY:\",\"- Bàn chân gầy nên lùi 1 size.\",\"- Bàn chân bình thường đi đúng size sẽ hơi rộng nhưng lùi size thì khi đi lại nhiều thỉnh thoảng sẽ bị cảm giác kích mũi chân (bạn có thể đi tất dày và chọn đúng size để có cảm giác vừa vặn hơn)\",\"- Bàn chân mập hoặc rộng bề ngang nên chọn đúng size\",\"\\n\",\" HƯỚNG DẪN VỆ SINH:\",\"- Do giày mới sản xuất nên bạn đừng vội giặt giày sớm vì vải da lộn mới nhuộm cần khoảng 1 tháng để khô kĩ hoàn toàn.\",\"- Bạn không nên giặt bằng nước giặt có chất tẩy mạnh vì sẽ dễ phai màu.\",\"- Nên giặt từng phần của giày lần lượt chứ không nên nhúng nước và chà toàn bộ cùng 1 lúc.\",\"\\n\"]',NULL,174,'GNN',NULL,'[\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-livvaxcioi4y59_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lnnv55kkjqwd8f_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lq0qgz1t44ia81_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-ljqq2oovv3eq47_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-ljr9vqvyr8ok2f_tn\"]',8234,NULL,2558,'2024-02-11 15:00:44','2024-02-11 15:00:44');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (110,'Mistery GiàY Thể Thao Nữ ĐộN Đế Màu Nâu MIS-542','[\"💖💖Chào mừng bạn đến với cửa hàng chính thức Mistery💖💖\",\"\\n\",\"\\n\",\"Thương hiệu: Mistery\",\"Mã sản phẩm:MIS-542\",\"Màu be màu\",\"Chất liệu mặt trên: Vải\",\"Thông tin kích thước:\",\"35【22.5cm】、36【23cm】\",\"37【23.5cm】、38【24cm】\",\"39【24.5cm】、40【25cm】\",\"Nếu bạn có bàn chân mỏng, hãy mua ở kích thước bình thường của bạn. Nếu bàn chân của bạn mập, nên mua một kích thước lớn hơn.\",\"Kích thước nam và nữ có cùng chiều dài, nhưng kích thước nam rộng hơn một chút so với kích thước nữ.\",\"Dành cho: Nữ\",\"Chất liệu đế: Cao su\",\"Chức năng: Thoáng khí\",\"\\n\",\"\\n\",\"⭐ Tất cả các sản phẩm đều được lấy bằng sản phẩm thực tế, không sửa đổi thêm, bạn cứ yên tâm mua hàng.\",\"⭐ Tất cả các sản phẩm đều hỗ trợ tiền mặt khi giao hàng và sau khi bán. Nếu có vấn đề với sản phẩm nhận được Vui lòng liên hệ với bộ phận chăm sóc khách hàng ngay khi có thể.\",\"⭐ Thời gian giao hàng khoảng 24 giờ và thời gian vận chuyển khoảng 5-7 ngày.\",\"⭐ Cửa hàng được cập nhật thường xuyên và các sự kiện được tổ chức theo thời gian. Xin vui lòng theo dõi chúng tôi một lần nữa Có thể hữu ích nếu bạn là một thành viên bổ sung.\",\"Về chúng tôi:\",\"📣 Đội ngũ phát triển độc lập và nhà máy để mang đến cho bạn những sản phẩm tốt hơn và tiết kiệm chi phí hơn.\",\"📣 Đội ngũ dịch vụ chăm sóc khách hàng chất lượng cao để mang đến cho bạn trải nghiệm mua sắm tốt hơn.\",\"📣 Quản lý liêm chính. Hy vọng xây dựng một mối quan hệ đáng tin cậy và hài hòa với khách hàng.\"]',NULL,146,'GNN',NULL,'[\"https://down-vn.img.susercontent.com/file/9b5a497ac5e387477ba30eb58cfc0890_tn\",\"https://down-vn.img.susercontent.com/file/cn-11134207-7qukw-li9xsb6sduuu64_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-22110-baaak26kj9jvca_tn\",\"https://down-vn.img.susercontent.com/file/cd2711fa44b512c5921a7f4c89da33ed_tn\",\"https://down-vn.img.susercontent.com/file/5fa3cdcd5d1c46fbcbcd13855693a27f_tn\"]',1218,NULL,185,'2024-02-11 15:00:44','2024-02-11 15:00:44');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (111,'Giày thể thao nữ cao cấp All White trendy hợp thời trang, Giày nữ chống trơn trượt đi chơi dễ phối đồ BRL','[\"Tên sản phẩm: Giày thể thao nữ cao cấp All White trendy hợp thời trang, Giày nữ chống trơn trượt đi chơi dễ phối đồ\",\"\\n\",\"Giày một phụ kiện không thể thiếu trong cuộc sống hàng ngày, ngoài việc đôi giày bảo vệ bàn chân khỏi các tác nhân bên ngoài, việc lựa chọn cho mình một đôi giày đẹp phần nào tăng mức độ tự tin của bản than và BraLune có thể đáp ứng cho bạn được đó. Vậy đừng chần chừ gì nữa mà hay sắm cho mình một đôi giày đẹp ngay bây giờ tại BraLune Shoes nhé!\",\"Mô tả:\",\"-\\tKiểu dáng hiện đại, trendy và sang trọng.\",\"-\\tNhiều màu sắc, mẫu mã đáp ứng được nhu cầu của phái đẹp.\",\"-\\tChất liệu vải cao cấp giúp chống nước, có độ bền lâu.\",\"-\\tNhững đôi giày đã được gia công một cách tỉ mỉ khiến đôi giày phần nào trở nên đẹp và tốt hơn.\",\"-\\tPhần gót được đôn cao nhằm mục đích kéo dài chân, làm tôn dáng chị em thêm đẹp hơn\",\"-\\tPhần đế bằng cao su và chắc chắn giúp nâng cao trải nghiệm đi lại của chị em.\",\"-\\tỞ phần đế, các vân đế được thiết kế có mục đích bảo đảm an toàn, chống trơn trượt khi thời tiết xấu.\",\"Lưu ý sử dụng sản phẩm:\",\"Để giữ được độ bền cũng như màu sắc hay form của đôi giày, các chị em nên làm như sau:\",\"-\\tKhi làm sạch giày, chị em nên chọn những loại bàn chải mềm mại, tránh làm hỏng bề ngoài của đôi giày.\",\"-\\tKhi phơi giày nên tránh ánh nắng trực tiếp.\",\"-\\tKhông dùng những chất tẩy rửa quá mạnh.\",\"-\\tTránh va chạm với những vật sắc nhọn, góc cạnh để tránh làm hỏng đôi giày và bản thân.\",\"Cam kết : \",\"-\\tSản phẩm về tay như hình và mô tả.\",\"-\\tHàng luôn có sẵn, thời gian đóng gói và chuẩn bị nhanh chóng.\",\"-\\tLuôn có nhân viên thường trực Shop online để trả lời những thắc mắc , giải quyết vấn đề của khách hàng sớm nhất \",\"-\\tNếu sản phẩm có vấn đề, liên hệ shop để được tư vấn một cách tốt nhất. \",\"-\\tHỗ trợ khách hàng đổi trả trong vòng 7 ngày nếu sản phẩm có gặp lỗi trong quá trình vận chuyển.\",\"Khi hàng về và quý khách thấy ưng ý thì đừng quên đánh giá 5 sao và ủng hộ shop lần tới nhé!\",\"G010\",\"G013\",\"G028\",\"G030\",\"#giaynu #botnu #depnu #giaythoitrang #giay #bot #dep #giaycaogot #giaybot #giaydep #giaythethao #giaysneaker #giaysneakers #sneaker #sneakers #depcaogot #botcaogot #depthoitrang #botthoitrang #giaydihoc #giaysangtrong #giaydutiec #giaydongot #giaydichoi\"]',NULL,154,'GNN',NULL,'[\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lpew2jk0yfkeb5_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-ln28dzhxz07sa7_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lpew2jk12n9q83_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lpew2jk0zu4u29_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lpew2jk118pa60_tn\"]',5122,NULL,795,'2024-02-11 15:00:44','2024-02-11 15:00:44');
