INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (113,'Giày Thể Thao Nữ Đế Dày Thời Trang Hàn Quốc Màu Sắc Nổi Bật','[\"Chào mừng đến với cửa hàng của chúng tôi😊😊😊\",\"🌄 Chất lượng cao và giá cả thân thiện.🌄\",\"Trước khi đặt hàng, bạn sẽ nhận được phiếu giảm giá trên trang chủ cửa hàng với giá rẻ hơn.\",\"Sử dụng các màn hình khác nhau cho sản phẩm trong ảnh có thể khiến màu sắc thực tế của sản phẩm hơi đậm hoặc nhạt hơn màu trong ảnh.\",\"Sản phẩm của chúng tôi đến từ nước ngoài. Giao hàng khoảng 7-12 ngày.🚚🚚🚚\",\"🔥 Trước khi nhấp vào đơn đặt hàng, vui lòng đảm bảo số điện thoại và địa chỉ của bạn là chính xác, nếu có sai sót, chúng tôi không thể thay đổi hoặc sửa chữa bất cứ điều gì.🔥\",\"Chúng tôi có kinh nghiệm phong phú và sản phẩm chất lượng cao.\",\"Cung cấp cho bạn trải nghiệm mua sắm tốt nhất\",\"Sản phẩm của chúng tôi là thương hiệu mới 100%.\",\"Chúng tôi tập trung vào chất lượng và giá cả!\",\"Nếu bạn thích sản phẩm của chúng tôi, vui lòng đặt hàng vào giỏ hàng và giúp bạn nhấp chuột👍👍👍 💖💖💖\",\"Cửa hàng của chúng tôi cung cấp dịch vụ khách hàng trực tuyến, vì vậy nếu các câu hỏi do cửa hàng gây ra, vui lòng trả lời câu hỏi của bạn. Điều này cho thấy sản phẩm bị lỗi. Bạn có thể tìm thấy cửa hàng qua trò chuyện .Shop sẵn sàng chịu trách nhiệm.\",\"💕💕 Điều bình thường nếu không có vấn đề gì với sản phẩm, đừng quên khen ngợi và đánh giá cửa hàng của chúng tôi. Chúng tôi rất mong được cung cấp cho bạn đánh giá năm sao.⭐⭐⭐⭐⭐⭐⭐⭐\",\"Mọi điểm đều có giá trị đối với cửa hàng của chúng tôi. Cảm ơn bạn đã cho tôi một ngón tay cái.💕💕💕\",\"Chúng tôi luôn có những sản phẩm mới, bắt kịp những tin tức mới nhất từ cửa hàng của chúng tôi, chúng tôi sẽ gửi cho bạn phiếu giảm giá và giảm giá.\"]',NULL,158,'GNN',NULL,'[\"https://down-vn.img.susercontent.com/file/2f2ca7f576250c3c5536b7e3d215d3cc_tn\",\"https://down-vn.img.susercontent.com/file/sg-1113420