INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (114,'Giày Thể Thao Nữ Vải Canvas Mix Dây Thừng Cá Tinh Mới Siêu Nhẹ G431','[\"\\nFull hộp qc loại 1\\nKiểu dáng thời trang mix dây thừng cá tính\\nđi siêu nhẹ êm chân\\nđi 2 kiểu sục và đi bình thường nha rất tiện lợi\\nsize 36*40\\nchuẩn fom size nha các bạn\\n\\n#giaynu #giaythethao #sneaker #giaythethaonu #giare  #maumoi #sneakerulzzang #ulzzang  #hot #giaydecao #giaynu #giaydeto #tangchieucao #5cm #giaynuthethao #xinh #donde #nangde #nu #tondang #sneakers #nangdong #giaytrang #giay #mem #thethao #giaysneakers #dongian #gonchan #rangcua #giayden #giaydentron #giaythe #thethao #dep #giaythethaodep #giayhottrend #hottrend #hot #maumoi #moi #giare #catinh #nangdong #donde #decao #giaydecao #sneakernu #giaythethaonu #shopee  #giaydonde #giayulzzang #tangchieucao #decao #5cm  #giaymauden #denfull #mauxam #maukem #giaymauxam #giaymaukem #giaydep #giayvai #quangchau  #muadong #giaymuadong #muahe #giaymuahe #giaydihoc #dihoc #dichoi #giaydichoi #noel #trungthu #tet #quatangsinhnhat #quatangbangai #dibo #chaybo #gym #giayphanquang #phanquang #thoitrangnu #dephoido  #giayhaymua #haymua #hanquoc #style #sneakers #giaydepnu #thoitrangnu #giay #nu #moi #giaythethaoden #giaythethaotrang #giaydebang #debang #cohop #giaybosua #bosua #giayvai #debanhmi #debang #buocday #trend #hanquoc #giayvai #vaicanvas #canvas #muito #basic #debang #giaydebang #giayhocsinh #batanu #bata #giaynudebang #retro #ulzzang #sneaker #giaythethao #debang #muitron #buocday #giaydonde #donde #nangde #phongcach #hanquoc #buocday #maxlovestore\\n\\n\"]',NULL,149,'GNN',NULL,'[\"https://down-vn.img.susercontent.com/file/37cbae0fece7e654b444c54c464c794a_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7qvdl-lj8ofxhy6wwdbe_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7qvg8-lj8ofxhoa4xf98_tn\",\"https://down-vn.img