INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (115,'Giày Thể Thao JD Trà Sữa cổ thấp Siu Cấp Full Box Hàng Xịn Dành Cho Nữ Tặng Kèm Tất + Hộp Bảo','[\"Dễ dàng phối đồ\\n -Phù hợp với mọi người đi chơi, đi học, đi làm ,...\\n✅Người bán chịu trách nhiệm: Nguyễn Văn Hiếu\\n✅Địa chỉ người bán chịu trách nhiệm: Khu làng nghề Đồng văn,huyện Yên Lạc,tỉnh Vĩnh Phúc\\n✅Xuất xứ hàng hoá:Trung Quốc\\n✅Bảng size tiêu chuẩn:\\n-36:22,5cm\\n-37:23,5cm\\n-38:24cm\\n-39:25cm\\n-40:25cm\\n-41:26cm\\n-42:26,5cm\\n-43:27,5cm\\n📦📦Lưu ý bảng size trên dựa theo tiêu chuẩn có thể nhiều bạn đo sẽ không đúng nên hãy inbox shop để được tư vấn chính xác hơn❤️\\n✅ Các bạn nên giặt qua 1 lần để mùi hôi của keo bay bớt\\n✅Năm sản xuất:2021\\nShip COD toàn quốc\\n➡️Các bạn lướt sản phẩm sang trái hoặc nhắn tin cho shop để có thêm ảnh thật của sản phẩm\\n➡️Bán hàng uy tín chất lượng \\n➡️ Hàng lỗi của nhà sản xuất được đổi trả lại shop\\n Sự hài lòng của các bạn là niềm tự hào của chúng tôi\\n➡️Các bạn mua giày rồi đánh giá giúp mình nhé\\n\\n- Giày được Tặng hộp mới 100%, nhưng trong quá trình vận chuyển rất có thể hộp sẽ bị móp méo, điều này shop không hề mong muốn và cũng không thể can thiệp được vào công việc vận chuyển của bên shopee, nên mong bạn rất thông cảm\\n- Nếu bạn nhận được sản phẩm lỗi hoặc do nhầm lẫn. Mong các bạn nhắn tin cho shop khắc phục trước khi đánh giá sản phẩm ạ . Shop cam kết sẽ luôn có trách nhiệm với sản phẩm đã bán\\n- Quý khách có quyền đổi hàng trong vòng 3 ngày kể từ ngày nhận hàng (với điều kiện GIÀY CÒN MỚI NGUYÊN-CHƯA QUA SỬ DỤNG) cho những trường hợp sau:\\n+ Hàng lỗi nghiêm trọng do sản xuất; hàng giao sai mẫu, nhầm size. Shop sẽ hỗ trợ 100% phí ship. \\n+ Trường hợp khách đổi giày do đổi size, đổi mẫu khác thì chi phí ship 2 chiều quý khách sẽ chịu 100%, vì vậy Shop lưu ý quý khách vui lòng đọc kỹ quy định đổi hàng.\\n- Chat với shop để được tư vấn nếu cần nhé. \\n- Về sản phẩm: Shop cam kết 100% về chất lượng \\n- Về giá cả : Shop nhập với số lượng nhiều và trực tiếp nên chi phí sẽ là rẻ nhất nhé.\\n- Về dịch vụ: Shop có đội ngũ tư vấn 24/24 và sẽ cố gắng trả lời hết những thắc mắc xoay quanh sản phẩm nhé. \\n- Thời gian chuẩn bị hàng: Hàng luôn có sẵn, thời gian chuẩn bị tối ưu nhất\\n luôn tuyển ctv toàn quốc\"]',NULL,77,'GNN',NULL,'[\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lnueurbhmlbu56_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lnv03wnfqtfe80_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lnueurbhpegqc8_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lnv03wnfpeuya0_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lnueurbhs7lm19_tn\"]',4749,NULL,293,'2024-02-11 15:00:44','2024-02-11 15:00:44');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (116,'Giày thể thao nữ LANYUJING FLF23B00R6 44Z231101 thiết kế mới thoáng khí đơn giản đa năng chất liệu tốt','[\"🌈 Chào mừng đến với cửa hàng của chúng tôi.\",\"\\n\",\"  🌈 Theo dõi cửa hàng để nhận phiếu giảm giá ”◕‿◕｡\",\"\\n\",\"  🌈 Nếu bạn hài lòng với sản phẩm và dịch vụ của chúng tôi Lời khen ngợi năm sao\",\"\\n\",\"  🚚 Sản phẩm đến từ Trung Quốc và mất một thời gian để vận chuyển\",\"\\n\",\"  💕 Phải mặc! Phổ biến vào năm 2023!\",\"\\n\",\"  💕Được làm bằng chất liệu cao cấp, đủ bền để bạn mặc hàng ngày!\",\"\\n\",\"  💕 Thật thoải mái Chất liệu vải mềm mại, hình dáng đẹp, chất lượng tốt.\",\"\\n\",\"  💕 Thiết kế đẹp, sang trọng, độc đáo.\",\"\\n\",\"  💕 Nó là một món quà tốt cho người yêu của bạn hoặc chính bạn.\",\"\\n\",\"  ❣️ Chất lượng và giá cả như thế này không thể tìm thấy ở bất kỳ nơi nào khác, rất đáng đồng tiền. ️\",\"\\n\",\"  ❣️Do các thiết bị hiển thị và chiếu sáng khác nhau, hình ảnh có thể không phản ánh màu sắc thực tế của tất cả các sản phẩm. Cảm ơn bạn đã thông cảm ❣️\",\"\\n\",\"  ❣️ Đánh giá 1 hoặc 2 sao không có lý do / hình minh họa. hoặc đặt điều gì đó không đúng sự thật làm hỏng danh tiếng của shop shop sẽ không giúp gì cả vì bạn được coi là đang vào vì lợi ích của Shop, đặc biệt cảm ơn quý khách hàng đã có nhu cầu vui lòng đặt hàng hoặc yêu cầu thêm thông tin tin tin nhé ️\"]',NULL,51,'GNN',NULL,'[\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbks-lnjy29p4iug873_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbkz-lnjy2ckcbsts7e_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbmz-ln1c850ogayzf1_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rblx-lnjy2hf57zmme3_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbl4-lnjy2aijbsug77_tn\"]',5278,NULL,228,'2024-02-11 15:00:44','2024-02-11 15:00:44');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (117,'Giày Oxford nữ Đế Dày Đính Nơ Phong Cách Anh Quốc Sang Trọng LuxyShoes LX34','[\"Giày Oxford nữ Đế Dày Đính Nơ Phong Cách Anh Quốc Sang Trọng LuxyShoes LX34\",\"\\n\",\"\\n\",\"\\n\",\"HƯỚNG DẪN CHỌN SIZE\",\"\\n\",\"- Form chuẩn, khách chân mỏng, gầy cân nhắc lấy lùi 1 size để vừa dáng hơn. \",\"\\n\",\"- Shop đã chọn kỹ và kiểm tra kỹ trước khi gửi để đảm bảo sản phẩm đến tay khách hàng hoàn hảo nhất. Nếu có vấn đề gì về hàng hóa, khách chat với hop để được hỗ trợ miễn phí ạ.\",\"\\n\",\"\\n\",\"SHOP CAM KẾT:\",\"\\n\",\"1. Tất cả sản phẩm đều bọc chống sốc và kẹp bằng catton cứng để sản phẩm đến tay các bạn đẹp đẽ và nguyên vẹn nhất, tư vấn nhiệt tình\",\"\\n\",\"2.  Nếu chẳng may bạn nhận hàng bị gãy hỏng do vận chuyển shop sẽ đổi cho các bạn sản phẩm mới (freeship). Việc các bạn chỉ là cầm điện thoại lên và nhắn tin + gửi kèm ảnh  sản phẩm hỏng vào tin nhắn shopee. Shop sẽ giải quyết cho bạn ngay lập tức.\",\"\\n\",\"3. 100% sản phẩm giống mô tả và video\",\"\\n\",\"4. Hàng có sẵn, giao hàng ngay khi nhận được đơn \",\"\\n\",\"5. Hoàn tiền nếu sản phẩm không giống với mô tả\",\"\\n\",\"QUY ĐỊNH BẢO HÀNH, ĐỔI TRẢ (FREESHIP)\",\"\\n\",\"1. Điều kiện áp dụng (trong vòng 07 ngày kể từ khi nhận sản phẩm) \",\"- Hàng hoá vẫn còn mới, chưa qua sử dụng \",\"- Hàng hoá bị lỗi hoặc hư hỏng do vận chuyển hoặc do nhà sản xuất \",\"\\n\",\"2. Trường hợp không đủ điều kiện áp dụng chính sách: \",\"- Quá 07 ngày kể từ khi Quý khách nhận hàng \",\"- Không thích, không hợp, đặt nhầm mã, nhầm màu,... \",\"\\n\",\"3. Bảo hành 12 tháng với các lỗi bong keo, hở mũi, mất form,... do chất lượng sản phẩm \",\"\\n\",\"#giaynu #giaylolita #giaynudebang #giaybupbe #giaybupbenu #giaylolitanu #giaymaryjane #babydoll #vintage #maryjane #lolita #bupbe #bupbenu #luxyshoes #giaytieuthu #giaycongchua #giàynữ #giàylolita