INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (132,'Bộ Thể Thao Nam Phong Cách Trẻ Trung , Bộ Quần Áo Nam Chất Xốp Mặc Cực Mát - RMAN','[\"🔸 Thông tin sản phẩm :\",\"Bộ Thể Thao Nam Phong Cách Trẻ Trung , Bộ Quần Áo Nam Chất Xốp Mặc Cực Mát - RMAN\",\"🎀Trong thế giới thời trang của phái mạnh các set thể thao hay bộ quần áo nam luôn chiếm một vị trí quan trọng.\",\"\\n\",\"quần áo thể thao có cổ hay không cổ hợp dáng người, hợp màu sắc không chỉ khỏe khoắn mà còn rất thời trang.\",\"\\n\",\"Mang tới cho các anh chàng sự thoải mái khi đi dạo phố hoặc hẹn hò bè bạn , những bộ đồ thể thao nam cao cấp đã trở thành người bạn không thể thiếu các chàng.\",\"\\n\",\"Và nếu bạn cũng đang đi tìm một set bộ cộc tay nam đẹp thời trang thể thể hiện được cá tính của bản thân một cách rõ nét nhất và đang... lạc lối, thì hãy cùng khám phá và cảm nhận trên sản phẩm của RMAN chúng mình nhé\",\"\\n\",\"🎀 Luôn là nơi cập nhật những xu hướng quần áo thể thao, bộ quần áo nam, quần áo hè nam mới nhất\",\"\\n\",\"RMAN đã khẳng định vị trí của mình với nhiều bạn trẻ bởi phong cách thời trang sang trọng, thanh lịch nhưng không thiếu sự năng động và cá tính.\",\"\\n\",\"Khéo léo kết hợp trang phục cùng phụ kiện, bạn dễ dàng mang lại một set đồ hài hòa, thể hiện được cá tính riêng của bạn\",\"\\n\",\"BẢNG TƯ VẤN SIZE ĐỒ BỘ NAM\",\"- SIZE M :     43 - 55 Kg\",\"- SIZE L:    55 - 62 Kg\",\"- SIZE XL:    63 - 70 Kg\",\"- SIZE 2XL:    71 - 83 Kg\",\"Bảng size phù hợp 90% khách hàng. Nếu bạn không chắc chắn thì inbox shop tư vấn ạ\",\"\\n\",\"🔸 RMAN CAM KẾT\",\"Sản phẩm 100% giống mô tả. Kiểu dáng hoàn toàn giống ảnh mẫu\",\"Áo được kiểm tra kĩ càng, cẩn thận và tư vấn nhiệt tình trước khi gói hàng giao cho Quý Khách\",\"Hàng có sẵn, giao hàng ngay khi nhận được đơn \",\"Hoàn tiền nếu sản phẩm không giống với mô tả\",\"Chấp nhận đổi hàng khi size không vừa\",\"Giao hàng trên toàn quốc, nhận hàng trả tiền \",\"Do màn hình và điều kiện ánh sáng khác nhau, màu sắc thực tế chút xíu xíu\",\"\\n\",\"#Dobonam #dothethaonam #bodonam #dobothethaonam #bonam #bonammuahe #bonammaconha #domaconhanam #do_mac_o_nha_nam #bodonammacnha #bo_do_nam_mac_nha #bodonam #dobonam #dobonamthethao #do_bo_nam #bo_do_nam #do_bo_nam #bo_do_nam #do_bo_nam #do_bo_nam_bo_he #bo_do_nam_mua_he #bo_do_nam_the_thao #đo_bo_nam_bo_he\"]',NULL,157,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/8fe41d282a154a7db101abd44d76e889_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134201-23030-veze76lm1fov29_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-23020-swxky1dkn8mv34_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-23020-dq7v0dakn8mvd4_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134201-23030-rrmypexzrfov68_tn\"]',972,NULL,475,'2024-02-11 15:01:34','2024-02-11 15:01:34');
