INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (136,'áo thun nữ,nam cộc tay phối màu in số 11 dáng rộng giấu quần năng động','[\"áo thun nữ,nam cộc tay phối màu in số 11 dáng rộng giấu quần năng động\\náo thun nữ cộc tay phối màu in số 11 phong cách hàn\\n\\nchất sợi lolyester\\n\\nmàu :trắng,hồng,xanh\\n\\nfree size<62kg\\n\\nphiên bản áo dáng rộng nam nữ đều măc được \\n\\nphong cách đường phố ,măc đi chơi đi tập thể thao đi học đều được a!\\n\\ntất cả các sản phẩm đều có sẵn hàng ,các bạn hãy yên tâm đăt hàng nhé.\\n\\ntất cả các mẫu áo đều được may từ chất liệu tốt đảm bảo mang đến cho khách hàng sự thoải mái,không khó chịu khi mặc .\\n\\nshop luôn tuyển sỉ và ctv trên toàn quốc .\\n\"]',NULL,195,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/f2262d6ecf6fb17b9ae0c38064cfd313_tn\",\"https://down-vn.img.susercontent.com/file/10c7e3f6014b275dd811046e9d5d4462_tn\",\"https://down-vn.img.susercontent.com/file/e2e17e42728706a6ddd4d527816adf5f_tn\",\"https://down-vn.img.susercontent.com/file/7249ba30fa4bf7d6d4cd63ea415f9a46_tn\",\"https://down-vn.img.susercontent.com/file/cc1cb475b6931d8a3ee0c37329422539_tn\"]',4105,NULL,316,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (137,'Bộ Quần Áo Thể Thao PAUL FITZGERALD Tay Ngắn Cổ Tròn Màu Trắng Đen Trẻ Trung Hợp Thời Trang Cho Nam','[\"💌Nếu bạn có bất kỳ câu hỏi mua hàng nào, vui lòng liên hệ với chúng tôi và chúng tôi sẽ giải đáp thỏa đáng nhất cho bạn.\",\"✅ Sản phẩm của chúng tôi là thương hiệu mới 100%.\",\"✅ Hy vọng sẽ mang đến cho bạn trải nghiệm mua sắm tốt nhất.\",\"✅ Chúng tôi có kinh nghiệm phong phú và sản phẩm chất lượng cao.\",\"✅ Chúng tôi tập trung vào chất lượng tốt và giá rẻ!\",\"✅ Sản phẩm mới mọi lúc. Hãy tiếp tục chú ý đến những tin tức mới nhất của cửa hàng của chúng tôi. Chúng tôi sẽ gửi cho bạn phiếu giảm giá và chiết khấu sản phẩm.\",\"\\n\",\"\\n\",\"💕 Nếu bạn thích sản phẩm của chúng tôi, xin vui lòng thêm vào giỏ hàng, cảm ơn bạn!!!\",\"\\n\",\"🍻 Chúng tôi mong muốn nhận được đánh giá năm sao của bạn.\",\"\\n\",\"Chào mừng bạn đến với cửa hàng của chúng tôi! Hy vọng bạn thích mua sắm tại cửa hàng của chúng tôi (^ __ ^)\"]',NULL,181,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/c5b5189d15516cb8976da8d53630cdb9_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-23030-b60hvye9mfov8a_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-23030-b6ysy3d9mfov7d_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-23030-nwu3l8c9mfov40_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-23030-61u9nhe9mfov7e_tn\"]',500,NULL,131,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (138,'Hàng Mới Về Set Áo Thun Ngắn Tay In Chữ + Quần Short Ống Rộng Thời Trang Nam Tính','[\"🎈 Kính chào quý khách hàng, chào mừng đến với cửa hàng của chúng tôi!\",\"\\n\",\"Cửa hàng tự hào đã mua lại. Đó là một cửa hàng hoàn toàn mới vừa mở, mặc dù nó đã không mở được lâu. Nhưng thương hiệu có lịch sử lâu đời ở Trung Quốc, với nhà máy và đội ngũ thiết kế riêng. Tất cả các sản phẩm được vận chuyển từ nhà máy nguồn của riêng chúng tôi. Có rất nhiều sản phẩm khác nhau trên thị trường. Nhưng cửa hàng của chúng tôi luôn tập trung vào quần áo truyền thống.\",\"\\n\",\"✨ Đây là cơ sở của sản phẩm. 👇👇👇\",\"\\n\",\"Tên sản phẩm: Bộ áo phông nam\",\"Vải: Cotton\",\"Màu sắc: Đen, Trắng, Xám\",\"Kích thước: M, L, XL, 2XL, 3XL\",\"\\n\",\"Sản phẩm thiết kế sạch sẽ, không bị biến dạng. Phong cách đường phố, thiết kế đồ họa rõ ràng và cổ tay áo độc đáo làm nổi bật sự độc đáo của trang phục. Các chi tiết gọn gàng, sự khéo léo tinh tế, các loại vải hoàn hảo, thân thiện với làn da, kết cấu rõ ràng và sự khéo léo tinh tế.\",\"\\n\",\"🎀🎀 Tất cả các sản phẩm được làm từ chất liệu vải cao cấp với sự khéo léo tinh tế để đảm bảo chất lượng sản phẩm.\",\"\\n\",\"📍 Lưu ý:\",\"\\n\",\"📢 1. Vui lòng hiểu rằng ảnh chụp thực tế và hình ảnh mô hình có thể hơi khác một chút do máy ảnh, ánh sáng, màn hình và hiểu biết cá nhân về màu sắc.\",\"\\n\",\"📢Chữ số Ả Rập. Cửa hàng này đặt tại Trung Quốc và thuộc thương hiệu địa phương, do nhà sản xuất giao hàng vẫn còn xa người lớn, và vẫn còn một chặng đường dài về chất lượng và giá cả, mong các bạn ơi Ai thích cửa hàng này có thể mong đợi nó!\",\"\\n\",\"📢 3. Lựa chọn kích cỡ: Sự lựa chọn cụ thể phụ thuộc vào loại cơ thể của cá nhân và thói quen Xi Xi Tây XiXi. Nếu bạn thích kiểu tóc lỏng lẻo, chúng tôi khuyên bạn nên đặt hàng một kích thước.\",\"\\n\",\"📢4. Cửa hàng là cửa hàng xuyên biên giới, không thể xác minh thông tin hậu cần trước khi hàng về. Nếu bạn không thấy thông tin vận chuyển, đừng lo lắng. Tình trạng đơn hàng là \\\"Sẵn sàng giao hàng\\\", có nghĩa là mặt hàng của bạn đã được đóng gói và vận chuyển.\"]',NULL,169,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/cn-11134211-7r98o-lqx8i6sewuzh32_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rcdw-lqu5e3h9qd5z8f_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rccn-lqu5e3zv0kig61_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rce0-lqu5e4i69ryh13_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rcco-lqu5e50rh5g118_tn\"]',5576,NULL,2386,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (139,'Bộ quần áo nam phom rộng Áo sơ mi khuy cài kết hợp Quần short vải xốp thoáng mát 9clothing','[\"- Hãy mặc bộ quần áo này trong những ngày thư giãn ở nhà, dạo phố \\n- Luôn mát mẻ và khô ráo nhờ chất liệu vải dư xịn của chính hãng, giúp bạn luôn mát mẻ và khô thoáng trong thời tiết nóng bức!\\n* Thiết kế phom thụng thời trang\\n* Cảm giác mềm mại, thoải mái và thoáng khí, kiểm soát nhiệt và độ ẩm trong mọi điều kiện \\n* Vải công nghệ dry thấm mồ hôi và khô cực nhanh\\n\\n🔹 Lưu ý:\\n- Nếu chưa chắc chắn về chọn size sản phẩm\\n- Nếu khách form người không cân đối (Béo, gầy, thấp...)\\n- Nếu khách thích mặc ôm body hoặc mặc rộng thoải mái\\nĐừng ngại INBOX trực tiếp cho shop để được tư vấn size nhé\\n\\n⚠️ Hướng dẫn sử dụng:\\n- Lộn trái quần/ áo khi giặt máy để đảm bảo các chi tiết in có độ bền cao nhất\\n\\n🔹 CHÍNH SÁCH ĐỔI TRẢ:\\n- Được đổi nếu có lỗi của NSX.\\n- Được đổi-trả nếu không đúng với ảnh sản phẩm.\\n- Shop hỗ trợ đổi nếu size không vừa\\n\\n🤝Cam kết:\\n        💯 hình ảnh giống sản phẩm thực tế\\n        💯 giá tốt nhất thị trường\\n\\n\"]',NULL,70,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/7947728673d4031a2774413daa63cb4e_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-limmfxsnw0ya30_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-lh3q2jlaooojea_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-lh3q2jlarhtff0_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-lirrslzslzwsd9_tn\"]',3849,NULL,1180,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (140,'Bộ Quần Áo Nam Áo Sơ Mi Dài Tay Quần Kaki Basic Có Túi Trẻ Trung Thời Trang Zenkonu SO MI NAM 023 + QUAN NAM 060','[\"Bộ Quần Áo Nam Áo Sơ Mi Dài Tay Quần Kaki Basic Có Túi Trẻ Trung Thời Trang Zenkonu SO MI NAM 023 + QUAN NAM 060\",\"* THÔNG TIN SẢN PHẨM:\",\"🔸Chât liệu: vải nỉ bông mềm mại, thấm hút mồ hôi.\",\"🔸 Kích thước: XS   S   M   L    XL\",\"🔸 Xuất xứ: Việt Nam\",\"Với thiết kế trẻ trung năng động, phù hợp nhiều hoàn cảnh, phong cách Ulzzang cập nhập xu hướng mới nhất.\",\"* Chi tiết Size:\",\"Size XS: cho bạn có cân nặng từ 40 - 45kg tùy chiều cao \",\"Size S: cho bạn có cân nặng từ 45 - 50kg tùy chiều cao \",\"Size M: cho bạn có cân nặng từ 50 - 55kg tùy chiều cao \",\"Size L: cho bạn có cân nặng từ 55 - 60kg tùy chiều cao \",\"Size XL: cho bạn có cân nặng từ 60 - 65kg tùy chiều cao \",\"🔰 Thông tin thêm:\",\"- Để bảo quản áo cũng như chất liệu hình in, shop khuyên bạn lộn mặt trái khi giặt và ủi nha\",\"- Bảng size chỉ mang tính chất tham khảo, tùy thuộc hình thể mỗi người và chất liệu nên có chênh lệch. Hãy ibox cho shop khi cần tư vấn cụ thể nha ^^\",\" Hãy theo dõi để ủng hộ shop và cập nhập các chương trình khuyến mãi cũng như các mẫu sản phẩm mới nhất của shop nhé!\",\"🔸 Lưu ý: Shop chỉ hỗ trợ xử lý đơn hàng đổi trả trong vòng 15 ngày kể từ khi giao hàng thành công!\"]',NULL,88,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/564d132de36b5c7fb2c2efab4b9953ac_tn\",\"https://down-vn.img.susercontent.com/file/850dbf89d966ffcd43feb9ea148f6634_tn\",\"https://down-vn.img.susercontent.com/file/3251977c3cd7ad7dc3b076c88610df27_tn\",\"https://down-vn.img.susercontent.com/file/be401154665999f78c2b8a177300284d_tn\",\"https://down-vn.img.susercontent.com/file/55c1f54f43b0416b5530bb230b55976c_tn\"]',9508,NULL,2153,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (141,'Bộ Đồ Thể Thao Nam Thu Đông Cao Cấp Thời Trang Đường Phố Cổ Tròn Áo Quần Ống Suông','[\"Màu sắc: Bộ vest DK kiểu dài màu trắng/bộ vest DK kiểu dài màu đen/bộ vest DK kiểu dài màu xám/bộ vest DK kiểu dài màu xanh Klein/áo nỉ trắng/áo nỉ trắng 1/áo nỉ trắng 2/áo nỉ trắng 3/áo nỉ trắng 4/áo nỉ trắng 4\\nChiều dài tay áo trên: tay áo dài\\nChiều dài: quần\\nCó báo cáo kiểm tra chất lượng: Không\\nKích thước: M/L/XL/2XL/3XL/4XL/5XL/5XL\"]',NULL,142,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbk1-lmvoyvwjct618f_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbki-lmvoyysb4yc0db_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbmo-lmvoywf4llt586_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rblx-lmvoywz3sde8e4_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbkv-lmvoyz52m9z92c_tn\"]',7780,NULL,3183,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (142,'Bộ thể thao nam mùa hè chất cotton xốp thái, đồ bộ nam form dáng trẻ trung - ahstore','[\"🔸 Thông tin sản phẩm :\",\"Bộ thể thao nam mùa hè chất cotton xốp thái, đồ bộ nam form dáng trẻ trung - ahstore\",\"🎀Trong thế giới thời trang của phái mạnh các set thể thao hay bộ quần áo nam luôn chiếm một vị trí quan trọng.\",\"\\n\",\"quần áo thể thao có cổ hay không cổ hợp dáng người, hợp màu sắc không chỉ khỏe khoắn mà còn rất thời trang.\",\"\\n\",\"Mang tới cho các anh chàng sự thoải mái khi đi dạo phố hoặc hẹn hò bè bạn , những bộ đồ thể thao nam cao cấp đã trở thành người bạn không thể thiếu các chàng.\",\"\\n\",\"Và nếu bạn cũng đang đi tìm một set bộ cộc tay nam đẹp thời trang thể thể hiện được cá tính của bản thân một cách rõ nét nhất và đang... lạc lối, thì hãy cùng khám phá và cảm nhận trên sản phẩm của AHSTORE chúng mình nhé\",\"\\n\",\"🎀 Luôn là nơi cập nhật những xu hướng quần áo thể thao, bộ quần áo nam, quần áo hè nam mới nhất\",\"\\n\",\"AHSTORE đã khẳng định vị trí của mình với nhiều bạn trẻ bởi phong cách thời trang sang trọng, thanh lịch nhưng không thiếu sự năng động và cá tính.\",\"\\n\",\"Khéo léo kết hợp trang phục cùng phụ kiện, bạn dễ dàng mang lại một set đồ hài hòa, thể hiện được cá tính riêng của bạn\",\"\\n\",\"BẢNG TƯ VẤN SIZE ĐỒ BỘ NAM\",\"- SIZE M :     43 - 55 Kg\",\"- SIZE L:    55 - 62 Kg\",\"- SIZE XL:    63 - 70 Kg\",\"- SIZE 2XL:    71 - 83 Kg\",\"Bảng size phù hợp 90% khách hàng. Nếu bạn không chắc chắn thì inbox shop tư vấn ạ\",\"\\n\",\"🔸 AHSTORE CAM KẾT\",\"Sản phẩm 100% giống mô tả. Kiểu dáng hoàn toàn giống ảnh mẫu\",\"Áo được kiểm tra kĩ càng, cẩn thận và tư vấn nhiệt tình trước khi gói hàng giao cho Quý Khách\",\"Hàng có sẵn, giao hàng ngay khi nhận được đơn \",\"Hoàn tiền nếu sản phẩm không giống với mô tả\",\"Chấp nhận đổi hàng khi size không vừa\",\"Giao hàng trên toàn quốc, nhận hàng trả tiền \",\"Do màn hình và điều kiện ánh sáng khác nhau, màu sắc thực tế chút xíu xíu\",\"\\n\",\"#Dobonam #dothethaonam #bodonam #dobothethaonam #bonam #bonammuahe #bonammaconha #domaconhanam #do_mac_o_nha_nam #bodonammacnha #bo_do_nam_mac_nha #bodonam #dobonam #dobonamthethao #do_bo_nam #bo_do_nam #do_bo_nam #bo_do_nam #do_bo_nam #do_bo_nam_bo_he #bo_do_nam_mua_he #bo_do_nam_the_thao #đo_bo_nam_bo_he\"]',NULL,153,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/85670d43b96269c740692705a7f0838f_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-23020-29c1zlxv19mvd0_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134201-23030-gbttfg5nrfovd7_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-23020-j4rxf91ln8mvc9_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134201-23030-rrmypexzrfov68_tn\"]',5292,NULL,1932,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (144,'Bộ Quần Áo Thu Đông Nam Áo Khoác Nhẹ Khoá Kéo Phối Màu Thanh Lịch Kèm Quần Jogger Bo Gấu ZENKODLMEN SET NAM 90000133','[\"Sản Phẩm: Bộ Quần Áo Thu Đông Nam Hot Trend mẫu mới 2020 in hình siêu đẹp\",\"- Chất liệu vải: chất vải nỉ trơn mềm mịn, dày dặn mặc ấm ấp\",\"- Cam kết sản phẩm giống ảnh và giới thiệu, hàng luôn có sẵn \",\"- Hỗ trợ - chăm sóc - tư vấn trước và sau khi mua sản phẩm  \",\"- Sẵn sàng nhận lại hàng nếu Quý khách cung cấp đủ video hình ảnh sản phẩm đã nhận có lỗi hoặc sai hàng  \",\"- Bộ đồ Thích hợp cho mặc nhà, đi chơi, đi học, mặc đội nhóm đều rất đẹp \",\"Kích thước:\",\"Size S: Dành cho người từ 45kg trở xuống tùy chiều cao\",\"Size M: Dành cho người từ 55kg trở xuống tùy chiều cao\",\"Size L: Dành cho người từ 60kg trở xuống tùy chiều cao\",\"Size XL: Dành cho người từ 65kg trở xuống tùy chiều cao\",\"Lưu ý: Nên giặt bằng tay, nếu giặt bằng máy bạn nên giặt với nhiệt độ nước không quá 40 độ C để đảm bảo sản phẩm bền lâu và giữ được màu sắc ban đầu.\"]',NULL,109,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/1895d6c9310fb46e43db0e39516e884b_tn\",\"https://down-vn.img.susercontent.com/file/bdca64e0b08edc54d9869a5e365b0197_tn\",\"https://down-vn.img.susercontent.com/file/43b406c04046274eeeae5ec7449341a2_tn\",\"https://down-vn.img.susercontent.com/file/c5d1854f079159d305842be34fc5ac55_tn\",\"https://down-vn.img.susercontent.com/file/580c8fff63bba10e384c762f013890dd_tn\"]',7412,NULL,3465,'2024-02-11 15:01:34','2024-04-03 12:59:40');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (147,'Bộ Đồ Ngủ Chất Nỉ Dày Dặn Ấm Áp Thời Trang Mùa Đông Cho Nam Bộ đồ ngủ lông cừu san hô của nam giới Mùa đông dày dặn Thanh niên Phễu ấm áp Bộ đồ mặc nhà thông thường','[\"Tên: Bộ đồ ngủ lông cừu san hô của nam giới Mùa đông dày dặn Thanh niên Phễu ấm áp Bộ đồ mặc nhà thông thường\",\"\\n\",\"Danh mục sản phẩm: Đồ ngủ\",\"Tên vải: Phễu\",\"Phong cách: phù hợp\",\"Thành phần vải chính: Sợi Polyester (Polyester)\",\"Độ dày: Dày lên\",\"Loại cổ áo: Cổ tròn\",\"Chiều dài tay áo: Dài tay\",\"Chiều dài quần: Quần\",\"Chức năng: Giải trí, Ngủ, Ở nhà, Ấm áp, Thoải mái, Có thể Mặc bên ngoài\",\"Mùa thích hợp: Đông, Xuân, Thu\",\"Danh mục đám đông áp dụng: Đàn ông trẻ\",\"Cảnh áp dụng: Ngoài trời, Nhà\",\"Kích thước: M, L, XL, XXL, XXXL\",\"Phong cách: Đơn giản và giản dị\"]',NULL,137,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/cn-11134211-7r98o-low896nzaq1o9c_tn\",\"https://down-vn.img.susercontent.com/file/vn-11110105-7r98o-loqoeg7vrs6rab_tn\",\"https://down-vn.img.susercontent.com/file/cn-11134211-7r98o-low896nzc4m48f_tn\",\"https://down-vn.img.susercontent.com/file/cn-11134211-7r98o-low896nzdj6ke1_tn\",\"https://down-vn.img.susercontent.com/file/cn-11134211-7r98o-low896nzexr0cc_tn\"]',481,NULL,152,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (148,'Sinransinya set Áo Thun Ngắn Tay + Quần short Thể Thao In Hình Bánh waffle Phong Cách retro Đường Phố Mỹ Cho Nam','[\"\\\"Chào mừng đến với cửa hàng của chúng tôi\\\"\",\"\\n\",\"🌴Chất lượng sản phẩm được đảm bảo và sẽ được kiểm tra trước khi giao hàng.\",\"\\n\",\"🌴Chúng tôi có kinh nghiệm phong phú và sản phẩm chất lượng cao, tập trung vào chất lượng và giá cả thấp!Mang đến cho bạn trải nghiệm mua sắm tốt nhất!\",\"\\n\",\"🌴Tham khảo ý kiến của cửa hàng nếu có bất kỳ câu hỏi nào.\",\"\\n\",\"💗Sản phẩm có xuất xứ từ Trung Quốc và mất một thời gian để giao hàng.\",\"\\n\",\"💗Nếu bạn thích sản phẩm của chúng tôi Vui lòng thêm vào giỏ hàng. Cảm ơn bạn rất nhiều.\",\"\\n\",\"💗Tiếp tục theo những tin tức mới nhất trong cửa hàng của chúng tôi. Chúng tôi sẽ gửi cho bạn phiếu giảm giá và giảm giá sản phẩm.\",\"\\n\",\"Nếu bạn muốn một phiên bản rời, vui lòng mua một kích thước lớn hơn.\",\"💕 Chào mừng đến với cửa hàng của chúng tôi\",\"💕 Kích thước chi tiết được hiển thị trong hình. Vui lòng đọc kỹ\",\"💕 Sản phẩm có sẵn trong kho.\",\"❤❤❤  Mô tả sản phẩm ❤❤❤\",\"💌  Nếu bạn có bất kỳ câu hỏi nào về việc mua hàng, vui lòng liên hệ với chúng tôi và chúng tôi sẽ trả lời thỏa đáng nhất cho bạn.\",\"✅  Chúng tôi có nhiều kinh nghiệm và sản phẩm chất lượng cao.\",\"✅ Mang đến cho bạn trải nghiệm mua sắm tốt nhất\",\"✅  Sản phẩm của chúng tôi là thương hiệu mới 100%.\",\"✅  Chúng tôi tập trung vào chất lượng và giá cả thấp!\",\"✅  Chúng tôi sẽ luôn có những sản phẩm mới. Vui lòng tiếp tục theo dõi tin tức mới nhất của chúng tôi. Chúng tôi sẽ gửi cho bạn phiếu giảm giá và giảm giá sản phẩm.\",\"💕 Nếu bạn thích sản phẩm của chúng tôi, xin vui lòng tham gia giỏ hàng, cảm ơn bạn rất nhiều!!\",\"🍻  Chúng tôi mong đợi đánh giá năm sao của bạn.\",\"----------------------------------------------\",\"※ Màu sắc thực tế của sản phẩm có thể không được phản ánh đầy đủ trong hình ảnh do thiết bị hiển thị và ánh sáng khác nhau. Cảm ơn bạn cho sự hiểu biết của bạn.\",\"※ Vui lòng đọc kỹ kích thước trước khi mua. Có thể có 1-3 cm sự khác biệt do đo lường thủ công.\",\"※ Mọi thắc mắc vui lòng sử dụng \\\"Chat\\\" để liên hệ với chúng tôi. Chúng tôi sẽ trả lời càng sớm càng tốt và cố gắng hết sức để giải quyết vấn đề của bạn.\",\"🔹🔸🔹🔸🔹🔸🔹🔸🔹🔸🔹🔸🔹🔸🔹🔸\"]',NULL,190,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbkq-lqedmk6m0tc4fc_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbna-lqedmkmpd9j8a7_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbne-lqedml5klntq4c_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rblp-lqedmloptmsq88_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbml-lqedmm8p0ehs4d_tn\"]',4122,NULL,1239,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (150,'Bộ Đồ Thời Trang Nam Nửa Tay Phù Hợp Với Áo Sơ Mi Quần Short Dạo Phố Một Bộ Phù Hợp Với Mùa Hè Mỏng Nam Bộ Đồ Hai Mảnh','[\"📣📣📣\\nGiới thiệu cửa hàng và mô tả sản phẩm và đề xuất kích thước\\n1: Thân mến, hãy yên tâm mua sắm. Tất cả các sản phẩm chúng tôi bán đều được kiểm tra chất lượng nghiêm ngặt trước khi rời khỏi nhà máy. Nhân viên kiểm tra chất lượng chuyên nghiệp sẽ tiến hành kiểm tra lần thứ hai trước khi giao hàng. Chúng tôi cố gắng đảm bảo rằng không có vấn đề về chất lượng và cung cấp Đảm bảo chất lượng cho tất cả các sản phẩm được bán tại cửa hàng này và dịch vụ sau bán hàng. Nếu bạn có bất kỳ câu hỏi nào, vui lòng liên hệ với chúng tôi\\n\\n2: Thân mến, Em bé mà bạn nhìn thấy có, bạn có thể tự tin mua nó ~\\n\\n3: Theo Dõi Cửa Hàng Để Nhận Phiếu Giảm Giá, Chúng Tôi Sẽ Sắp Xếp Hàng Cho Bạn Trong Thời Gian Sớm Nhất Có Thể Trong Vòng 24H ~\\n\\n4: Do Lý Do Ánh Sáng Và Màn Hình Khác Nhau, Có Thể Có Sự Khác Biệt Từ Hình Ảnh, Vui Lòng Tham khảo Sản Phẩm Thực Tế ~\\n\\n5: Nếu Bạn Không Chắc Chắc Nếu Bạn Có Thể Nhận Hàng Trong Thời Gian Quy Định, Vui Lòng Đặt Hàng Cẩn Thận, Hãy Trân trọng Sự Toàn vẹn của Bạn!\\n\\n6: Tập trung vào quần áo thời trang thời trang, với khả năng thiết kế riêng và sức mạnh của nhà máy, nó được khách hàng vô cùng yêu thích ~ ~!\\n\\n7: Hầu hết quần jean / áo khoác không có lỗ cài nút, không lười và chưa hoàn thành, và nhiều quần áo đại lục mới không có lỗ hở, và bạn có thể dễ dàng cắt chúng bằng kéo bằng cách gấp chúng Trong một nửa trong các lỗ nút.\\n\\n📣📣📣 Mô TẢ SẢN PHẨM\\nMàu sắc: Nhấn SKU\\n\\nKích thước: Nhấn SKU\\n\\nChất liệu: Bông + Polyester hoặc khác\\n\\nCảnh liên quan: Giải trí khác\\n\\nNhân viên liên quan: Nam và nữ trẻ\\n\\nPhong cách: Trendy\\n\\nLoại phiên bản: Tiêu chuẩn\\n\\nMẹo mua hàng:\\nNếu bạn muốn chọn kích thước, vui lòng tham khảo các gợi ý về kích thước sau. Nếu bạn không chắc mình đang mặc Size nào, bạn có thể cung cấp cho chúng tôi chiều cao và cân nặng của bạn, chúng tôi sẽ tư vấn chuyên nghiệp cho bạn.\\n\\nChiều cao (cm) 155-168cm Cân nặng (kg) 45-55kg Size: M\\n\\nChiều cao (cm) 165-175cm Cân nặng (kg) 52-63kg Size: L\\n\\nChiều cao (cm) 170-178cm Cân nặng (kg) 58-68kg Size: XL\\n\\nChiều cao (cm) 172-180cm Cân nặng (kg) 65-75kg Kích thước: 2XL\\n\\nChiều cao (cm) 180-190cm Cân nặng (kg) 70-80kg Kích thước: 3XL\"]',NULL,133,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/6fef1f969906ed68acb5056ad7e61726_tn\",\"https://down-vn.img.susercontent.com/file/007ccef2a91f732f139be3ba06c32afa_tn\",\"https://down-vn.img.susercontent.com/file/9acd8e8dd391f97c0db0a5d0f9270d9d_tn\",\"https://down-vn.img.susercontent.com/file/2421cad0ef5001f3883a16081be91875_tn\",\"https://down-vn.img.susercontent.com/file/726651ed7b491cc59935dc8391965d6d_tn\"]',2506,NULL,704,'2024-02-11 15:01:34','2024-02-11 15:01:34');
