INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (152,'Bộ quần áo thể thao nam nữ vải poly cá sấu thoáng mát thấm hút mồ hôi cao cấp phối sọc mẫu 2024 Bảo Đăng','[\"HÌNH ẢNH TỔNG QUAN VÀ 1 SỐ HÌNH ẢNH CHI TIẾT VỀ SẢN PHẨM :\",\"MÔ TẢ CHI TIẾT SẢN PHẨM :\",\"\\n\",\"ƯU ĐIÊM :\",\"\\n\",\"+ Thẩm mỹ cao: Vải poly có bề mặt vải trơn bóng rất đẹp, đồng thời vải có độ rũ nên khi lên dáng rất thanh lịch, nhẹ nhàng, độ bền cao.\",\"\\n\",\"+ Thoát ẩm tốt: Vải có khả năng thoát ẩm tốt, giặt mau khô, không bị nhăn và không bao giờ bị xù lông như các loại vải cotton khác.\",\"\\n\",\"+ Có khả năng khán khuẩn: chống nấm mốc, chống bám bẩn rất tốt, nhờ vậy mà vải có độ bền rất cao.\",\"\\n\",\"ĐẶC ĐIỂM NỔI BẬT :\",\"\\n\",\"- Thiết kế trẻ trung cá tính cực kỳ sang trọng và lịch sự giễ dàng tạo ấn tượng ở cái nhìn đầu tiên giúp bạn thêm phần tự tin thể hiện cá tính\",\"\\n\",\"- Sản phẩm được shop sản xuất gia công tỉ mỹ đảm bảo chất lượng - đường may kỹ chắc chắn from dáng chuẩn dễ mặc không kén dáng\",\"\\n\",\"- Màu sắc đa dạng , cá tính , nỗi bật , rất giễ phối đồ , rất cuốn hút khi mặc đi chơi hay đi làm\",\"\\n\",\"HƯỚNG DẪN CHỌN SIZE : *** ( lưu ý : bảng size chỉ mang tính chất tham khảo các bạn hãy để lại 1 tin nhắn để shop được tư vấn kỹ hơn nhé !!! )\",\"\\n\",\"size M : dưới 1m68 < 50kg\",\"\\n\",\"size L : từ 1m65 đến 1m73 dưới 60kg\",\"\\n\",\"size XL : từ 1m73 - 1m76 dưới 70kg\",\"\\n\",\"SHOP hỗ trợ đổi size , đổi màu ,đổi mẫu hoặc hoàn lại tiền nếu sản phẩm các bạn mặc không vừa , không như mẫu , sai mẫu ... không vừa ý ạ\",\"\\n\",\"HƯỚNG DẪN BẢO QUẢN :\",\"\\n\",\"Sợi co giãn spandex pha thêm trong vải cá sấu poly kém bền với nhiệt vì vậy không nên giặt chúng trong nước nóng trên 40 độ C hay phơi ngoài nắng gắt vì sẽ làm vải xơ cứng, bạc màu vải.\",\"\\n\",\"Vải poly ít bị nhăn nên không cần phải ủi, nếu cần ủi thì nên chỉnh nhiệt độ dưới 180 độ C, để tránh làm vải mất độ đàn hồi do quá nóng.\",\"\\n\",\"Không nên sử dụng chất tẩy rửa mạnh, phân loại đồ màu đậm với màu nhạt khi giặt để tránh lem màu và nên lộn trái áo khi phơi để bảo vệ màu sắc và hình in trên áo.\",\"🔰🔰🔰  HƯỚNG DẪN CÁCH ĐẶT HÀNG:     \",\"\\n\",\"     *KHÔNG GỬI THEO GHI CHÚ** \",\"\\n\",\"\\n\",\"✔ Cách chọn size: Shop có bảng size mẫu. Bạn NÊN INBOX, cung cấp chiều cao, cân nặng để SHOP TƯ VẤN SIZE \",\"\\n\",\"✔ Mã sản phẩm đã có trong ảnh \",\"\\n\",\"✔ Cách đặt hàng: Nếu bạn muốn mua 2 sản phẩm khác nhau hoặc 2 size khác nhau, để được freeship \",\"\\n\",\"-\\tBạn chọn từng sản phẩm rồi thêm vào giỏ hàng \",\"\\n\",\"-\\tKhi giỏ hàng đã có đầy đủ các sản phẩm cần mua, bạn mới tiến hành ấn nút “\"]',NULL,171,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lpch523pnuqj6f_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lpch523pffbvb7_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lpch523pgtwb3c_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lpch523pi8gr20_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lpch523pjn1731_tn\"]',5082,NULL,257,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (153,'Bộ Áo Thun + Quần Dài Thể Thao In Họa Tiết Phong Cách Hip Hop Thời Trang Mùa Hè Cho Nam Cỡ M-5XL','[\"⚡Studio nguyên bản của Y-C, tập trung vào quần áo thời trang, dựa vào khả năng thiết kế của riêng mình và sức mạnh của nhà máy, nó đã được khách hàng yêu thích sâu sắc ~~\\n⚡Studio gốc Y-C, mang màu sắc của thế giới đến với bạn, dịch vụ trước và sau bán hàng hoàn hảo, hãy cho mọi người biết Y-C đều có cảm giác và có lợi ~~\\n⚡Yc studio nguyên bản, chúng tôi có một đội ngũ sản xuất và đổi mới gắn kết. Mọi người trong đội đều chắc chắn, bền bỉ, đam mê và tận tâm ~~\\n\\n⚡\\\"Đối Với vẻ đẹp của thế giới\\\" - Phòng thu ban đầu Y-C \\n👦Người mua thân mến, bạn có thể thấy rằng tất cả các hàng hóa trong cửa hàng có thể được mua bất cứ lúc nào, và chúng tôi sẽ gửi đơn đặt hàng trong thời gian sớm nhất.\\n🎈Mục đích của chúng tôi: cung cấp cho bạn dịch vụ hậu cần nhanh nhất, chất lượng tốt nhất và giá cả tốt nhất.\\n💥Sau khi đặt hàng, hàng hóa đã gửi đi không thể được trả lại. Vui lòng đặt hàng cẩn thận, cảm ơn bạn.\\n\\n💢💢💢💢💢💢💢💢💢Chú ý: Theo dõi cửa hàng, Nhận phiếu giảm giá💢💢💢💢💢💢💢💢💢\\n·🏃Phong cách: trẻ trung; tràn đầy năng lượng; thời trang\\n·📉Nhà máy sản xuất trực tiếp giá thấp\\n·🏭Giao ngay\\n·⚡Giao hàng nhanh chóng (đóng gói trong kho hàng ngày, kể cả cuối tuần)\\n·⭐️Mới 100%\\n·💵Nguyên liệu nào tương ứng với giá gì, giá cả ưu đãi nhất\\n·🚚Mất khoảng 6-12 ngày làm việc để hàng hóa được vận chuyển từ Trung Quốc\\n·📏Kích thước đều là kích thước của Trung Quốc, vui lòng tham khảo biểu đồ kích thước trước khi đặt hàng\\n\\n🔥Mẹo mua hàng:\\n1. Để biết chi tiết kích thước, vui lòng tham khảo mẫu cuối cùng hoặc biểu đồ kích thước trong hình. Tạp dề dưới kích thước tổng thể của cửa hàng này là rời, và các đỉnh mỏng và rời. Nếu bạn không chắc mình mặc bao nhiêu size, bạn có thể trao đổi về việc cung cấp cho chúng tôi chiều cao và cân nặng, chúng tôi sẽ tư vấn chuyên nghiệp cho bạn \\n\\n2. Tất cả các sản phẩm được vận chuyển từ đất liền, được vận chuyển trong vòng 48 giờ sau khi đấu thầu, và đến cửa hàng siêu thị 7-15 ngày sau khi đến trung tâm vận chuyển hậu cần quốc tế. Sau khi chúng tôi gửi hàng, họ sẽ không hiển thị rằng chúng đã được vận chuyển ngay lập tức, vì hậu cần sẽ không được hiển thị cho đến khi nhân viên đến trung tâm trung chuyển quốc tế để hoàn thành đăng ký và giao hàng, Hãy kiên nhẫn chờ đợi ~~\\n\\n3. Đối với tất cả quần jean mới được sản xuất tại Trung Quốc đại lục, hãy yên tâm sử dụng chúng nếu bạn không mở mắt và mở miệng. Chúng không phải là mặt hàng bị lỗi chưa hoàn thành, mà là để đảm bảo tính toàn vẹn của sản phẩm ở mức độ cao nhất ~ ~ PS [quần jean ở Trung Quốc đại lục không phải là eo quần hở mắt, chúng là sản phẩm mới]]\\n\\n4. Cửa hàng đã được kiểm tra trước khi xuất xưởng, nhưng thỉnh thoảng sẽ có thiếu sót. Ví dụ: nếu có sai sót, giao hàng nhỡ, vấn đề chất lượng,... sau khi nhận hàng, vui lòng liên hệ với chúng tôi lần đầu để giải quyết cho bạn, chúng tôi chân thành và có trách nhiệm ~~\\n\\n5. Nếu bạn hài lòng với sản phẩm và dịch vụ của chúng tôi, xin vui lòng khen ngợi năm sao cho Phong Thủy. Cảm ơn các bạn đã ủng hộ và chúc các bạn sống vui vẻ ~\"]',NULL,200,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/5917e08c78689aa8d9ba693ed531cb21_tn\",\"https://down-vn.img.susercontent.com/file/22f4cabfee5c1e59df6ee956a64418b5_tn\",\"https://down-vn.img.susercontent.com/file/c3ef3a6c75b203bd2af0416817103edc_tn\",\"https://down-vn.img.susercontent.com/file/b132a4e2ca4a9361aab8caf63585ba5a_tn\",\"https://down-vn.img.susercontent.com/file/5de2b3866a13c46f6c1bb788bd3d6e99_tn\"]',2353,NULL,253,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (155,'Set Áo Sơ Mi Tay Ngắn + Quần Đùi Phong Cách Hàn Quốc Cho Nam','[\"★Chào mừng đến với cửa hàng của chúng tôi!\\r\\n★Tất cả các sản phẩm của chúng tôi đều là bán hàng trực tiếp tại nhà máy, kiểm soát chất lượng tốt.\\r\\n★Đơn đặt hàng sẽ được giao trong vòng 1-3 ngày đầu tiên.\\r\\n\\r\\n* * Hàng sẵn sàng\\r\\n* * Chất lượng hoàn toàn mới 100%\\r\\n\\r\\n\\r\\nThương hiệu: Lion Yichao\\r\\nXuất xứ: Tỉnh Quảng Đông\\r\\nVải / chất liệu: Khác / Polyester (Sợi Polyester)\\r\\nNội dung thành phần: 51% (Bao gồm) -70% (Bao gồm)\\r\\nPhiên bản phiên bản: Loose\\r\\nLoại cổ áo: Cổ áo vuông\\r\\nChiều dài tay áo: Tay áo năm điểm / Tay áo giữa\\r\\nChi tiết kiểu quần áo: Màu đồng nhất\\r\\nPhong cách: Phong cách Hồng Kông\\r\\nĐộ tuổi áp dụng: Thanh niên (18-25 tuổi)\"]',NULL,53,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbkz-lnk3dhxs9redf3_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbn1-lnk3dhdj3eeg16_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rblb-lnk3dfn3qyzsb3_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rblo-lnk3df3efl4g1f_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rblp-lnlmu8u6co8671_tn\"]',309,NULL,3,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (156,'Áo cộc tay nam, áo phông nam tay ngắn cổ tròn Unisex chất thun cotton 4 chiều mềm mại','[\"✔️ GIỚI THIỆU THƯƠNG HIỆU : Áo cộc tay nam, áo phông nam tay ngắn cổ tròn Unisex chất thun cotton 4 chiều mềm mại\",\"TOPMEN Là 1 trong những shop thời trang nam được xứng danh “MẪU MÃ ĐẸP - CHẤT LƯỢNG TỐT- GIÁ TẬN XƯỞNG” nên Shop luôn chú trọng nghiên cứu phát triển mẫu mã cải tiến và đặc biệt tối ưu giá tốt nhất, giá tận xưởng đến tay khách hàng. \",\"............................\",\"\\n\",\"Áo cộc tay nam, áo phông nam tay ngắn cổ tròn Unisex chất thun cotton 4 chiều mềm mại\",\"\\n\",\"✔️ ĐẶC TÍNH NỔI BẬT ÁO CỘC TAY NAM, ÁO PHÔNG NAM TAY NGẮN CỔ TRÒN UNISEX\",\"- Áo thun nam dáng đứng, phong cách trẻ trung năng động và đầy cá tính \",\"- Thiết kế fom áo thoải mái tự tin khi đi chơi hay mặc ở nhà , vận động ngoài trời \",\"- Chất Thun cotton 4 chiều tạo cảm giác cực kỳ thoải mái khi mặc, đặc biệt không gây dị ứng cho da\",\"- Co dãn mềm mại giặt tay hay giặt máy đều không hề bai dão hay phai màu\",\"- Hàng siêu hot với chất liệu được làm từ 60% Thun kết hợp 40% Cotton tạo nên sự Co giãn 4 chiều cực mát và mịn giúp người mặc cảm giác thoải mái.\",\"\\n\",\"        ---------------------\",\"- KÍCH THƯỚC CHUẨN: ÁO THUN NAM, ÁO PHÔNG NAM TAY NGẮN\",\"\\n\",\"+ Size L: 48-58kg\",\"​+ Size XL:  59- 68kg\",\"+ Size XXL:  69-78kg\",\"Bảng size phù hợp 90% khách hàng. Nếu bạn không chắc chắn thì inbox shop tư vấn ạ\",\"\\n\",\"✔️ CHẾ ĐỘ BẢO HÀNH                                                                             \",\"- Tất cả các sản phẩm đều được Shop bảo hành 6 tháng                                                                                                \",\"- Giao hàng trên toàn quốc, nhận hàng trả tiền\",\"- Chính sách đổi trả hàng miễn phí khi sản phẩm kém chất lượng, không giống hình, nhầm size, số lượng mà quý khách đã đặt. \",\"- Sản phẩm chỉ được đổi/ trả khi còn nguyên tem mác. Quý khách vui lòng chụp toàn bộ bao bì, sản phẩm để shop xác nhận, gửi lại shop chậm nhất trong 7 ngày.\",\" 📌 LƯU Ý:  Khi bạn gặp bất kì vấn đề gì về sản phẩm đừng vội đánh giá  mà hãy liên hệ Shop để đc hỗ trợ 1 cách tốt nhất  nhé.\",\"---------------------------------------------\",\"✔️ Cơ sở sản xuất : Nhà May An Nguyễn\",\"✔️ Chịu Trách nhiệm về sẩn phẩm : Nguyễn Nhật Linh\",\"\\n\",\"TOPMEN XIN CHÂN THÀNH CẢM ƠN QUÝ KHÁCH HÀNG ĐÃ TIN TƯỞNG VÀ ỦNG HỘ SHOP.\",\"\\n\",\"#ao_-thun_nam_tay_ngan #unisex #ao_thun_nu #ao_thun #ao #ao_thun_gia_re #siaothunnutphcm #ao_thun_tay_ngan \",\"#aophong #thoitrangnu #ao_thun_teen #ao_cap #ao_doi #ao_thun_cotton #xuong_si_ao_thun #ao_phong #ao_thun_nam #ao_thun_co_tron #ao_coc_tay_nam #ao_nam_tay_ngan #ao_phong_nam_ngan_tay #ao_phong_nam_dep #áo_phông_nam #áo_phông_nam_tay_ngắn #ao_thun_nam #ao_thun_nam_tay_ngan #ao_coc_tay_nam \"]',NULL,102,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/4bb86577a89b67cbb45dbd6b9ae41a3f_tn\",\"https://down-vn.img.susercontent.com/file/b5042204aa2d50bef0fc03c10c0b7585_tn\",\"https://down-vn.img.susercontent.com/file/c9b5ef76da1c5b59654bf9aa93c8a324_tn\",\"https://down-vn.img.susercontent.com/file/836768c5ccdbb304cce7e39e3f66f3fb_tn\",\"https://down-vn.img.susercontent.com/file/45a25fc4fbf413c079e9c27cec5c924b_tn\"]',6980,NULL,580,'2024-02-11 15:01:34','2024-02-11 15:01:34');
