INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (162,'SET ĐỒ STREETWEAR UNISEX FORM ÂU RAGE OF THE SEA (ROTS STUDIO) - \"SET ĐỒ BEHIND THE LOGO(GỒM CẢ ÁO VÀ QUẦN)\"','[\"TÊN SẢN PHẨM: Set đồ Unisex Rage Of The Sea (ROTS STUDIO)\",\"CÁCH BẢO QUẢN ÁO THUN CỦA RAGE OF THE SEA:\",\"-        Đầu tiên các bạn hãy lộn ngược áo và ủi (là) 2-4 lần để hình in và hình thêu được bám thêm vào áo.\",\"-        Tiếp theo trong lúc giặt áo bạn lộn ngược khi giặt và lúc phơi nên phũ áo để tránh tình trạng hình in dính lại nhau.\",\"-        Khuyến khích giặt tay và không sử dụng chất tẩy.\",\"-        Nếu quên hình in bị dính lại thì bạn nên ngâm áo 5 phút rồi từ từ gỡ ra nhá.\",\"-        Cứ làm như shop hướng dẫn đảm bảo áo sẽ đẹp mãi mãi.\",\"-        Các bạn cứ yên tâm shop bảo hành hình in và đường may trong vòng 7 ngày.\",\"\\n\",\"Thông Số Sản Phẩm:\",\"-        Chất vải áo thun tici cotton đẹp, chất vải quần là da cá tici cotton không bị co rút sau khi giặt nhiều lần. Tạo cảm giác thoải mái.\",\"-        Họa tiết trên áo được may vô cùng chi tiết.\",\"-        Cổ áo được bo vô cùng tinh tế, đầy đủ tag bọc chính hãng.\",\"-        Tự hào là sản xuất tại Việt Nam bởi chính Rage Of The Sea.\",\"-        Độ co dãn tốt chính là ưu điểm của loại vải tici 2 chiều này.\",\"-        Độ thoáng khí và thấm hút mồ hôi ở mức khá. Nhưng bù lại các bạn sẽ không sợ bị nhăn và co rút sản phẩm sau khi giặt. Và gần như các bạn có thể sử dụng liền không cần ủi.\",\"\\n\",\"Quy Trình Xử Lý Khiếu Nại:\",\"-        Liên hệ cho shop để được tư vấn size trước khi đặt hàng.\",\"-        Khách hàng tự chọn size vui lòng xem bảng quy đổi kích thước được tính bằng “cm” ở hình ảnh bảng size.\",\"-        Quy trình sản xuất công nghiệp nếu sai xót thông số trong mức 5% hoặc nếu có vấn đề phát sinh rất mong được các bạn nhắn tin cho shop để được shop hỗ trợ và giải quyết.\",\"-        Miễn phí đổi trả cho khách hàng của Rage Of The Sea trong trường hợp bị lỗi từ nhà sản xuất, giao nhầm hàng, nhầm size, sản phẩm phải còn đầy đủ bọc tag.\",\"\\n\",\"HƯỚNG  DẪN CHỌN SIZE:\",\"-Size S: dưới 55kg, Cao dưới 1m6\",\"-Size M: từ 55kg - 75kg , Cao 1m60 - 1m7\",\"-Size L: từ 60kg - 95kg, Cao : 1m7 – 1m85\",\"(VÌ ÁO FORM RỘNG VÀ DÀI NÊN BẠN LƯU Ý CHỌN ĐÚNG SAI NHƯ TRÊN, NẾU BẠN MUỐN MẶC RỘNG DÀI OVERSIZE BẠN MỚI CỘNG SIZE THUI Ạ)\",\"Cảm Ơn Các Bạn Đã Ủng Hộ Shop.\",\"#rageofthesea #aothun #aothununisex #aothunoversize #local #freeship #sale #99k #shopee #tee #áothun #sale #SHOPEE #AOTHUN #UNISEX #REVIEW  #SETĐỒ #LOCALBRAND \"]',NULL,102,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/vn-11110107-7r98o-lrb3zex9yvgta2_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lp58xm2wgtvy09_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lp58xm2wb7m6d3_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lp58xm2wcm6mc6_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lp58xm2we0r263_tn\"]',5882,NULL,395,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (163,'Bộ Quần Áo Nam Thể Thao Mùa Hè Phối Layer Thời Trang Vải Tổ Ong Thoáng Mát J7','[\"Bộ Quần Áo Thể Thao Nam Phối Layer Thời Trang Vải Tổ Ong Thoáng Mát J7\",\"- Bộ Quần Áo Layer được thiết kế theo đúng form chuẩn của nam giới Việt Nam\",\"- Sản phẩm Bộ Quần Áo Layer chính là mẫu thiết kế mới nhất của VESCA\",\"------------------------------------ \",\"Hướng dẫn sử dụng:\",\"🎗 Đối với sản phẩm Bộ thể thao mới mua về, nên giặt tay lần đâu tiên để tránh phai màu sang quần áo khác\",\"🎗 Khi giặt nên lộn mặt trái ra để đảm bảo độ bền của hình in/decal\",\"🎗 Sản phẩm phù hợp cho giặt máy/giặt tay\",\"------------------------------------ \",\"THÔNG TIN CHI TIẾT \",\"🎗 Chất liệu: Tổ ong\",\"🎗 Màu sắc: Đen - Xám - Trắng - Be\",\"🎗 Thương hiệu: VESCA\",\"🎗 Xuất xứ: Việt Nam \",\"🎗Size: M - L- XL - XXL\",\"------------------------------------ \",\"HƯỚNG DẪN CÁCH ĐẶT HÀNG \",\"🎗 Cách chọn size: Shop có bảng size mẫu. Bạn NÊN INBOX, cung cấp chiều cao, cân nặng để SHOP TƯ VẤN SIZE \",\"🎗 Mã sản phẩm đã có trong ảnh \",\"🎗 Cách đặt hàng: Nếu bạn muốn mua 2 sản phẩm khác nhau hoặc 2 size khác nhau, để được freeship \",\"- Bạn chọn từng sản phẩm rồi thêm vào giỏ hàng \",\"- Khi giỏ hàng đã có đầy đủ các sản phẩm cần mua, bạn mới tiến hành ấn nút “ Thanh toán” \",\"🎗 Shop luôn sẵn sàng trả lời inbox để tư vấn \",\"------------------------------------ \",\"Chế độ bảo hành VESCA:\",\"🎗 Tất cả các sản phẩm đều được shop bảo hành\",\"🎗 Đối với sản phẩm lỗi/đơn hàng thiếu sản phẩm, quý khách vui lòng nhắn tin/gọi ngay cho shop trong vòng 3 ngày (kể từ ngày nhận đơn hàng)\",\"🎗 Nếu quá thời hạn 3 ngày kể từ ngày nhận đơn hàng, chế độ bảo hành của VESCA sẽ hết hiệu lực\",\"------------------------------------ \",\"VESCA cam kết:\",\"🎗 VESCA cam kết mang đến cho khách hàng những sản phẩm với chất lượng tốt nhất trong