INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (166,'Set Áo Thun Ngắn Tay Sọc Ngang Quần short Thời Trang đồ bộ thể thao nữ phong cách Hàn Quốc đồ bộ nam simple bộ thể thao nam','[\"Chào mừng bạn, cửa hàng của chúng tôi vừa mở ra, chuyên kinh doanh các loại quần áo thời trang và thời trang, cả nam và nữ đều có thể mặc, mong các bạn quan tâm và mua hàng! #Mgjinse.vn\",\"Thông tin sản phẩm:\",\"Màu: Đen, Trắng, Xám\",\"Kích thước: M-3XL\",\"Chất liệu: Cotton + Polyester\",\"\\n\",\"Lưu ý:\",\"1. Chúng tôi chân thành mời bạn đến \\\"+ Theo dõi\\\" cửa hàng của chúng tôi để trở thành người hâm mộ và cập nhật những thông tin sản phẩm mới nhất và các chương trình khuyến mãi\",\"2phần lớn các sản phẩm của chúng tôi có trong kho và sẽ được vận chuyển trong vòng 1-3 ngày làm việc sau khi đặt hàng\",\"3. Kích thước và màu sắc của sản phẩm sẽ thay đổi do độ phân giải máy tính khác nhau và biên nhận thực tế sẽ chiếm ưu thế🤞\",\"4. Nếu bạn có bất kỳ thắc mắc nào trong quá trình mua sắm, vui lòng liên hệ với bộ phận chăm sóc khách hàng trực tuyến. Chúng tôi sẽ liên hệ lại với bạn trong thời gian sớm nhất.\",\"5. Nếu có vấn đề về kích thước, bạn có thể tư vấn cho chúng tôi và chúng tôi sẽ tư vấn cho bạn.\"]',NULL,122,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/cn-11134207-7qukw-li8rabewxbp238_tn\",\"https://down-vn.img.susercontent.com/file/cn-11134207-7qukw-lf5bxcluoucq50_tn\",\"https://down-vn.img.susercontent.com/file/cn-11134207-7qukw-lf5bxcluvv6yd0_tn\",\"https://down-vn.img.susercontent.com/file/cn-11134207-7qukw-lf5bxcluq8x65e_tn\",\"https://down-vn.img.susercontent.com/file/cn-11134207-7qukw-lf5bxclu9e3u35_tn\"]',6728,NULL,1796,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (167,'Bộ đồ nam cộc tay tổ ong Nam Nữ Bigsize mùa hè thấm hút mồ hôi BO08 - OVERMAN','[\"Bộ thể thao nam nữ chất tổ ong cực mát, co dãn và thấm hút tốt BO08 - OVERMAN\",\"---------------------------\",\"\\n\",\"✅  CAM KẾT CỦA SHOP:\",\"- Sản phẩm  Bộ thể thao  nam 100% giống mô tả. Kiểu dáng hoàn toàn giống ảnh mẫu\",\"- Đồ bộ thể thao nam được kiểm tra kĩ càng, cẩn thận và tư vấn nhiệt tình trước khi gói hàng giao cho Quý Khách\",\"- Hoàn tiền nếu sản phẩm không giống với mô tả.\",\"- Chấp nhận đổi hàng khi size không vừa.\",\"- Giao hàng trên toàn quốc, nhận hàng trả tiền .\",\"- Hỗ trợ đổi trả theo quy định của Shopee.\",\"- Do màn hình và điều kiện ánh sáng khác nhau, màu sắc thực tế của sản phẩm có thể chênh lệch khoảng 3-5%.\",\"---------------------------\",\"\\n\",\"✅ MÔ TẢ SẢN PHẨM ĐỒ BỘ TỔ ONG NAM CAO CẤP\",\"- Mã sản phẩm bộ thể thao nam : BO08\",\"- Đồ bộ thể thao nam Chất liệu: Vải tổ ong cao cấp, Co giãn 4 chiều cực mát và mịn giúp người dùng cảm giác thoải mái, thông thoáng, độ co giãn đàn hồi cao.\",\"- Bảng màu Bộ quần áo nam : có 4 màu: Đen, Trắng, Xám, Kem\",\"- Đồ thể thao là phụ kiện thời trang đơn giản nhưng không thể thiếu cho mùa hè. Các anh có thể mặc đồ bộ nam ờ nhà, hay dùng làm đồ thể thao, tập gym rất mát mẻ và thoải mái\",\"- Sợi vải cao cấp sang trọng và thoải mái. Đồ bộ thể thao nam chất liệu có độ thoáng cao và khả năng kháng khuẩn tốt\",\"- Sản phẩm có nhiều màu sắc nam tính tạo nên sự mạnh mẽ, hấp dẫn và lôi cuốn.\",\"- Quần chất liệu co dãn 4 chiều, mịn mềm mại, bền đẹp, thoáng mát, đàn hồi và hút ẩm tốt.\",\"---------------------------\",\"\\n\",\"✅ OVERMAN mang tới cho các anh chàng sự thoải mái khi đi dạo phố hoặc hẹn hò bè bạn , những bộ đồ thể thao nam cao cấp đã trở thành người bạn không thể thiếu các chàng.\",\"Và nếu bạn cũng đang đi tìm một set bộ thể thao nam đẹp thời trang thể thể hiện được cá tính của bản thân một cách rõ nét nhất và đang... lạc lối, thì hãy cùng khám phá và cảm nhận trên sản phẩm của OMAN chúng mình nhé.\",\"---------------------------\",\" ✅ BẢNG CHỌN SIZE \",\"- SIZE M :     45 - 57 Kg\",\"- SIZE L:    57 - 65 Kg\",\"- SIZE XL:    65 - 75 Kg\",\"- SIZE 2XL:    75 - 85Kg\",\"- SIZE 3XL:    85 - 95Kg\",\"Bảng size phù hợp 90% khách hàng. Nếu bạn không chắc chắn thì inbox shop tư vấn ạ\",\"Nếu bạn béo bụng hay muốn mặc rộng hơn chút thì nhớ tăng 1 size nha!\",\"---------------------------\",\" ✅ QUY ĐỊNH ĐỔI TRẢ SẢN PHẨM:\",\"- Hỗ trợ hết mình vấn đề đổi trả hàng hoá nhanh chóng trong vòng một nốt nhạc!\",\"- Thời gian đổi trả sản phẩm của shop trong vòng 3 ngày nếu sản phẩm bị lỗi, nhầm size hoặc size không vừa kể từ khi nhận hàng (quý khách vui lòng xem kỹ trước khi đặt hàng giúp shop với \",\"ạ!).\",\"- Hàng đổi trả phải còn nguyên vẹn không qua sử dụng, còn nguyên tem nhãn\",\"\\n\",\"#domaconhanam #do_mac_o_nha_nam #bodonammacnha #bo_do_nam_mac_nha #bodonam #dobonam #dobonamthethao #do_bo_nam #bo_do_nam #do_bo_nam #bo_do_nam #do_bo_nam #do_bo_nam_bo_he #bo_do_nam_mua_he #bo_do_nam_the_thao #đo_bo_nam_bo_he #bo_quan_ao_nam_mua_he #bo_the_thao_nam_mua_he #do_bo_ngan #do_bo_nam_mua_he #do_nam_he #bo_do_he_nam #do_nam_mua_he #bo_nam_mua_he #bo_bigsize #bộ_bigsize #bo_big_size #bo_bigsize_95kg\"]',NULL,91,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/4f4757a15cfe8ab7b4bcd494fb1c68d5_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134201-23030-nku98c5ceiov87_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134201-7qukw-leqxkdtmjcmqf5_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134201-7qukw-leqxqnvxpx2q11_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134201-7qukw-leqjfy6np1o38d_tn\"]',7686,NULL,3709,'2024-02-11 15:01:34','2024-04-10 07:32:36');
