INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (169,'Bộ Quần Áo Mặc Nhà Thể Thao Nam Mùa Hè Cao Cấp Bộ Đồ Nam Thun Cotton Cộc Tay tập gym, đi bộ, bộ đồ ngủ. Có BigSize 115kg','[\"Bộ Quần Áo Mặc Nhà Thể Thao Nam Mùa Hè Cao Cấp Bộ Đồ Nam Thun Cotton Cộc Tay đa năng (tập gym, đi bộ, bộ đồ ngủ). Bộ quần áo mùa hè nam có BigSize 115kg. \",\"Quần áo nam mùa hè nhà Fox được thiết kế dạng cổ tròn, form rộng, tay lỡ đặc biệt tôn dáng, che khuyết điểm bụng bia đùi to. Với chất liệu cotton 100% Loại 1, co giãn 4c,  mềm mịn mát, không xù lông, bộ nam hè nhà Fox có thể dùng là bộ đồ ngủ, mặc đi tập gym, chạy bộ. Thiết kế trang nhã của bộ đồ nàm nhà Fox giúp bạn tự tin mặc ra ngoài đi dạo , đi chơi. t\",\"\\n\",\"*** Lưu ý***:  Đồ bộ nam nhà Fox là hàng 100% cotton, co giãn 4c, may cẩn thận sắc nét từng mũi kim, không chỉ thừa. Là hàng loại 1. Tránh nhầm với các hàng rẻ chất vải chứa nhiều nilon, mặc nóng . \",\"\\n\",\"\\n\",\"1. Hướng dẫn chọn size bộ nam hè big size\",\"Bộ nam hè có size to cho người trên 100kg, cụ thể cách chọn size như sau: \",\"- M (<65 Kg, <1m65)\",\"- L (66 – 69 kg, <1m74)\",\"- XL (71 – 79 kg, <1m76)\",\"- 2XL (81 – 95Kg, <1m80)\",\"- 3XL (96 – 115 Kg, <1m87)\",\"****Lưu ý ***\",\"- Nếu chưa chắc chắn về chọn size sản phẩm\",\"- Nếu khách form người không cân đối (Béo, gầy, thấp...)\",\"- Nếu khách thích mặc ôm body hoặc mặc rộng thoải mái\",\" INBOX trực tiếp cho shop để được tư vấn size nhé\",\"Tham  khảo  kích  thước  chi  tiết  từng  size  tại  đây: \",\" 3.  Hướng dẫn bảo quản bộ thể thao nam mùa hè \",\"- Đối với sản phẩm quần áo mới mua về, nên giặt tay lần đâu tiên để tránh phai màu sang quần áo khác\",\"- Khi giặt nên lộn mặt trái ra để đảm bảo độ bền của hình in\",\"- Sản phẩm phù hợp cho giặt máy/giặt tay\",\"\\n\",\"4. CHẾ ĐỘ BẢO HÀNH – ĐỔI TRẢ BỘ NAM HÈ \",\"- Được xem hàng trước khi thanh toán, đúng hàng mới thanh toán\",\"- Đối với sản phẩm lỗi/đơn hàng thiếu sản phẩm, quý khách vui lòng nhắn tin/gọi ngay cho shop khi xem hàng\",\"- Về nhà mặc thử đàng hoàng, không ưng size inbox/ gọi điện hotline: 0983.739.109 để được đổi size ( quần áo đổi size cần còn nguyên tem mác, sạch sẽ).  Shop sẽ chủ động gửi hàng size mới, thu hàng size cũ về, khách không cần vất vả gửi hàng đổi size. \",\"#set_he_nam\",\"#set_do_nam_bigsize\",\"#sét_bo_nam\",\"#set_bo_nam\",\"#do_ngu_nam\",\"#do_ngu_cho_nam\",\"#do_nam_mua_he\",\"#do_nam_mac_nha\",\"#do_nam_bo\",\"#do_nam_bigsize\",\"#do_mua_he_nam\",\"#do_mac_nha\",\"#do_he_nam\",\"#do_bo_thun_mac_nha\",\"#do_bo_thun_cotton\",\"#do_bo_thun\",\"#do_bo_thể_thao_nam\",\"#do_bo_quan_ngan\",\"#do_bo_quan_nam\",\"#do_bo_nam_ngan\",\"#do_bo_nam_mua_he\",\"#do_bo_nam_mac_nha\",\"#do_bo_nam_he\",\"#do_bo_nam_big_size\",\"#do_bo_nam\",\"#do_bo_mua_he_nam\",\"#do_bo_mac_nha\",\"#do_bo_mac_nha\",\"#do_bo_he_nam\",\"#do_bo_dui_nam\",\"#do_bo_dui\",\"#do_bo_cotton\",\"#do_bigsize_nam\",\"#do_big_size_nam\",\"#bo_thun_nam\",\"#bo_quan_ao_ngu_nam\",\"#bo_quan_ao_coc_nam\",\"#bo_nam_mua_he\",\"#bo_nam_he_cao_cap\",\"#bo_nam_he\",\"#bo_nam_big_size\",\"#bo_nam\",\"#bo_mua_he_nam\",\"#bo_mac_nha_cao_ngu\",\"#bo_mac_nha\",\"#bo_he_nam\",\"#bo_dui_nam\",\"#bo_do_thun_nam\",\"#bo_do_ngu_nam\",\"#bo_do_nam_mua_he\",\"#bo_do_nam_dep\",\"#bo_do_nam\",\"#bo_do_mua_he_nam\",\"#bo_do_mua_he\",\"#bo_do_mac_nha_mua_he_cotton\",\"#bo_do_mac_nha_mua_he_cao_ngu\",\"#bo_do_mac_nha_mua_he\",\"#bo_do_he_nam\",\"#bo_do_coc_nam\",\"#bo_cotton_mac_nha\",\"#bo_coc_tay_nam\",\"#bo_coc_nam\",\"#bo_coc_mua_he\"]',NULL,156,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lp97fq4mzgb288_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lmyc1m1qk7of36_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lmyc1m1qn0tbfe_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lnvpc6v9tnqy2b_tn\",\"https://down-vn.img.susercontent.