INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (170,'Bộ Quần Áo Thể Thao Ngắn Tay Form Rộng Thời Trang Mùa Hè Cho Nam','[\"\\n\",\"Thương hiệu: other\",\"Chiều dài tay áo: Nửa tay áo\",\"Mùa áp dụng: Mùa hè\",\"Đối tượng áp dụng: Thanh thiếu niên\",\"Kiểu áo khoác: áo phông\",\"Thời gian đưa ra thị trường: 2023\",\"Chiều dài quần: Quần cắt\",\"\\n\",\"💖Xin chào, chào mừng đến với cửa hàng của chúng tôi. Thời gian giao hàng ước tính cho sản phẩm này là 5-8 ngày\",\"Nếu bạn cần mua một sản phẩm. Vui lòng liên hệ trước với bộ phận chăm sóc khách hàng để biết yêu cầu về kích thước và màu sắc, cảm ơn bạn\",\"\\n\",\"⭐⭐⭐ Sản phẩm đảm bảo đúng như hình - không hoàn lại tiền khi không hài lòng.\",\"⭐⭐⭐Khi có vấn đề gì về sản phẩm (đổi size, có vấn đề...) vui lòng để lại tin nhắn trong hộp thư đến cửa hàng, mình sẽ hỗ trợ và comment.\",\"\\n\",\"- Chất liệu: Cotton + Polyester\",\"- Loại kích thước: 157cm ~ 168cm 45KG ~ 53KG M\",\"                      165cm ~ 170cm 49kg ~ 58kg L\",\"                      168cm ~ 175cm 59kg ~ 68kg XL\",\"                      165cm ~ 178cm 69KG ~ 76KG 2XL\",\"                      175cm ~ 188cm 77kg ~ 84kg 3XL\",\"                      178cm ~ 185cm 87kg ~ 95kg 4XL\",\"                      180cm ~ 190cm 89kg ~ 100kg 5XL \",\"-Fit: Mềm mại và thoáng khí\",\"💖- Chủ đề: Nhà thiết kế, Lễ hội, phong cách nấu chín nhẹ, Hàn Quốc, Tình yêu, Nhật Bản, Đường phố, Thanh niên, Xu hướng, Mát mẻ\",\"- Tính năng: Thanh niên, Giản dị, Thoải mái, Thoáng khí\",\"- Nhân dịp: cuộc sống hàng ngày, đi làm, du lịch, mua sắm, v.v.\",\"- Đóng gói: 1 bộ quần áo trong một gói\",\"\\n\",\"✔️Nhắc nhở: Hình ảnh mô hình chỉ mang tính chất tham khảo\",\"\\n\",\"⭐Do độ sáng của màn hình và ánh sáng của bạn, vui lòng cho phép quang sai màu.\",\"⭐ Do đo lường thủ công, có sai số 1-3 cm (0,4-1,2).\",\"⭐Nếu quần áo bạn thích không có trong cửa hàng, bạn có thể liên hệ với chúng tôi để lên kệ.\",\"\\n\"]',NULL,122,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/7051b4c931f5e5598b6c2b469a701217_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbkq-lnaewc4bytaf70_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbm0-lnaewh12s63e65_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbn1-lnaewo5qckzmbc_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbl0-lnaewlj4715608_tn\"]',3945,NULL,1126,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (171,'Set Đồ nam Dài Tay Form Rộng đồ bộ nam Phong Cách Hàn Quốc Dành bộ quần áo Nam Nữ','[\"���Trong trường hợp bình thường, bạn sẽ nhận được hàng trong vòng 7-10 ngày.\",\"\\n\",\"���Màu đen, trắng\",\"\\n\",\"���Kích thước “M-3XL\",\"\\n\",\"���Chất liệu\'Cotton\'Polyester\",\"\\n\",\"���Biểu đồ kích thước là để tham khảo. xin vui lòng tham khảo ý kiến dịch vụ khách hàng để biết kích thước cụ thể.\",\"\\n\",\"\\n\",\"\\n\",\"Banuuuu.vn \'\'Gua ghi chú \\\"\",\"\\n\",\"1.Chúng tôi là người bán ở Trung Quốc đại lục, tất cả đều được vận chuyển từ Trung Quốc đại lục.\",\"\\n\",\"2.Cửa hàng có nhiều kiểu dáng, tốc độ mới nhanh chóng, chất lượng đảm bảo, giá siêu ưu đãi.Hãy chú ý nhiều hơn đến doanh số bán hàng của chúng tôi.\",\"\\n\",\"3.Các lô hàng khẩn cấp không được chấp nhận. hậu cần có thể bị chậm trễ một chút.Xin hãy tha thứ cho tôi.\",\"\\n\",\"4.Một khi gói hàng được gửi đi, nó không thể được trả lại hoặc trao đổi.Nếu bạn không muốn hoặc muốn đóng đơn hàng, chúng tôi sẽ mất nó.Cửa hàng chịu rất nhiều áp lực.Xin hãy tha thứ cho tôi.\",\"\\n\",\"5.Nếu bạn có bất kỳ câu hỏi nào, bạn có thể liên hệ với chúng tôi, đừng đưa ra đánh giá xấu một cách dễ dàng.\",\"\\n\",\"6.Do sự khác biệt về ánh sáng và màn hình, màu sắc của sản phẩm có thể hơi khác so với hình ảnh. xin vui lòng hiểu.\"]',NULL,125,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/c6618675111f37e6bca6851866bd7d73_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-22110-s7tzzl8qy6jv9a_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-22110-qewmhriry6jv18_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-22110-eqyzw1ary6jv4b_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-22110-n9xp6iary6jv4f_tn\"]',2993,NULL,1216,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (172,'Mới Set áo sweater + Quần ống rộng Thời Trang đồ bộ nam Hàn Quốc bộ quần áo nam Dành bộ Nam Nữ','[\"���Trong trường hợp bình thường, bạn sẽ nhận được hàng trong vòng 7-10 ngày.\",\"���Màu: Đen, Trắng, Xám\",\"���Kích thước: M-5XL\",\"���Chất liệu: Polyester + Cotton\",\"���Bảng kích thước là để tham khảo, vui lòng tham khảo dịch vụ khách hàng để biết kích thước cụ thể.\",\" \",\"Banuuuu.vn: 【Lưu ý khi mua hàng】\",\"1.Chúng tôi là người bán ở Trung Quốc đại lục, tất cả đều được vận chuyển từ Trung Quốc đại lục.\",\"2. Có rất nhiều kiểu dáng trong cửa hàng, tốc độ mới nhanh chóng, chất lượng được đảm bảo, và giá cả siêu ưu đãi. Xin vui lòng quan tâm nhiều hơn đến cửa hàng của chúng tôi.\",\"3. Các lô hàng khẩn cấp không được chấp nhận, hậu cần có thể bị chậm trễ một chút. Xin hãy tha thứ cho tôi.\",\"4. Một khi gói được gửi đi, nó không thể được trả lại hoặc trao đổi. Nếu bạn không muốn hoặc muốn đóng đơn hàng, chúng tôi sẽ mất nó. Cửa hàng dưới áp lực rất nhiều. Xin hãy tha thứ cho tôi.\",\"5. Nếu bạn có bất kỳ câu hỏi nào, bạn có thể liên hệ với chúng tôi, đừng đánh giá xấu dễ dàng.\",\"6.Do sự khác biệt về ánh sáng và màn hình, màu sắc của sản phẩm có thể hơi khác so với hình ảnh, vui lòng thông cảm.\"]',NULL,89,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/0da007df917d7ebcfcb824c79cbe8ae6_tn\",\"https://down-vn.img.susercontent.com/file/ea61e77c6c36a00ee5ca0e2bcd859291_tn\",\"https://down-vn.img.susercontent.com/file/b36b082f935fbf855a7a55c65b55ee59_tn\",\"https://down-vn.img.susercontent.com/file/d7066ea875f557c9ac51269c0045d2c9_tn\",\"https://down-vn.img.susercontent.com/file/f3c33af0edf896c2279f8d0a254cb09c_tn\"]',7551,NULL,2371,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (173,'[Hàng Có Sẵn] Set Áo Sơ Mi Ba Lỗ + Quần Tây Nam Phong Cách Mùa Hè Sáng Màu 3ZL0 trang nam áo bếp quần áo nam bộ quần áo nam bộ quần áo nữ','[\"Chào mừng\\n == Vui lòng Nhấp vào [Theo dõi] Đầu tiên để bạn có thể hiểu được các chiết khấu mới nhất trong cửa hàng càng sớm càng tốt == \\n✨Tất cả các em bé trong bảo tàng đều được chúng tôi lựa chọn cẩn thận \\n✨Hàng hóa sẽ được kiểm tra cẩn thận cho trẻ sơ sinh trước khi giao hàng \\n✨Nếu bạn nhận được hàng bị lỗi hoặc thiếu mặt hàng, vui lòng liên hệ với chúng tôi trước\\n ✨Cảm ơn sự hỗ trợ của bạn, Cảm ơn bạn \\nHãy đến và trang trí ngôi nhà ấm áp của bạn (❁\'◡\'❁)*✲ﾟ** Tôi Chúc Bạn Mua Sắm Vui Vẻ (๑ ′ ́ ・・ ๑) I L O V E → O U❤   \\n\\n =========== Chi tiết sản phẩm ===============\\n\\r\\nThương hiệu: ENK\\r\\nXuất xứ: Tỉnh Quảng Đông\\r\\nVải / chất liệu: Polyester / Polyester (Sợi Polyester)\\r\\nNội dung thành phần: 100%\\r\\nChiều dài tay áo: Tay áo ba phần tư\\r\\nChiều dài quần: Quần dài\\r\\nPhong cách: Kinh doanh\\r\\nĐộ tuổi sử dụng: Thanh niên (18-25 tuổi)\"]',NULL,68,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/sg-11134201-23020-r109ne5wx2nvac_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-23020-r109ne5wx2nvac_tn\",\"https://down-vn.img.susercontent.com/file/tw-11134201-23030-g4w89r8llbovab_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-23020-9jjlxt5wx2nvef_tn\",\"https://down-vn.img.susercontent.com/file/th-11134201-23020-qisgovwxmknve0_tn\"]',1723,NULL,154,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (174,'Bộ đồ nam thể thao mùa hè mùa hè xu hướng băng giản dị thoải mái warveg ngắn tay quần short một bộ quần áo đẹp trai kết hợp với HZFMC1042','[\"🔰 Thông tin sản phẩm cơ bản:\",\"\\n\",\"Danh mục sản phẩm: Bộ thường ngày nam\",\"\\n\",\"Phong cách: thể thao\",\"\\n\",\"Dày và mỏng: Bình thường\",\"\\n\",\"Chiều dài quần: Quần short\",\"\\n\",\"Phong cách hàng đầu: Áo phông\",\"\\n\",\"Chiều dài tay áo trên: tay áo ngắn\",\"\\n\",\"Mùa thích hợp: mùa xuân, mùa hè và mùa thu\",\"\\n\",\"Tên vải: Hỗn hợp sợi hóa học\",\"\\n\",\"Thành phần cơ thể: polyeste (polyeste)\",\"\\n\",\"Nội dung của thành phần vải chính: 100\",\"\\n\",\"Kịch bản áp dụng: Hàng ngày\",\"\\n\",\"Màu sắc: 7 mẫu\",\"\\n\",\"Kích thước: M / L / XL / 2XL / 3XL / 5XL\",\"\\n\",\"\\n\",\"🔰 Hướng dẫn mua sắm đa danh mục:\",\"\\n\",\"- Bước 1: Chọn kích thước và màu sắc bạn muốn mua.\",\"\\n\",\"- Bước 2: Nhấn \\\"Thêm vào giỏ hàng\\\" và quay lại bước 1 để chọn Thêm kích thước màu khác\",\"\\n\",\"- Bước 3: Vào \\\"Giỏ hàng\\\" để chọn sản phẩm bạn muốn mua\",\"\\n\",\"- Bước 4: Nhập điện thoại, nhận hàng đúng địa chỉ hoặc mình đã đặt một cái, sau đó \\\"Chú ý\\\" cửa hàng sẽ lấy màu trước!\",\"\\n\",\"\\n\",\"🔰 Giới thiệu các mẹo giúp bảo quản\",\"\\n\",\"- Đối với quần áo mới mua, nên giặt tay trước để tránh phai màu cho quần áo khác\",\"\\n\",\"- Nên lật mặt trái khi giặt để đảm bảo độ bền\",\"\\n\",\"- Sản phẩm thích hợp giặt máy / giặt tay\",\"\\n\",\"- Không dùng chung quần áo trắng và sẫm màu\",\"\\n\",\"\\n\",\"🔰 Cửa hàng hứa hẹn:\",\"\\n\",\"- Mô tả sản phẩm 100% đa dạng. Phong cách giống hệt ảnh người mẫu\",\"\\n\",\"- Sau khi kiểm tra cẩn thận và cẩn thận và tư vấn nhiệt tình trước khi gói hàng được giao cho khách hàng\",\"\\n\",\"- Hàng có sẵn, giao hàng ngay khi nhận được đơn hàng\",\"\\n\",\"- Kích thước là kiểm tra và đo lường thủ công, có thể có sai sót, vui lòng kiểm tra biểu đồ kích thước trước khi mua\",\"\\n\",\"- Chấp nhận đổi, hoàn tiền và bồi thường khi kích thước không phù hợp (vui lòng liên hệ với bộ phận chăm sóc khách hàng trong trường hợp không hài lòng, chúng tôi sẽ cố gắng hết sức để giúp bạn giải quyết vấn đề)\",\"\\n\",\"- Do điều kiện màn hình và ánh sáng khác nhau, màu sắc thực tế của sản phẩm có thể chênh lệch khoảng 3-5%. /\",\"\\n\"]',NULL,144,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/sg-11134201-7qvde-likde3dcn3ina9_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7qvew-ljc489qyvh1p5d_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7qvfy-ljb27mziqvwt69_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7qve6-ljb27nnxpqti26_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7qvfj-ljb27okyc16of1_tn\"]',1132,NULL,239,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (175,'Set Áo Thun Ngắn Tay + Quần jeans Phong Cách Hàn Quốc Thời Trang Cho Nam Áo thun nam+Quần bò baggy nam Quần bò trơn Thích hợp cho cả nam và nữ','[\"🤵‍♂️Chào mừng đến với \\\"Mr. Thời trang | Quần áo & Giày & Mũ & Túi xách & Trang phục Nam hợp thời trang \\\"!\\n🤵‍♂️[Theo dõi quà tặng] Theo dõi cửa hàng để được giảm giá, chú ý trước ~\\n🤵‍♂️[Nhấn Like Gift] Thích 10 Sản phẩm, Trò chuyện và Liên hệ với Chúng tôi, Quà tặng ~\\n\\n⚫[Giới thiệu sản phẩm]\\n◾ Phiên bản Hàn Quốc của Trang phục Hợp thời trang và Đẹp trai\\n◾ Áo thun tay ngắn thời trang thông thường Tay áo năm điểm\\n◾ Quần jean cắt thẳng tất cả phù hợp\\n◾ Các cô gái cũng cảm thấy rất tốt khi mặc, Unisex!\\n\\n⚫[Vấn đề Vận chuyển và Vận chuyển]\\n ※ Cửa hàng của chúng tôi về cơ bản còn hàng ~​Nó sẽ được vận chuyển trong vòng 1-3 ngày sau khi đặt hàng ~\\n ※ Sẽ Mất Một Thời Gian Để Giao Hàng Hậu Cần Xuyên Biên Giới, Vui Lòng Kiên nhẫn Chờ đợi!Nếu Bạn Đang Nhanh Chóng Trong Thời Gian, Vui Lòng Đặt Hàng Cẩn Thận Để Không Làm Chậm Sắp Xếp Của Bạn, Vui Lòng Thông Cảm!～\\n ※ Vui lòng nhận gói hàng kịp thời sau khi gói hàng đến (Thời gian dài nhất là trong vòng 7 ngày sau khi gói hàng đến), vui lòng tham khảo tin nhắn văn bản đã nhận và không tham khảo thời gian hoàn thành Trên trang đặt hàng!\\n ※ Nếu Bạn Không Muốn Còn Sau Khi Đặt Hàng, Vui Lòng Liên Hệ Với Chúng Tôi Trong Vòng 24 Giờ Để Tránh Mất mát Không cần thiết, Vì Sau Khi Gói Hàng Đã Gửi Sẽ Không Được Trả Lại, Chúng Tôi Sẽ Trực Tiếp Mất Hàng Và Chi Phí Vận Chuyển, Không Dễ Làm Cửa Hàng Trực Tuyến Xuyên Biên Giới, Vui Lòng Hiểu!\\n\\n⚫[Sự khác biệt về màu sắc và sự cố lỗi kích thước]\\n ※ Máy tính và điện thoại di động khác nhau có sự khác biệt về màu sắc trên cùng một màu và điều chỉnh độ sáng của màn hình cũng khác nhau, vì vậy không thể khắc phục được rằng sự khác biệt về màu sắc là không thể tránh khỏi, không phải là lý do Trở lại và trao đổi, xin vui lòng hiểu!\\n ※ Do các yếu tố như điểm bắt đầu và dừng đo thủ công, có một lỗi nhẹ với kích thước sản phẩm thực tế. Kích thước lỗi ± 2cm đều nằm trong phạm vi chấp nhận được, không phải là khiếm khuyết.\\n\\n🤵‍♂️Nếu Quý Khách Có Bất Kỳ Câu Hỏi Sau Khi Nhận Hàng Vui Lòng Liên Hệ Để Giải Quyết Cho Đến Khi Hài Lòng, Vui Lòng Không Đưa Đánh Giá Chung Hoặc Tiêu Cực Trực Tiếp, Xin Cảm Ơn ~ ^ _ ^\\n🤵‍♂️Nếu bạn hài lòng với dịch vụ của chúng tôi, xin vui lòng khen ngợi 5 sao!Mỗi lời khen ngợi năm sao đều rất quan trọng đối với chúng tôi, tôi hy vọng sẽ được bạn công nhận và ủng hộ!\\n🤵‍♂️Nếu Bạn Thích Sản Phẩm Của Chúng Tôi, Bạn Có Thể Click Thích Và Theo Dõi Cửa Hàng, Sản Phẩm Mới Sẽ Có Trên Kệ Thỉnh thoảng ~🤵‍♂️Cuối cùng, tôi muốn bạn mua sắm vui vẻ!^_^\"]',NULL,158,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/d5d8f663bf56aac44095e528158fe3b8_tn\",\"https://down-vn.img.susercontent.com/file/cn-11134207-7qukw-lk7mls0s66lw98_tn\",\"https://down-vn.img.susercontent.com/file/cn-11134207-7r98o-lllli2rrbdlk93_tn\",\"https://down-vn.img.susercontent.com/file/cn-11134207-7qukw-lk7mls0saeb87f_tn\",\"https://down-vn.img.susercontent.com/file/cn-11134207-7r98o-lllli2rre6qg99_tn\"]',6731,NULL,1921,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (176,'Bộ đồ thể thao áo hoodie tay dài + quần dài dáng rộng thời trang dành cho nam','[\"Thời gian giao hàng dự kiến cho sản phẩm này là từ 7-9 ngày\\n\\nVải / Chất liệu: Khác / Polyester (Sợi Polyester)\\n\\nHàm lượng chất liệu: 96% -100%\\n\\nChiều dài tay áo: tay dài \\n\\nChiều dài: quần\\n\\nPhong cách: Giản dị\\n\\n💯 【Tất cả các sản phẩm của chúng tôi là 100% chính hãng và còn hàng】\\n\\n🚚 [Chúng tôi sẽ giao hàng nhanh chóng, giao hàng từ Trung Quốc đến tay bạn]\\n\\n📦 【Chúng tôi sẽ kiểm tra cẩn thận và đóng gói đơn hàng của bạn trước khi vận chuyển】\\n\\n🔥 【Mọi thắc mắc về sản phẩm vui lòng liên hệ nhân viên của cửa hàng, chúng tôi sẽ trả lời bạn kịp thời】\\n\\n🔥 【Sau khi nhận hàng, quý khách vui lòng giúp xác nhận việc nhận hàng và đánh giá. Xin chân thành cảm ơn, chúc các bạn sử dụng vui vẻ]\"]',NULL,55,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/e014ad3f1297b3e6d8aa406cdcd22313_tn\",\"https://down-vn.img.susercontent.com/file/13a1ae94cc81bbf3b5a99122219b617e_tn\",\"https://down-vn.img.susercontent.com/file/afa018198d2c3971fb4b867fceee3ced_tn\",\"https://down-vn.img.susercontent.com/file/70d3d66cba256a0df128daf6a66280a0_tn\",\"https://down-vn.img.susercontent.com/file/4c85f683226c9e1e1dec881ffff04b75_tn\"]',7893,NULL,1565,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (177,'Áo sơ mi nam kiểu dáng basic TOPMEN khoác ngoài chất vải kaki cao cấp trẻ trung năng động phù hợp cả mặc đi làm, đi chơi','[\"Áo sơ mi nam kiểu dáng basic TOPMEN khoác ngoài chất vải kaki cao cấp trẻ trung năng động phù hợp cả mặc đi làm, đi chơi\\n\\n⭐ Chất Liệu: Chất kaki xuất hàn xịn dày dặn\\n⭐ Màu sắc: Đen – Be - Trắng - Cam - Xám\\n⭐ Đặc Tính:  \\n- Chất vải áo là chất kaki cao cấp dày dặn, dễ phối hợp đồ, dành cho nam nhưng nữ mặc đều hợp. \\n- Áo có thể phối với áo thun bên trong, với quần jeans hoặc quần dài để đi chơi \\n- Áo sơ mi kaki cũng có thể mặc với quần âu phù hợp cho đi làm hoặc đi dự tiệc \\n\\nBảng size bên shop các bạn tham khảo ạ:\\nSize M: Dành cho người nặng từ  42kg - 50kg 1m55-1m60\\nSize L : Dành cho người nặng từ  51kg - 58kg 1m60-1m65\\nSize XL: Dành cho người nặng từ  59kg  - 67kg 1m65-1m70\\nSize 2XL: Dành cho người nặng từ  68kg  - 75kg 1m70-1m75\\nSize 3XL: Dành cho người nặng từ  76kg  - 85kg 1m75-1m80\\n\\n👉 Bảng size mang tính chất tham khảo bạn có thể lấy size to hơn hoặc nhỏ theo yêu cầu của bạn!\\nMàu sắc: Đen – Be - Trắng - Cam - Xám\\nLưu ý: Các bạn hãy nhắn tin cho shop để tư vấn size chính xác\\n\\n\\n   SHOP CAM KẾT\\n- Sản phẩm Áo sơ mi kaki basic giống mô tả 100%\\n- Hình ảnh sản phẩm là ảnh thật, các hình hoàn toàn do shop tự thiết kế.\\n- Kiểm tra  cẩn thận trước khi gói hàng giao cho Quý Khách\\n- Hàng có sẵn, giao hàng ngay khi nhận được đơn \\n- Hoàn tiền nếu sản phẩm không giống với mô tả\\n- Chấp nhận đổi hàng khi size không vừa trong 3 ngày.\\n\\n   HỖ TRỢ ĐỔI TRẢ THEO QUY ĐỊNH CỦA SHOPEE\\n- Điều kiện áp dụng (trong vòng 2 ngày kể từ khi nhận sản phẩm) \\n- Hàng hoá bị rách, in lỗi, bung chỉ, và các lỗi do vận chuyển hoặc do nhà sản xuất.\\n1. Trường hợp được chấp nhận: \\n- Hàng giao sai size khách đã đặt hàng \\n- Giao thiếu hàng \\n2. Trường hợp không đủ điều kiện áp dụng chính sách: \\n- Quá 2 ngày kể từ khi Quý khách nhận hàng \\n- Gửi lại hàng không đúng mẫu mã, không phải sản phẩm của shop\\n- Không thích, không hợp, đặt nhầm mã, nhầm màu,... \\n\\n#aosominam #aosomi #somi #somikaki #somibasic #somitheu #somitron #sominam #unisex #formrong #ao #so #mi #kaki #aosomikaki #aokhoacngoainam #aonamkhoacngoaibasic #aonamkhoacngoaikaki #aonamkhoacngoaikakibasic #aosomikhoacngoainam #aokhoacngoainamsomibasic #aosomikhoacngoainamkakibaisc #aosomikhoacngoainamkakiinthue\"]',NULL,102,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/sg-11134201-23010-3eds9jmvivlv8d_tn\",\"https://down-vn.img.susercontent.com/file/9c1455e5e54509c8968f796056998265_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-23010-wh7djogvivlv6c_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-23010-uc3sy3gvivlvbb_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-23010-j0cd4ogvivlvd5_tn\"]',8540,NULL,1800,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (178,'Bộ Đồ Thể Thao Áo Tay Ngắn Phối Quần Dài Vải Lụa Lạnh Thời Trang Mùa Hè Cho Nam','[\"Mùa hè băng lụa ngắn tay + quần tây phù hợp với nam giới#39 \'s rộng rãi cỡ lớn cảm giác mát mẻ đồ thể thao hai mảnh cao cấp#39 \'s rộng rãi kích thước lớn cảm giác mát mẻ quần áo thể thao hai mảnh cao cấp\"]',NULL,95,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/sg-11134201-7qvdh-ligqdnwjw4c705_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7qvez-li9m7w6bvl719a_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7qvdq-li9m7usxxa805f_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7qve8-li9m7wox4du53a_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7qvfv-li9m7vaf6agcc0_tn\"]',4437,NULL,2162,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (179,'Set Đồ Nam Thanh Lịch Áo Sơ Mi Tay Lỡ Kết Hợp Quần Túi Hộp Stylemarven - SET NAM 90000120C','[\"Bộ Quần Áo Sơ Mi Nam Tay Lỡ Kết Hợp Quần Túi Hộp Stylemarven - SET NAM 90000120C\",\"𝓣𝓱𝓸̂𝓷𝓰 𝓽𝓲𝓷 𝓼𝓪̉𝓷 𝓹𝓱𝓪̂̉𝓶\",\"◈ Sản phẩm: Set đồ áo sơ mi kết hợp quần túi hộp\",\"◈ Mã sản phẩm: SET NAM 90000120C\",\"◈ Xuất xứ: Việt Nam\",\"◈ Chất liệu vải: Áo sử dụng vải sơ mi truyền thống trơn mềm mại, thấm hút, mặc thoáng mát. Quần chất liệu ít nhăn,lên dáng chuẩn đẹp trẻ trung.\",\"◈ Thiết kế: Áo sơ mi nam cổ bẻ, tay lỡ, thân áo phối túi tạo nên điểm nhấn khác biệt, form rộng rãi thoải mái.\",\"◈ Kiểu dáng: Áo sơ mi thiết kế trơn màu trẻ trung, năng động, đường may chắc chắn, gọn gàng. Quần có túi tiện lợi.\",\"◈ Quần Áo form rộng vừa người thích hợp cho đi làm, đi chơi, đi học, mặc đội nhóm đều rất đẹp \",\"\\n\",\"Bộ Quần Áo Sơ Mi Nam Tay Lỡ Kết Hợp Quần Túi Hộp Stylemarven - SET NAM 90000120C\",\"𝓗𝓾̛𝓸̛́𝓷𝓰 𝓭𝓪̂̃𝓷 𝓬𝓱𝓸̣𝓷 𝓼𝓲𝔃𝓮\",\"◈ Size S: Nặng 40kg - 50kg, Cao 1m50 - 1m60\",\"◈ Size M: Nặng 50kg - 60kg, Cao 1m6 - 1m7\",\"◈ Size L: Nặng 60kg - 68kg, Cao 1m7 - 1m75\",\"Lưu ý: Nên giặt bằng tay, nếu giặt bằng máy bạn nên giặt với nhiệt độ nước không quá 40 độ C để đảm bảo sản phẩm bền lâu và giữ được màu sắc ban đầu\",\"----------------------------------------------------------------------\",\"𝐒𝐓𝐘𝐋𝐄 𝐌𝐀𝐑𝐕𝐄𝐍 - 𝐌𝐀𝐍𝐆 Đ𝐄̂́𝐍 𝐓𝐑𝐀̉𝐈 𝐍𝐆𝐇𝐈𝐄̣̂𝐌 𝐓𝐇𝐔́ 𝐕𝐈̣ 𝐕𝐄̂̀ 𝐓𝐇𝐎̛̀𝐈 𝐓𝐑𝐀𝐍𝐆\",\"♛ Cam kết sản phẩm giống y hình, hình ảnh do shop tự chụp.\",\"♛ Đảm bảo chất lượng, dịch vụ tốt, hàng được giao từ 1-5 ngày kể từ ngày đặt hàng.\",\" \",\"➥ CHÍNH SÁCH ĐỔI TRẢ VÀ BẢO HÀNH\",\"- Hỗ trợ đổi Size hoặc đổi mẫu trong vòng 3 ngày (Miễn cước đổi trả khi Shop giao sai hàng, khách hàng chịu cước đổi trả nếu khách hàng là người chủ động muốn đổi size hoặc đổi mẫu)\",\"- Khách hàng được đổi sang các sản phẩm ngang giá hoặc hơn giá (Sản phẩm thấp giá hơn sẽ không được nhận lại giá chênh lệch giữa 2 sản phẩm)\",\"- Mỗi sản phẩm chỉ được đổi hàng duy nhất 1 lần\",\"- Không hỗ trợ đổi hàng với các sản phẩm đã qua sử dụng, sản phẩm có tình trạng bẩn, rách, ố vàng,…\",\"\\n\",\"HÃY ĐÁNH GIÁ ⭐️⭐️⭐️⭐️⭐️ NẾU BẠN YÊU THÍCH SẢN PHẨM CỦA STYLEMARVEN NHÉ !\"]',NULL,122,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/vn-11134201-23030-4gyxwj40ipov17_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134201-23030-n13tin40ipovc3_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134201-23030-bfen5q40ipov60_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134201-23030-fe5hqu40ipova3_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134201-23030-veb56440ipov8a_tn\"]',9337,NULL,4176,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (180,'Set Áo Khoác + Quần Jeans Dài Ống Đứng Thời Trang Nam','[\"💖💖Chào mừng đến với cửa hàng của tôi💖💖\",\"\\n\",\"\\n\",\"⭐Mô tả sản phẩm\",\"⭐Nơi gửi hàng: Trung Quốc\",\"⭐Người bán ở nước ngoài, mất 8-15 ngày để đến nơi, vui lòng cân nhắc\",\"⭐Vải / chất liệu: Khác / Khác\",\"⭐Chiều dài tay áo: Dài tay\",\"⭐Chiều dài quần: Quần\",\"⭐Phong cách: xu hướng thanh niên\",\"⭐Độ tuổi áp dụng: thanh niên (18-25 tuổi)\",\"⭐Mùa niêm yết thời gian: Mùa thu 2023\",\"⭐Phiên bản phiên bản: Loose\",\"⭐Có thêm nhung hay không: không nhung\"]',NULL,126,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/sg-11134201-7rblq-llpveutjv1o985_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbm2-llj9dpj0l3rm2c_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbln-llpvevkqso6136_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbk0-lkrgg6lztqpj09_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7r98z-llpvew6dvlerdc_tn\"]',6931,NULL,2801,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (181,'Set đồ nam áo khoác dạ sang chảnh kèm quần jean hiện đại phong cách zenkodlmen KHOAC DA 001+JEAN','[\"Set đồ nam áo khoác dạ sang chảnh kèm quần jean hiện đại phong cách zenkodlmen KHOAC DA 001+JEAN𝓣𝓱𝓸̂𝓷𝓰 𝓽𝓲𝓷 𝓼𝓪̉𝓷 𝓹𝓱𝓪̂̉𝓶◈ Sản phẩm: Bộ quần áo dạ nam nữ◈ Mã sản phẩm: KHOAC DA 001+JEAN◈ Xuất xứ: Việt Nam◈ Chất liệu: Bộ quần áo unisex sử dụng chất vải nỉ dầy mềm mại, giữ ấm tốt◈ Thiết kế: Áo khoác thu đông dài tay in chữ phối cùng quần jogger bo ống thể thao◈ Kiểu dáng: Bộ quần áo nam nữ thiết kế đơn giản, trẻ trung, đường may chắc chắn, gọn gàng◈ Phù hợp: Mặc đi làm, đi học, đi chơi, đi du lịch...Set đồ nam áo khoác dạ sang chảnh kèm quần jean hiện đại phong cách zenkodlmen KHOAC DA 001+JEAN𝓗𝓾̛𝓸̛́𝓷𝓰 𝓭𝓪̂̃𝓷 𝓬𝓱𝓸̣𝓷 𝓼𝓲𝔃𝓮◈ Size XS: Nặng trên 40kg tùy chiều cao◈ Size S: Nặng dưới 50kg tùy chiều cao◈ Size M: Nặng dưới 60kg tùy chiều cao◈ Size L: Nặng dưới 65kg tùy chiều cao◈ Size XL: Nặng dưới 75kg tùy chiều caoLưu ý: Nên giặt bằng tay, nếu giặt bằng máy bạn nên giặt với nhiệt độ nước không quá 40 độ C để đảm bảo sản phẩm bền lâu và giữ được màu sắc ban đầu----------------------------------------------------------------------ZENKODLMEN - 𝐌𝐀𝐍𝐆 Đ𝐄̂́𝐍 𝐓𝐑𝐀̉𝐈 𝐍𝐆𝐇𝐈𝐄̣̂𝐌 𝐓𝐇𝐔́ 𝐕𝐈̣ 𝐕𝐄̂̀ 𝐓𝐇𝐎̛̀𝐈 𝐓𝐑𝐀𝐍𝐆♛ Cam kết sản phẩm giống y hình, hình ảnh do shop tự chụp.♛ Đảm bảo chất lượng, dịch vụ tốt, hàng được giao từ 1-5 ngày kể từ ngày đặt hàng.➥ CHÍNH SÁCH ĐỔI TRẢ VÀ BẢO HÀNH- Hỗ trợ đổi Size hoặc đổi mẫu trong vòng 3 ngày (Miễn cước đổi trả khi Shop giao sai hàng, khách hàng chịu cước đổi trả nếu khách hàng là người chủ động muốn đổi size hoặc đổi mẫu)- Khách hàng được đổi sang các sản phẩm ngang giá hoặc hơn giá (Sản phẩm thấp giá hơn sẽ không được nhận lại giá chênh lệch giữa 2 sản phẩm)- Mỗi sản phẩm chỉ được đổi hàng duy nhất 1 lần- Không hỗ trợ đổi hàng với các sản phẩm đã qua sử dụng, sản phẩm có tình trạng bẩn, rách, ố vàng,…HÃY ĐÁNH GIÁ ⭐️⭐️⭐️⭐️⭐️ NẾU BẠN YÊU THÍCH SẢN PHẨM CỦA ZENKODLMEN NHÉ !#set #do #bo #nam #nu #unisex #setdo #dobo #bodo #bothethao #boni #thu #dong #quan #ao #hoodie #jogger #ni #hoatiet #thethao #nangdong #catinh #dep #thoitrang #zenkodlmen\"]',NULL,75,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbly-lpllnc1dq8xe27_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbku-lpllnc7rgxavf5_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbmu-lpllnchr2aofd8_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbk1-lpllncnau66ze7_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbmq-lpllncyyd48i11_tn\"]',8426,NULL,541,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (182,'Bộ Quần Áo Thu Đông Nam Dài Tay Cao Cấp, Bộ Quần Áo Thể Thao Nam Chất Liệu TỔ Ong cotton Hàng Xuất Xịn BN04 - OVERMAN','[\" 📌  GẤU QUẦN CÓ HAI LOẠI BO CHUN VÀ BO VẢI SHOP GIAO NGẪU NHIÊN NHÉ!\",\"🍀 OVERMAN STORE CAM KẾT\",\"– Hàng cao cấp, tỉ mỉ, chắc chắn và tinh tế qua từng đường chỉ.\",\"– Sản phẩm đảm bảo y hình và đẹp hơn hình.\",\"– Đổi trả hàng nếu có bất cứ lỗi gì từ nhà sản xuất.\",\"\\n\",\"🍀 TÍNH NĂNG NỔI BẬT BỘ THỂ THAO NAM NỮ BN04\",\"- Bộ thể thao nam được thiết kế theo đúng form chuẩn của nam giới Việt Nam\",\"- Sản phẩm Bộ thể thao nam chính là mẫu thiết kế mới nhất cho Thu Đông này\",\"- Chất liệu: Xốp tổ ong mềm mịn, co dãn 4 chiểu cao cấp (Mềm nhẹ )\",\"\\n\",\"🍀 BẢNG SIZE BỘ THỂ THAO NAM NỮ BN04\",\"M:      40 - 48kg\",\"L:       48 - 58kg\",\"XL:     58 - 70kg\",\"2XL:  75 - 85kg\",\"3XL : 85 - 95kg\",\"\\n\",\"Nếu bạn béo bụng hay muốn mặc rộng hơn chút thì nhớ tăng 1 size nha!\",\"Bảng size này phù hợp 90% khách hàng. Nếu bạn không chắc chắn thì inbox shop tư vấn nhé\",\"\\n\",\" 🍀KIỂU DÁNG BỘ THỂ THAO NAM NỮ BN04\",\"☘ Đứng dáng vừa vặn mang đến phong cách khỏe khoắn, trẻ trung và thoải mái.\",\"☘ Quần đùi nam có chiều dài gần đến gối, phom dáng vừa vặn rất hợp với thể hình người Việt. \",\"☘ Quần được thiết kế đơn giản tiện dụng, hai túi sườn và túi sau đều có khoá kéo tiện lợi.\",\"☘ Cạp chun có dây rút dễ dàng điều chỉnh.\",\"☘ Quần thiết kế màu sắc đơn giản, nam tính dễ mặc dễ phối.\",\"=> LƯU Ý : Tuỳ từng cây vải khác màu mà chất vải cũng có sự khác biệt. Hãy nhắn tin cho shop để được tư vấn nhé.\",\"\\n\",\"🍀 GIÁ CẢ BỘ THỂ THAO NAM NỮ BN04\",\"☘ Chúng tôi luôn không ngừng cải tiến để có thể tạo ra những sản phẩm có chất lượng tốt với giá rẻ. \",\"☘ Hơn nữa luôn có các chương trình khuyến mại dành cho quý khách dùng thử và trải nghiệm sản phẩm mới.\",\"\\n\",\" 📌 LƯU Ý: Khi bạn gặp bất kì vấn đề gì về sản phẩm đừng vội đánh giá mà hãy inbox Shop ngay để đc hỗ trợ\",\"📌 LƯU Ý: Do màn hình và điều kiện ánh sáng khác nhau, màu sắc thực tế của sản phẩm có thể chênh lệch khoảng 3-5% so với màu thật của sản phẩm, khách iu vui lòng thông cảm giúp OVERMAN nha\",\"📌 Đừng quên \\\"THEO DÕI GIAN HÀNG\\\"OVERMAN để cập nhật được thông tin ưu đãi khuyến mại sớm nhất từ OVERMAN nhé!\",\"📌 OVERMAN LUÔN CHE TÊN SẢN PHẨM ĐỐI VỚI ĐƠN CÓ QUẦN LÓT NAM/QUẦN SỊP NAM, NÊN CÁC ANH EM ĐỪNG NGẦN NGẠI KHI ĐẶT HÀNG TẠI OVERMAN NHÉ ^^ \",\"\\n\",\"#quần_áo_nam #short_nam #bộ_quần_áo_nam #bộ_thể_thao #bo_the_thao #the_thao_thun_lanh #bộ_nam_nam_mặc_nhà #bo_thu_nam #bo_coc_nam #set_thể_thao #bộ_mùa_đông_nam #bộ_dài_thể_thao_nam #bộ_nữ_nam_quần_thể_thao #bộ_sport_nam_nữ #bộ_cotton_dày #set_thun_nam #quần_quần_thể_thao #quần_thể_thao #quần_sport_nam_cao_cấp #quần_nam_quần_thể_thao #quần_thể_thao \"]',NULL,133,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/11e41b7b3bdc2fc7de20ad182eccc186_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lkughroswfk08d_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lkundad8gji87d_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lkughrosjsg049_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lkughroso05c04_tn\"]',7601,NULL,2582,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (183,'Combo áo blazer quần âu áo sơ mi form dáng rông MrHero Hàn QUốc BZ12/QA01 Màu Be Dài tay M.RO','[\"Combo áo blazer quần âu áo sơ mi form dáng rông MrHero Hàn QUốc BZ12/QA01 Màu Be Dài tay M.RO\\n------------------------\\nI.\\tGIỚI THIỆU SẢN PHẨM\\n 1.\\tChất liệu\\n- Blazer chất liệu vải tuýt mềm, thoải mái khi mặc\\n- Quần âu vải âu/ Tuyết \\n- Chất vải không bai , xù khi mặc, bền màu.\\n(***Lưu ý: Bộ đồ sau khi nhận có thể sẽ có chút nhăn và nếp gấp do quá trình sản xuất và là gấp, tuy nhiên chỉ cần giặt qua lần nước đầu tiên, sản phẩm sẽ trơn và không còn nếp gấp)\\n\\n2.\\tThiết kế\\n-\\tKiểu dáng:\\n+ Dáng áo xuông rộng giúp che khuyết điểm vùng bụng cực kì hiệu quả\\n+ Cổ áo: Cổ Vest lịch sự, trẻ trung\\n+ Tay áo: Tay dài tay thanh lịch\\n+ Túi áo: Túi chéo 2 bên tiện dụng\\n+ Quần: Quần dài dáng xuông lịch sự, túi hai bên tiện lợi. Túi quần may hai bên tỉ mỉ, tiện lợi.\\n+ Mặc được nhiều trường hợp: đi học, đi làm, đi chơi , tiệc cưới ... đều dễ phối đồ\\n-\\tHọa tiết: Trơn, có phối tay áo\\n\\nGỢI Ý MỘT SỐ CÁCH MIX ĐỒ UNISEX CỰC CHẤT\\nÁo Blazer Dài, Ngắn Tay + quần short jeans + giày cổ cao\\nÁo Blazer Dài, Ngắn Tay + áo phông trắng + quần âu mix giày cổ thấp.\\nÁo Blazer Dài, Ngắn Tay + Sơ vin quần âu + giày cổ thấp.\\n3.\\tMàu sắc: Be, Đen\\n\\n4.\\tSize\\nFULLSIZE: M, L, XL, 2XL\\n- M: 45 -59kg, chiều cao 1.55 -1.68 m\\n- L: 60 -69 kg, chiều cao 1.68 -1.75 m\\n- XL: 65 – 75kg, chiều cao 1.65 -.178m\\n- 2XL: 70 - 80kg, chiều cao từ 1.65 - 1.82m\\n\\n(*** Size số sản phẩm phụ thuộc cả vào chiều cao, cân nặng và form người của từng khách hàng . Vậy nên để có thể sở hữu được 1 em blazer ưng ý nhất các bạn đừng ngần ngại mà hãy nhắn tin ngay cho Hero để được hỗ trợ tư vấn size chuẩn nhất nhé!)\\n\\n5.      Xuất xứ\\nSản xuất tại Việt Nam\\nCông ty: Công ty TNHH  HERO CLOTHES\\nĐịa chỉ: số 63 Cổ Vân, Nội Dục, xã Việt Hùng, Đông Anh, Hà Nội\\n\\nII.\\tHƯỚNG DẪN GIẶT VÀ BẢO QUẢN ĐỒ LỤA BỀN ĐẸP\\n- Nếu giặt máy nên chọn chế độ giặt nhẹ nhất, để giữ form áo\\n- Nên vò nhẹ khi giặt áo,hạn chết tối đa nhồi, vắt để không làm nhăn áo\\n- Không giặt với nước nóng\\n- Không sử dụng bàn chải chà vết bẩn, nếu dùng chỉ sử dụng loại bàn chải lông mềm\\n- Phơi ái thoáng mát không nắng quá to để hạn chế bạc màu áo\\n- Lúc cất áo vào tủ đảm bảo áo được treo thẳng và không có bất kì nếp gấp nào.\\n\\nIII.\\tMr.Hero CAM KẾT\\n- Sản phẩm đảm bảo 100% y hình và đẹp hơn hình.\\n- Đổi trả hàng nếu có bất cứ lỗi gì từ nhà sản xuất.\\n- Giao hàng nhanh chóng\\n- Hỗ trợ đổi hàng trong vòng 7 ngày nếu có lỗi sản phẩm/ đổi size / màu . \\nĐối với trường hợp lỗi từ phía shop, khách hàng không phải thanh toán bất kì khoản phí phát sinh nào\\nTrường hợp đổi do khách hàng, các bạn thanh toán phí ship đổi hàng giúp shop nha.\\n- KHÔNG HỖ TRỢ TRẢ HÀNG NẾU KHÔNG VỪA Ý, HÀI LÒNG, KHÔNG ƯNG MẪU\\n- THEO QUY ĐỊNH CỦA SHOPEE KHÔNG HỖ TRỢ XEM HÀNG KHI THANH TOÁN. \\nMONG CÁC BẠN CÂN  NHẮC KĨ TRƯỚC KHI ĐẶT, TRÁNH MẤT THỜI GIAN CỦA 2 BÊN NHA\\n \\n4. PHẢN HỒI VỀ TRẢI NGHIỆM SẢN PHẨM\\nShop rất mong nhận được sự góp ý của các bạn về trải nghiệm mua hàng để chúng mình ngày càng nâng cấp phục vụ tốt hơn.\\nTRONG QUÁ TRÌNH PHỤC VỤ NẾU CÓ ĐIỀU GÌ THIẾU SÓT, XIN CÁC BẠN NHẸ TAY IN BÓC, ĐỂ CHÚNG MÌNH ĐƯỢC TẠ LỖI\"]',NULL,173,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/6b964d1e3eea9fc287b3991c241fa789_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-22090-sma89rytvuhv80_tn\",\"https://down-vn.img.susercontent.com/file/d103d7e35ebbdda8d731add692564c9f_tn\",\"https://down-vn.img.susercontent.com/file/bba8ea3fc4378320e6806a26f61be2ed_tn\",\"https://down-vn.img.susercontent.com/file/865b30b5e8b9cd1beb13fd2f8830aa3b_tn\"]',8280,NULL,1208,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (184,'【M-5XL】Bộ thể thao nam thời trang simple áo thun nam nữ Sọc đồ bộ thể thao nữ phong cách hàn quốc quần đùi nam oversize unisex đồ đôi bộ','[\"🎉🎉🎉Chào mừng đến với cửa hàng của tôi. Tất cả các sản phẩm trong cửa hàng được bán với giá thấp với chất lượng đảm bảo. Thời gian giao hàng ước tính cho sản phẩm này là 5-9 ngày.\",\"\\n\",\"💕Thông tin sản phẩm cơ bản:\",\" Kích thước: M, L, XL, 2XL\",\" Chất liệu chính: bông + khác\",\" Màu sắc: Green, Blue\",\" Loại cổ áo: Áo phông\",\" Chiều dài tay áo: Tay áo ngắn\",\" Phong cách: hợp thời trang, trẻ trung\",\" Độ dày: Bình thường\",\" Phong cách: rộng\",\" Loại hàng đầu: Bộ\",\"\\n\",\"【Vui Lòng đọc trước khi mua】\",\" 💕Cửa hàng của chúng tôi có rất nhiều loại áo phông, áo sơ mi, quần short, quần tây, áo khoác, v.v., mỗi chiếc có đặc điểm và kích cỡ riêng.\",\"  💕 Màu sắc thực tế hơi khác so với hình ảnh do hiệu ứng ánh sáng.\",\"  💕 Do các phương pháp đo lường khác nhau, xin vui lòng cho phép lỗi 2-5CM, phạm vi lỗi không phải là vấn đề chất lượng.\",\"  💕Vui lòng kiểm tra cẩn thận trước khi đặt hàng. Khi đơn hàng đã được đặt, chúng tôi không chấp nhận việc hủy hoặc sửa đổi đơn hàng!\",\"  💕Nếu có thắc mắc về kích thước trong quá trình mua hàng, vui lòng để lại tin nhắn cho chúng tôi, chúng tôi sẽ giới thiệu kích thước phù hợp nhất cho bạn trong thời gian.\",\" 💕 Nếu bạn hài lòng với việc mua hàng của mình, hãy nhớ cung cấp cho tôi phản hồi năm sao và giới thiệu cửa hàng của tôi với bạn bè của bạn. Sự động viên và ủng hộ của các bạn sẽ là động lực lớn nhất của tôi. Đã có một kinh nghiệm mua sắm tốt. Chúc một ngày tốt lành! 🎉\"]',NULL,75,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/cn-11134207-7qukw-lezq0l2ovcmie2_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7qvem-lesicz3a52spf4_tn\",\"https://down-vn.i