INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (185,'Bộ Quần Áo Sơ Mi Nam Hoa Hồng Phai Quần Baggy Phong Cách Hàn Quốc Stylemarven - AO SOMI 041 + JOGGER 066C','[\"Set Áo Sơ Mi Ngắn Tay Họa Tiết Hoa Hồng Phai Kết Hợp Quần Baggy Stylemarven - SOMI 041 + JOGGER 066C\",\"𝓣𝓱𝓸̂𝓷𝓰 𝓽𝓲𝓷 𝓼𝓪̉𝓷 𝓹𝓱𝓪̂̉𝓶\",\"◈ Sản phẩm: Set Áo Sơ Mi Kết Hợp Quần Baggy\",\"◈ Mã sản phẩm: SOMI 041 + JOGGER 066C\",\"◈ Xuất xứ: Việt Nam\",\"◈ Chất liệu vải: Áo sử dụng vải sơ mi truyền thống trơn mềm mại, thấm hút, mặc thoáng mát. Quần chất liệu ít nhăn,lên dáng chuẩn đẹp trẻ trung.\",\"◈ Thiết kế: Áo sơ mi nam cổ bẻ, tay ngắn, Họa Tiết Hoa Hồng Phai tạo nên điểm nhấn khác biệt, form rộng rãi thoải mái.\",\"◈ Kiểu dáng: Áo sơ mi thiết kế trơn màu trẻ trung, năng động, đường may chắc chắn, gọn gàng.\",\"◈ Quần Áo form rộng thích hợp cho đi làm, đi chơi, đi học, mặc đội nhóm đều rất đẹp \",\"\\n\",\"Set Áo Sơ Mi Ngắn Tay Họa Tiết Hoa Hồng Phai Kết Hợp Quần Baggy Stylemarven - SOMI 041 + JOGGER 066C\",\"𝓗𝓾̛𝓸̛́𝓷𝓰 𝓭𝓪̂̃𝓷 𝓬𝓱𝓸̣𝓷 𝓼𝓲𝔃𝓮\",\"◈ Size S: Nặng 40kg - 50kg, Cao 1m50 - 1m60\",\"◈ Size M: Nặng 50kg - 60kg, Cao 1m6 - 1m7\",\"◈ Size L: Nặng 60kg - 68kg, Cao 1m7 - 1m75\",\"Lưu ý: Nên giặt bằng tay, nếu giặt bằng máy bạn nên giặt với nhiệt độ nước không quá 40 độ C để đảm bảo sản phẩm bền lâu và giữ được màu sắc ban đầu\",\"----------------------------------------------------------------------\",\"𝐒𝐓𝐘𝐋𝐄 𝐌𝐀𝐑𝐕𝐄𝐍 - 𝐌𝐀𝐍𝐆 Đ𝐄̂́𝐍 𝐓𝐑𝐀̉𝐈 𝐍𝐆𝐇𝐈𝐄̣̂𝐌 𝐓𝐇𝐔́ 𝐕𝐈̣ 𝐕𝐄̂̀ 𝐓𝐇𝐎̛̀𝐈 𝐓𝐑𝐀𝐍𝐆\",\"♛ Cam kết sản phẩm giống y hình, hình ảnh do shop tự chụp.\",\"♛ Đảm bảo chất lượng, dịch vụ tốt, hàng được giao từ 1-5 ngày kể từ ngày đặt hàng.\",\" \",\"➥ CHÍNH SÁCH ĐỔI TRẢ VÀ BẢO HÀNH\",\"- Hỗ trợ đổi Size hoặc đổi mẫu trong vòng 3 ngày (Miễn cước đổi trả khi Shop giao sai hàng, khách hàng chịu cước đổi trả nếu khách hàng là người chủ động muốn đổi size hoặc đổi mẫu)\",\"- Khách hàng được đổi sang các sản phẩm ngang giá hoặc hơn giá (Sản phẩm thấp giá hơn sẽ không được nhận lại giá chênh lệch giữa 2 sản phẩm)\",\"- Mỗi sản phẩm chỉ được đổi hàng duy nhất 1 lần\",\"- Không hỗ trợ đổi hàng với các sản phẩm đã qua sử dụng, sản phẩm có tình trạng bẩn, rách, ố vàng,…\",\"\\n\",\"HÃY ĐÁNH GIÁ ⭐️⭐️⭐️⭐️⭐️ NẾU BẠN YÊU THÍCH SẢN PHẨM CỦA STYLEMARVEN NHÉ !\"]',NULL,139,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/vn-11134201-23030-5hqiaetbjpov56_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134201-23030-fif0pitbjpov64_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134201-23030-rjw1jotbjpovac_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134201-23030-8neuzstbjpov76_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134201-23030-b4gl4ytbjpov80_tn\"]',846,NULL,345,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (188,'Set Áo Sơ Mi + Quần Short Phong Cách retro Nhật Bản Cho Nam','[\"Vải / chất liệu: Polyester / Polyester (Sợi Polyester)\\r\\nNội dung thành phần: 100%\\r\\nChiều dài tay áo: tay áo năm phần tư / tay áo giữa\\r\\nChiều dài quần: quần năm điểm\\r\\nPhong cách: Nhật Bản\\r\\nĐộ tuổi áp dụng: Thanh niên (18-25 tuổi)\\r\\nChức năng: moisture wicking\\r\\nThoáng khí\\r\\nChống rỉ Chào mừng!    Xin chào mọi người, Chào mừng đến với Phòng ngủ của tôi!    Luôn có một cái bạn thích!    Tôi Thích Bạn, Không Chỉ Bạn Thích Nó!\\r\\n\\r\\nHy vọng bạn có một ngày tốt lành và chọn bao nhiêu tùy thích!\\r\\n\\r\\nCó Giảm Giá Cho Món Quà Chú Ý, Mong Mọi Người Chú Ý!    Có Nhiều Giảm Giá Trong Cửa Hàng Mới, Và Bạn Có Thể Tham Gia Giảm Giá Lớn Hơn Bất Cứ Lúc Nào.\\r\\n\\r\\nNếu bạn có bất kỳ câu hỏi nào, bạn có thể trò chuyện với chủ sở hữu bất cứ lúc nào, chúng tôi sẵn sàng đưa ra giải pháp tốt cho bạn\\r\\n\\r\\n❤️\\r\\n\\r\\nVui lòng tham khảo ảnh chụp màn hình của đề xuất kích thước hoặc tham khảo ý kiến dịch vụ khách hàng\\r\\n\\r\\nPhong cách: Giản dị\\r\\n\\r\\n✨Do Sẽ Có Sự Khác Biệt Màu Sắc Trên PC / Màn Hình Di Động, Hình Ảnh Chỉ Cung Cấp Sử Dụng Tham Khảo, Sẽ Mất 1-2 Ngày Để Hiển Thị Thông Tin Hậu Cần Sau Khi Giao Hàng.\\r\\n\\r\\nNếu Có Bất Kỳ Vấn Đề Sau Khi Nhận Hàng: Mảnh Nhỡ, Gửi Sai Hàng, v.v., Vui Lòng Liên Hệ Trước, Đừng Lo lắng Về Đánh Giá Tiêu Cực, Chúng Tôi Chắc Chắc Chắn Sẽ Giải Quyết Vấn Đề Cho Bạn, Cảm Ơn Bạn!\\r\\n\\r\\nNó sẽ được gửi từ Trung Quốc, nó sẽ được gửi đi sau 1-3 ngày sau khi đơn đặt hàng của bạn được thông qua, và nó sẽ đến trong khoảng 8-15 ngày.     Nếu bạn không có thời gian để nhận được gói hàng.     Vui lòng trì hoãn việc mua hàng, và cô bé xinh xắn sẽ đợi bạn quay lại đây!     Nói chuyện với tôi, tôi có thể đặt giảm giá tương tự cho bạn khi bạn quay lại.\"]',NULL,193,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/vn-11134201-7r98o-llajma6a6ojac5_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134201-7r98o-llajmga193na39_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134201-7r98o-llajmazozn3q65_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134201-7r98o-llajmhsz0p8o6e_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134201-7r98o-llajmids694mdb_tn\"]',8259,NULL,2548,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (189,'Đồ Bộ Nam Cộc Tay Thể Thao Mùa Hè Bộ Nam basic In Hình Chấm Bi Chất Liệu Vải Thun Cao Cấp Phong Cách Hàn Quốc Mã Benche','[\"Đồ Bộ Nam Cộc Tay Thể Thao Mùa Hè Bộ Nam basic In Hình Chấm Bi Chất Liệu Vải Thun Cao Cấp Phong Cách Hàn Quốc Mã Benche\\n\\nSize M - L - XL-XXl\\nGiá rẻ nhất thị trường,\\nmọi người thấy shop khác rẻ hơn cũng đừng vội đánh giá, vì chất lượng chưa chắc đã phải hàng cao cấp.\\n\\nChất liệu: Thun lạnh cao cấp, hàng vải xuất dư, hàng may công ty với đường may chắc chắn, chữ ép logo decal rất bền ko bong khi giặt, sản phẩm không bài không xù khi giặt, có thể giặt máy thoải mái nha quý khách. Là hàng đẹp nên khách không nên so sánh giá với những loại rẻ tiền chất liệu thông thường hay loại freesize ạ. Size số chuẩn và form to nha khách.\\n\\n• Thiết kế : 3 size\\nSize M : Từ 45 – 53 Kg\\nSize L  : Từ 54 – 60Kg\\nSize XL: Từ 60– 75kg\\nsize XXL:từ 75.85 kg\\nLƯU Ý: Size shop ghi là tham khảo theo cân nặng, Bạn nào béo, cao, có bụng, thích mặc phom rộng hoặc ôm thì còn tùy thuộc vào chiều cao,vui lòng chat với shop  hoặc lh qua sđt 0919160220 zalo.091160220 \\nđể được tư vấn.\\n➡️Thiết kế thể thao sang trọng - thoải mái\\n➡️Hàng đảm bảo y hình 100%\\n.......................................................................\\n\\n👌QUÝ KHÁCH SẼ ĐƯỢC HỖ TRỢ MIỄN SHIP TỐI ĐA 40k VỚI ĐƠN HÀNG TỪ 150K (VỚI KHÁCH Ở HÀ NỘI  VÀ TỪ 250K ( VỚI KHÁCH Ở CÁC TỈNH THÀNH KHÁC)\\nCAM KẾT HÀNG ĐẢM BẢO CHẤT LƯỢNG VÀ Y HÌNH.MỌI VẤN ĐỀ XIN CHAT VỚI SHOP HOẶC LIÊN HỆ TRỰC TIẾP ĐỂ ĐƯỢC TƯ VẤN \\nCẢM ƠN QUÝ KHÁCH!\\n\\n✔️ Tên Đơn Vị Sản Xuất : Xưởng May Hoàng Duy\\n✔️ Địa Chỉ Sản Xuất: Xóm 8 Mỹ Thắng Mỹ Lộc Nam Định\\n\\n#bonam #namcaocấp  #bothethao #thethaonam #dobonam#đồbộnam\\n#bộnam\\n#bộthểthao\\n#bộhè\\n#bộđồnam \\n#aophong #aococ #aonam #aothethao\"]',NULL,54,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/0058ec3f6c871d4e81b53e32c6cbd32f_tn\",\"https://down-vn.img.susercontent.com/file/072d374cb8ff25481a046ce2f967c243_tn\"]',7424,NULL,495,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (190,'Đồ Bộ Nam Cổ Bẻ Chất Vải Cotton Cao Cấp Thoáng Mát, Bộ Quần Áo Thể Thao Mùa Hè Phong Cách','[\"THÔNG TIN SẢN PHẨM:\",\"• Chất liệu : vải xốp thái mềm, mát, thông hơi thấm hút mồ hôi\",\"• Thiết kế tay lỡ, fom unisex, nam nữ đều mặc được\",\"• Thiết kế : 4 size\",\"Size M : 43-54kg\",\"Size L : 55-65kg\",\"Size XL: 65-75kg\",\"Size XXL: 75-85kg\",\"- Size shop để là tham khảo theo chiều cao và cân nặng, Quý khách muốn mặc ôm hay rộng thoải mái, thể hình cao gầy hay béo thấp vui lòng ib shop để được tư vấn size cho phù hợp\",\"BẢO QUẢN \",\"- Khi giặt chúng ta không ngâm trong bột giặt quá 30 phút.\",\"- Sử dụng xà phòng trung tính\",\"- Lộn trái khi giặt máy và giặt ở chế độ nhẹ nhàng, không sử dụng nước nóng quá 40 độ C\",\"- Không sử dụng thuốc tẩy, tẩy quần áo\",\"- Là ở nhiệt độ dưới 120 độ C\",\"- Nên phơi ở những nơi thoáng mát và tránh ánh nắng mặt trời.\",\"- Không giặt chung đồ trắng với những sản phẩm màu\",\"* T&T CAM KẾT :\",\"- Sản phẩm 100% giống với mô tả\",\"- Giao hàng đúng size, lỗi 1 đổi 1\",\"- Giao hàng trên toàn quốc\",\"- Đảm bảo chất lượng, dịch vụ tốt nhất, hàng được giao từ 1-5 ngày kể từ ngày đặt hàng\",\"- Hỗ trợ đổi size và đổi màu trong vòng 15 ngày kể từ khi nhận hàng, sản phẩm đổi phải còn nguyên tem mác và chưa qua sử dụng.\",\"- Nếu có bất kì khiếu nại cần T&T hỗ trợ về sản phẩm, khi mở sản phẩm, khách iu vui lòng quay lại video quá trình mở sản phẩm để được đảm bảo 100% đổi lại sản phẩm mới nếu T&T giao bị lỗi.\",\"- Khách iu nhận được sản phẩm, vui lòng đánh giá giúp T&T để hưởng thêm nhiều ưu đãi nhé!\",\"#bo #quan #ao #he #thethao #thun #bohe #bothethao #bomacnha #boquanaonam #bodonam #dobonam #thoitrangnam #dajito #bothun #cotton\"]',NULL,177,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/d4b6c315abee6744e6103e3595ea6183_tn\",\"https://down-vn.img.susercontent.com/file/a3b2b85fb9891a2881bb570163e8a416_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-lhga82spfrgh42_tn\",\"https://down-vn.img.susercontent.com/file/6f1a4fd09ad0a9853ed11bfe7546b1c8_tn\",\"https://down-vn.img.susercontent.com/file/a060d8b286e7978f66f1d95c2b7095e9_tn\"]',7174,NULL,121,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (191,'Áo sơ mi basic 5 Màu chất kaki cao cấp, Áo sơ mi nam nữ cực đẹp Năm 2023','[\"⭐Bảng size bên shop các bạn tham khảo ạ:\\nSize M: Dành cho người nặng từ  38kg - 50kg\\nSize L : Dành cho người nặng từ  51kg - 59kg\\nSize XL: Dành cho người nặng từ  60kg  - 69kg\\nSize 2XL: Dành cho người nặng từ  70kg  - 79kg\\nSize 3XL: Dành cho người nặng từ  80kg  - 90kg\\n\\n👉 Bảng size mang tính chất tham khảo bạn có thể lấy size to hơn hoặc nhỏ theo yêu cầu của bạn!\\nMàu sắc: Đen – Be - Trắng - Cam - Xám\\nLưu ý: Các bạn có thể nhắn tin cho shop để tư vấn size.\\n\\n\\nI. SHOP CAM KẾT\\n- Sản phẩm Áo sơ mi kaki basic giống mô tả 100%\\n- Hình ảnh sản phẩm là ảnh thật, các hình hoàn toàn do shop tự thiết kế.\\n- Kiểm tra  cẩn thận trước khi gói hàng giao cho Quý Khách\\n- Hàng có sẵn, giao hàng ngay khi nhận được đơn \\n- Hoàn tiền nếu sản phẩm không giống với mô tả\\n- Chấp nhận đổi hàng khi size không vừa trong 3 ngày.\\n\\nII. HỖ TRỢ ĐỔI TRẢ THEO QUY ĐỊNH CỦA SHOPEE\\n- Điều kiện áp dụng (trong vòng 2 ngày kể từ khi nhận sản phẩm) \\n- Hàng hoá bị rách, in lỗi, bung chỉ, và các lỗi do vận chuyển hoặc do nhà sản xuất.\\n1. Trường hợp được chấp nhận: \\n- Hàng giao sai size khách đã đặt hàng \\n- Giao thiếu hàng \\n2. Trường hợp không đủ điều kiện áp dụng chính sách: \\n- Quá 2 ngày kể từ khi Quý khách nhận hàng \\n- Gửi lại hàng không đúng mẫu mã, không phải sản phẩm của KARLEY STORE\\n- Không thích, không hợp, đặt nhầm mã, nhầm màu,... \\n\\nIII. MÔ TẢ SẢN PHẨM\\n⭐ Tên sản phẩm : Áo sơ mi kaki basic cao cấp\\n⭐ Chất Liệu: Chất kaki xuất hàn xịn \\n⭐ Màu sắc: Đen – Be - Trắng - Cam - Xám\\n⭐ Đặc Tính:  Chất vải áo là chất kaki cao cấp dày dặn, dễ phối hợp đồ, nam nữ mặc đều đẹp ạ \\n\\n#aosominam #aosomi #somi #somikaki #somibasic #somitheu #somitron #sominam #unisex #formrong \"]',NULL,90,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/sg-11134201-22110-39sieuoxz0jv32_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-22110-4gf2pvrxz0jv55_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-22110-6skp0ii1z0jv08_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lkxhxmojqrq527_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lkxhxmojz74t46_tn\"]',9771,NULL,728,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (192,'Quần Ống Rộng NAM TẶNG KÈM ÁO SƠ MI thời trang BAGGY chất liệu co giãn cao cấp phong cách Hàn Quốc.','[\"Quần âu nam là trang phục không thể thiếu trong tủ quần áo của một người đàn ông lịch thiệp và sang trọng.\",\"Được thiết kế để mặc trong các dịp lễ trang trọng và chuyên nghiệp.\",\"Quần âu nam thường được làm từ vải Tuyết hàn cao cấp, tạo cảm giác thoải mái, dễ chịu khi mặc.\",\"Quần âu nam có nhiều màu sắc và kiểu dáng khác nhau để mọi người lựa chọn phù hợp với nhiều phong cách và sở thích cho mình.\",\"----------------------------------------------------------------------------------------\",\"THÔNG TIN SẢN PHẨM\",\"- Chất liệu: Cotton Hàn\",\"- Màu Sắc: Đen, Xanh Than, Nâu vintage, Ghi Xám\",\"- Kiểu dáng: Dáng rộng Unisex\",\"🔸 SHOP CAM KẾT\",\"- Sản phẩm 100% giống mô tả. Kiểu dáng hoàn toàn giống ảnh mẫu\",\"- Áo được kiểm tra kĩ càng, cẩn thận và tư vấn nhiệt tình trước khi gói hàng giao cho Quý Khách\",\"- Hàng có sẵn, giao hàng ngay khi nhận được đơn \",\"- Chấp nhận đổi hàng khi size không vừa\",\"- Giao hàng trên toàn quốc \",\"- Hỗ trợ đổi trả theo quy định của Shopee\",\"*QUY ĐỊNH BẢO HÀNH ĐỔI TRẢ \",\"1. Điều kiện áp dụng (trong vòng 07 ngày kể từ khi nhận sản phẩm) \",\"- Hàng hoá vẫn còn mới, chưa qua sử dụng \",\"- Hàng hoá bị lỗi hoặc hư hỏng do vận chuyển hoặc do nhà sản xuất \",\"2. Trường hợp được chấp nhận: \",\"- Hàng không đúng size, kiểu dáng như quý khách đặt hàng \",\"- Không đủ số lượng, không đủ bộ như trong đơn hàng \",\"3. Trường hợp không đủ điều kiện áp dụng chính sách: \",\"- Quá 07 ngày kể từ khi Quý khách nhận hàng \",\"- Gửi lại hàng không đúng mẫu mã, không phải sản phẩm của Shop.\",\"- Không thích, không hợp, đặt nhầm mã, nhầm màu,... \",\"Do màn hình và điều kiện ánh sáng khác nhau, màu sắc thực tế của sản phẩm có thể chênh lệch khoảng 3-5% \",\"#quan#au#nam#quanaunam#sidetad#capcao#\"]',NULL,163,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/2015c17bb0a2ee452adbd8d575e17312_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-lihj6n50f9cc4b_tn\",\"https://down-vn.img.susercontent.com/file/88e0cc6fc4c91cb189dcaf87831a2b05_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-22110-gqmeknrbwikvb3_tn\",\"https://down-vn.img.susercontent.com/file/fb5cb6add08bf5be1a8583ec6d4e28b8_tn\"]',3356,NULL,309,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (193,'Quần âu nam + tặng sơ mi lụa hàn 98WEAR Công Sở trẻ trung năng động không nhăn không xù','[\"Mọi người muốn chọn màu áo size áo .màu quần size quần khác mọi người nhắn tin với shop để shop gói theo giúp mọi người nha .\",\"------------------------------------------\",\" * THÔNG TIN SẢN PHẨM:\",\"- Sản Phẩm Quần Âu đen nam lần này của shop sẽ được lựa chọn vải Mỏng hơn để tạo cảm giác thoải mái khi mặc , khách hàng có yêu cầu vải dày thì cân nhắc trước khi đặt hàng nha ạ.\",\"- Quần âu nam đen ống côn sẽ giúp các chàng trông chuẩn soái ca.\",\"- Trong tủ có e này thì cực dễ phối đồ: sơmi, thun, vest đều đẹp\",\"- Chất Liệu: Vải lụa co giãn nhẹ, mềm mịn\",\"- Chất vải đảm bảo không nhăn nhàu, lên form đứng dáng\",\"- Form Chuẩn, khoá giữa, có túi  dễ mặc và cực tiện dụng.\",\"\\n\",\"- Có 4 màu cơ bản: Đen, Xanh than, Ghi sáng\",\"* Bảng size chỉ mang tính chất tham khảo, tùy thuộc vào số đo cơ thể và chất liệu vải khác nhau sẽ có sự chênh lệch nhất định. \",\"* Màu sắc vải sản phẩm có thể sẽ chênh lệch thực tế một phần nhỏ, do ảnh hưởng về độ lệch màu của ánh sáng nhưng vẫn đảm bảo chất lượng.\",\"-------------------------------\",\"* 98WEAR CAM KẾT: \",\"- Shop không bán hàng giả, hàng nhái, chất lượng luôn là hàng đầu để shop có thể phát triển thương hiệu và vươn xa. \",\"- Quần âu nam đen ống côn 100% giống mô tả\",\"- Tư vấn nhiệt tình, chu đáo luôn lắng nghe khách hàng để phục vụ tốt. \",\"- Giao hàng nhanh đúng tiến độ không phải để quý khách chờ đợi lâu để nhận hàng. \",\"-------------------------------\",\"* Đổi trả theo đúng quy định của Shopee \",\"1. Điều kiện áp dụng (trong vòng 07 ngày kể từ khi nhận sản phẩm): \",\"- Hàng hoá vẫn còn mới, chưa qua sử dụng \",\"- Hàng hóa hư hỏng do vận chuyển hoặc do nhà sản xuất. \",\"2. Trường hợp được chấp nhận: \",\"- Hàng không đúng size, kiểu dáng như quý khách đặt hàng \",\"- Không đủ số lượng, không đủ bộ như trong đơn hàng\",\"3. Trường hợp không đủ điều kiện áp dụng chính sách:\",\" - Quá 07 ngày kể từ khi Quý khách nhận hàng \",\" - Gửi lại hàng không đúng mẫu mã, không phải hàng của shop.\",\" - Đặt nhầm sản phẩm, chủng loại, không thích, không hợp,...\",\" Ấn theo dõi để ủng hộ shop và tham khảo các sản phẩm mới của shop, “ 98wear ” rất hân hạnh được phục vụ quý khách.\",\"#quanauaosomi #quan #nam #ong #xuong #suong #cong #so #vai #quandai #dai #quannam #quantaynam #quanvai #quanaunam #quanau #quancongso #quanvest\"]',NULL,99,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/ed53699dc75e5e33d027dc3661e2b061_tn\",\"https://down-vn.img.susercontent.com/file/vn-11110105-7r98o-lp0ddgp5qh2la3_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-li5e6ucz9qz610_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-li5e6uczdyoid3_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-lf96yzqr55zecf_tn\"]',7479,NULL,1245,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (194,'Set Áo Sơ Mi Tay Ngắn + Quần Đùi Phong Cách Hàn Quốc Cho Nam','[\"★Chào mừng đến với cửa hàng của chúng tôi!\\r\\n★Tất cả các sản phẩm của chúng tôi đều là bán hàng trực tiếp tại nhà máy, kiểm soát chất lượng tốt.\\r\\n★Đơn đặt hàng sẽ được giao trong vòng 1-3 ngày đầu tiên.\\r\\n\\r\\n* * Hàng sẵn sàng\\r\\n* * Chất lượng hoàn toàn mới 100%\\r\\n\\r\\n\\r\\nThương hiệu: Lion Yichao\\r\\nXuất xứ: Tỉnh Quảng Đông\\r\\nVải / chất liệu: Khác / Polyester (Sợi Polyester)\\r\\nNội dung thành phần: 51% (Bao gồm) -70% (Bao gồm)\\r\\nPhiên bản phiên bản: Loose\\r\\nLoại cổ áo: Cổ áo vuông\\r\\nChiều dài tay áo: Tay áo năm điểm / Tay áo giữa\\r\\nChi tiết kiểu quần áo: Màu đồng nhất\\r\\nPhong cách: Phong cách Hồng Kông\\r\\nĐộ tuổi áp dụng: Thanh niên (18-25 tuổi)\"]',NULL,99,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbkz-lnk3dhxs9redf3_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbn1-lnk3dhdj3eeg16_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rblb-lnk3dfn3qyzsb3_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rblo-lnk3df3efl4g1f_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rblp-lnlmu8u6co8671_tn\"]',6243,NULL,1297,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (195,'Bộ Đồ Thời Trang Nam Nửa Tay Phù Hợp Với Áo Sơ Mi Quần Short Dạo Phố Một Bộ Phù Hợp Với Mùa Hè Mỏng Nam Bộ Đồ Hai Mảnh','[\"📣📣📣\\nGiới thiệu cửa hàng và mô tả sản phẩm và đề xuất kích thước\\n1: Thân mến, hãy yên tâm mua sắm. Tất cả các sản phẩm chúng tôi bán đều được kiểm tra chất lượng nghiêm ngặt trước khi rời khỏi nhà máy. Nhân viên kiểm tra chất lượng chuyên nghiệp sẽ tiến hành kiểm tra lần thứ hai trước khi giao hàng. Chúng tôi cố gắng đảm bảo rằng không có vấn đề về chất lượng và cung cấp Đảm bảo chất lượng cho tất cả các sản phẩm được bán tại cửa hàng này và dịch vụ sau bán hàng. Nếu bạn có bất kỳ câu hỏi nào, vui lòng liên hệ với chúng tôi\\n\\n2: Thân mến, Em bé mà bạn nhìn thấy có, bạn có thể tự tin mua nó ~\\n\\n3: Theo Dõi Cửa Hàng Để Nhận Phiếu Giảm Giá, Chúng Tôi Sẽ Sắp Xếp Hàng Cho Bạn Trong Thời Gian Sớm Nhất Có Thể Trong Vòng 24H ~\\n\\n4: Do Lý Do Ánh Sáng Và Màn Hình Khác Nhau, Có Thể Có Sự Khác Biệt Từ Hình Ảnh, Vui Lòng Tham khảo Sản Phẩm Thực Tế ~\\n\\n5: Nếu Bạn Không Chắc Chắc Nếu Bạn Có Thể Nhận Hàng Trong Thời Gian Quy Định, Vui Lòng Đặt Hàng Cẩn Thận, Hãy Trân trọng Sự Toàn vẹn của Bạn!\\n\\n6: Tập trung vào quần áo thời trang thời trang, với khả năng thiết kế riêng và sức mạnh của nhà máy, nó được khách hàng vô cùng yêu thích ~ ~!\\n\\n7: Hầu hết quần jean / áo khoác không có lỗ cài nút, không lười và chưa hoàn thành, và nhiều quần áo đại lục mới không có lỗ hở, và bạn có thể dễ dàng cắt chúng bằng kéo bằng cách gấp chúng Trong một nửa trong các lỗ nút.\\n\\n📣📣📣 Mô TẢ SẢN PHẨM\\nMàu sắc: Nhấn SKU\\n\\nKích thước: Nhấn SKU\\n\\nChất liệu: Bông + Polyester hoặc khác\\n\\nCảnh liên quan: Giải trí khác\\n\\nNhân viên liên quan: Nam và nữ trẻ\\n\\nPhong cách: Trendy\\n\\nLoại phiên bản: Tiêu chuẩn\\n\\nMẹo mua hàng:\\nNếu bạn muốn chọn kích thước, vui lòng tham khảo các gợi ý về kích thước sau. Nếu bạn không chắc mình đang mặc Size nào, bạn có thể cung cấp cho chúng tôi chiều cao và cân nặng của bạn, chúng tôi sẽ tư vấn chuyên nghiệp cho bạn.\\n\\nChiều cao (cm) 155-168cm Cân nặng (kg) 45-55kg Size: M\\n\\nChiều cao (cm) 165-175cm Cân nặng (kg) 52-63kg Size: L\\n\\nChiều cao (cm) 170-178cm Cân nặng (kg) 58-68kg Size: XL\\n\\nChiều cao (cm) 172-180cm Cân nặng (kg) 65-75kg Kích thước: 2XL\\n\\nChiều cao (cm) 180-190cm Cân nặng (kg) 70-80kg Kích thước: 3XL\"]',NULL,101,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/6fef1f969906ed68acb5056ad7e61726_tn\",\"https://down-vn.img.susercontent.com/file/007ccef2a91f732f139be3ba06c32afa_tn\",\"https://down-vn.img.susercontent.com/file/9acd8e8dd391f97c0db0a5d0f9270d9d_tn\",\"https://down-vn.img.susercontent.com/file/2421cad0ef5001f3883a16081be91875_tn\",\"https://down-vn.img.susercontent.com/file/726651ed7b491cc59935dc8391965d6d_tn\"]',4304,NULL,875,'2024-02-11 15:01:34','2024-02-11 15:01:34');
