INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (201,'Combo quần áo nam quần tây nam kèm áo sơ mi tay dài cao cấp GEN ALPHA , set âu phục GEN145','[\"Combo quần áo nam quần tây nam kèm áo sơ mi tay dài cao cấp GEN ALPHA , set âu phục GEN145\\n\\n* Kiểu dáng trẻ trung, năng động, khỏe khoắn, tự tin, thời trang Hàn Quốc \\n* Sản phẩm đẹp, đảm bảo uy tín, chất lượng hàng đầu\\n* Phù hợp mặc công sở, sự kiện, đi chơi dã ngoại\\n* Sản phẩm vải chéo cao cấp, co giản tốt, bền đẹp, thoáng mát, thấm hút tốt\\n* Đường chỉ may tinh tế, chắc chắn, bền đẹp, thời trang phố phong cách hiện đại\\n\\n\\n* i Quần CAM KẾT \\n     - Shop chỉ bán sản phẩm chất lượng, tốt nhất trong tầm giá\\n     - Đổi trả miễn phí trong 5 ngày nếu sản phẩm sai, lỗi\\n     - Sản phẩm ảnh chụp chuẩn y hình, hoàn tiền 100% nếu sai lệch \\n     - Giao hàng toàn quốc, kiểm tra hàng trước khi thanh toán\\n     - Hàng có sẵn, giao hàng ngay khi nhận được đơn\\nĐược phục vụ và mang đến những sản phẩm thời trang đẹp tốt nhất cho quý khách hàng là niềm vui vinh dự của i Quần\\n\\n* 𝐂𝐡𝐢 𝐓𝐢𝐞̂́𝐭 𝐒𝐚̉𝐧 𝐏𝐡𝐚̂̉𝐦\\n   - Tên sản phẩm: Quần Tây Nam Công Sở, Quần Âu Nam Hàn Quốc \\n   - Chất liệu: Vải Chéo Cao Cấp bền đẹp, thoáng mát, chống xù, không nhăn nhàu\\n   - Màu sắc: Đen\\n   - Size: S M L XL\\n   - Xuất xứ: Hàng Việt Nam Xuất Khẩu\\n \\n   \\n*Đ𝐨̂̉𝐢 𝐓𝐫𝐚̉ 𝐓𝐡𝐞𝐨 Đ𝐮́𝐧𝐠 𝐐𝐮𝐲 Đ𝐢̣𝐧𝐡 𝐂𝐮̉𝐚 𝐒𝐡𝐨𝐩𝐞𝐞:\\n     - Trong vòng 7 ngày kể từ khi nhận sản phẩm\\n     - Hàng hóa vẫn còn mới, chưa qua sử dụng\\n     - Hàng hóa hư hỏng do vận chuyển hoặc do sản xuất\\n     - Hàng không đúng size, kiểu dáng như quý khách đặt hàng\\n     - Không đủ số lượng, không đủ bộ như trong đơn hàng\\n\\n#quan, #quanaunam,#quannam , #quanaunam, #quanaunamhanquoc #quanaunamden, #quannam , #quanaunam, #quantay , #quantaynam #quantaycongso #quantaynamcongso #quantaynamcaocap #quanaunamcaocap #quanbaggynam #quanaunamcogian #quanaunamdep #quantaynamhanquoc #quantaynamdep #quanaunamdep\\n#quanvainam #quanvainamcaocap #quanvainamdep\"]',NULL,143,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/vn-11110105-7r98o-lp4wt2ycx2the9_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lp4ws6e3f4nv81_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lp4ws6e2zoez9d_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lp4ws6e2k86391_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lp4ws6e2k8r221_tn\"]',316,NULL,134,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (202,'Aokang nam giới bộ quần áo đơn giản phần mỏng thẳng rộng phiên bản hàn quốc màu đồng nhất quần âu ống rộng','[\"\\n\",\"\\n\",\"\\n\",\"\\n\",\"\\\"“ ” “”“ ” “”“ ” Hình ảnh chi tiết sản phẩm được hiển thị bên dưới “” ”“ ” “” ”“ ” ” ”\",\"\\n\",\"\\n\",\"\\n\",\"                                                             🎶 Chào mừng đến với AOKANG🎶\",\"\\n\",\"\\n\",\"\\n\",\"🔖 Kích thước và mô hình của sản phẩm được thể hiện trong hình. Vui lòng đọc kỹ.\",\"\\n\",\"🔖 Do đo lường thủ công, lỗi có thể là 1-2 cm\",\"\\n\",\"\\n\",\"\\n\",\"Lợi ích, xin vui lòng lưu ý. 📣📣📣\",\"\\n\",\"✨ Theo dõi cửa hàng của chúng tôi để nhận phiếu giảm giá cửa hàng. Vui lòng nhấp vào \\\"\\\" Theo dõi \\\"\\\" để thử. ✨\",\"\\n\",\"\\n\",\"\\n\",\"📫 Nếu bạn có bất kỳ câu hỏi nào về việc mua sắm, xin vui lòng liên hệ với chúng tôi. Chúng tôi sẽ cung cấp cho bạn những câu trả lời thỏa đáng nhất.\",\"\\n\",\"✔ Chúng tôi có nhiều kinh nghiệm và sản phẩm chất lượng cao. Chúng tôi sẽ cung cấp cho bạn trải nghiệm tốt nhất.\",\"\\n\",\"✔ Sản phẩm của chúng tôi là 100% mới.\",\"\\n\",\"✔ Chúng tôi theo đuổi chất lượng cao và giá cả thấp.\",\"\\n\",\"✔ Chúng tôi luôn có sản phẩm mới. Vui lòng tiếp tục theo dõi tin tức mới nhất trong cửa hàng của chúng tôi. Chúng tôi sẽ gửi cho bạn phiếu giảm giá và giảm giá.\",\"\\n\",\"\\n\",\"\\n\",\"🛒 Nếu bạn thích sản phẩm của chúng tôi, vui lòng cho chúng vào giỏ hàng và mang đi.\",\"\\n\",\"⭐ Chúng tôi mong đợi đánh giá năm sao của bạn.\",\"\\n\",\"\\n\",\"\\n\",\"❗ Do thiết bị hiển thị và ánh sáng khác nhau, hình ảnh có thể không phản ánh màu sắc trung thực của tất cả các sản phẩm. Cảm ơn bạn cho sự hiểu biết của bạn.\",\"\\n\",\"❕ Nếu bạn có bất kỳ câu hỏi nào, xin vui lòng liên hệ với chúng tôi. Chúng tôi sẽ trả lời câu hỏi của bạn càng sớm càng tốt và cố gắng hết sức để giải quyết vấn đề của bạn.\",\"\\n\",\"\\n\",\"\\n\",\"🤠 Chúng tôi mong bạn chú ý và mua sắm. 🤠\\\"\",\"\\n\",\" \"]',NULL,147,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/d9177e6f24b3c72bd1cdfec00f929637_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7qven-lkc12tukkxfr44_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7qvcq-lkahxre59s4278_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7qvfv-lkahyih5ljzt98_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7qvd5-lkahxqlag08sd7_tn\"]',1784,NULL,472,'2024-02-11 15:01:34','2024-02-11 15:01:34');
