INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (204,'Quần TÂYnam TẶNG KÈM ÁO SƠ MI NAM chất vải cao cấp ,chuẩn thiết kế hàn quốc, cực tôn dáng, lịch sự, trẻ trung.','[\"Thời trang nam Patio chuyên cung cấp quần áo, phụ kiện thời trang nam. \",\"Cam kết giá tốt nhất thị trường, chất lượng đảm bảo. \",\"Uy tín được đảm bảo qua hàng vạn đơn hàng trên khắp cả nước.\",\"Đổi trả trong vòng 7 ngày nếu hàng lỗi, sai mẫu cho quý khách.\",\"Hàng sản xuất tại Việt Nam, trên dây chuyền xuất khẩu cao cấp.\",\"----------------------------------------------------------------------------------------\",\"THÔNG TIN SẢN PHẨM\",\"- Form dáng đơn giản, không quá kén dáng người mặc là một trong những yếu tố giúp bộ trang phục này luôn hợp thời trang với phong cách hiện đại.\",\"- Bộ thời trang có màu sắc thanh lịch cùng chất liệu cao cấp là một gợi ý hoàn hảo cho các quý khách theo đuổi vẻ đẹp sang trọng, tinh tế.\",\"- Chất liệu vải co giãn nhẹ giúp thoải mái trong mọi hoạt động, vải mềm mịn, không nhăn, không bai màu, ít xù lông, ít bám bụi, giữ dáng không bai.\",\"- Thiết kế thời trang, đơn giản nhưng luôn tạo được ấn tượng đặc biệt đối với người nhìn.\",\"- Chất liệu vải may đẹp, chắc chắn, đường may tỉ mỉ, hiện đại.\",\"- Xuất xứ Chính Hãng, được sản xuất tại nhà máy và phân phối trực tiếp đến tay người tiêu dùng => Cam kết giá thành và chất lượng sản phẩm luôn tốt thị trường\",\" - Hỗ trợ tư vấn ~ Đổi trả sản phẩm khi gặp lỗi\",\"- Bộ phận chăm sóc khách hàng 24/7\",\"* SHOP CAM KẾT: \",\"- Shop không bán hàng giả, hàng nhái, chất lượng luôn là hàng đầu để shop có thể phát triển thương hiệu và vươn xa. \",\"- Quần âu nam đen ống côn 100% giống mô tả\",\"- Tư vấn nhiệt tình, chu đáo luôn lắng nghe khách hàng để phục vụ tốt. \",\"- Giao hàng nhanh đúng tiến độ không phải để quý khách chờ đợi lâu để nhận hàng. \",\"-------------------------------\",\"#QUẦN#TÂY#NAM#quannam#quantay#quanaunam#quantaynam#quanau#quanaunamhanquoc#quanaunamke#quanaunamkecaro#kecaro#quan\"]',NULL,64,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/fa678e8730d1573d93f77d9de9b6e0e0_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-lk63ihzydjn8be_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-lk63ihzyc52sd2_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-lk63ihzz71kkaa_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-lk63ihzyrl6q09_tn\"]',3910,NULL,1815,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (205,'Áo sơ mi nam dài tay PEALO chất cotton cao cấp mới dáng xuông sang trọng thanh lịch','[\"Áo sơ mi nam dài tay PEALO 100% cotton form mới dáng xuông hàng cao cấp\\nThông tin sản phẩm:\\n- Sản phẩm: Áo sơ mi nam dài tay\\n- Chất liệu:cotton\\n- Màu sắc:be, trắng, xanh\\n- Họa tiết : trơn basic\\n\\nSố đo: \\nSize 2XL :Dài 76, rộng ngực 118\\nSize XL :Dài 75, rộng ngực 115\\nSize L :Dài 74, rộng ngực 112\\nSize M: Dài 73 , rộng ngực 109\\n--------------------------------\\nHướng dẫn bảo quản:\\n- Nên giặt bằng tay lần đầu để trang phục có độ bền cao\\n- Khi giặt thì giặt với các sp cùng màu để giữ độ bền màu tốt nhất\\n- Giặt với nhiệt độ tối đa 30 độ C\\n- Sấy ở nhiệt độ thường\\n- Là ủi ở nhiệt độ thấp\\n\\n* Quyền lợi và điều kiện đổi trả\\n- hính sách đổi trả hàng miễn phí khi sản phẩm kém chất lượng, không giống hình, nhầm size, số lượng mà quý khách đã đặt.\\n- Sản phẩm chỉ được đổi/ trả khi còn nguyên tem mác.\\n- Sản phẩm bị lỗi khi vận chuyển \\n\\n* Pealo cam kết\\n- Sản phẩm giống như mô tả và hình ảnh\\n- Tư vấn hỗ trợ khách hàng nhiệt tình, chu đáo\\n- Thời gian chuẩn bị hàng tối ưu nhất\\n- Đổi trả hàng theo đúng quy định của Shopee\\n* Nếu đơn hàng có vấn đề xin quý khách liên hệ shop trước để có được sự phục vụ tốt nhất\\n\\n#somitaydai #sominam #aosomi #sominam #somidep #somioxford  #sominamtaydai #sominamdep #somigiare #aosomitaydainam  #so #mi #tay #dai  #nam #freeship #dep #ao #somicaocap #somi #caocap #somisoc #soc #nam #thoitrang #aonam\"]',NULL,143,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-llbmt794wddi9c_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134201-7qukw-lepbv913bgs225_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134201-23030-0tniwoi6lzov4a_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134201-7qukw-lepbw8bvnu7n4c_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-llbmt7950l2u5b_tn\"]',5868,NULL,1022,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (206,'Áo sơ mi nam FEAER DENIM tay dài chất lụa nhung gân VELVET FABRIC màu đen','[\"🔰  Thông tin chi tiết Áo sơ mi nam FEAER\",\"- Hàng Full tag, mác cực sang chảnh (xem video trên ảnh sản phẩm). \",\"- Chất liệu: Vải Nhung gân  mềm mịn, siêu mát, thấm hút mồ hôi nhanh, sử dụng loại vải này còn mang lại cảm giác vô cùng ấm áp vào mùa đông mà vẫn mát mẻ vào mùa hè\",\"- Đường may tỉ mỉ, chắc chắn\",\"- Họa tiết trơn. Khách hàng phối với Jeans, Kaki, Short đều được. Mặc dạo phố, du lịch hay đến các buổi tiệc đều mang đến sự thoải mái, tự tin đẳng cấp dành cho khách hàng.\",\"- Màu: ĐEN\",\"- GIÁ SẢN PHẨM CHƯA BAO GỒM ÁO THUN BÊN TRONG\",\"\\n\",\"\\n\",\"⏩  Cách chọn size: Shop có bảng size mẫu. Bạn NÊN INBOX, cung cấp chiều cao, cân nặng để SHOP TƯ VẤN SIZE.\",\"⏩ Shop luôn sẵn sàng trả lời inbox để tư vấn.\",\"⏩Bảng size mẫu Feaer:\",\"Size M: Nặng 55-64kg ; Cao 1m60-1m74\",\"Size L: Nặng 65-74kg ; Cao 1m75-1m79\",\"Size XL: Nặng 75-84kg ; Cao 1m80-1m83\",\"Size XXL: Nặng 85-94kg ; Cao 1m83-1m87\",\"Lưu ý: Đây là bảng thông số chọn size cơ bản, tùy thuộc và vào mỗi người mà có thể +/- 1 Size\",\"\\n\",\"Hướng dẫn sử dụng sản phẩm Áo sơ mi nam FEAER\",\"- Giặt ở nhiệt độ bình thường, với đồ có màu tương tự.\",\"- Không được dùng hóa chất tẩy.\",\"- Hạn chế sử dụng máy sấy và ủi (nếu có) thì ở nhiệt độ thích hợp.\",\"\\n\",\"🔰 Là khách của FEAER, bạn sẽ được:\",\"Sản phẩm Áo sơ mi tay dài FEAER 100% giống mô tả. Hình ảnh sản phẩm là ảnh thật do shop tự chụp và giữ bản quyền hình ảnh.\",\"Đảm bảo vải chất lượng 100%\",\"Áo được kiểm tra kĩ càng, cẩn thận và tư vấn nhiệt tình trước khi gói hàng giao cho Quý Khách\",\"Hàng có sẵn, giao hàng ngay khi nhận được đơn \",\"Hoàn tiền nếu sản phẩm không giống với mô tả\",\"Chấp nhận đổi hàng khi size không vừa\",\"Giao hàng trên toàn quốc, nhận hàng trả tiền \",\"Hỗ trợ đổi trả theo quy định của Shopee \",\"\\n\",\"📣  CHÍNH SÁCH FEAER DENIM\",\"1. Điều kiện áp dụng (trong vòng 07 ngày kể từ khi nhận sản phẩm) \",\"- Hàng hoá vẫn còn mới, chưa qua sử dụng \",\"- Hàng hoá bị lỗi hoặc hư hỏng do vận chuyển hoặc do nhà sản xuất \",\"2. Trường hợp được chấp nhận: \",\"- Hàng không đúng size, kiểu dáng như quý khách đặt hàng \",\"- Không đủ số lượng, không đủ bộ như trong đơn hàng \",\"3. Trường hợp không đủ điều kiện áp dụng chính sách: \",\"- Quá 07 ngày kể từ khi Quý khách nhận hàng \",\"- Gửi lại hàng không đúng mẫu mã, không phải sản phẩm của FEAER\",\"- Không thích, không hợp, đặt nhầm mã, nhầm màu,... \",\"Do màn hình và điều kiện ánh sáng khác nhau, màu sắc thực tế của sản phẩm có thể chênh lệch khoảng 3-5%\",\"\\n\",\"#feaer #aosomi #sominam #aosominam #aonam #somifeaer #somi #somidep #somigiare #aosomidep #shirt #aosomitayngan #somitayngan #sominamtayngan #aosominamtayngan #ao #so #mi\"]',NULL,111,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/daa8524846bbb80409f6422f0fb8b684_tn\",\"https://down-vn.img.susercontent.com/file/c4284ba4c5b40c17c8939fd4a5ecc27e_tn\",\"https://down-vn.img.susercontent.com/file/bd8a5b4db00436f51df35d25f9b763f9_tn\",\"https://down-vn.img.susercontent.com/file/7c2abf00a0063c2d5b5d5804f17b9868_tn\",\"https://down-vn.img.susercontent.com/file/735b4efce8b625747330b2edd72c3790_tn\"]',9819,NULL,2854,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (207,'Áo sơ mi nam kiểu dáng basic TOPMEN khoác ngoài chất vải kaki cao cấp trẻ trung năng động phù hợp cả mặc đi làm, đi chơi','[\"Áo sơ mi nam kiểu dáng basic TOPMEN khoác ngoài chất vải kaki cao cấp trẻ trung năng động phù hợp cả mặc đi làm, đi chơi\\n\\n⭐ Chất Liệu: Chất kaki xuất hàn xịn dày dặn\\n⭐ Màu sắc: Đen – Be - Trắng - Cam - Xám\\n⭐ Đặc Tính:  \\n- Chất vải áo là chất kaki cao cấp dày dặn, dễ phối hợp đồ, dành cho nam nhưng nữ mặc đều hợp. \\n- Áo có thể phối với áo thun bên trong, với quần jeans hoặc quần dài để đi chơi \\n- Áo sơ mi kaki cũng có thể mặc với quần âu phù hợp cho đi làm hoặc đi dự tiệc \\n\\nBảng size bên shop các bạn tham khảo ạ:\\nSize M: Dành cho người nặng từ  42kg - 50kg 1m55-1m60\\nSize L : Dành cho người nặng từ  51kg - 58kg 1m60-1m65\\nSize XL: Dành cho người nặng từ  59kg  - 67kg 1m65-1m70\\nSize 2XL: Dành cho người nặng từ  68kg  - 75kg 1m70-1m75\\nSize 3XL: Dành cho người nặng từ  76kg  - 85kg 1m75-1m80\\n\\n👉 Bảng size mang tính chất tham khảo bạn có thể lấy size to hơn hoặc nhỏ theo yêu cầu của bạn!\\nMàu sắc: Đen – Be - Trắng - Cam - Xám\\nLưu ý: Các bạn hãy nhắn tin cho shop để tư vấn size chính xác\\n\\n\\n   SHOP CAM KẾT\\n- Sản phẩm Áo sơ mi kaki basic giống mô tả 100%\\n- Hình ảnh sản phẩm là ảnh thật, các hình hoàn toàn do shop tự thiết kế.\\n- Kiểm tra  cẩn thận trước khi gói hàng giao cho Quý Khách\\n- Hàng có sẵn, giao hàng ngay khi nhận được đơn \\n- Hoàn tiền nếu sản phẩm không giống với mô tả\\n- Chấp nhận đổi hàng khi size không vừa trong 3 ngày.\\n\\n   HỖ TRỢ ĐỔI TRẢ THEO QUY ĐỊNH CỦA SHOPEE\\n- Điều kiện áp dụng (trong vòng 2 ngày kể từ khi nhận sản phẩm) \\n- Hàng hoá bị rách, in lỗi, bung chỉ, và các lỗi do vận chuyển hoặc do nhà sản xuất.\\n1. Trường hợp được chấp nhận: \\n- Hàng giao sai size khách đã đặt hàng \\n- Giao thiếu hàng \\n2. Trường hợp không đủ điều kiện áp dụng chính sách: \\n- Quá 2 ngày kể từ khi Quý khách nhận hàng \\n- Gửi lại hàng không đúng mẫu mã, không phải sản phẩm của shop\\n- Không thích, không hợp, đặt nhầm mã, nhầm màu,... \\n\\n#aosominam #aosomi #somi #somikaki #somibasic #somitheu #somitron #sominam #unisex #formrong #ao #so #mi #kaki #aosomikaki #aokhoacngoainam #aonamkhoacngoaibasic #aonamkhoacngoaikaki #aonamkhoacngoaikakibasic #aosomikhoacngoainam #aokhoacngoainamsomibasic #aosomikhoacngoainamkakibaisc #aosomikhoacngoainamkakiinthue\"]',NULL,66,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/sg-11134201-23010-3eds9jmvivlv8d_tn\",\"https://down-vn.img.susercontent.com/file/9c1455e5e54509c8968f796056998265_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-23010-wh7djogvivlv6c_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-23010-uc3sy3gvivlvbb_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-23010-j0cd4ogvivlvd5_tn\"]',7388,NULL,3383,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (208,'Quần Tây + Áo Sơ Mi Học sinh- Văn phòng - phong cách','[\"Combo quần tây áo sơmi\\nSIZE 28 ( Áo M) : từ 45kg -50Kg\\n SIZE 29 (Áo L)  :từ 50kg  -55Kg \\nSIZE 30 (Áo XL) từ 56kg -59Kg \\nSIZE 31 (Áo XXL) từ 60kg -66kg \\nSIZE 32 ( Áo XXL) từ 66kg - 69kg\\nSize 33 ( áo 3xl) dưới 75kg\\nSize 34 ( áo 3xl) dưới 80kg\\n\\nThông tin chi tiết sản phẩm: Áo sơ mi nam cổ bẻ dài tay\\n--Chất vải sờ mịn không bai, không nhăn, không xù.\\n--Mếch cổ và tay làm bằng chất liệu cao cấp, không sợ bong tróc.\\n--Fom Body cực chuẩn, ôm trọn bờ vai mặc cực trẻ trung và phong cách, phù hợp mọi hoàn cảnh kể cả đi chơi và đi làm.\\n--Sản phẩm có các size như sau:\\nQuần âu nam \\n- quần tây nam ( quần vải nam ) phong cách Hàn Quốc. \\nQuần âu nam  được thiết kế theo phong cách Hàn Quốc, dáng trẻ trung với form ống côn rất chuẩn như hình. quần âu nam, quần tây nam của công ty chúng tôi may bằng chất liệu vải lụa thái cao cấp số 1 trên thị trường Việt Nam và khu vực\\n Chất liệu vải lụa thái cao cấp co dãn nhẹ rất mềm và không xù, không nhăn, không phai màu, đem lại sự thoải mái khi mặc!\\n Quần âu có các màu sau : đen, xanh than đậm, xanh nhạt, xám, ghi sáng Khách đặt hàng vui lòng để lại lưu ý về số size và màu bạn chọn \\nQuần form hơi ôm nên các bạn đặt hàng nên xem kỹ thông số size để chọn cho mình size phù hợp tránh trường hợp mặc không vừa ạ\\n Quần có thể nới ra hoặc bóp vào tùy ý ạ nếu bạn mặc chật có thể nới ra dc tầm 2m và mặc rộng thì có thể bóp vào được nha các bạn\"]',NULL,69,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/4dbeb535f564eb2053a6d835f3ada93d_tn\",\"https://down-vn.img.susercontent.com/file/d8d52920415d6a35989bfca01f824394_tn\",\"https://down-vn.img.susercontent.com/file/ac1ca6f81cc56dd0a7386ef1098080cb_tn\",\"https://down-vn.img.susercontent.com/file/c9ecf6db18c8ee13f79de71df640efc8_tn\"]',6910,NULL,962,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (209,'Áo Sơ Mi Nam Ngắn Tay Set Áo Khoác Vest + Quần Short Dáng Rộng Thời Trang Mùa Hè Cho Nam','[\"😊😊😊\",\"Chúng tôi có kinh nghiệm phong phú và sản phẩm chất lượng tốt.\",\"Cung cấp cho bạn trải nghiệm mua sắm tốt nhất\",\"Sản phẩm của chúng tôi là thương hiệu mới 100%.\",\"Chúng tôi chú ý đến chất lượng và giá cả!\",\"Nếu bạn thích sản phẩm của chúng tôi, vui lòng đặt giỏ hàng vào giỏ hàng và giúp anh ấy nhấp vào👍👍👍 💖💖💖\",\"Cửa hàng này cung cấp dịch vụ khách hàng trực tuyến, vì vậy nếu vấn đề do cửa hàng gây ra, vui lòng yên tâm trả lời câu hỏi của bạn, giải thích rằng sản phẩm bị lỗi, bạn có thể tìm thấy cửa hàng của chúng tôi thông qua trò chuyện, cửa hàng bị lỗi Sẵn sàng chịu trách nhiệm.\",\"💕💕 Nếu Không Có Vấn Đề Với Bất Kỳ khía cạnh nào của Sản Phẩm, Đó là Bình thường, Đừng quên Đưa Cho Cửa Hàng Của Chúng Tôi Đánh giá Và Đánh giá, Mong Được Đánh giá Năm Sao Của Bạn. ⭐⭐⭐⭐⭐⭐⭐⭐\",\"Mọi điểm đều có giá trị đối với cửa hàng của chúng tôi, cảm ơn bạn đã lên ngón tay cái. 💕💕💕\",\"Chúng tôi luôn có những sản phẩm mới, bắt kịp những tin tức mới nhất từ cửa hàng của chúng tôi, chúng tôi sẽ gửi cho bạn phiếu giảm giá và giảm giá.\",\"\\n\",\"\\t    Danh mục Amoy: Thanh niên nổi tiếng (18-24 tuổi)\",\"\\n\",\"\\t    Placket: Một hàng với hai nút\",\"\\n\",\"\\t    Phạm vi lỗi: Không có lỗi\",\"\\n\",\"\\t    Tên vải: Bánh quế\",\"\\n\",\"\\t    Thành phần vải chính: Sợi axetat\",\"\\n\",\"\\t    Nội dung của thành phần vải chính: 100\",\"\\n\",\"\\t    Cảnh áp dụng: Hàng ngày\",\"\\n\",\"\\t    Loại cổ áo: Cổ áo ve áo\",\"\\n\",\"\\t    Phương pháp khe: Không có khe\",\"\\n\",\"\\t    Phiên bản phiên bản: Loose\",\"\\n\",\"\\t    Độ dày: Thường xuyên\",\"\\n\",\"\\t    Chi tiết phong cách: Topstitching\",\"\\n\",\"\\t    Màu sắc: đen, trắng\",\"\\n\",\"\\t    Kích thước: M, L, XL, XXL\",\"\\n\",\"\\t    Phong cách: Kinh doanh nhẹ nhàng\",\"\\n\",\"\\t    Công nghệ quần áo: Quy trình lót bán lót\"]',NULL,136,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/sg-11134201-7qvf2-ljf17spv70w925_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7qve7-ljf17srj4l833c_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7qve6-ljf14n0pkumea9_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7qvco-ljf17su10x6f64_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7qvf4-ljf17sl5jjls6b_tn\"]',9596,NULL,1323,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (211,'Áo sơ mi nam nữ tay dài họa tiết from rộng vải lụa cao cấp UNICI ASM50','[\"Áo sơ mi nam nữ tay dài họa tiết from rộng vải lụa cao cấp UNICI ASM50\",\"\\n\",\"Áo sơ mi tay dài nam nữ là mẫu thời trang không thể thiếu trong tủ quần áo tất cả mọi người. Những chiếc áo sơ mi tay dài dáng rộng luôn toát lên phong cách lịch sự, trang trọng rất phù hợp với quý ông làm việc ở văn phòng, công sở. Đặc biệt áo sơ mi tay dài form rộng còn xuất hiện trong những sự kiện sang trọng như là gặp đối tác, khách hàng,... Chính vì thế, các bạn nam nữ đều nên có ít nhất 2 chiếc áo sơ mi tay dài để biến hóa phong cách cho phù hợp. Đến với UNICI bạn hoàn toàn có thể mua áo sơ mi nam nữ đẹp, ưng ý với mẫu mã được cập nhật thường xuyên. Cùng tham khảo nhé!\",\"Bí quyết chọn mua áo sơ mi tay dài họa tiết phong cách hàn quốc đẹp\",\"\\n\",\"Chất liệu\",\"Là yếu tố quan trọng để chọn mua áo sơ mi  tay dài đó chính là chất liệu áo. Chất liệu áo sơ mi  tay dài nam nữ tốt sẽ mang lại sự thoải mái, dễ chịu khi mặc. Bên cạnh đó còn giữ được một phom dáng ổn định. Hãy chọn mua những chiếc áo sơ mi  tay dài nam nữ có chất liệu vải tốt, thấm hút mồ hôi hiệu quả, đem lại cho bạn sự thoải mái khi mặc.\",\"\\n\",\"Kiểu dáng\",\"Áo sơ mi nam nữ  tay dài họa tiết thường có hai kiểu áo chính là áo sơ mi ôm và không ôm. Những kiểu áo không ôm thường có phong cách trẻ trung hơn, thích hợp với những bạn trẻ năng động.\",\"\\n\",\"Kích thước\",\"Tốt nhất bạn nên chọn những kiểu áo sơ mi phù hợp với vóc dáng của mình. Các sản phẩm sẽ đẹp hơn khi bạn mặc rộng ra một chút. Bởi vì áo sơ mi thường co giãn ít khi mặc rộng ra sẽ giúp bạn có cảm giác thoải mái hơn trong các hoạt động sinh hoạt thường ngày.\",\"\\n\",\"Cách chọn size: Shop có bảng size mẫu. Bạn NÊN INBOX, cung cấp chiều cao, cân nặng để SHOP TƯ VẤN SIZE.\",\"🌈 Bảng size áo sơ mi nam nữ tay ngắn họa tiết dáng rộng vải lụa cao cấp UNICI ASM50\",\" + Size S: <50kg, Cao 1m50 - 1m65\",\"+ Size M: từ 51 - 58kg, Cao 1m65 - 1m70\",\"+ Size L: từ 58 - 65kg , Cao 1m70 - 1m75\",\"+ Size XL: từ 65 - 75 kg, Cao : 1m70 - 1m80\",\"+ Size 2XL: từ 75 - 80 kg, Cao : 1m8 - 1m85\",\"\\n\",\"Lưu ý: Đây là bảng thông số chọn size cơ bản, tùy thuộc và vào mỗi người mà có thể +/- 1 Size\",\"\\n\",\"* Chính sách và điều kiện đổi trả của UNICI :\",\"\\n\",\"+ Cam kết chất lượng và mẫu mã sản phẩm giống với hình ảnh.\",\"\\n\",\"+ Cam kết được đổi trả hàng trong vòng 7 ngày.\",\"\\n\",\"+ Hàng phải còn mới và chưa qua sử dụng\",\"\\n\",\"+ Sản phẩm bị lỗi do vận chuyển và do nhà sản xuất\",\"\\n\",\"📌 LƯU Ý: \",\"+ Bạn hãy quay lại video mở hàng để dễ dàng khi đổi trả nhé\",\"+ Khi quý khách có gặp bất kì vấn đề gì về sản phẩm và vận chuyển đừng vội đánh giá mà hãy liên hệ Shop để đc hỗ trợ 1 cách tốt nhất nhé.\",\"\\n\",\"#aosomi#aosominam#aosominu#somi#sominam#sominu#sominamtaydai#aosominutaydai#somitrang#aosomicaocap#aosomidep#aosominamdaitay#aosomitrang#aosomiden#somicobe#aosominamcobe#unici#aodaitay\",\"aominamfromrong#aosomihanquoc#aosomigiare#aosomitaydai#aosominamcongso\",\"#sominamgiare#sominamhanquoc#quanau#quanaunam#aosominamtron#aosominamnutaydaihoatiet\"]',NULL,110,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/86726ca8b7f5a4e65355969c63faf024_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-lfi3iix59ymc30_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134201-23030-489l6mfunwov29_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-lff936a30tj8a6_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-lff936a3283o64_tn\"]',8815,NULL,446,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (212,'Áo sơ mi nam nữ tay dài giấu khuy form rộng vải lụa cao cấp UNICI ASM41 phong cách Hàn Quốc','[\"Áo sơ mi nam nữ tay dài giấu khuy form rộng vải lụa cao cấp UNICI ASM41 phong cách Hàn Quốc\",\"hàng fullbox cực sang chảnh, Chất lượng cao, thiết kế sang trọng (xem video chi tiết trên sản phẩm)\",\"Về chất liệu: Áo sơ mi này được làm từ vải lụa thái cao cấp, vải dày, mềm mịn thấm hút mồ hôi tốt, không phai màu,không nhăn, không xù.\",\"Độ hoàn thiện của áo sơ mi nam nữ tay dài giấu khuy form rộng: đường may tinh tế, tỉ mỉ, ít chỉ thừa ...\",\"Thiết kế giấu khuy form rộng hiện đại, trẻ trung lên áo sơ mi nam nữ tay dài rất dễ kết hợp các trang phục khác nhau: quần jean, quần âu, giày tây, giầy thể thao.\",\"Dù là đi học, đi làm, đi chơi hay dự tiệc thì mặc chiếc áo sơ mi tay dài giấu khuy này đều đẹp, trẻ trung và sang trọng nó luôn thu hút mọi ánh nhìn đến bạn.\",\"\\n\",\"Hướng dẫn chọn size áo sơ mi nam nữ:\",\"Size M từ 48-55kg, dưới 1m65\",\"Size L từ 55- 65kg,  từ 1m65 - 1m72\",\"Size XL từ 65-72kg, từ 1m72 - 1m78\",\"Size XXL từ 72-80kg, từ 1m78- 1m85\",\"Bụng to thì tăng thêm 1 size nhé\",\"Lưu ý: thông số các số đo có thể bị chênh lệch 1-2cm\",\"\\n\",\"Cam kết:\",\"Sản phẩm 100% giống mô tả. Kiểu dáng hoàn toàn giống ảnh mẫu\",\"Đảm bảo vải lụa Thái chất lượng 100% cao cấp\",\"Áo được kiểm tra kĩ càng, cẩn thận và tư vấn nhiệt tình trước khi gói hàng giao cho Quý Khách\",\"Hàng có sẵn, giao hàng ngay khi nhận được đơn \",\"Hoàn tiền nếu sản phẩm không giống với mô tả\",\"Chấp nhận đổi hàng khi size không vừa\",\"Giao hàng trên toàn quốc, nhận hàng trả tiền \",\"Hỗ trợ đổi trả theo quy định của Shopee\",\"\\n\",\"Chính sách đổi trả:\",\"1. Điều kiện áp dụng (trong vòng 07 ngày kể từ khi nhận sản phẩm) \",\"- Hàng hoá vẫn còn mới, chưa qua sử dụng \",\"- Hàng hoá bị lỗi hoặc hư hỏng do vận chuyển hoặc do nhà sản xuất \",\"2. Trường hợp được chấp nhận: \",\"- Hàng không đúng size, kiểu dáng như quý khách đặt hàng \",\"- Không đủ số lượng, không đủ bộ như trong đơn hàng \",\"3. Trường hợp không đủ điều kiện áp dụng chính sách: \",\"- Quá 07 ngày kể từ khi Quý khách nhận hàng \",\"- Gửi lại hàng không đúng mẫu mã, không phải sản phẩm của Shop\",\"- Không thích, không hợp, đặt nhầm mã, nhầm màu,... \",\"Do màn hình và điều kiện ánh sáng khác nhau, màu sắc thực tế của sản phẩm có thể chênh lệch khoảng 3-5%\",\"\\n\",\"Hướng dẫn cách đặt hàng\",\" Nếu bạn mua 2 sản phẩm khác nhau hoặc 2 size khác nhau :\",\" - bạn chọn từng sản phẩm và thêm vào giỏ hàng\",\" - khi giỏ hàng có đầy đủ các sản phẩm cần mua, bạn mới tiến hành ấn nút \\\" Thanh toán \\\"\",\" Tên nhà sản xuất: Xưởng may Anh Châu\",\" Địa chỉ: Hồ My Thượng, Thôn My Thượng, Xã Thanh Mai, Huyện Thanh Oai, Hà Nội\",\"\\n\",\"#aosomi#aosominam#aosominu#somi#sominam#sominu#sominamtaydai#aosominutaydai#somitrang#aosomicaocap#aosomidep#aosominamdaitay#aosomitrang#aosomiden#somicobe#aosominamcobe#unici#aodaitay\",\"aominamfromrong#aosomihanquoc#aosomigiare#aosomitaydai#aosominamcongso\",\"#sominamgiare#sominamhanquoc#quanau#quanaunam#aosominamtron\"]',NULL,159,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/70758d437275564e3046c3843ceb0ce5_tn\",\"https://down-vn.img.susercontent.com/file/affc8543092e23ab0fb02b68db48be3e_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lrd1s6pawres9c_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-lgz99comt7g3c8_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134201-23030-f2jbvsgmmvovc5_tn\"]',9810,NULL,2908,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (213,'Set bộ kaki áo sơ mi quần short màu nâu unisex nam nữ cao cấp local brand thêu logo teeholic','[\"Set bộ kaki áo sơ mi quần short màu nâu unisex nam nữ cao cấp local brand thêu logo teeholic\",\"_______________ \",\"Chất Liệu: \",\"-\\tKaki thun, dày dặn, co giãn nhẹ\",\"-\\tVải dày dặn đứng form, không xù, không nhão\",\"-   Hình thêu tỉ mỉ\",\"-\\tCổ áo có line chống giãn\",\"-\\tHình ảnh sản phẩm là ảnh thật TEEHOLIC chụp, sản phẩm thực tế có thể chệnh lệch khoảng 5% do điều kiện ánh sáng\",\"Size Chart: \",\"-\\tSize M (cân nặng <55kg tuỳ chiều cao và sở thích mặc rộng)\",\"-\\tSize L (cân nặng <70kg tuỳ chiều cao và sở thích mặc rộng)\",\"-\\tSize XL (cân nặng <90kg tuỳ chiều cao và sở thích mặc rộng)\",\"\\n\",\"Mặc vừa người chọn đúng size, mặc form rộng chọn lớn hơn 1 size. \",\"Nếu khó chọn size hãy inbox để TEEHOLIC tư vấn cho bạn nhé\",\"Sản phẩm thực tế có thể sai lệch thủ công 0.1-1cm\",\"Hướng dẫn giặt ủi & bảo quản sản phẩm: \",\"-\\tLộn mặt trái áo khi giặt và ủi, không ủi trực tiếp lên hình in\",\"-\\tSản phẩm có thể giặt tay hoặc máy ở nhiệt độ thường, giặt chung với đồ có màu vải tương tự tránh gây nhiễm màu\",\"-\\tPhơi ngay sau khi giặt, giũ nhẹ để áo mau khô và không nhăn\",\"-\\tKhông dùng chất tẩy và phơi dưới nắng gắt để giữ độ bền của vải và tăng thời gian sử dụng của sản phẩm\",\"Chính sách đổi hàng: \",\"-\\tHàng đã thanh toán xin vui lòng không trả lại, ngoại từ sản phẩm lỗi từ khâu sản xuất\",\"-\\tCó thể đổi size trong vòng 03 ngày kể từ khi khách hàng nhận được sản phẩm. Phí ship đổi size khách hàng vui lòng thanh toán\",\"-\\tSản phẩm còn mới, chưa qua sử dụng và giặt sấy (full tag, không có mùi lạ)\",\"-\\tSản phẩm shop gửi không đúng size hoặc không đúng mẫu khách đặt shop chịu hoàn toàn phí ship\",\"-\\tShop xin phép không giải quyết đổi trả các trường hợp: thời gian phản hồi cho shop quá 03 ngày kể từ khi nhận hàng; hàng gửi lại không đúng mẫu, không đủ số lượng sản phẩm đã đặt hàng; khách hàng đặt về không thích, không hợp\",\" \",\"TEEHOLIC cảm ơn bạn đã quan tâm đến sản phẩm và nếu phân vân về sản phẩm và size thì đừng ngại inbox cho shop chiều cao và cân nặng, sẽ tư vấn size phù hợp với bạn nhé!\",\"\\n\",\"#teeholic #teeholicsaigon #ths #polo #unisex #setpolo #setsomi #somi #quan\",\"\\n\"]',NULL,168,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lnjfoty88yy5fa_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-lk5775zuymte93_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-lk5775zux88y5b_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-lk5775zuvtoi5b_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-lk5775zurlz6ad_tn\"]',3125,NULL,1070,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (214,'sơ mi nam cách điệu kiểu cổ V - vải lụa trơn không nhăn cao cấp form suông rộng , công sở phong cách Hàn Quốc','[\"💎💎 𝗛𝗧 - Đ𝗼̂̀ 𝗡𝗮𝗺 𝗰𝗮𝗼 𝗰𝗮̂́𝗽 - 𝐂𝐚𝐦 𝐊𝐞̂́𝐭 𝐂𝐡𝐚̂́𝐭 𝐋𝐮̛𝐨̛̣𝐧𝐠 - 𝐔𝐲 𝐓𝐢́𝐧 𝐆𝐢𝐚́ 𝐓𝐨̂́𝐭 𝐍𝐡𝐚̂́𝐭 - 𝐁𝐚́𝐧 𝐇𝐚̀𝐧𝐠 Đ𝐮́𝐧𝐠 𝐌𝐚̂̃𝐮!\",\"\\n\",\"Shop Xin Thông Báo Đến Quý Khách Hàng Lịch Làm Việc Xuyên Tết - Quý Khách cần Hỗ Trợ LH Ngay : O3.755.8.99.3\",\"\\n\",\"Phát Sinh : Đơn Hà Nội Shop vẫn nhận đơn hỏa tốc đến hết ngày 29 Tết\",\"                  Đơn Tỉnh Bắc , Trung Nam :\",\"- Shop Nhận Đơn cuối cùng ngày 4/2 ( tức tối ngày 25 tết ) thì sẽ được vận chuyển và nhận trong tết ( Trường Hợp Khách ở xa đơn vị vận chuyển sẽ không giao kịp , mong quý khách thông cảm qua tết nhận giúp shop )\",\"\\n\",\"- Đơn hàng Từ Ngày 5/2 ( Tức Ngày 26 tết ) đến ngày 14/2 ( Tức mùng 5 tết ) sẽ được nhận được hàng vào mùng 6 , mùng 7 , mùng 8\",\"Xin Kính chúc quý Khách Hàng 1 năm mới vạn sự như ý . \",\"\\n\",\"👉 sơ mi nam cách điệu kiểu cổ V  - vải lụa trơn không nhăn cao cấp form suông rộng , công sở phong cách Hàn Quốc\",\"\\n\",\"❌ Thông Tin Chi Tiết : sơ mi nam cách điệu kiểu cổ V  - vải lụa trơn không nhăn cao cấp form suông rộng , công sở phong cách Hàn Quốc\",\"\\n\",\"- Chất liệu : Hình thêu trực tiếp lên tay và cổ áo ,  Vải lụa trơn co giãn nhẹ , đặc biệt  không nhăn, không xù , tiêu chuẩn đường may kĩ. \",\"- Kiểu dáng : Form ôm slim thiết kế ôm vừa tinh tế , mới nhất hiện nay.\",\"- Phù hợp mọi lứa tuổi : Đi làm , đi chơi , café giao lưu phong cách trẻ trung , lịch sự.\",\"- Mong muốn mang đến cho quý khách chất lượng sản phẩm tốt , giá thành hợp lý.\",\"\\n\",\"❌ HƯỚNG DẪN CHỌN SIZE : sơ mi nam cách điệu kiểu cổ V  - vải lụa trơn không nhăn cao cấp form suông rộng , công sở phong cách Hàn Quốc\",\"\\n\",\"Size Áo phụ thuộc vào chiều cao cân nặng và các yếu tố khác như bắt tay, vai rộng , vòng bụng có thể chênh lệch 1 , 2cm ... Do đó quý khách còn phân vân xin vui lòng nhắn tin trực tiếp để được hỗ trợ tốt nhất . \",\"\\n\",\"- Size M    :  Cân nặng  45 - 55 kg    Chiều cao >1m68 \",\"- Size L     :  Cân nặng  55 - 63 kg    Chiều cao >1m72 \",\"- Size XL   :  Cân nặng  64 - 69 kg    Chiều cao >1m78 \",\"- Size 2XL :  Cân nặng  70 - 74kg     Chiều cao >1m83 \",\"- Size 3XL :  Cân nặng  74 - 80kg     Chiều cao >1m85 \",\"- Size 4XL :  Cân nặng  80 - 85kg     Chiều cao >1m85 \",\"- Size 5XL :  Cân nặng  85 - 90kg     Chiều cao >1m85 \",\"\\n\",\"❌ HƯỚNG DẪN CÁCH ĐẶT HÀNG \",\"- Bạn chọn size phù hợp + màu sắc muốn mua theo bảng size như trên ảnh . Rồi thêm vào giỏi hàng . ( ưu đãi khi mua 2sản phẩm sẽ được freeship ) Tiếp đến khi giỏ hàng đã có đầy đủ số lượng các sản phẩm cần mua , bạn mới tiến hành ấn nút “ Thanh toán” AE thắc mắc , cần hỗ trợ nhắn tin ngay cho Shop Luôn Hỗ trợ nhiệt tình và tư vấn hết mình cho AE 24/7.\",\"#sominam# #aosominam# #sominam# #sominamgiare# #sominamhanquoc# #aosomi# #somi# #quanau# #quanaunam #aosominamdaitay #aosomitrangnam #aosominamtrang #aosominamtron\",\"#sominam# #aosominam# #sominam# #sominamgiare# #sominamhanquoc# #aosomi# #somi#somi #sominam #somidep #tshirt #vest\"]',NULL,140,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/58d9c7d7db67548dc6159e0934de465f_tn\",\"https://down-vn.img.susercontent.com/file/e556c83259a35d93ddea18d49a280ea4_tn\",\"https://down-vn.img.susercontent.com/file/02bc3d2b9711740896b7208536957ee5_tn\",\"https://down-vn.img.susercontent.com/file/864e8a6e946a70cb7d8aa5176a8a99e4_tn\",\"https://down-vn.img.susercontent.com/file/ea97ed4ef507b6baf26e2112084b3132_tn\"]',8906,NULL,3532,'2024-02-11 15:01:34','2024-04-07 17:50:42');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (216,'Bán Chạy✨Bộ Áo Sơ Mi Ngắn Tay + Quần Short Denim Ống Rộng Thời Trang Retro Cá Tính Cho Nam Nữ','[\"💖Chào mừng. Kính gửi quý khách hàng💖\",\"Đừng quên theo dõi cửa hàng để nhận phiếu giảm giá ngưỡng!!!\",\"[Thông báo vận chuyển]\",\"✈️Hầu hết chúng được vận chuyển ngay trong ngày (Không quá 48 giờ muộn nhất), nếu hết hàng, chúng tôi sẽ thông báo cho bạn trong thời gian sớm nhất. Gói hàng sẽ được giao cho bạn trong thời gian sớm nhất. 7-15 ngày, hãy kiên nhẫn ~\",\" \",\" \",\" ------------------------------- Kích thước ----------------------------------\",\"Denim hàng đầu:\",\"M: Chiều dài 73cm; Ngực 120cm; Vai 108cm; Tay áo 22,5cm;\",\"L: Chiều dài 75cm; Ngực 124cm; Vai 110cm; Tay áo 23cm;\",\"Xl: Chiều dài 77cm; Ngực 128cm; Vai 112cm; Tay áo 23,5cm;\",\"2xl: Chiều dài 79cm; Ngực 132cm; Vai 114cm; Tay áo 24cm;\",\"Quần short Denim:\",\"M: Dài quần 53cm; Eo co giãn; Vòng hông 102cm;\",\"L: Dài quần 54cm; Eo co giãn; Vòng hông 106cm;\",\"Xl: Dài quần 55cm; Eo co giãn; Vòng hông 110cm;\",\"2xl: Dài quần 56cm; Eo co giãn; Vòng hông 118cm;\",\"（1. Do tỷ lệ khác nhau của mỗi hình, các kích thước trên chỉ mang tính chất tham khảo; 2. Đo lường thủ công, xin vui lòng cho phép lỗi 2-4 cm, vui lòng tham khảo màu thực tế)\",\"\\n\",\"Đơn vị: 1 in = 2,54 cm\",\"Nếu bạn có bất kỳ câu hỏi nào, vui lòng liên hệ với chúng tôi để đề xuất kích thước ~\",\"-------------------------------------------------------------------------\",\"Vải / Chất liệu: Bông / Bông\",\"Nội dung thành phần: 31% (Bao gồm) -50% (Bao gồm)\",\"Chiều dài tay áo: Tay áo ngắn\",\"Chiều dài quần: Quần năm điểm\",\"Phong cách: Châu Âu và Hoa Kỳ\",\"Độ tuổi áp dụng: thanh niên (18-25 tuổi)\",\"Mùa niêm yết thời gian: Mùa hè 2023\",\"\\n\",\" \",\"[Thông báo sau bán hàng]\",\"⭐ Sau Khi Nhận Hàng, Quý Khách Vui Lòng Kiểm Tra Trước Có Vấn Đề Về Chất Lượng, Nếu Có Bất Kỳ Câu Hỏi Nào Vui Lòng Chat Để Liên Hệ Với Chúng Tôi, Chúng Tôi Sẽ Giải Quyết Thời Gian, Vui Lòng Yên Tâm.\",\"⭐ Vui lòng không cho chúng tôi đánh giá tiêu cực trực tiếp [1-4 sao], hoặc đánh giá xấu, đây thực sự là một thiệt hại lớn và lớn đối với chúng tôi, nếu bạn có bất kỳ vấn đề gì, hãy tìm chúng tôi 100% để giải quyết Nó.\",\"⭐ Nếu Bạn Hài Lòng, Hãy Đánh Giá Nhau Năm Sao ^.^\",\"[Lời khuyên ấm áp]\",\"💖Do Các Phương Pháp Đo Và Đo Thủ Công Khác Nhau, Sẽ Có Một Số Lỗi, Vui Lòng Tham Khảo Sản Phẩm Thực Tế Để Biết Chi Tiết.\",\"💖Do các lý do và màn hình chụp ảnh ban đầu khác nhau, có thể có sự khác biệt nhất định về màu sắc giữa hình ảnh và vật thể thực, đó là hiện tượng bình thường.\",\"💖Trò chuyện Thời gian trực tuyến: Thứ Hai đến Chủ Nhật 9: 00-22: 00\",\"Lưu ý: Thức Ăn Trên Hình Chỉ Là Để Thể Hiện Tác Dụng Của Sản Phẩm, Chỉ Để Chụp, Không Bán, Qua Tuyên Bố!!!\"]',NULL,76,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/cn-11134207-7r98o-lmqwhvvjxqg2d3_tn\",\"https://down-vn.img.susercontent.com/file/cn-11134207-7r98o-lmqwhvvjwbvm80_tn\",\"https://down-vn.img.susercontent.com/file/cn-11134207-7r98o-lmqwhvvjz50ic4_tn\",\"https://down-vn.img.susercontent.com/file/cn-11134207-7r98o-lmqwhvvk0jkyb0_tn\",\"https://down-vn.img.susercontent.com/file/cn-11134207-7r98o-lmqwhvva3rc2e6_tn\"]',5174,NULL,373,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (218,'(S ~ 5xl) Áo sơ mi nam, Thời trang Hàn Quốc, phù hợp với quần áo văn phòng','[\"Thông số sản phẩm\\nTên: áo sơ mi màu rắn\\nMàu: đen, trắng, đỏ, hồng, xanh đậm, xanh nhạt\\nKích thước: S-5XL\\nChỉ số phiên bản: Vừa vặn\\nChỉ số độ mềm: Trung bình\\nChỉ số co giãn: Vừa phải\\nChỉ số độ dày: Thường xuyên\\nHiển thị chi tiết\\nCổ bẻ không dễ biến dạng, đơn giản, thời trang.\\nThiết kế nút bấm, chi tiết trang trí đơn giản, thu hút.\\nCòng được thiết kế cho công thái học.\\n\\nNhắc nhở: Chiếc áo này là phiên bản slim fit của Hàn Quốc, nhỏ hơn một chút, đối với những ai thích vừa vặn hơn thì nên nâng một size lên nhé!\\nkích thước:\\nS 【35KG-45KG】\\nM 【45KG-50KG】\\nL 【50KG-58KG】\\nXL 【58KG-63KG】\\nXXL 【63KG-70KG】\\n3XL 【70KG-77KG】\\n4XL 【77KG-82KG】\\n5XL 【82KG-90KG】\\n\\ntính năng:\\n100% thương hiệu mới chất lượng cao! Chất liệu là cotton và spandex.\\nĐịa điểm kho hiện tại tại Hà Nội, thời gian giao hàng khoảng 3 đến 5 ngày\\nChiếc áo này được làm từ chất liệu cotton siêu mềm mại và rất dễ mặc. Hoàn hảo cho trang phục ở nhà hoặc dạo phố.\\nThiết kế trẻ trung, thoải mái, giản dị, trung tính\"]',NULL,143,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/52c315137ad2573ab86a8fd528ce0672_tn\",\"https://down-vn.img.susercontent.com/file/e10d127850a40b2bdd27326ccdfc3bf2_tn\",\"https://down-vn.img.susercontent.com/file/c103783744bc7027c868a785ff544b8a_tn\",\"https://down-vn.img.susercontent.com/file/3fd433b72370db4994717c4fed82264d_tn\",\"https://down-vn.img.susercontent.com/file/5b2ff98f4c19abd7147487cf93ff3df2_tn\"]',5860,NULL,2115,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (219,'Áo sơ mi nam 3D phom rộng xịn xò kiểu dáng Hàn Quốc siêu hot dễ kết hợp với các loại quần','[\"✔Chất lụa trơn, không nhăn, không xù, không bai, không phai màu.\\n✔Form  Hàn Quốc, dễ kết hợp với các loại quần.\\n✔Made in Việt Nam.\\n✔Size: M, L, XL,XXL, XXXL\\n✔Được sử dụng nhiều trên thị trường.\\n✔Thích hợp mặc trong nhiều môi trường khác nhau như công sở, tiệc, event, du lịch...=>CHÚNG TÔI CAM KẾTCam kết chất lượng và mẫu mã sản phẩm giống với hình ảnh.Hoàn tiền nếu sản phẩm không giống với mô tả.Được kiểm tra hàng trước khi thanh toán.Cam kết được đổi trả hàng trong vòng 7 ngày.SIZE M: Cân nặng 48-55kg, Cao 1m50 - 1m62, \\\" Áo Dài giữa cổ sau đến lai bầu 68cm, Vai 38cm, Vòng ngực 88cm, Chiết eo 76cm, Dài tay 54cm\\\"\\nSIZE L: Can nặng 55- 60kg, Cao 1m60 - 1m68, \\\" Áo Dài giữa cổ sau đến lai bầu 70cm, Vai 40cm, Vòng Ngực 92cm, Chiết eo 80cm, Dài tay 56cm\\\"\\nSIZE XL: cân nặng 60 - 68kg, Cao 1m65 - 1m72, \\\" Áo Dài giữa cổ sau xuống lai bầu 72cm, Vai 42cm, Vòng ngực 96cm, Chiết eo 84cm, Dài tay 58cm\\\"\\nSIZE XXL: Cân nặng 65 -74kg Cao 1m7. - 1m80, Áo Dài giữa cổ sau xuống lai bầu 74cm, Vai 46cm, Vòng Ngực 100cm, Chiết eo 90cm, Dài tay 60cm\\\"\"]',NULL,145,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/1d972b078fa0289fbee9f82756ffd714_tn\",\"https://down-vn.img.susercontent.com/file/5342042e9412ec8de738a0ce3fc12b8e_tn\",\"https://down-vn.img.susercontent.com/file/2ebd0598fedddcf5d8b8aee73ec4c5ea_tn\",\"https://down-vn.img.susercontent.com/file/45a5823fe83176537b536aeb1beca923_tn\",\"https://down-vn.img.susercontent.com/file/9e9b6cf8a73be760c960a3bae1cd6141_tn\"]',7010,NULL,3342,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (220,'Áo Sơ Mi Tay Dài Dáng Rộng + Quần Yếm Phong Cách Hàn Quốc Thời Trang Xuân Thu Cho Nam Và Nữ','[\"💖Chào mừng đến với Bảo tàng thời trang Muxi Pavilion!\",\"Sự ủng hộ của bạn là lực lượng lái xe lớn nhất của chúng tôi, Tất cả các sản phẩm trong cửa hàng này được bán với giá thấp và chất lượng được đảm bảo. Nếu Bạn Cần, Hãy Yên Tâm Mua Hàng, Chúng Tôi Chắc Chắn Sẽ Mang Đến Cho Bạn Trải Nghiệm Mua sắm Thoải mái Nhất!\",\"📷Tất Cả Ảnh Hàng Ở Cửa Hàng Này Được Chụp Bằng Các Nhiếp Ảnh Chuyên Nghiệp Và Chúng Được Sửa Đổi Và Điều Chỉnh Màu Sân Sau Trong Sân Tùng, Cũng Có Thể Có Thể Phù Hợp Với Hàng Thực Tế, Nhưng Do Để Sự Khác Biệt Về Ánh Sáng, Góc, Độ lệch Màu Sự Khi Chụp Và Nhận Màu Cá Nhân, Sản Phẩm Thực Tế Có Thể Có Một Số Khác Biệt Màu Sắc Với Các Ảnh Và Màu Cuối Của Tùy Theo Sản phẩm thực tế. Vui lòng lựa chọn cẩn thận sau khi giao tiếp hoàn toàn với dịch vụ khách hàng của chúng tôi trước khi mua hàng. Vấn đề khác biệt về màu sắc sẽ không được chúng tôi công nhận là lý do trả lại!\",\"📢Cửa hàng của chúng tôi cung cấp các sản phẩm chất lượng cao, dịch vụ sau bán hàng hoàn hảo, vì vậy bạn có thể tự tin mua hàng và mua hàng thoải mái!Tất cả giá mặt hàng đã thấp nhất, vui lòng không mặc cả!Nếu bạn có bất kỳ câu hỏi nào, vui lòng liên hệ với bộ phận chăm sóc khách hàng, chúng tôi sẽ cung cấp cho bạn câu trả lời kiên nhẫn!❣\",\"Phong cách: Đơn giản đi lại / Phiên bản Hàn Quốc\",\"Các yếu tố phổ biến: Khâu, Các nút, Chuỗi\",\"Phong cách: quần phù hợp\",\"Chiều dài tay áo: Dài tay\",\"Vải / chất liệu: Polyester / Polyester (Sợi Polyester)\",\"Nội dung thành phần: 71% (Bao gồm) -80% (Bao gồm)\",\"Độ tuổi sử dụng: Thanh niên (18-25 tuổi)\",\"Có thêm nhung: Không lót nhung\",\"Sẵn có: Mùa đông năm 2023\"]',NULL,193,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/sg-11134201-22110-rve0itvcxejv3c_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-22110-y9wpu7vcxejv13_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-22110-rqhbohwcxejv9f_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-22110-ksl2tezcxejvaa_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-22110-z99ix2wcxejv83_tn\"]',761,NULL,2,'2024-02-11 15:01:34','2024-02-11 15:01:34');
