INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (222,'Bộ Quần Áo Thun Nam Dài Tay Khóa Kéo Phối Dây Chữ Thời Trang Zenkocs3 MEN QA 049','[\"Sản phẩm: Bộ quần áo nam\",\"Chất liệu: Vải mềm mại, thoáng mát dễ thấm hút mồ hôi\",\"Kiểu dáng đơn giản nhưng không kém phần thời trang, phong cách\",\"Phù hợp khi đi chơi, dạo phố cùng bạn bè…\",\"Size S: cho người từ 50kg trở xuống tùy chiều cao\",\"Size M: cho người từ 55kg trở xuống tùy chiều cao\",\"Size L: cho người từ 60kg trở xuống tùy chiều cao\",\"Size XL: Dành cho người từ 65kg trở xuống tùy chiều cao\"]',NULL,194,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/37484b55aafe48e0d31d1bd3e3263577_tn\",\"https://down-vn.img.susercontent.com/file/3f7507721e4608f9723118e96bdb0a8f_tn\",\"https://down-vn.img.susercontent.com/file/07d4053447fdde2a35ea6709c7e9933b_tn\",\"https://down-vn.img.susercontent.com/file/1a423d04e66410c21754d1473210757e_tn\",\"https://down-vn.img.susercontent.com/file/318c95c9454cc29fa267e8a4deeaa4a0_tn\"]',5827,NULL,351,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (224,'Đồ bộ quần áo thun tổ ong cao cấp thoáng mát thấm mồ hôi tốt TF4.0','[\"Thông tin sản phẩm Đồ bộ quần áo thun tổ cao cấp thoáng mát thấm mồ hôi tốt TF4,0:\",\"- Đồ bộ quần áo thun tổ cao cấp thoáng mát thấm mồ hôi tốt TF4,0 được thiết kế theo đúng form chuẩn của nam giới Việt Nam\",\"- Sản phẩm Đồ bộ quần áo thun tổ cao cấp thoáng mát thấm mồ hôi tốt TF4,0 chính là mẫu thiết kế mới nhất cho mùa hè này\",\"- Chất liệu cực mềm mịn, thoáng mát (chất tổ ong cao cấp)\",\"- Đem lại sự thoải mái tiện lợi nhất cho người mặc\",\"\\n\",\"Hướng dẫn sử dụng:\",\"- Đối với sản phẩm quần áo mới mua về, nên giặt tay lần đâu tiên để tránh phai màu sang quần áo khác\",\"- Khi giặt nên lộn mặt trái ra để đảm bảo độ bền của hình in/decal\",\"- Sản phẩm phù hợp cho giặt máy/giặt tay\",\"\\n\",\"Hướng dẫn chọn size quần thể thao nam:\",\"- Size M: 45-58Kg, <1m70\",\"- Size L: 58-66Kg, <1m75\",\"- Size XL: 66-75Kg, <1m80\",\"- Size 2XL: 75-85Kg, <1m85\",\"\\n\",\"Lưu ý:\",\"- Nếu chưa chắc chắn về chọn size sản phẩm\",\"- Nếu khách form người không cân đối (Béo, gầy, thấp...)\",\"- Nếu khách thích mặc ôm body hoặc mặc rộng thoải mái\",\" INBOX trực tiếp cho shop để được tư vấn size nhé\",\"#bo #the #thao #bothethao #do #nam #bodonam #bong #da #bongda #re #giare #aothethao #quanthethao #thoitrangnam #1992 #the1992\",\"\\n\"]',NULL,66,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/f6a0497c81cead717013fdd2194ee024_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-23020-w90ov4zq23mvbc_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-23020-1k8efiab23mv81_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-23020-1mghxfab23mv5b_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-23020-c0uhnfab23mvfc_tn\"]',3192,NULL,263,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (225,'Áo sơ mi nam dài tay KJ chất vải lụa thái phom vừa người tôn dáng chống bai xù phong cách công sở KJ-Vua Quần Jeans','[\"Chính sách hỗ trợ đổi hàng:\",\"\\n\",\"- Khi mẫu lỗi do nhà sản xuất\",\"\\n\",\"- Khi giao sai size/ Sai mẫu khách đã đặt hàng\",\"\\n\",\"- Khi giao thiếu hàng/ Sai màu sắc\",\"\\n\",\"- Hỗ Trợ đổi trả nếu sản phẩm không giống hình trong 7 ngày\",\"\\n\",\"- BẢO HÀNH: 6 THÁNG KỂ TỪ NGÀY SẢN XUẤT\",\"\\n\",\"- Phiếu bảo hành ghi rõ thông tin: Tên khách hàng - Sđt - Địa chỉ - Ngày bán sản phẩm.\",\"\\n\",\"- Nếu sản phẩm có vấn đề, khách hàng gửi trực tiếp về nhà sản xuất để được bảo hành theo chính sách ghi trên phiếu bảo hành sản phẩm\",\"\\n\",\"Áo sơ mi nam KJ dài tay,sơmi nam vải lụa thái phom BodyfIt ôm vừa người, tôn dáng chống bai xù\",\"\\n\",\"1. GIỚI THIỆU SẢN PHẨM\",\" Áo sơ mi nam dài tay dáng slimfit , chống nhăn cao cấp  chính là gợi ý tuyệt vời cho các bạn nam nữ  mỗi khi lựa chọn trang phục mỗi ngày. Với những mẫu áo sơ mi form rộng thiết kế đơn giản và toát lên vẻ lịch lãm tinh tế, mang đến phong cách thời trang trẻ trung, năng động \",\"\\n\",\"2. THÔNG TIN CHI TIẾT:\",\"-Chất liệu: 33% Rayon, 64% Polyester, 3% Spandex\",\"-Kiểu dáng: Phom BodyfIt ômvừa người, tôn dáng, nổi bật ưu điểm cơ thể\",\"-Thiết kế: Tỉ mỉ trên từng chi tiết, màu sắc của khuy áo và đường chỉ cần phải phù hợp với màu của  vải 100%\",\"-Ưu điểm: Thân thiện với da người mặc và môi trường\",\"\\n\",\"\\n\",\"3. CHÍNH SÁCH BÁN HÀNG:\",\"- Cam kết chất lượng và mẫu mã sản phẩm giống với hình ảnh.\",\"- Hoàn tiền nếu sản phẩm không giống với mô tả.\",\"\\n\",\" 4. HƯỚNG DẪN CÁCH ĐẶT HÀNG\",\"- Bước 1: Cách chọn size, shop có bảng size mẫu. Bạn NÊN INBOX, cung cấp chiều cao, cân nặng để SHOP TƯ VẤN SIZE\",\"- Bước 2: Cách đặt hàng: Nếu bạn muốn mua 2 sản phẩm khác nhau hoặc 2 size khác nhau, để được freeship\",\"- Bạn chọn từng sản phẩm rồi thêm vào giỏ hàng\",\"- Khi giỏ hàng đã có đầy đủ các sản phẩm cần mua, bạn mới tiến hành ấn nút “ Thanh toán”\",\"- Shop luôn sẵn sàng trả lời inbox để tư vấn.\",\"\\n\",\"         Áo sơ mi dài tay là lựa chọn hàng đầu cho bạn đi làm, đi học, đi chơi, sử dụng trong lễ cưới hay đi sự kiện kết hợp cùng vest,.... mang đến một hình ảnh soái ca gọn gàng, chỉnh chu, sang trọng và nam tính quyến rũ.\",\"       Là dòng sản phẩm được các bạn trẻ ưa chuộng, thiết kế  cổ bẻ, tay dài, có nút gài phía trước chắc chắn, đường may tỉ mỉ, áo thiết kế form rộng giúp thoải mái đi chơi hay đi làm\",\"\\n\",\"Áo sơ mi nam dài tay ,sơmi nam vải lụa kate phom BodyfIt ôm vừa người, tôn dáng chống bai xù phong cách công sở\",\"\\n\",\"-Sản Xuất Tại : KJ.Store\",\"-Địa Chỉ : Hà Đông-Thành phố Hà Nội\",\"-Xuất Xứ :Việt Nam\",\"\\n\",\"#ao #somi #aosomi #aosominam #sominam #aosominamdihoc #sominamdihoc #somicongso #aosomicongso #aosominamcongso #aoslimfit #aosomibody #aosominamtinh #aosomidep #aosomire #aosominamdep #aosominamtaydai #aosominamhanquoc #aosomiden #aosomitrang #aosominamde\",\"n #aosominamtrang\"]',NULL,152,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/b506a428fcc0b98ca49b246938852c7c_tn\",\"https://down-vn.img.susercontent.com/file/b8b9acc8783dfd167c8cf2b246b515a7_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-23010-qtd2eo7v7nmv1f_tn\",\"https://down-vn.img.susercontent.com/file/15eb3bb97673cf523af1184e50669710_tn\",\"https://down-vn.img.susercontent.com/file/01d6ad418d71b7ccd0414349eb8bafbb_tn\"]',7613,NULL,1543,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (226,'Áo sơ mi nam dài tay chất liệu lụa mịn dáng Hàn Quốc không nhăn Menswear phong cách công sở.','[\"Áo sơ mi trơn công sở là một kiểu áo sơ mi nam đơn giản, trang trọng và lịch sự, được thiết kế để mặc trong môi trường văn phòng hoặc các sự kiện chuyên nghiệp. Được làm từ chất liệu lụa áo sơ mi trơn công sở thường có màu sắc trung tính như trắng, đen, phù hợp với nhiều phong cách và dễ dàng kết hợp với quần âu hoặc quần tây.,,,,\",\"\\n\",\"Áo sơ mi trơn có kiểu dáng đơn giản, với áo cổ điển cổ điển và áo dài tay, tạo nên sự lịch sự và chuyên nghiệp. Áo có thể được thiết kế với áo cổ trụ hoặc áo cổ bẻ, phù hợp với sở thích và phong cách của người mặc........\",\"\\n\",\"Mặc dù áo sơ  mi trơn công sở có thiết kế đơn giản, nhưng vẫn có thể có các chi tiết nhỏ để tạo ra sự khác biệt. Ví dụ, áo có thể được thiết kế với nút cúc trên tay áo để cố định tay áo.\",\"Áo sơ mi trơn công sở là một trong những kiểu áo quen thuộc và được yêu thích trong thời trang nam giới. Được coi là trang phục đơn giản, nhưng với thiết kế tinh tế và đường may chắc chắn, áo sơ mi trơn công sở là sự lựa chọn hoàn hảo cho các sự kiện chuyên nghiệp\",\"----------------------------------------------------------------------------------------\",\"* THÔNG TIN SẢN PHẨM:\",\"- Áo sơ mi nam là món đồ kinh điển dành cho nam giới, đặc biệt là những quý ông công sở.\",\"- 100% chất cotton cao cấp, thấm hút mồ hôi gấp 5 lần vải bình thường giúp người mặc cảm thấy thoải mái, dễ chịu.\",\"- Mếch cổ và tay làm bằng chất liệu cao cấp, không sợ bong tróc.\",\"- Áo sơ mi nam với họa tiết đơn giản, dễ mặc, dễ phối đồ\",\"- Fom Body cực chuẩn, ôm trọn bờ vai mặc cực trẻ trung và phong cách, phù hợp mọi hoàn cảnh kể cả đi chơi và đi làm.\",\"Áo sơ mi nam đủ size từ M đến 3XL cho khách từ 40-70 kg mặc vừa:\",\"- Size M: Cân nặng từ 40-45kg, Chiều cao từ 1m45 - 1m55\",\"- Size L: Cân nặng từ 45-50kg, Chiều cao từ 1m50 - 1m65\",\"- Size XL: Cân nặng từ 51-55kg, Chiều cao từ 1m60 - 1m70\",\"- Size 2XL: Cân nặng từ 56-62kg, Chiều cao từ 1m65 - 1m72\",\"- Size 3XL: Cân nặng từ 63-70kg, Chiều cao từ 1m69 - 1m78\",\"- Có 5 màu cơ bản: Đen, Xanh than, Xanh da trời, Trắng, Xám\",\"* Bảng size chỉ mang tính chất tham khảo, tùy thuộc vào số đo cơ thể và chất liệu vải khác nhau sẽ có sự chênh lệch nhất định. \",\"* Màu sắc vải sản phẩm có thể sẽ chênh lệch thực tế một phần nhỏ, do ảnh hưởng về độ lệch màu của ánh sáng nhưng vẫn đảm bảo chất lượng.\",\"-------------------------------\",\"* THỜI TRANG NAM MENSWEAR CAM KẾT: \",\"- Shop không bán hàng giả, hàng nhái, chất lượng luôn là hàng đầu để shop có thể phát triển thương hiệu và vươn xa. \",\"- Áo sơ mi nam 100% giống mô tả\",\"- Tư vấn nhiệt tình, chu đáo luôn lắng nghe khách hàng để phục vụ tốt. \",\"- Giao hàng nhanh đúng tiến độ không phải để quý khách chờ đợi lâu để nhận hàng. \",\"#áo#sơ#mi#nam #nu #formrong #unisex #pastel #den #trang#somikieu #somihocsinh #somicaocap #aosomi #aosominam #somisinhvien #aosominam #aosominamdaitay #aosominamtaydai #aosomidangrong #aosomirong #sominubigsize #sominam #sominamdaitay #somiunisex #somiformrong #sominamformrong #aosominambasic #aosominamtrang #somitrang #aosominam #aosominamtenji #aosominamformrong #aosominamtayngan #aosomi\"]',NULL,59,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/e7374e356d7c1658daf01f9bce13b1ae_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-li9ob9mr29sc7f_tn\",\"https://down-vn.img.susercontent.com/file/0cb195ffe930ed88726d0ccbe9fabe70_tn\",\"https://down-vn.img.susercontent.com/file/a95d82eb0e2f2c1f9f335bb172ccc4b7_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134201-23020-61ub8vx8nnnv4b_tn\"]',8407,NULL,3916,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (227,'Set Đồ Nam Thanh Lịch Áo Sơ Mi Tay Lỡ Kết Hợp Quần Túi Hộp Stylemarven - SET NAM 90000120C','[\"Bộ Quần Áo Sơ Mi Nam Tay Lỡ Kết Hợp Quần Túi Hộp Stylemarven - SET NAM 90000120C\",\"𝓣𝓱𝓸̂𝓷𝓰 𝓽𝓲𝓷 𝓼𝓪̉𝓷 𝓹𝓱𝓪̂̉𝓶\",\"◈ Sản phẩm: Set đồ áo sơ mi kết hợp quần túi hộp\",\"◈ Mã sản phẩm: SET NAM 90000120C\",\"◈ Xuất xứ: Việt Nam\",\"◈ Chất liệu vải: Áo sử dụng vải sơ mi truyền thống trơn mềm mại, thấm hút, mặc thoáng mát. Quần chất liệu ít nhăn,lên dáng chuẩn đẹp trẻ trung.\",\"◈ Thiết kế: Áo sơ mi nam cổ bẻ, tay lỡ, thân áo phối túi tạo nên điểm nhấn khác biệt, form rộng rãi thoải mái.\",\"◈ Kiểu dáng: Áo sơ mi thiết kế trơn màu trẻ trung, năng động, đường may chắc chắn, gọn gàng. Quần có túi tiện lợi.\",\"◈ Quần Áo form rộng vừa người thích hợp cho đi làm, đi chơi, đi học, mặc đội nhóm đều rất đẹp \",\"\\n\",\"Bộ Quần Áo Sơ Mi Nam Tay Lỡ Kết Hợp Quần Túi Hộp Stylemarven - SET NAM 90000120C\",\"𝓗𝓾̛𝓸̛́𝓷𝓰 𝓭𝓪̂̃𝓷 𝓬𝓱𝓸̣𝓷 𝓼𝓲𝔃𝓮\",\"◈ Size S: Nặng 40kg - 50kg, Cao 1m50 - 1m60\",\"◈ Size M: Nặng 50kg - 60kg, Cao 1m6 - 1m7\",\"◈ Size L: Nặng 60kg - 68kg, Cao 1m7 - 1m75\",\"Lưu ý: Nên giặt bằng tay, nếu giặt bằng máy bạn nên giặt với nhiệt độ nước không quá 40 độ C để đảm bảo sản phẩm bền lâu và giữ được màu sắc ban đầu\",\"----------------------------------------------------------------------\",\"𝐒𝐓𝐘𝐋𝐄 𝐌𝐀𝐑𝐕𝐄𝐍 - 𝐌𝐀𝐍𝐆 Đ𝐄̂́𝐍 𝐓𝐑𝐀̉𝐈 𝐍𝐆𝐇𝐈𝐄̣̂𝐌 𝐓𝐇𝐔́ 𝐕𝐈̣ 𝐕𝐄̂̀ 𝐓𝐇𝐎̛̀𝐈 𝐓𝐑𝐀𝐍𝐆\",\"♛ Cam kết sản phẩm giống y hình, hình ảnh do shop tự chụp.\",\"♛ Đảm bảo chất lượng, dịch vụ tốt, hàng được giao từ 1-5 ngày kể từ ngày đặt hàng.\",\" \",\"➥ CHÍNH SÁCH ĐỔI TRẢ VÀ BẢO HÀNH\",\"- Hỗ trợ đổi Size hoặc đổi mẫu trong vòng 3 ngày (Miễn cước đổi trả khi Shop giao sai hàng, khách hàng chịu cước đổi trả nếu khách hàng là người chủ động muốn đổi size hoặc đổi mẫu)\",\"- Khách hàng được đổi sang các sản phẩm ngang giá hoặc hơn giá (Sản phẩm thấp giá hơn sẽ không được nhận lại giá chênh lệch giữa 2 sản phẩm)\",\"- Mỗi sản phẩm chỉ được đổi hàng duy nhất 1 lần\",\"- Không hỗ trợ đổi hàng với các sản phẩm đã qua sử dụng, sản phẩm có tình trạng bẩn, rách, ố vàng,…\",\"\\n\",\"HÃY ĐÁNH GIÁ ⭐️⭐️⭐️⭐️⭐️ NẾU BẠN YÊU THÍCH SẢN PHẨM CỦA STYLEMARVEN NHÉ !\"]',NULL,196,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/vn-11134201-23030-4gyxwj40ipov17_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134201-23030-n13tin40ipovc3_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134201-23030-bfen5q40ipov60_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134201-23030-fe5hqu40ipova3_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134201-23030-veb56440ipov8a_tn\"]',5601,NULL,2578,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (228,'Bộ Quần Áo Đũi Nam dài Cổ bẻ Cổ Tàu chất vải đũi thái loại dày 1 màu 02- N07','[\"CAM KẾT\\nSản phẩm 100% giống mô tả. Kiểu dáng hoàn toàn giống ảnh mẫu\\nÁo được kiểm tra kĩ càng, cẩn thận và tư vấn nhiệt tình trước khi gói hàng giao cho Quý Khách\\nHàng có sẵn, giao hàng ngay khi nhận được đơn \\nHoàn tiền nếu sản phẩm không giống với mô tả\\nChấp nhận đổi hàng khi size không vừa\\nGiao hàng trên toàn quốc, nhận hàng trả tiền \\nHỗ trợ đổi trả theo quy định của Shopee\\nDo màn hình và điều kiện ánh sáng khác nhau, màu sắc thực tế của sản phẩm có thể chênh lệch khoảng 3-5%\\n\\n#boduinam #dobo #bomacnha #quanaothethao #dothethao #dotapthethao #dobonam #bothethaonam #boquanaonam #setthethao #dothethaonam #donam #bodomacnha #quanaohenam #dotapgymnam\"]',NULL,76,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/6bfcd5a4db4ef98cf83f104606442931_tn\",\"https://down-vn.img.susercontent.com/file/417e8325eed52892c7cefb91831282eb_tn\",\"https://down-vn.img.susercontent.com/file/abf42e5a926e5db87fb77c975bb12ad4_tn\",\"https://down-vn.img.susercontent.com/file/43891f0b4fc44e419991f4eb6ae56948_tn\",\"https://down-vn.img.susercontent.com/file/b802c5ef95e5b6f67c1cb3fe06212ed1_tn\"]',517,NULL,28,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (229,'Áo sơ mi nam dài tay KJ cổ bẻ vải lụa kate hàn không nhăn không xù cao cấp KJ - Vua Quần Jeans','[\"THỜI TRAN NAM KJ chuyên cung cấp quần áo, phụ kiện thời trang nam. \",\"Cam kết giá tốt nhất thị trường, chất lượng đảm bảo. \",\"Uy tín được đảm bảo qua hàng vạn đơn hàng trên khắp cả nước\",\"Đổi trả trong vòng 7 ngày nếu hàng lỗi, sai mẫu cho quý khách.\",\"Hàng sản xuất tại Việt Nam, trên dây chuyền xuất khẩu cao cấp\",\"==> Shop xin phép giới thiệu đến các bạn mẫu sản phẩm mới:\",\" \\\"Áo sơ mi nam dài tay KJ cổ bẻ, áo sơ mi trắng vải lụa nến không nhăn không xù\\\". \",\"------------------------------------------\",\" * THÔNG TIN SẢN PHẨM:\",\"- Áo sơ mi nam là món đồ kinh điển dành cho nam giới, đặc biệt là những quý ông công sở.\",\"- 100% chất cotton cao cấp, thấm hút mồ hôi gấp 5 lần vải bình thường giúp người mặc cảm thấy thoải mái, dễ chịu.\",\"- Mếch cổ và tay làm bằng chất liệu cao cấp, không sợ bong tróc.\",\"- Áo sơ mi nam với họa tiết đơn giản, dễ mặc, dễ phối đồ\",\"- Fom Body cực chuẩn, ôm trọn bờ vai mặc cực trẻ trung và phong cách, phù hợp mọi hoàn cảnh kể cả đi chơi và đi làm.\",\"Áo sơ mi nam đủ size từ M đến 3XL \",\"- Size M: Cân nặng từ 40-45kg, Chiều cao từ 1m45 - 1m55\",\"- Size L: Cân nặng từ 45-53kg, Chiều cao từ 1m50 - 1m60\",\"- Size XL: Cân nặng từ 54-62kg, Chiều cao từ 1m55 - 1m65\",\"- Size 2XL: Cân nặng từ 62-71kg, Chiều cao từ 1m60 - 1m70\",\"- Size 3XL: Cân nặng từ 70-78kg, Chiều cao từ 1m65 - 1m77\",\"- Có 4 màu cơ bản: Đen và Trắng\",\"* Bảng size chỉ mang tính chất tham khảo, tùy thuộc vào số đo cơ thể và chất liệu vải khác nhau sẽ có sự chênh lệch nhất định. \",\"* Màu sắc vải sản phẩm có thể sẽ chênh lệch thực tế một phần nhỏ, do ảnh hưởng về độ lệch màu của ánh sáng nhưng vẫn đảm bảo chất lượng.\",\"-------------------------------\",\"* THỜI TRAN NAM KJ CAM KẾT: \",\"- Shop không bán hàng giả, hàng nhái, chất lượng luôn là hàng đầu để shop có thể phát triển thương hiệu và vươn xa. \",\"- Áo sơ mi nam 100% giống mô tả\",\"- Tư vấn nhiệt tình, chu đáo luôn lắng nghe khách hàng để phục vụ tốt. \",\"- Giao hàng nhanh đúng tiến độ không phải để quý khách chờ đợi lâu để nhận hàng. \",\"-------------------------------\",\"* Đổi trả theo đúng quy định của Shopee \",\"1. Điều kiện áp dụng (trong vòng 07 ngày kể từ khi nhận sản phẩm): \",\"- Hàng hoá vẫn còn mới, chưa qua sử dụng \",\"- Hàng hóa hư hỏng do vận chuyển hoặc do nhà sản xuất. \",\"2. Trường hợp được chấp nhận: \",\"- Hàng không đúng size, kiểu dáng như quý khách đặt hàng \",\"- Không đủ số lượng, không đủ bộ như trong đơn hàng\",\"3. Trường hợp không đủ điều kiện áp dụng chính sách:\",\" - Quá 07 ngày kể từ khi Quý khách nhận hàng \",\" - Gửi lại hàng không đúng mẫu mã, không phải hàng của shop.\",\" - Đặt nhầm sản phẩm, chủng loại, không thích, không hợp,...\",\" Ấn theo dõi để ủng hộ shop và tham khảo các sản phẩm mới của shop, “ Quần âu áo sơ mi” rất hân hạnh được phục vụ quý khách.\",\"\\n\",\"-Sản Xuất Tại : KJ.Store\",\"-Địa Chỉ : Hà Đông-Thành phố Hà Nội\",\"-Xuất Xứ :Việt Nam\",\"\\n\",\"#ao #somi #aosomi #aosominam #sominam #aosominamdihoc #sominamdihoc #somicongso #aosomicongso #aosominamcongso #aoslimfit #aosomibody #aosominamtinh #aosomidep #aosomire #aosominamdep #aosominamtay\"]',NULL,79,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/b506a428fcc0b98ca49b246938852c7c_tn\",\"https://down-vn.img.susercontent.com/file/7c8539bf1dc9a1c1a9b8e8b1c6a3dc44_tn\",\"https://down-vn.img.susercontent.com/file/e41d62af51e7cc72658e27969cb63be6_tn\",\"https://down-vn.img.susercontent.com/file/15eb3bb97673cf523af1184e50669710_tn\",\"https://down-vn.img.susercontent.com/file/a0179bb9f365a235e8255d00aedca1ce_tn\"]',3874,NULL,1234,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (230,'Áo Sơ Mi Nam Trendyman Dài Tay Trơn dáng ôm Áo Sơ Mi Dáng rộng unisex phong cách hàn quốc','[\"Trendyman - \\\"Chúng tôi cam kết đảm bảo chất lượng và Tiến độ từng đơn đặt hàng\\\"\\nSản phẩm Áo sơ mi nam là 1 trong những mẫu áo bất hủ. Trendyman luôn sẵn mẫu này.\\nQuý khách hàng lưu ý đọc bảng size hoặc nhắn tin để shop tư vấn chính xác nhé!\\n\\n1. Tên sản phẩm: Áo sơ mi nam đẹp dài tay hàn quốc màu trắng đen vải sơ mi lụa công sở cao cấp - Trendyman\\nDáng áo: Dáng vừa\\nMàu sắc: màu trắng, Đen, xanh than, xanh nhạt, ghi, đỏ\\nTrọng lượng: 150 g\\nChất vải: Vải lụa dãn\\nHọa Tiết: Trơn\\n\\n2. Hướng dẫn sử dụng Áo sơ mi:\\nCó thể giặt tay hoặc giặt máy\\nKhông giặt chung với những sản phẩm ra mầu\\nKhông dùng chất tẩy rửa, không ngâm quá lâu ngày\\nKhông phơi dưới nhiệt độ cao, nắng gắt\\nNên là ủi thường xuyên\\n\\n4. Chính sách bán hàng tại Trendyman\\nSản phẩm chúng tôi mang tính chất : \\\"Điểm mua hàng giá xưởng\\\". Lợi nhuận mỗi đơn hàng rất thấp, vì thế chúng tôi chỉ hoàn tiền, nhận trả hàng nếu sản phẩm của chúng tôi có lỗi, quý khách có video rõ ràng. Những trường hợp bị chật, bị rộng chúng tôi sẽ không hỗ trợ chi phí đổi trả được cho quý khách nếu như đặt hàng không đúng bảng size.\\n\\n5. Những tiêu chí quan trọng khi tìm mua áo sơ mi\\nSơ mi là một trong những loại phục trang có tính ứng dụng cao, bạn có thể sử dụng trong những bữa tiệc yêu cầu sự lịch lãm, hoặc những chuyến dạo chơi thoải mái bên bạn bè, hoặc ngay cả dịp hẹn hò cùng người yêu. Cùng  Trendyman  tìm hiểu những tiêu chí khi chọn mua áo sơ mi sau đây.\\n- Kiểu dáng: Loại áo này thường được chia thành hai loại là áo sơ mi trơn và áo sơ mi kiểu.. Vào những ngày hè nóng bức, các kiểu sơ mi ngắn tay cũng được các khách hàng quan tâm.\\n- Chất liệu: Khi lựa chọn một chiếc áo sơ mi, chất liệu là yếu tố quan trọng đem đến người mặc sự thoải mái. Phần lớn áo sơ mi được sản xuất từ cotton hay sợi vải bông. Hai loại chất liệu này có khả năng thấm hút mồ hôi tốt, thông thoáng và thoải mái dù diện ở bất kỳ thời tiết nào. \\n- Đường may: Chính bởi vì áo sơ mi thường được diện trong những dịp quan trọng, nên đường may của áo là chi tiết được phần đông khách hàng quan tâm. Một chiếc áo sơ mi cao cấp được thể hiện qua chất liệu, kiểu dáng và đường may. Đồng thời đường may chất lượng cũng làm cho form áo sang trọng hơn. Tuy nhiên, những áo cao cấp thường được các thợ may có tay nghề cao may thủ công, vì vậy mức giá không hề thấp.\\n#ao #so #mi  #nam #trang #đen #xanhden #do #somi #lua #cotton #cogian #congso #hocsinh #caocap #aosomi #aosominam #hanquoc #Trendyman #congso #xuhuong #classic\"]',NULL,141,'QAN',NULL,'[\"https://down-vn.img.susercontent.com/file/a3a3b5063e55b5a808b80f517b8d1c67_tn\",\"https://down-vn.img.susercontent.com/file/6cdb9aed2da74c122f3ff81b7e3d270f_tn\",\"https://down-vn.img.susercontent.com/file/3f67d6cb01779ac70ae9cff0d05549e0_tn\",\"https://down-vn.img.susercontent.com/file/46455ec297c862fdf2e138c91b1029f8_tn\",\"https://down-vn.img.susercontent.com/file/aea159374801bba354503ce2a6e8e9a8_tn\"]',6142,NULL,1096,'2024-02-11 15:01:34','2024-02-11 15:01:34');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (232,'Đồ bộ nữ mặc nhà dễ thương hoạt hình bigsize cao cấp tay cộc quần cộc mùa hè chất cotton thun sữa BC01','[\"Đồ bộ nữ mặc nhà dễ thương, bộ ngủ hoạt hình bigsize cao cấp tay cộc quần cộc mùa hè chất cotton thun sữa BC01\\n\\n✅ THÀNH PHẦN VẢI CHÍNH : đồ bộ nữ có thành phần là chất cotton thun sữa mềm mại\\n\\n✅ THÔNG SỐ KỸ THUẬT\\n\\n- Mẫu: In\\n\\n- Chiều dài tay áo: tay ngắn\\t\\n\\n- Xuất xứ: sản xuất tại Việt Nam\\n\\n✅ THÔNG TIN CẢNH BÁO\\n\\n- Không dùng cho trẻ em dưới 3 tuổi\\n\\n✅ HƯỚNG DẪN SỬ DỤNG, BẢO QUẢN\\n\\n- Giặt nước lạnh lần đầu để tránh chất thun mềm nhăn, xù\\n- Giặt tay sau 1 ngày nhận đồ bộ nữ mặc nhà\\n- Không giặt nước nóng, sử dụng thuốc tẩy mạnh\\n- Khi phơi tránh trực tiếp với ánh nắng mặt trời\\n\\n✅ HƯỚNG DẪN CHỌN SIZE\\n\\nSize M (40-45kg)\\nSize L (46-52kg)\\nSize XL (52-58kg)\\nSize XXL (58-65kg)\\nForm rộng thoải mái nhé, các mẹ sau sinh cũng có thể mặc đồ bộ nữ dễ thương rất ok ạ.\\n\\n✅ SHOP CAM KẾT\\n\\n- Bộ ngủ hoạt hình cao cấp giống 100% trong hình, ảnh cho thể bị chênh lệch 5-10% do ánh sáng chụp\\n- Đồ bộ nữ mặc nhà được nhân viên đóng hàng kiểm tra kĩ đủ số lượng, đúng size trước khi giao\\n- Hàng có sẵn, được đóng trong vòng nửa ngày khi bạn đặt đơn\\n- Hoàn tiền nếu sản phẩm bị lỗi do nhà sản xuất\\n- Giao hàng toàn quốc, nhận hàng thanh toán, hàng lỗi trả hàng\\n- Hỗ trợ đổi theo quy định shopee\\n\\n✅ QUYỀN LỢI CỦA BẠN\\n\\nKhách hàng cũ : nhận ngay mã giảm giá 5% khi mua đơn hàng tiếp theo\\nĐược chăm sóc tận tình chu đáo, hỗ trợ tối đa khi sản phẩm bộ ngủ hoạt hình có lỗi, hỏng\\n\\n✅ THÔNG TIN SẢN XUẤT\\n\\nNăm sản xuất: 2022\\n\\nXưởng sản xuất: xưởng may Sơn Hà\\n\\nNơi sản xuất: thôn 6, Ninh Hiệp, Gia Lâm, Hà Nội\\n\\n#dobonu #dobomacnha #dobodethuong #dobonumacnha #dobonudethuong #dobomacnhabigsize #dobo #dongunu #dongu #dongusexy #dongu2day #dongubigsize #dongupijama #bongu #bongunu #bonguhoathinh #pijama #dongusexy\\n\"]',NULL,185,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/653f04ae03dde787b3577a6e33e776b9_tn\",\"https://down-vn.img.susercontent.com/file/1bda6d7a548f7721fadc622c7a5f38f9_tn\",\"https://down-vn.img.susercontent.com/file/9146b8ded5de9a89a060919ffabbeddb_tn\",\"https://down-vn.img.susercontent.com/file/3bba9d4aa66c025dd1fde57daf95196d_tn\",\"https://down-vn.img.susercontent.com/file/dea729f6304a6d37d0cbf99c0aa5f877_tn\"]',1386,NULL,171,'2024-02-11 15:01:59','2024-02-11 15:01:59');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (233,'Set Thun Classid Unisex - Bộ Hè Áo Cổ Tròn Cộc Tay Mix Quần Short Chun Dây Rút Bản To Basic Ống Rộng','[\"Set Thun Classid Unisex - Bộ Hè Áo Cổ Tròn Cộc Tay Mix Quần Short Chun Dây Rút Bản To Basic Ống Rộng\",\"\\n\",\"MÔ TẢ SẢN PHẨM\",\"- Màu sắc: Trắng, Đen, Xám.\",\"- Chất liệu: Cotton.\",\"- Kích cỡ: Freesize từ 40 - 65kg.\",\"- Số đo:\",\"               Áo: Dài 69cm; Rộng 51cm; Vai 51cm; Tay áo 23cm.\",\"               Quần: Dài 41cm; Ống rộng 34cm.\",\"- Xuất xứ: Việt Nam.\",\"Set Thun Classid chất mềm mát, đường may chắc chắn, thẳng đều nét.\",\"\\n\",\"HƯỚNG DẪN CÁCH GIẶT VÀ BẢO QUẢN\",\"- Lần giặt đầu tiên, bạn nên GIẶT BẰNG TAY và KHÔNG NÊN sử dụng xà phòng có chất tẩy. Đặc biệt KHÔNG NÊN giặt chung với các loại quần áo có màu. HẠN CHẾ giặt bằng máy để được bền hơn.\",\"- Nên lộn trái khi giặt để tránh bị xước và bong tróc khi bạn giặt mặt ngoài.\",\"\\n\",\"KHOBUONCAREY CAM KẾT \",\"- Mẫu shop chụp, sản phẩm như hình.\",\"- Đổi trả sản phẩm trong 3 ngày.\",\"- Hỗ trợ nhanh, tư vấn nhiệt tình.\",\"- Shop chuyên sỉ, lẻ quần áo giá tận xưởng không qua trung gian ...\",\"- Cập nhập mẫu mã liên tục giá tốt nhất.\",\"💋 Cảm ơn các bác đã xem và đặt hàng Set Thun Classid Unisex của shop 💋 \",\"\\n\",\" =>> LƯU Ý:\",\"+ Bạn sẽ nhận được hàng sau khoảng 1-3 ngày kể từ ngày shop gửi hàng đi tùy theo khoảng cách và đơn vị vận chuyển. (Do số lượng hàng lớn nên có thể chậm chễ hơn 1 ngày rất mong các bạn thông cảm ạ).\",\"+ Các bạn có thắc mắc, góp ý về sản phẩm, giao hàng xin hãy nhắn tin trực tiếp cho shop để được hỗ trợ sớm nhất.\",\"+ Đối với các mặt hàng đổi trả, vui lòng liên hệ và cung cấp hình ảnh cũng như chi tiết lỗi để nhân viên bên shop tiếp nhận và xử lý, đảm bảo quyền lợi cho các bạn ạ.\",\"\\n\",\"♥ Xin chân thành cảm ơn các bạn!\",\"\\n\",\"#setbohe #setnu #bohe2023 #quanshort #