INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (234,'Đồ Bộ Pijama Bộ Mặc Nhà Nữ Dài Tay RAME CLOTHING Chất Cotton Mềm Mại Không Nhăn','[\"✅ Sản phẩm: Đồ Ngủ Nữ Dài Tay Đồ Bộ Nữ Pijama Mặc Nhà Kẻ Caro Chất Cotton Mềm Mại Không Nhăn\\n\\n✅ Thiết kế và sản xuất: RAME Clothing.\\n\\n✅ Đặc tính:\\n- Pijama nữ nhà RAME Clothing thích hợp để mặc ở nhà, mặc đi ngủ hoặc cũng có thể mặc đi chơi đều được. Ngày nay, có nhiều bạn lựa chọn đồ pijama để dạo phố vẫn mang đến sự lịch sự và nét sang trọng nhất định. \\n- Chất liệu vải Cotton nên dễ chịu khi sử dụng.\\n- Thiết kế: \\n+ Cổ bẻ ve, áo dài, quần dài.\\n\\n✅ Số size:\\n* Ghi chú: Size theo cân nặng chỉ tương đối chính xác, còn phụ thuộc vào thể trạng và chiều cao mỗi người khác nhau, quý khách nên liên hệ với Shop để được tư vấn 24/7 chọn size phù hợp với mình nhé.\\n+ Size S: cho người từ 40kg- 47kg.\\n+ Size M: cho người từ 48kg - 54kg.\\n+ Size L: cho người từ 55kg - 60kg.\\n+ Size XL: cho người từ 61kg - 66kg.\\n+ Size XXL: cho người từ 67kg - 72kg.\\n\\n✅ Ưu điểm:\\n- Quần có túi chéo tiện lợi, đường kim, mũi chỉ tỉ mỉ, chỉn chu, không chỉ thừa trong mỗi sản phẩm. \\n- Chất liệu: vải thô, mát, thấm hút mồ hôi, dễ chịu khi mặc, đảm bảo an toàn cho da.\\n- Chất vải bền màu, không nhăn, không xù, vải mềm mại hơn sau vài lần sử dụng.\\n\\n✅ Cam kết:\\n- Không bán sản phẩm kém chất lượng.\\n- Bộ đồ Nữ, đồ ngủ, Pijama 100% giống như mô tả.\\n- Tư vấn nhiệt tình, chu đáo, luôn lắng nghe khách hàng để phục vụ tốt.\\n- Đóng gói và hỗ trợ giao hàng tới Quý khách nhanh nhất có thể.\\n\\n✅ Chính sách đổi trả theo quy định của Shopee:\\n1. Điều kiện áp dụng (trong vòng 07 ngày kể từ khi nhận sản phẩm):\\n- Hàng hóa vẫn còn mới, chưa qua sử dụng.\\n- Hàng hóa bị lỗi hoặc hư hỏng do vận chuyển hoặc do nhà sản xuất. \\n2. Trường hợp được chấp nhận: \\n- Hàng không đúng size, kiểu dáng như quý khách đặt hàng.\\n- Không đủ số lượng, không đủ bộ như trong đơn hàng. \\n3. Trường hợp không đủ điều kiện áp dụng chính sách: \\n- Quá 07 ngày kể từ khi Quý khách nhận hàng. \\n- Khách gửi lại hàng không đúng mẫu mã, không phải sản phẩm của Shop.\\n4. Nếu có bất kì khiếu nại cần hỗ trợ về sản phẩm, khi mở sản phẩm Quý khách NÊN quay lại video quá trình mở hàng để được đảm bảo 100% vấn đề sẽ được giải quyết.\\n\\n✅ LƯU Ý:\\n- Màu sắc vải có thể chênh lệch 3-5% do hiệu ứng ánh sáng chụp trên mỗi thiết bị điện thoại là khác nhau.\\n- Quý khách nhận được hàng nếu có thắc mắc cần giải đáp gọi điện trực tiếp hoặc Inbox ngay, bên Shop sẽ xử lý rất nhanh chóng.\"]',NULL,106,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/vn-11110107-7r98o-lpe061b66ui579_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lq6jfjnxq3f6a1_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lq6jfjnxrhzm71_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lpdybr640acb35_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lpdybr6433h708_tn\"]',9582,NULL,1565,'2024-02-11 15:01:59','2024-02-11 15:01:59');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (235,'Bộ ngủ lông cừu thêu chó xám huskey đen mũ tai gấu form rộng dễ thương, áo lông nữ mượt mà ấm áp hàn quốc','[\"Bộ ngủ lông cừu thêu chó xám huskey đen mũ tai gấu form rộng dễ thương, áo lông nữ mượt mà ấm áp hàn quốc\",\"Thời trang đồ bộ là một trong những lựa chọn hàng đầu của chị em phái đẹp hiện đại, nếu chưa biết chọn ở đâu hãy ghé thăm các mẫu đồ bộ của Shop nhé các bạn.\",\"Hiện nay, rất nhiều những mẫu đồ bộ phát triển thịnh hành, người ta từng nói rằng nếu biết cách chăm sóc bản thân mình, điều đầu tiên đó là phải tôn trọng cơ thể của bản thân qua năm tháng. Hiểu được tâm lý các chị em phụ nữ thời hiện đại, chúng tôi sẽ giúp bạn những bí quyết nhỏ xinh để lựa chọn cho mình những bộ đồ ngủ sành điệu và quyến rũ. Tại SHOP có vô vàn những mẫu để bạn có thể tự tin chọn lựa.\",\"Bộ ngủ lông cừu nữ thêu gấu nâu trắng- Đồ bộ mặc nhà thu đông nữ chất lông ấm áp mũ tai gấu fom rộng ulzzang hàn quốc\",\"-màu sắc:màu tươi tắn như hình\",\"-chất liệu: lông nhung 2 mặt\",\"-mẫu :nhiều mẫu hình thú\",\"-kích thước: s M, L, XL,\",\"S dưới 45kg\",\"M: dưới 50kg\",\"L: 51-57kg\",\"Xl : 57-61kg\",\"-họa tiết: hình thú\",\"-hoàn cảnh: mặc nhà, mặc ngủ, đi bộ,....\",\"-đặc điểm: k ngứa, k dị ứng, k rụng lông, có thể giặt máy\",\"\\n\",\"#domacnha #domacnhanu #bomacnha #bomacnhanu #dongu #dongunu #dongubong #dongulong #dongumuadong #bongu #bongunu #bongubong #bongulong #PIJAMA #domacngu #bobong #bolong\",\"#aoni #aogau #aonilong #aonu #aonibong #aothudong #aoniday\",\"#hot #aoret #aothoitrang #thoitrangnu #freeship #long #lot_long #khoac_long #si #kho_si #unisex #ulzzang #hoodie #sweet #freesize #hottrend    #aodoi #aodaitay #phanquang\",\"#cadigan #quan #set_nu #set_do_nu #set_trang_phuc\",\"#aophong #aolop #phanquang #freeship #taylo #formthung #nam #nu #unisex #7mau #aolop #phongrongnam #aonu #thời #trang #aonam #aothun domacnha #bolong #bonu #longcuu #đồbộ #đồngủ #bộngủ #bộmặcnhà #đồbộmặcnhà #bộnhung #bộstudio #mẹvàbé\",\"#đồ_bộ #đồ_ngủ #bộ_ngủ #bộ_mặc_nhà #đồ_bộ_mặc_nhà #bộ_nhung #bộ_studio #D.studio #Hoodie #hoodielotlong #hoodietron #hoodienam #hoodienu #aohoodie #aohoodietron #aohoodienibong #hoodienibong #aoni #aođoi\",\"#bo_nu #bo_ni_nhung #bo_thu_dong #bo_lot_long #bo_ngu\",\" #bộ nỉ nhung cao cấp #bộ nhung\",\"#bộ_nỉ\",\"#bộ_nỉ_nữ_mùa_đông\",\"#bộ_nỉ_bông\",\"#bộ_nỉ_bông_nữ\",\"#bộ_đồ_nỉ_nữ_mùa_đông\",\"#đồ_bộ_nỉ_nữ\",\"#bộ_nỉ_mặc_nhà_cho_nữ\",\"#bộ_nỉ_mặc_nhà_nữ\",\"#bộ_nỉ_nữ_mặc_ở_nhà\"]',NULL,104,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lktaeainxk1s66_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lktaeaio4kw043_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lktaeaio8shnde_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lktaeaioa72394_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lktaeainyym816_tn\"]',3828,NULL,1780,'2024-02-11 15:01:59','2024-02-11 15:01:59');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (236,'Set đồ nữ gồm áo thun ngắn tay cổ tròn họa tiết gấu và quần dài ống rộng thời trang thể thao','[\"Thời gian giao hàng dự kiến cho sản phẩm này là từ 7-9 ngày\\n\\n👉Lưu ý💌 từ người bán: Đây là danh sách mới nhất. Để tri ân khách hàng mới và cũ, cửa hàng của chúng tôi đã giữ giá ở mức ⬇tối thiểu, cảm ơn bạn💕 đã ủng hộ và ghi nhận! 🏬\\n\\nXin chào! Chào mừng bạn đến với cửa hàng của chúng tôi!\\nChất lượng là hàng đầu với dịch vụ tốt nhất. Khách hàng đều là bạn của chúng tôi.\\nThiết kế thời trang, mới 100%, chất lượng cao!\\n\\n* Kích thước thẻ: M ~ 2XL, kích thước thẻ là kích thước châu Á, nhỏ hơn một chút so với kích thước US/AU/EU. Vui lòng đảm bảo rằng các số đo thực tế này sẽ vừa với bạn. Chọn kích thước lớn hơn nếu kích thước của bạn giống với Bảng kích thước đo phẳng.\\n\\n🍒 Mô tả sản phẩm: \\n🍒Tình trạng sản phẩm: Sản phẩm này có sẵn trong kho.\\n🍒Chất Liệu: Cotton + polyester\\n🍒Màu sắc: Như hình ảnh\\n🍒Phong cách: Thời trang, Ngày thường\\n🍒Kích thước: M, L, XL,2XL\\n\\nÁo thun: \\nM Vòng ngực: 102 Chiều dài: 58 Chiều dài tay: 25 Vai: 41\\nL Vòng ngực: 106 Chiều dài: 59 Chiều dài tay: 25.6 Vai: 42\\nXL Vòng ngực: 110 Chiều dài: 60 Chiều dài tay: 26.2 Vai: 43\\n2XL Vòng ngực: 114 Chiều dài: 61 Chiều dài tay: 26.8 Vai: 44\\n\\nQuần: \\n\\nM Chiều dài: 93 Eo: 56-78 Hông: 88\\nL Chiều dài: 94 Eo: 58-81 Hông: 92\\nXL Chiều dài: 95 Eo: 60-84 Hông: 96\\n2XL Chiều dài: 96 Eo: 62-87 Hông: 100\\n\\n\\n\\n①❥❥❥Có thể sai số kích thước 2-3% do đo lường thủ công.\\nVui lòng kiểm tra bảng kích thức cẩn thận trước khi bạn mua sản phẩm.\\n【1 inch = 2,54cm 】\\n②❥❥❥Do chênh lệch cài đặt ánh sáng và màn hình, màu sắc sản phẩm có thể hơi khác so với hình ảnh.\\n③❥❥❥Gói hàng bao gồm: 1 x áo thun + Quần\\n\\n\\n#Readystock #Mới #Thời trang #Rẻ #Sọc #Mới nhất #Hotselling #Mùa hè #Colthing #2 chiếc#Rộng rãi #Quần shortsleeves #Longpants #Thời trang nữ #Leisuresuits #Suits #Ladiespantssuits #Readystock\"]',NULL,186,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/9115329510dc9fc100912cb3a3480fcb_tn\",\"https://down-vn.img.susercontent.com/file/a26715fff1b51de6eac2437b9ed15f33_tn\",\"https://down-vn.img.susercontent.com/file/4190f0653ec88f49b8023bc1c319d740_tn\",\"https://down-vn.img.susercontent.com/file/9146d77d852208861f820bb403757b3d_tn\",\"https://down-vn.img.susercontent.com/file/494b2926cc4688e4d6f793cebed32b79_tn\"]',1802,NULL,215,'2024-02-11 15:01:59','2024-02-11 15:01:59');
