uanjoggernu #quanjogger #quannam #quannu #quannamongrong #quannamongsuong #quannhungongrong #quannhungtamongrong #quannhungganongrong #quannhungtamnu\"]',NULL,154,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/vn-11110105-7r98o-lp5czqp5huzdba_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-loe9qxod19mba9_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-loe9qxodci4770_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-loe9qxod5hbn4c_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-loe9qxod8agje9_tn\"]',450,NULL,71,'2024-02-11 15:01:59','2024-02-11 15:01:59');
