INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (246,'Bộ ngủ nữ dài hoạ tiết ❤️Đồ bộ pijama dài tay chất cotton in hình ngộ nghĩnh from rộng phong cách ulzzang,Nene','[\"\\nCảm ơn quý khách đã ghé thăm gian hàng, nhà  chuyên bán buôn, bán lẻ đồ ngủ pijama, đồ mặc nhà với mẫu mã đa dạng, mới nhất, xu hướng hot nhất.\\nSản phẩm phù hợp mặc nhà, mặc đi ngủ, các mẹ bỉm sữa sau sinh đều mặc thoải mái\\nVới mỗi sản phẩm đều có ảnh shop tự chụp, nếu còn thắc mắc hãy inbox cho shop để được gửi ảnh xem kĩ hơn.\\n\\n\\tMÔ TẢ SẢN PHẨM\\n-\\tChất liệu: cotton\\n-\\tVải mềm mịn, không nhăn, xù, lem vải khi giặt.\\n-\\tPhù hợp mặc mùa thu đông, xuân, hè\\n\\n\\tKÍCH THƯỚC:\\nSize s dưới 45kg sizw m dứoi 52kf size l dưới 58kg size xl dưới 63kg\\n\\tCAM KẾT  \\n- Sản phẩm của shop cam kết chuẩn y hình, \\n- Sản phẩm được kiểm tra kĩ càng, cẩn thận và tư vấn nhiệt tình trước khi gói hàng giao cho Quý Khách \\n- Hỗ trợ đổi trả theo quy định \\n- Cam kết chất lượng, dịch vụ trước và sau bán hàng\\n#dongu #setdonu #dobonu #bongunu #bomacnha #bomacnhanu #bongu #dobo #pijama #bongulua #bodongunu #bodongu #domacnha #dobopijama #bongu2day #dongu2day #dongunu2day #bodomacnha #bodonu #setdobonu #dobomacnha #boquanaongu #dongupijama #bongupijama #dobomacnhanu #bomacnhanumuahe #setdobo #boquanaonu #pijamanu #setbonu #bo2daymacnha #bolua #bomacnha #dobopijamalua #boluamacnha #bolua2day #bopijamalua #bopijama #dobomacnhadethuong #dobonumacnha #dongumacnha #dobolua #bodomacnhanu #dongulua2day #dongunulua #bodongu #bomacnhadep #pijamanulua #dobongu2day #bopijamanu #bongumuahe #dobodui #doboluasatin #dopijama #dongunupijama #doluamacnha \"]',NULL,188,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/5a103ad1ed23e473bf992ee391bae375_tn\",\"https://down-vn.img.susercontent.com/file/880e7958ba6b0176d8a0cc952abc2172_tn\",\"https://down-vn.img.susercontent.com/file/149bad