INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (247,'Set Áo Thun Tay Ngắn Và Quần Short Ống Rộng Thời Trang Hàn Quốc Cho Nữ','[\"❥(^ _-) Xin chào thân yêu, chào mừng đến với cửa hàng của chúng tôi! ~~ Cảm ơn♪(→)\",\"—Thiết Kế thời trang, mới 100%, chất lượng cao!\",\"—Nếu Bạn thích, vui lòng đặt hàng và chúng tôi có thể giao hàng trong thời gian sớm nhất!\",\"—Nếu Mô tả kích thước không rõ ràng, vui lòng liên hệ với bộ phận chăm sóc khách hàng.\",\"—— Nhận → COUPONS → chỉ cần theo dõi cửa hàng của tôi!\",\"\\n\",\"❥Mô tả sản phẩm❥\",\"\\n\",\"Phong cách: ngọt ngào và tươi mát\",\"Các yếu tố phổ biến: màu đặc\",\"Phong cách: áo cánh và quần\",\"Chiều dài tay áo: Tay ngắn\",\"Vải / chất liệu: polyester / polyester (sợi polyester)\",\"Hàm lượng thành phần: 31% (bao gồm) -50% (bao gồm)\",\"Độ tuổi sử dụng: Thanh niên (18-25 tuổi)\",\"Có / không có nhung: không có nhung\",\"Thời gian đưa ra thị trường: mùa hè 2022\",\"\\n\",\"❥(^ _-) Mẹo❥\",\"1. Vui lòng so sánh kích thước chi tiết với kích thước của bạn trước khi đặt mua!!!\",\"2. Màu sắc có thể hơi khác một chút, tùy thuộc vào cài đặt máy tính và màn hình của bạn.\",\"3. Vì yêu cầu đo thủ công, vui lòng giữ khoảng cách 1-3 cm (tất cả các đơn vị đo lường đều tính bằng cm. Xin lưu ý rằng 1 cm = 0,39 inch)\",\"4. Chúng tôi sẽ chịu trách nhiệm cho bất kỳ vấn đề sau bán hàng. Nếu bạn có bất kỳ câu hỏi nào, vui lòng liên hệ với chúng tôi mà không do dự!\"]',NULL,142,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/e26b0e5ee072bc775cc295f7cab4fc33_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-22100-qvqmhm8elyive5_tn\",\"https://down-vn.img.susercontent.com/file/4e79d3e6fa2f3f92e0118bbb25a21380_tn\",\"https://down-vn.img.susercontent.com/file/3a14ea3606699370d029e56dd80e189c_tn\",\"https://down-vn.img.susercontent.com/file/a664e557c110ebadb24f119120bccab5_tn\"]',6717,NULL,1695,'202