INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (249,'Đồ bộ quần dài kẻ sọc caro ống rộng unisex Bộ kẻ sọc caro nữ áo phông tay ngắn quần dài kate dáng suông','[\"     Đồ bộ quần dài kẻ sọc caro ống rộng unisex Bộ kẻ sọc caro nữ áo phông tay ngắn quần dài kate dáng suông\",\"     THÔNG SỐ KỸ THUẬT CỦA SET BỘ DÀI:\",\"    - Đồ bộ hoạt hình unisex form UNISEX phù hợp cho cả nam và nữ luôn ạ\",\"    - Size: \",\"       + Áo: FREESIZE, từ 40-60kg mặc vừa nha khách.\",\"       + Quần caro kate có 2 size M, L.\",\"             * Size M từ 40-55KG\",\"             * Size L từ 50-65KG\",\"    - Kích thước đồ bộ mặc nhà: \",\"       + Áo thun Unisex: Dài: 63cm, rộng 53cm, cổ áo: 21cm\",\"       + Quần caro kate:\",\"             * Size M: Chiều dài 90-92 cm (tùy chiều cao quần sẽ dài đến mắc cá chân hoặc trên mắc cá chân), chiều rộng đùi 30 cm, ống quần rộng 21 cm, chiều dài từ lưng thun đến đáy quần: 33cm, lưng thun rộng: 28-30cm.\",\"             * Size L: Chiều dài 95-97 cm (tùy chiều cao quần sẽ dài đến mắc cá chân hoặc trên mắc cá chân), chiều rộng đùi 32 cm, ống quần rộng 23 cm, chiều dài từ lưng thun đến đáy quần: 33cm, lưng thun rộng: 28-30cm\",\"    - Chất liệu bộ đồ dài: \",\"       + Áo thun Unisex: Vải thun tổng hợp mềm, mịn mát, co giãn tốt, không xù lông\",\"       + Quần ống rộng được may bằng vải kate lụa mềm mịn, đặc biệt không nhăn, độ dày vừa phải mặc rất nhẹ, dễ chịu, thoáng mát.\",\"    - Cân nặng: từ 40kg cao 1m50 tới 65kg cao 1m70, mặc vô cùng thoải mái khách nhé.\",\"    - Kiểu dáng: \",\"       + Áo phông cổ tròn tay lỡ phom rộng\",\"       + Quần dài ống rộng dáng suông, lưng thun, có may 2 túi.\",\"    - Xuất xứ: Việt Nam\",\"-------- ❤\",\"\\n\",\"      Đồ bộ quần caro ống rộng có kiểu dáng thời trang trẻ trung, năng động. Đây là 01 item không thể thiếu trong tủ quần áo của những anh chàng hay cô nàng năng động cá tính.\",\"      Set bộ quần dài ống bom bo chun phối áo phông unisex phù hợp để đi học, đi chơi. Kiểu dáng set hoạt hình đa dạng, họa tiết ngộ nghĩnh, đáng yêu.\",\"      Bộ kẻ sọc caro của 92HOUSE có Áo phông được may từ chất thun tổng hợp, được in theo công nghệ in chuyển nhiệt nên người dùng luôn trong cảm giác thoái mái khi mặc, không bị bí bách. \",\"      Quần ống rộng được may từ vải kate lụa mềm mịn, đặc biệt không nhăn, thấm hút mồ hôi nên người dùng luôn trong cảm giác thoái mái, nhẹ nhàng khi mặc. \",\"     \",\"-------❤ \",\"\\n\",\"     92HOUSE CAM KẾT:\",\"✅ Giao đúng mẫu Đồ bộ quần dài kẻ sọc caro ống rộng unisex Bộ kẻ sọc caro nữ áo phông tay ngắn quần dài kate dáng suông được khách hàng chọn mua.\",\"✅ Chất lượng giống mô tả 100%.\",\"✅ Nếu có vấn đề phát sinh khi khách hàng nhận sản phẩm, vui lòng ib ngay cho 92HOUSE, chúng mình sẽ hứa sẽ tận tình hỗ trợ bạn giải quyết.\",\"✅ Ảnh thật do 92HOUSE tự chụp. Do màn hình và điều kiện ánh sáng khi chụp ảnh khác nhau, màu sắc thực tế của sản phẩm sẽ có sự chênh lệch khoảng 3-5%.\",\"✅ Hàng luôn có sẵn, 92HOUSE sẽ sắp xếp giao ngay khi khách hàng đặt mua đơn hàng, bảo đảm cho bạn được nhận hàng sớm nhất.\",\"\\n\",\"-------❤\",\"\\n\",\"#set #setbo #dobohoathinh #setbohoathinh #setdounisex #unisex #dobo #setdonu #setdonam #setdobo #setboquanaounisex #setboquanaonu #setbonu  #setbomacnha #dongu #dobomacnha #aophong\",\"#quan-unisex #quancaro #quan-plaid-pant  #quanongrong #caroongrong \"]',NULL,159,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/0b819e6fcc0faf428e65b8beb8b328de_tn\",\"https://down-vn.img.susercontent.com/file/1a6e3e6b88a46d54190d6ee7ab0fa18e_tn\",\"https://down-vn.img.susercontent.com/file/dadf7001d5631c97d63e23bc0a1f46f5_tn\",\"https://down-vn.img.susercontent.com/file/82c9b967133f1d6765251e616fa7c323_tn\",\"https://down-vn.img.susercontent.com/file/fd6e5f20ce91edfd3b1cf7d874a69797_tn\"]',829,NULL,30,'2024-02-11 15:01:59','2024-02-11 15:01:59');
