INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (251,'Sét Bộ Đồ Quần Áo Nữ Đẹp Xinh Cute Áo Trắng In Hoạt Hình Nằm Mơ Mix Quần Thun Hồng Bo Gấu','[\"Thông Tin Về Sản Phẩm:\\nSét Bộ Đồ Quần Áo Nữ Đẹp Xinh Cute Áo Trắng In Hoạt Hình Nằm Mơ Mix Quần Thun Hồng Bo Gấu\\nMàu sắc: Sét Bộ Như Hình\\nSize: S; M; L\\n- Size S: Cân Nặng: 35 - 42kg; Chiều Cao: m40 - m45\\n- Size M: Cân Nặng: 43 - 47kg; Chiều Cao: m46 - m52\\n- Size L: Cân Nặng: 48 - 52kg; Chiều Cao: m53 - m60\\n- Chất liệu: Áo cotton, Q Thun\\n=============================\\nYEGO Fashion LUỐN ĐẶT UY TÍN LÊN HÀNG ĐẦU\\n️Cập nhập mẫu mã liên tục giá tốt nhất\\n️ Shop up ảnh thật tự chụp\\n=>> Lưu ý:\\n+ Khách đặt hàng sẽ nhận được hàng sau khoảng 3-5 ngày làm việc tùy theo khoảng cách và đơn vị vận chuyển.\\n+ Mọi thắc mắc, góp ý về sản phẩm, giao hàng vui lòng nhắn tin với để được hỗ trợ trực tiếp và nhanh nhất.\\nXin chân thành cảm ơn các bác\\n==============================\\nYEGO Fashion Chuyên Sỉ Lẻ thời trang Nam Nữ bốn mùa.\\n️Các Sản phẩm đều là thời trang Hot của giới trẻ, mẫu mã được cập nhật thường xuyên.\\n️Thiết kế kiểu dáng đa dạng phong cách, hợp thời trang.\\n️Áo được may tinh tế sắc sảo, thiết kế đẹp, chuẩn form, vải cotton dày, mịn thấm hút mồ hôi, thoáng mát\\n️Dễ dàng phối sét trang phục, thích hợp đi chơi, đi làm hay dạo phố. Đặc biệt cho các bạn trẻ năng động cá tính.\\nSự kết hợp hoàn hảo giữa áo  với quần Jean; quần sooc; quần Jogger cực kì cute, sang chảnh\\n️Cảm ơn các bạn đã dành thời gian ghé thăm gian hàng và ủng hộ Shop! Chúc các bạn luôn vui vẻ hạnh phúc\\\"\\n==============================\\n#Setbodonumacdichoi, #setbodonumaconha, #setaonuthoitrang, #boquanaonudichoi, #boquanaonudihoc, #boquanaonumuahe, #setdonudep, #setdonudepaothun\"]',NULL,192,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/11f4901c678e50c40233faa5a5f63566_tn\",\"https://down-vn.im