bytee#quanduiongrong#oversize#fromrong #setaobabytee #setquanao#babytee\"]',NULL,60,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-lhn3s8y8xa4l60_tn\"]',2439,NULL,921,'2024-02-11 15:01:59','2024-02-11 15:01:59');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (253,'[RẺ VÔ ĐỊCH] [Ảnh Thật ]Set bộ gồm áo thun kẻ mix quần short kaki','[\"𝗧𝗲̂𝗻 𝘀𝗮̉𝗻 𝗽𝗵𝗮̂̉𝗺: Set bộ gồm áo thun kẻ mix quần short kaki \\n𝗠𝗮̀𝘂 𝘀𝗮̆́𝗰: Áo be / Áo đen\\n𝗖𝗵𝗮̂́𝘁 𝗹𝗶𝗲̣̂𝘂: Áo chất thun , quần chất kaki\\n𝗫𝘂𝗮̂́𝘁 𝘅𝘂̛́: Việt Nam\\n\\n𝗖𝗔𝗠 𝗞𝗘̂́𝗧 𝗦𝗔̉𝗡 𝗣𝗛𝗔̂̉𝗠\\n• Shop cam kết cả về CHẤT LIỆU cũng như HÌNH ẢNH (đúng với những gì được nêu bật trong phần mô tả sản phẩm)\\n• Sản phẩm được đổi trả hàng lỗi trong vòng 3 ngày kể từ khi nhận được hàng. Đổi trả trong trường hợp hàng lỗi đường may, sai màu sắc, sai mẫu, lỗi do nhà sản xuất, và Có Video Quay Quá Trình Nhận Hàng Và Bóc Hàng.\\n\\n#aoni #aoninam #aoninu #aosweater #aosweaternam #aosweaternuformrong #aosweaterformrong #aosweaterunisex #aonikhongmu #aonibong #aonicotton #aonitaydai #aonitaybong #aonidoi #aonidep #aosweaterdoi #aosweaternamhanquoc #aonihanquoc #aosweaterphoichanvay #trend #unisex  #setni #boni #boaoquanni #tui\\n\\n\"]',NULL,180,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/vn-11134201-23020-tj0tluzcc2nv8d_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-23010-g3fjxk5dtumv16_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-23010-9v2lqjrdtumvfc_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-23010-ur1h4gldtumvea_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-23010-lytijgldtumv4c_tn\"]',1564,NULL,318,'2024-02-11 15:01:59','2024-02-11 15:01:59');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (254,'Bộ Áo + Quần Ống Rộng In Họa Tiết Thời Trang Dành Cho Nữ 150kg','[\"───😳Chào mừng đến với điều này😳────\\nCửa hàng này sẽ có sản phẩm mới mỗi ngày,\\nXin hãy chú ý hơn!Đảm bảo chất lượng Giá ưu đãi\\nNhớ Theo Dõi + Thích, Giao Hàng Ưu Đãi ~\\nTrước khi đặt hàng, vui lòng chắc chắn để nhận phiếu giảm giá\\nNếu bạn có bất kỳ câu hỏi nào, vui lòng tham khảo và trò chuyện!\\n----------------------------------------------------------------------------------------------------------------\\n\\r\\nPhong cách: đi làm đơn giản /\\r\\nCác yếu tố phổ biến: Khâu, In\\r\\nPhong cách: Quần Suit\\r\\nChiều dài tay áo: tay áo ngắn\\r\\nNội dung thành phần: 71% (Bao gồm) -80% (Bao gồm)\\r\\nCó thêm nhung: Không lót nhung\\r\\n\\r\\n\\n\\n----------------------------------------------------------------------------------------------------------------\\n[Thông Báo người mua] \\n[1] Khách hàng mới theo dõi cửa hàng và thích sản phẩm có thể nhận được chiết khấu ~                                                          \\n[2] Bất kỳ lời khen ngợi năm sao nào + Tải lên chương trình người mua đẹp mắt, mua lại có thể trò chuyện để nhận phiếu giảm giá ~ \\n[3] Hàng hóa trong cửa hàng này có chất lượng tốt và giá thành thấp.\\n[4] Nếu Có Vấn Đề Sau Khi Lấy Hàng, Giao Hàng Ít, Hậu Cần Chậm Và Lỗi, Vui Lòng Liên Hệ Với Chúng Tôi Để Xử Lý, Xin Cảm Ơn.\\n[5] Kích thước được đo bằng tay, không thể tránh khỏi rằng sẽ có một số lỗi, đó là bình thường và không ảnh hưởng đến việc sử dụng.\"]',NULL,51,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/sg-11134201-23030-dqsa4dm0beovbd_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-23030-0zf0l4m0beovdb_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-23030-wth9usn0beov03_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-23030-h7n3flo0beov