INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (256,'Set bộ tanktop 3 món Chú Bò Unisex ❤ Gồm Tank top 3 lỗ+ Quần Short+ áo bra♥️Chất cotton mịn 🦋Phong cách THỂ THAO HÈ','[\"  \\nSet bộ tanktop 3 món Chú Bò Unisex ❤ Gồm Tank top 3 lỗ+ Quần Short+ áo bra♥️Chất cotton mịn 🦋Phong cách THỂ THAO HÈ\\nThông tin sản phẩm:\\nNEW SET!! ✨ Bán cả set áo quần mà giá thì như áo rời là đâyy 😝😝 Ai đang tìm set đồ sporty khoẻ khoẻ lại đơn giản thì chính em nó, set thể thao 💯💯 Mua set hời được ngay 1 áo tanktop có sẵn bra, 1 quần short để phối đồ. Áo tanktop này cũng như những mẫu tanktop mình đã bán trước đó, có kèm sẵn bra quây. Chất áo cũng như chất quần đều là vải cotton dày dặn không phải thun nhão thì lên form mới xịn 💕💕\\n 📍3:colors: Đen, Trắng, Xanh\\n📍Size <55kg\\n* CHÍNH SÁCH ĐỔI SẢN PHẨM\\n - Shop CHỈ NHẬN đổi sản phẩm bị lỗi do nhà sản xuất (shop hỗ trợ phí ship) và đổi size (áp dụng cho sản phẩm có size, shop không hỗ trợ phí ship). KHÔNG NHẬN đổi mẫu, đổi màu.\\n - Thời gian đổi sản phẩm: Trong vòng 7 ngày kể từ ngày nhận.\\n - Sản phẩm phải còn nguyên mác, chưa qua sử dụng, giặt tẩy, không bị dơ, bẩn hoặc bị hư hỏng bởi các tác nhân bên ngoài.\\n #sétđồnữ #bộ_đồ_nữ #bộđồ #bộthểthao #bộđồ #bộtank #sétđồnữđẹp #setbộ #đồbộđẹp #đồbộkiểu #đồbộnữ #đồngủđẹp #đồbộmặcnhà #setquầnốngrộngáothun #tanktop #setbộthun #set # bộtanktop#gym\\n\"]',NULL,144,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/1430f84bc0419e53a3e335c79edaa87b_tn\",\"https://down-vn.img.susercontent.com/file/280e05b38f33655fda19b991be2620b8_tn\",\"https://down-vn.img.susercontent.com/file/f6b7695e305ffbf55f6045a1fd2a172f_tn\",\"https://down-vn.img.susercontent.com/file/f1f0afe9ed4d4f1aacb0669cda4bc00c_tn\"]',2590,0.5,834,'2024-02-11 15:01:59','2024-04-23 06:59:53');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (257,'Áo thun tay lỡ unisex nam nữ GẤU EVERYDAY LUXA, Áo phông unisex form rộng ATL02','[\"THÔNG TIN SẢN PHẨM: - Tên sản phẩm: Áo thun Unisex form rộng tay lỡ nam nữ- Xuất sứ: Việt Nam - Chất liệu: 35% Cotton, 60% Polyester, 5% Spandex- Vải thun co giãn, hình in sắc nét, chất vải thoáng mát, không xù, không nhăn, không hút bụi bẩn\\nBẢNG SIZE:SIZE      Cân Nặng          Chiều Cao     Chiều Dài - Rộng áo                     S          29 - 35kg         1m31 - 1m41   Dài 63cm rộng 48cm  M         36 - 44kg         1m42 - 1m52   Dài 66cm rộng 50cm             L         45 - 52kg         1m53 - 1m59   Dài 68cm rộng 53cm     XL        53 - 63kg         1m60 - 1m69   Dài 70cm rộng 55cm   XXL      Trên 63kg           Trên 1m70     Dài 73cm rộng 57cm\\nNgày nay, áo thun tay lỡ Unisex form rộng đang ngày càng trở nên phổ biến và đa dạng với các mẫu thiết kế độc đáo bắt mắt, thậm chí còn bắt kịp nhiều trào lưu xu hướng đặc biệt là phong cách Hàn Quốc. Do đó, việc tìm hiểu tất tần tật về áo thun tay lỡ nam/nữ là cần thiết giúp bạn luôn cập nhật những mẫu thiết kế mới nhất. Điều này sẽ giúp bạn có nhiều sự lựa chọn mới mẻ và đa dạng phong cách thời trang của bạn.\\nVậy áo thun tay lỡ là gì?- Là loại áo phông có chiều dài tay áo dài hơn so với áo thun nam ngắn tay, thường là dài đến khuỷu tay hoặc qua khuỷu tay. - Kiểu áo phông tay lỡ này thường xuất hiện ở những thiết kế áo thun unisex oversize rộng rãi, thoáng mát. - Loại áo này “khó tính” hơn áo thun nam nữ ngắn tay, nếu biết cách mix đồ, bạn sẽ trở nên thật cá tính với phong cách thời trang đậm chất Hàn Quốc, nhưng nếu phối đồ không tốt trông bạn như đang “lọt thỏm” trong chiếc áo thun tay lỡ.\\nĐặc điểm nổi bật của áo thun tay lỡ Unisex form rộng:- Là item không thể thiếu trong tủ đồ vì sự thoải mái, dễ chịu, lại rất dễ phối đồ.- Áo thun unisex thích hợp với cả nam và nữ. Mặc làm áo thun cặp, áo nhóm rất phù hợp.- Áo thun form rộng dễ dàng phối đồ, thời trang phong cách Hàn Quốc.\\nHƯỚNG DẪN GIẶT/ỦI ÁO THUN TAY LỠ- Không sử dụng hóa chất, tẩy trực tiếp lên sản phẩm, không ngâm quá lâu trong dung dịch tẩy. - Không sử dụng bàn chải khi giặt- Giặt mặt trái, nhẹ tay, giặt xong phơi ngay, không ngâm trong nước quá lâu.- Áo trắng - áo màu nên chia ra giặt riêng, không giặt chung.\\nKhách hàng có thể an tâm khi mua hàng tại Luxa - Thời trang Unisex:+ Cam kết về chất lượng sản phẩm, Shop cam kết cả về CHẤT LIỆU cũng như HÌNH ẢNH (đúng với những gì được nêu bật trong phần mô tả sản phẩm).+ Giá thành thấp nhất thị trường và được bảo hành theo quy định với từng sản phẩm, được đổi trả hàng lỗi trong vòng 7 ngày kể từ khi mua hàng.\\n#ao #aophong #aoformrong #aoformrongnu #aonu #aonam#aophong #aophongformrong #aophongformrongnu #aosadboiz #aothun #aothununisex #aothunformrong#aothunformrongnu #aothunformrongtaylo #aothunnuformrong #aothuntaylo #aothununisex #aounisex #aounisex\"]',NULL,174,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/sg-11134201-23020-cghbapnxuinv1e_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-lihh3od5h9le23_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-lihh3od5h91o8a_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-23020-hxyt2obq9zmv6e_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-lihh3od5inm425_tn\"]',3300,0.25,171,'2024-02-11 15:01:59','2024-05-09 18:00:46');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (258,'Sét Croptop 3 Món Gấu , Quần Cạp Chun Ống Rộng, Chất Cotton su Xinh xắn','[\"Sét Croptop 3 Món Gấu , Quần Cạp Chun Ống Rộng, Chất Cotton su Xinh xắn\",\"\\n\",\"Mô  tả sản phẩm: \",\"\\n\",\"• Hàng giống hình  về kiểu dáng, màu sắc chênh lệch ko đáng kể do độ phân giải màn hình\",\"\\n\",\"• Kiểu dáng đơn giản, dễ mặc, phù hợp nhiều lứa tuổi\",\"\\n\",\"• Mùa mặc: Thích hợp nhất khi mặc mùa hè\",\"\\n\",\"• Mặc đi học, đi làm, dạo phố cùng bạn bè\",\"\\n\",\"• Xuất xứ : Việt nam\",\"\\n\",\"• Size: form to freesize dưới 58kg (Chat để nhân viên tư vấn kĩ hơn)\",\"\\n\",\"• Màu sắc: 2 màu như hình\",\"\\n\",\"------------------------------------------------\",\"\\n\",\"Lưu ý:\",\"\\n\",\"- Màu sắc vải/sản phẩm có thể sẽ chênh lệch thực tế một phần nhỏ, do ảnh hưởng về độ lệch màu của ánh sáng, góc chụp nhưng vẫn đảm bảo chất lượng.\",\"\\n\",\"\\n\",\"- Shop hỗ trợ đổi sang sản phẩm khác cùng giá hoặc cao hơn nếu quý khách không hài lòng về sản phẩm đã mua.\",\"\\n\",\"- Nếu có bất kì khiếu nại cần Shop hỗ trợ về sản phẩm, khi mở sản phẩm các Chị vui lòng quay lại video quá trình mở sản phẩm để được đảm bảo 100% đổi lại sản phẩm mới nếu Shop giao bị lỗi.\",\"\\n\",\"- Đội ngũ CSKH của shop luôn tư vấn tận tâm, chi tiết, hỗ trợ nhiệt tình nhất với khách hàng.\",\"\\n\",\" <HOTLINE> Hỗ trợ nhanh: 0972.137.357\",\"\\n\",\" Tư vấn viên hỗ trợ chat inbox: từ 8h00 - 22h00 hàng ngày\",\"\\n\",\"- Bảo quản: \",\"\\n\",\"+ Tránh phơi quần áo trực tiếp dưới ánh nắng mặt trời\",\"\\n\",\"+ Ưu tiên giặt sản phẩm bằng tay\",\"\\n\",\"#setbo #bodo #aosomi #aosomike #aoke #kexanh #sominu #somidangrong #quanshort #quanshortnu #quansoocnu #quansooc#setcroptop #set3mon #setxinh\"]',NULL,180,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/sg-11134201-22110-yo06f2jz1jjv40_tn\",\"https://down-vn.img.suser