INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (261,'Sét áo tanktop kèm quần đùi CaMa store M125','[\"🍃Mô  tả sản phẩm: \\n•  Với thiết kế đơn giản dễ mặc và sự kết hợp của chất vải co giản, thấm hút mồ hôi. Kiểu dáng thanh lịch trẻ trung.\\n•  Bộ sản phẩm bao gồm 1 quần 1 kèm áo ba lỗ\\n•  Set xinh yêu cho các nàng diện đây ạ..\\n•  Mix đồ đi chơi, dạo phố, mặc ở nhà đi học đều xinh nha..\\n•  Freesize 38- 55kg đẹp ạ..\\n\\n🌱 HƯỚNG DẪN CÁCH ĐẶT HÀNG:\\n- Cách chọn màu: Shop đã phân bảng  Màu. Vui lòng chọn Màu phù hợp.\\n- Cách đặt hàng qua Shopee: Nếu mua 1 sản phẩm thì bạn chọn  Màu rồi ấn MUA HÀNG. Nếu bạn muốn mua 2-3 Sản phẩm khác nhau :\\n+ Bạn chọn từng Sản phẩm rồi thêm vào Giỏ hàng.\\n+ Khi giỏ hàng đã có đầy đủ các sản phẩm cần mua bạn mới tiến hành \\\"Thanh toán\\\".\\n\\nĐỔI TRẢ & HOÀN TIỀN.\\n- Do tất cả thông tin về sản phẩm áo tay lỡ form rộng shop đều đã mô tả chi tiết kèm hình thật, nên shop chỉ nhận đổi trả & hoàn tiền với hàng lỗi thuộc về sản xuất như: lỗi đường may, rách vải, bong tróc hình in,... sai hàng.\\n- Không đổi trả & hoàn tiền với những trường hợp như: mặc không vừa(vì hàng freesize), đổi mẫu khác,...\\n-----------------------------------CAMA STORE CHUYÊN SỈ LẺ QUẦN ÁO ------------------------------------\\n#boyem #yem #yemnu #setyem #setyemkemao #boyemao #yemkaki #freeship #aniestore #trumthoitrangqc #settrangphuc #botrangphuc #setnu #setbo #thoitrangnu #set #bo #setnu #bonu #ao #aonu #aodaitay #thundaitay #aothun #aophong #aothunnu #aophongnnu #aococtay #aongantay \"]',NULL,194,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/293fc16f1ac34f6e4ea30781fcc840b6_tn\",\"https://down-vn.img.susercontent.com/file/4a854d6dd70def4b8caf859c16715759_tn\",\"https://down-vn.img.susercontent.com/file/f81c18a86060ea6fb9c8fda3ba9a6b4b_tn\"]',4877,NULL,629,'2024-02-11 15:01:59','2024-02-11 15:01:59');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (262,'[NHIỀU MẪU] Set đồ nữ quần dài kẻ sọc caro ống rộng Size 40-68kg- Bộ áo tay ngắn hoạt hình phối quần dài kate dáng suông','[\"[NHIỀU MẪU] Set đồ nữ quần dài kẻ sọc caro ống rộng Size 40-68kg- Bộ áo tay ngắn hoạt hình phối quần dài kate dáng suông\\n-----------\\n❤ Mô tả chi tiết sản phẩm SET BỘ NỮ QUẦN DÀI KẺ SỌC KATE NỮ TUEANHSTORE 😍😍😍\\n\\n💕 Kiểu dáng: form rộng dễ mặc dễ thương, trẻ trung, năng động\\n💕 Hoạ tiết đơn giản áo thun hoạt hình nhiều màu sắc, quần sọc kẻ caro\\n💕 Xuất xứ: Việt Nam\\n💕 Phong cách: Unisex thích hợp cho các bạn nữ\\n💕 Chất liệu: Áo vải thun cotton co dãn 4 chiều hình in 3D cao cấp. Quần chất kate QC cao cấp xịn sò ( Đảm bảo không đổ lông mặc không ngứa và không bị hôi hắc )  😍😍😍\\n💕 Kích cỡ: Áo Freesize 38-68kg \\n❤️ Áo  : dài 65cm - ngang áo 52cm\\n❤️ Quần caro 2 size :\\n              ❣ Size M 40-55kg ( cao 1m55-1m60 )\\n              ❣️ Size L 56-68kg ( cao 1m61-1m67 )\\n\\n✔️ LƯU Ý: \\n💢 Kích cỡ shop ghi là tham khảo theo cân nặng. Bạn nào cao, có bụng, thích mặc phom rộng hoặc ôm,... thì còn tùy thuộc vào chiều cao,vui lòng chat với shop trước để được tư vấn.\\n💢 Do màn hình và điều kiện ánh sáng khác nhau, màu sắc thực tế của sản phẩm có thể chênh lệch khoảng 3-5%\\n\\n👉 Đừng ngại, hãy Inbox ngay để Tuệ Anh Store tư vấn hỗ trợ bạn nhanh nhất nhé 😘😘😘 \\n#Bộ_đồ_quần_dài #Set_bộ_dài\\n#do #bo #set #hoathinh #macnha #setdounisex  #unisex #dobo #setdonu #setdonam #setdobodep #Tueanhstorethegioiunisex #setdobo #setboquanaounisex #setboquanaonu setboquanaohoathinh #setbonu #setbonam #setbomacnha #setbo #dobo #dongu #dobomacnha \"]',NULL,105,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/3bf2b7769fc2135d335b8d014c31c3dd_tn\",\"https://down-vn.img.susercontent.com/file/99856d2c4f9f936b33246deecdcf4e98_tn\",\"https://down-vn.img.susercontent.com/file/57d0a20