INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (264,'Sét áo trễ vai tơ ánh kèm quần phong cách hàn quốc xixeoshop - v65','[\"Thông tin sản phẩm  Sét áo kèm quần phong cách hàn quốc xixeoshop-v900\",\"- Váy tơ 2 lớp buộc nơ sau\",\"- Kiểu dáng: suông xòe\",\"Size\",\"- S (40-47kg)\",\"- M (48-55kg)\",\"- L (56-63kg)\",\"- Sản phẩm 100% giống mô tả. Hình ảnh sản phẩm là ảnh thật do shop tự chụp và giữ bản quyền hình ảnh\",\"- Xuất xứ: Váy được thiết kế và gia công bởi xixeoshop.\",\"Thông tin sản phẩm Sét áo kèm quần phong cách hàn quốc xixeoshop-v900\",\"\\n\",\"- Bạn cũng có thể trả lại hàng nếu không thích mua nữa, shop cam kết hoàn 100% tiền sản phẩm cho bạn. \",\"- Hàng có sẵn nên thời gian giao hàng sẽ là tối ưu nhất\",\"Do màn hình và điều kiện ánh sáng khác nhau, màu sắc thực tế của sản phẩm có thể chênh lệch khoảng 3-5%\",\"\\n\",\"xixeoshop xin cam kết với khách hàng: \",\"- Sét áo kèm quần phong cách hàn quốc  được đảm bảo chất lượng, dịch vụ tốt nhất, hàng được giao từ 1-3 ngày kể từ ngày đặt hàng\",\"- Sét áo kèm quần phong cách hàn quốc  giao hàng trên toàn quốc – ship COD\",\"- Sét áo kèm quần phong cách hàn quốc đổi trả theo đúng quy định của Shopee.\",\"\\n\",\"#vay #vaybabydoll #dambabydoll #vaybabydollđangdai #babydoll #dambabydolltrang #vaybabydolltrang #damtrang #vaytrang #vaybabydollden #vaydoi #xixeoshop #vaytaydai #damtaydai #vayhoanhi #damhoa #vayhoa #vayhoanhivintage #damdibien #vaydibien #damhoanhi #hoanhi #damduoica\",\" #vaythietke #damxoe #vintage #vayxoe #damxoe \"]',NULL,121,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-lj27xne2flci8f_tn\",\"https://down-vn.img.susercontent.com/file/vn-11110107-7r98o-lpxx126vsuo99b_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-lj27xne2cs7m7b_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-lj27xne2iehe38_tn\",\"ht