INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (265,'Set yếm xẻ Đùi Kèm Áo Bo Tăm Chất Liệu Co Giãn Có Quần Trong, Set Xinh 2 Món','[\"CẢM ƠN CÁC NÀNG ĐÃ GHÉ THĂM DALI Shop:\\nCửa hàng của chúng mình luôn chú trọng và cho ra những dòng sản phẩm chất lượng để phục vụ khách hàng, bên cạnh đó chúng tớ luôn lắng nghe và thấu hiểu nhu cầu của khách hàng để từ đó có thể phục vụ tốt hơn.\\n🎟Thông tin sản phẩm :\\n⚜️ Tên sản phẩm: \\n\\n✅Kích thước: Size S (38-47kg)\\n                         Size M (48-57kg)\\n✅Chất liệu : UMI\\n♥️Thông tin xuất xứ : \\n- Cơ sở sản xuất: tại Việt Nam\\n\\n💥Shop đã up kèm ảnh thật (Ghi chú : Do màn hình và điều kiện ánh sáng khác nhau , màu sắc thực tế của sản phẩm có thể chênh lệch khoảng 3-5%)\\n❌ Vui lòng nhắn tin để hỗ trợ tư vấn size, không hỗ trợ đổi trả nếu khách tự ý chọn size mà không vừa ❌\\n⛔️ Quyền lợi của DALI Shop:\\n✔️Được nhận viên tư vấn tận tình, giải đáp mọi thắc mắc nhanh nhất có thể \\n✔️ Đổi trả do lỗi nhà sản xuất ( khuyến khích quý khách hàng quay video quá trình mở túi hàng)\\nXin cảm ơn và chúc quý khách hàng có những trải nghiệm tuyệt vời cùng với cửa hàng của chúng tôi. \\nCảm ơn quý khách.\\n\\n#vayxinh #ao #vay2s #vayxop #vaynu #hotgirl #chanvay #vayno #vayhot #aovay #babydoll \"]',NULL,103,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/b612118045d182e77d88e6a552e14fdb_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-lfftzji988z91e_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lkn9c2ujt3f4a3_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lkn9c2ujvwk0ab_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lkn9c2ujnh5c42_tn\"]',915,NULL,73,'2024-02-11 15:01:59','2024-02-11 15:01:59');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (266,'Ang Bộ Đồ Ngủ Ngắn Dáng Rộng Co Giãn Họa Tiết Chú Voi Nhỏ Vui Nhộn Cho Cặp Đôi sr','[\"Sự chỉ rõ:\",\"\\n\",\"100% thương hiệu mới với chất lượng cao.\",\"\\n\",\"Giới tính: Phụ nữ\",\"\\n\",\"Chất liệu: 90% Polyester\",\"\\n\",\"Màu sắc: như hình ảnh\",\"\\n\",\"Mô hình: như hình ảnh\",\"\\n\",\"Giặt: giặt tay, giặt máy\",\"\\n\",\"Mùa: Xuân, Hạ, Thu, Đông.\",\"\\n\",\"Gói bao gồm: 1 x quần short nữ\",\"\\n\",\"\\n\",\"Xin lưu ý:\",\"1.Do màn hình và hiệu ứng ánh sáng khác nhau, màu sắc thực tế có thể hơi khác so với màu hình ảnh.\",\"\\n\",\"2.Xin vui lòng cho phép 2-3 cm khác nhau do đo lường thủ công.\",\"\\n\",\"3.Kích thước Châu Á nhỏ hơn kích thước EU / US / UK, Vui lòng so sánh kích thước chi tiết với kích thước của bạn trước khi mua.\"]',NULL,178,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbk0-ll20potabrxt20_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbk0-ll20ppjn7ste0c_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbk0-ll20pqivpfmv0a_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbk0-ll20prt7z8tk8c_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbk0-ll20psnqkyaqab_tn\"]',4381,NULL,1706,'2024-02-11 15:01:59','2024-02-11 15:01:59');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (267,'Bộ Đồ Ngủ Liền Thân Hình Hoạt Hình Đáng Yêu','[\"Size unisex nên dù nam hay nữ đều mặc được, chúng tôi cũng khuyên bạn có thể dùng làm đồ ngủ cặp đôi\\n\\nCó dây kéo quanh hông nên dễ dàng đi tắm;\\n\\nXin vui lòng cho tôi biết nếu bạn muốn nhiều hơn, chúng tôi sẽ cung cấp cho bạn một mức giá tốt với vận chuyển nhanh chóng!Cảm ơn!\\n\\nKích thước đồ ngủ dành cho người lớn:\\n\\nS: 148-158cm (Chiều cao)\\nM: 158-165cm (Chiều cao)\\nL: 165-173cm (Chiều cao)\\nXl: 173-183cm (Chiều cao)\\n\\nKích thước giày:\\n\\nSize 40 cho Châu Âu Size 36-40, chiều dài chân 23-25cm\\nSize 44 cho Châu Âu Size 41-44, cho Chiều dài chân 25-27cm\\n\\nSo sánh kích thước chi tiết với của bạn, vui lòng cho phép chênh lệch 1-2 CM do đo lường thủ công, cảm ơn\\n\\nLưu ý: Do sự khác biệt giữa các màn hình khác nhau, hình ảnh có thể không phản ánh màu sắc thực tế của mặt hàng. Chúng tôi đảm bảo phong cách giống như trong hình, nhưng không giống biểu diễn trên các cơ thể khác nhau như trên người mẫu. Cảm ơn bạn!\\n\\nSản phẩm Bao gồm (không bao gồm Dép) (Nếu bạn cần dép, bạn nên mua nó)\\n1x đồ ngủ\"]',NULL,57,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/ff88a7eeeec7713ba3bd9c106ccf711c_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7qve3-ljgrtwfxbs8kf5_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7qvf1-ljgrtx7eae9g45_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7qve9-ljgrtxovi03u0d_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7qvfv-ljgooinulgcqf1_tn\"]',4504,NULL,863,'2024-02-11 15:01:59','2024-02-11 15:01:59');
