INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (270,'áo thun nữ,nam cộc tay phối màu in số 11 dáng rộng giấu quần năng động','[\"áo thun nữ,nam cộc tay phối màu in số 11 dáng rộng giấu quần năng động\\náo thun nữ cộc tay phối màu in số 11 phong cách hàn\\n\\nchất sợi lolyester\\n\\nmàu :trắng,hồng,xanh\\n\\nfree size<62kg\\n\\nphiên bản áo dáng rộng nam nữ đều măc được \\n\\nphong cách đường phố ,măc đi chơi đi tập thể thao đi học đều được a!\\n\\ntất cả các sản phẩm đều có sẵn hàng ,các bạn hãy yên tâm đăt hàng nhé.\\n\\ntất cả các mẫu áo đều được may từ chất liệu tốt đảm bảo mang đến cho khách hàng sự thoải mái,không khó chịu khi mặc .\\n\\nshop luôn tuyển sỉ và ctv trên toàn quốc .\\n\"]',NULL,160,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/f2262d6ecf6fb17b9ae0c38064cfd313_tn\",\"https://down-vn.img.susercontent.com/file/10c7e3f6014b275dd811046e9d5d4462_tn\",\"https://down-vn.img.susercontent.com/file/e2e17e42728706a6ddd4d527816adf5f_tn\",\"https://down-vn.img.susercontent.com/file/7249ba30fa4bf7d6d4cd63ea415f9a46_tn\",\"https://down-vn.img.susercontent.com/file/cc1cb475b6931d8a3ee0c37329422539_tn\"]',499,NULL,103,'2024-02-11 15:01:59','2024-02-11 15:01:59');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (271,'Áo Thun Polo Tay Ngắn Cổ Bẻ Phối Thời Trang Mùa Hè','[\"Gói bao gồm: 1 * đầu\",\"Gói bao gồm: 1 * quần\",\"Chất liệu: Cotton + sợi polyester + khác\",\"【Chỉ Mang tính chất tham khảo, không có tiêu chuẩn thực tế】\",\"Kích thước:\",\"S\\tChiều dài quần áo:\\t52\\tLật tẩy:\\t80\\tChiều dài tay áo:\\t21\\tChiều rộng vai:\\t32\",\"M\\tChiều dài quần áo:\\t53\\tLật tẩy:\\t84\\tChiều dài tay áo:\\t22\\tChiều rộng vai:\\t33\",\"S\\tChiều dài quần:\\t103\\tVòng eo:\\t62-70\\tHông:\\t104\",\"M\\tChiều dài quần:\\t104\\tVòng eo:\\t66-74\\tHông:\\t108\",\"L\\tChiều dài quần:\\t105\\tVòng eo:\\t70-78\\tHông:\\t112\",\"\\n\",\"Ghi chú:\",\"Đơn vị tính: cm\",\"   ❤ Vì hiệu ứng hiển thị và ánh sáng khác nhau, màu sắc thực tế của sản phẩm có thể hơi khác so với màu sắc trong hình. Cảm ơn bạn.\",\"   ❤ Nếu sản phẩm của chúng tôi không có kích thước hay màu sắc yêu thích của bạn, hoặc bạn muốn tìm hiểu thêm thông tin, vui lòng liên hệ với chúng tôi. Cảm ơn bạn.\",\"   ❤ Nếu có vấn đề gì khi nhận gói hàng, xin hãy liên hệ với chúng tôi để được hỗ trợ xử lý, chúng tôi sẽ giải đáp thỏa đáng cho bạn.\",\"   ❤ Tất cả các sản phẩm đều được gửi về từ nước ngoài, chất lượng siêu tốt với mức giá rẻ, các bạn thấy thích thì đừng quên chia sẻ cho bạn bè mình nha\"]',NULL,82,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/0cd7f4272bbbdceb1ab202919c8c3018_tn\",\"https://down-vn.img.susercontent.com/file/cn-11134207-7r98o-lllldzah4vbsca_tn\",\"https://down-vn.img.susercontent.com/file/60d8c310160ffed928f6646449b54c46_tn\",\"https://down-vn.img.susercontent.com/file/b32061a3c25c82d77aae8ca19717d54f_tn\",\"https://down-vn.img.susercontent.com/file/03b168987566aa98688dbc97b1548b06_tn\"]',4504,NULL,61,'2024-02-11 15:01:59','2024-02-11 15:01:59');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (272,'Bộ Đồ Ngủ Nữ Cotton Dài Tay Đáng Yêu BRALUNE, Đồ Ngủ Nữ Pijama Mềm Mại Thoải Mái','[\"Bộ Đồ Ngủ Nữ Cotton Dài Tay Đáng Yêu BRALUNE, Đồ Ngủ Nữ Pijama Mềm Mại Thoải Mái\",\"Giấc ngủ rất quan trọng, vậy nên chọn 1 bộ đồ ngủ phù hợp với mình là rất cần thiết cho chị em. Nhà BRALUNE chúng mình có rất nhiều mẫu mã đảm bảo cho khách hàng thấy đẹp mắt lẫn đẹp dáng.\",\"MÔ TẢ SẢN PHẨM :\",\"-\\tChất liệu: Cotton\",\"-\\tSize: M(40kg – 50kg)\",\"         L(50kg – 60kg)\",\"         XL(60kg – 70kg)\",\"-\\tMàu sắc: Nhiều màu sắc, mẫu mã đa dạng, hoạ tiết gấu , thỏ đáng yêu\",\"Cửa hàng chính hãng: Hà Nội, Hồ Chí Minh\",\"ĐẶC ĐIỂM NỔI BẬT :\",\"-\\tLà đồ ngủ dài tay nhưng không quá dày mà còn khá thoáng mát nên có thể mặc chúng ra ngoài mà vẫn có thể đảm bảo là không quá nóng hay lạnh.\",\"-\\tChị em phụ nữ có thể thoải mái vận động, là đồ ngủ được dệt từ Cotton nên khả năng thấm hút mồ hôi rất tốt, chống bị mài mòn, hơn nữa còn bảo vệ cơ thể khỏi những vết bẩn không đáng có.\",\"-\\tDù đồ ngủ ở nhà rất đơn giản nhưng nó lại tôn lên được vẻ nữ tính, một số bộ ngủ còn có thể có tác dụng tôn dáng.\",\"-\\tMặc lên mình bộ ngủ làm cho bản thân trở nên xinh đẹp chỉn chu đối với người bên cạnh hơn đó.\",\"-\\tBộ đồ ngủ BRALUNE có rất nhiều màu sắc cho chị em chọn lựa cũng như nhiều mẫu mã khác nhau, rất đa dạng.\",\"LƯU Ý KHI SỬ DỤNG:\",\"Để bảo quản được bộ đồ ngủ của mình, chị em nhớ chú ý 1 số điểm sau nhé:\",\"-\\tKhông nên giặt chung với quần áo khác, nên giặt tay đồ của bạn để tránh va chạm, tiếp xúc dẫn tới việc quần áo bị xước.\",\"-\\tTránh dùng những chất tẩy quá mạnh.\",\"-\\tKhi giặt xong, phơi đồ ở nơi thoáng mát, nên tránh ánh nắng trực tiếp để form quần áo giữ được lâu hơn nhé.\",\"\\n\",\"CAM KẾT CỦA SHOP :\",\"-\\tSản phẩm giống hình và mô tả\",\"-\\tHàng luôn sẵn có số lượng lớn , thời gian chuẩn bị hàng nhanh chóng\",\"-\\tLuôn có nhân viên thường trực Shop online để trả lời những thắc mắc , giải quyết vấn đề của khách hàng sớm nhất\",\"-\\tNếu như sản phẩm có vấn đề sau khi nhận hàng , shop sẽ hỗ trợ đổi trả 100% trong vòng 7 ngày\",\"#dongu #dongunu #dongudaitay #bodongu #bodongunu #bodongunudaitay #pyjama #pijama #dongupyjama #dongudangyeu #dongudethuong #dongurongrai #donguthoaimai #donguhoatiet #bodongudangyeu #quanaongu #quanaodethuong #quanaodaitay #bodongupyjamas #pyjamas #bodongucotton #dongucotton #dongupyjamas #dongudaitaycotton #bongudaitaycotton #bongucotton #bongupyjamas\"]',NULL,146,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lmiajjsh4u737f_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lmiajjshd9lr2b_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lmiajjsh68rj05_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lmiajjsh7nbz31_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lmiajjsh91wf72_tn\"]',4702,NULL,1074,'2024-02-11 15:01:59','2024-02-11 15:01:59');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (273,'Set Đầm Xốp Cổ V Bo Viền Sang Chảnh, Set 2 Món Gồm Áo Đính Cúc Ngọc + Chân Váy Có Quần Trong','[\"CẢM ƠN CÁC NÀNG ĐÃ GHÉ THĂM DALI Shop:\\nCửa hàng của chúng mình luôn chú trọng và cho ra những dòng sản phẩm chất lượng để phục vụ khách hàng, bên cạnh đó chúng tớ luôn lắng nghe và thấu hiểu nhu cầu của khách hàng để từ đó có thể phục vụ tốt hơn.\\n🎟Thông tin sản phẩm :\\n⚜️ Tên sản phẩm: Set Đầm Xốp Cổ V Bo Viền Sang Chảnh, Set 2 Món Gồm Áo Đính Cúc Ngọc + Chân Váy Có Quần Trong\\n\\n✅Kích thước: S,M\\n✅Chất liệu : gấm xốp\\n♥️Thông tin xuất xứ : \\n- Cơ sở sản xuất: tại Việt Nam\\n\\n💥Shop đã up kèm ảnh thật (Ghi chú : Do màn hình và điều kiện ánh sáng khác nhau , màu sắc thực tế của sản phẩm có thể chênh lệch khoảng 3-5%)\\n❌ Vui lòng nhắn tin để hỗ trợ tư vấn size, không hỗ trợ đổi trả nếu khách tự ý chọn size mà không vừa ❌\\n⛔️ Quyền lợi của DALI Shop:\\n✔️Được nhận viên tư vấn tận tình, giải đáp mọi thắc mắc nhanh nhất có thể \\n✔️ Đổi trả do lỗi nhà sản xuất ( khuyến khích quý khách hàng quay video quá trình mở túi hàng)\\nXin cảm ơn và chúc quý khách hàng có những trải nghiệm tuyệt vời cùng với cửa hàng của chúng tôi. \\nCảm ơn quý khách.\\n\\n#vayxinh #ao #vay2s #vayxop #vaynu #hotgirl #chanvay #vayno #vayhot #aovay #babydoll\"]',NULL,149,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-ljxwww9h3l4ke2_tn\",\"https://down-vn.img.susercontent.com/file/68c35621bac58f9f43a52283ebf72ea3_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-ljxwww9halys3b_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-ljxwww9h97ec92_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-ljxwww9h0ruqeb_tn\"]',3588,NULL,1481,'2024-02-11 15:01:59','2024-02-11 15:01:59');
