INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (275,'Áo đôi nam nữ, áo phông đôi, áo cặp mặc với người yêu in hình trụ cột nóc nhà dễ thương thấm hút tốt [ GIÁ 1 ÁO]','[\"Áo đôi nam nữ, áo phông đôi in hình phi hành gia đáng yêu chất co giản không bong tróc\\n⚠️ LƯU Ý:\\nGiá áo đôi nam nữ, áo phông đôi BAO GỒM 1 ÁO KHÁCH NHÉ !!! \\n(quý khách muốn đặt 2 áo size khác nhau thì chọn từng size rồi ấn thêm vào giỏi hàng, rồi quay trở lại chọn size khác thêm vào giỏi hàng là dc 2 size trong 1 đơn hàng khách nhé )\\n\\n🍀 CAM KẾT\\n✅ Áo đôi nam nữ, áo phông đôi giống mô tả và hình thật 100%\\n✅ Áo đôi nam nữ, áo phông đôi đảm bảo chất lượng sản phẩm giao cho khách được kiểm tra kỹ lưỡng\\n✅ Chất lượng sản phẩm luôn được cải tiến tốt nhất\\n✅ Hoàn tiền 100% nếu sản phẩm khác mô tả\\n✅ Cam kết đổi trả MIỄN PHÍ hàng trong vòng 7 ngày nếu phát sinh sự cố từ nhà sản xuất và vận chuyển\\n\\n\\n🍀 MÔ TẢ SẢN PHẨM\\n✔️  ✅ Áo đôi nam nữ, áo phông đôi với chất liệu thun cực mát, thấm hút tốt, sản phẩm sẽ mang đến cho bạn cảm giác dễ chịu và thoải mái những lúc nghỉ ngơi, thư giãn tại nhà.và những lúc bạn đi chơi,đi dạo,đi shopping.vvvv\\n✔️ Áo đôi nam nữ, áo phông đôi nam nữ kiểu dáng xinh xắn với áo cổ tròn, tay lỡ họa tiết vô cùng đáng yêu, giúp bạn gái thêm tự tin với vẻ ngoài gọn gàng, dễ thương của mình.\\n✔️ Ngoài ra, Áo đôi nam nữ, áo phông đôi còn ghi điểm bởi các họa tiết vô cùng kute, màu sắc tươi tắn, phù hợp với những cô nàng bánh bèo, đáng yêu.\\n✔️ áo cặp mặc với người yêu sản phẩm thích hợp mặc đi chơi, đi du lịch, shopping,vvv\\n\\n🍀 BẢNG SIZE ÁO( Mẫu 2 khách nên tăng 1 size để dc form rộng như hình nhé)\\n+ Size S: 36 - 45kg ; cao 146 - 158cm.\\n+ Size M: 45 - 54kg ; cao 156 - 165cm.\\n+ Size L: 54 - 63kg; cao 163 - 171cm.\\n+ Size XL: 63 - 72kg ; cao 164 - 175cm.\\n+ Size XXL: 72 - 81kg ; cao 168 - 182cm.\\n+ Size XXXL: 81 - 90kg ; cao 170 - 185cm.\\n⚠️ Lưu ý:\\n- Áo đôi nam nữ, áo phông đôi form chung cho nam và nữ.\\n- Áo form chuẩn nếu khách muốn mặc rộng thì tăng lên 1 size nhé ( mẫu 2 khách nên tăng 1 size để được form rộng như hình)\\n- Người quá béo hoặc quá gầy nên tăng giảm size cho phù hợp.\\n🍀 HƯỚNG DẪN BẢO QUẢN ÁO THUN:\\n✔️ Lần giặt áo trơn đầu tiên bạn nên vò bằng tay, giặt bằng nước lã và không sử dụng xà phòng. Bạn không nên giặt chung với các đồ dùng có khác màu đặt biệt là màu trắng vì đối với các loại áo thun có màu đậm như (đỏ đô, cam, xanh đen…) rất dễ ra màu ảnh hưởng đến các đồ khác.\\n✔️ Không đổ trực tiếp các loại xà phòng, nước tẩy lên hình in.\\n✔️ Hạn chế sử dụng nước xả làm mềm vải vì nó sẽ làm cho áo bạn nhanh bị giãn và làm cho hình in bị mềm, dễ bong tróc.\\n✔️ Không nên vắt áo thun sau khi giặt vì điều này khiến áo bạn bị giản ra và chảy xệ mất đi vẻ đẹp của áo.\\n⭕ ĐẶC BIỆT BÊN SHOP NHẬN IN HÌNH CÁ NHÂN (HÌNH,TÊN, SỐ ...) CHỈ CẦN GỬI ẢNH MÌNH THÍCH.\\n\\nHotline ZALO : 0362877709- 0903608758 MUA SỈ XIN GỌI\\n#aocap #aodoi #aothuncap #aothundoi #aotinhnhan #aothuncapnamnu #aothuncapdoi #aophongcap #aophongdoi #aophongdoiinhinh #aophongdoigiare #aothuncapcotron #aothuncapdep #aophongdoinamnu #aodoitinhnhan #aodoigiare #aodo\"]',NULL,70,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/f86009bbaf5cfa597ba03bf4df6128be_tn\",\"https://down-vn.img.susercontent.com/file/36308b2271f5e988a849b7a9aa56ee82_tn\",\"https://down-vn.img.susercontent.com/file/52214031db8b90bb471f1429522a4ffa_tn\",\"https://down-vn.img.susercontent.com/file/a01bf79574e78047d16ef2d8c2563ebd_tn\",\"https://down-vn.img.susercontent.com/file/2cc79cba3f95f315c8a7c9bfc82da877_tn\"]',626,NULL,207,'2024-02-11 15:01:59','2024-02-11 15:01:59');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (276,'[FREESHIP 25K] Áo phông babytee sọc tay NOC, áo thun form fit siêu hot','[\"SAMSAM4896 ❤️\",\"Chuyên Sản Xuất Hàng May Sẵn .\",\" Bán Buôn - Bán Sỉ Số Lượng Lớn Và Nhận Đặt May Theo Yêu Cầu . Inbox Zalo lấy link vào nhóm sỉ nếu có nhu cầu nhập hàng về bán nhé : 0345062610\",\"\\n\",\"🎁THÔNG TIN SẢN PHẨM : \",\"🕸️🕸️🕸️🕸️🕸️🕸️\",\"Chất cotton xuất đẹp\",\"Đường may kỹ,chắc chắn, tinh tế, sắc xảo\",\"Form Từ 40kg đến <57kg tùy cơ địa. \",\"form vừa hot\",\"Áo dài 58 rộng 48\",\"🌀 Màu sắc ( lưu ý ) :\",\" ● Do ánh sáng góc chụp, màn hình khác nhau, hàng thật có thể khác với hình ảnh. Vui lòng lấy sản phẩm thật làm tiêu chuẩn!\",\"🌀 Form chuẩn Unisex Nam Nữ Couple đều mặc được.\",\"🌀 Cam kết: Chất lượng và Mẫu mã Sản phẩm giống với Hình ảnh.\",\"🔥Lưu ý : \",\"+ Giao hàng tận nơi. Nhận hàng thanh toán.\",\"(Nếu Sản phẩm bị lỗi Quý khách vui lòng inbox liên hệ Shop để được hỗ trợ đổi hàng hoặc Trả hàng/Hoàn tiền cho Khách ạ. Rất mong Quý Khách đừng vì lỗi nhỏ mà cho Shop 1 - 2 sao tội nghiệp Shop! Và đồng nghĩa Quý khách sẽ mất đi quyền lợi đổi hàng nha)\",\"\\n\",\"HƯỚNG DẪN GIỮ LÂU MÀU HÌNH IN VÀ SẢN PHẨM NHÀ SAMSAM\",\"- Nhận hàng về nếu bạn có giặt thì mình giặt sơ bằng nước lạnh rồi phơi luôn nhé.\",\"- Hoặc giặt sau 3 ngày nhận áo ( để hình in được dính chặt hơn trên sợi vải) ---> giữ hình in đẹp hơn.\",\"- Các bạn tuyệt đối không ngâm áo với chất tẩy.\",\"- Hạn chế giặt máy nhiều nha ít nhất trong 2 tuần đầu nè.\",\"- Các bạn cũng đừng ngâm áo hoặc quần quá lâu trong nước giặt và nước xả nha.\",\"- À, QUAN TRỌNG HƠN LÀ NHỚ LỘN ÁO TRƯỚC KHI PHƠI NÈ.\",\"\\n\",\"- Hỗ trợ đổi trả qua Shopee.\",\"- Hàng có sẵn, nhận đơn thì donna đi hàng nhé.\",\"- Hoàn tiền 100% nếu sản phẩm không giống mô tả.\",\"- Hỗ trợ đổi sản phẩm miễn phí nếu sản phẩm bị lỗi do nhà sản xuất.\",\"-------------------------------\",\"* SAMSAM CAM KẾT: \",\"- Sản phẩm 100% giống mô tả\",\"- Tư vấn nhiệt tình, chu đáo luôn lắng nghe khách hàng để phục vụ tốt. \",\"- Giao hàng nhanh đúng tiến độ không phải để quý khách chờ đợi lâu để nhận hàng. \",\"-------------------------------\",\"* Đổi trả theo đúng quy định của Shopee \",\"1. Điều kiện áp dụng (trong vòng 03 ngày kể từ khi nhận sản phẩm): \",\"- Có video khi bóc hàng , kiểm hàng \",\"- Hàng hoá vẫn còn mới, chưa qua sử dụng \",\"- Hàng hóa hư hỏng do vận chuyển hoặc do nhà sản xuất. \",\"\\n\",\"2. Trường hợp được chấp nhận: \",\"- Hàng không đúng size, kiểu dáng như quý khách đặt hàng \",\"- Không đủ số lượng, không đủ bộ như trong đơn hàng\",\"\\n\",\"3. Trường hợp không đủ điều kiện áp dụng chính sách:\",\" - Quá 03 ngày kể từ khi Quý khách nhận hàng \",\" - Gửi lại hàng không đúng mẫu mã\",\" - Đặt nhầm sản phẩm, chủng loại, không thích, không hợp,...\",\" Ấn theo dõi để ủng hộ shop và tham khảo các sản phẩm mới của shop, Sam Sam rất hân hạnh được phục vụ quý khách\",\"------------------------------------------\",\"\\n\",\"#aoxevat #aotronxeta #aophongtron #aophoitay #aobongchay #aothethao\",\"#aothun #aounisex #aotaylo #aobabytee #babyteehot #aophong #aohe #aomacnha #aopolo #aoloang #aoessentials #aoformto #taylo #aooversize #aonhom #aolop #aocotton #aoloai1 #aothunnu #aothunnam #aothun #aopolo #namnu #aothundep #aothunformrong\",\"Chốt đơn số lượng lớn zalo: 0345062610\",\"NHẬN ĐẶT MAY THEO YÊU CẦU.\"]',NULL,128,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-lhirzv61kurlc8_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-lhiqy2babath4e_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-lhiqy2b9vukl7f_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-lhire0pugbr96e_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-lhirp46jui0xf5_tn\"]',1193,NULL,304,'2024-02-11 15:01:59','2024-02-11 15:01:59');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (277,'🔥SIÊU PHẨM🔥 Set áo nghộ nghĩnh + quần kaki','[\"❌ Mã SET MỚI SIÊU HÓT❌\\n➡️🔥 GIÁ CHỈ #95k/1set (áo lỡ + quần dài)🔥⬅️\\nMã hót mã hót lại thêm mẫu mới đây mọi người ơi đẹp rụng tim con dân mất thôi ❤️ \\nVẫn là shop em bao giá cho xị em mình nhỉ - chỉ có thể nói là siêu siêu rẻ kì công trên từng đường kim mũi chỉ💃🏻\\nSet đồ đi chơi - đi học - du nịch gì cũng đều không làm chị em thấy vọng được👻\\nchỉ có 95kkk bạn đã có ngay : 1 áo thun tay lỡ + 1 quần dài kaki cá tính . Còn đâu rẻ hơn shop Em nữa ạ . giá phá đảo trên từng hạt gạo hẳn sẽ không khiến chị em thất vọng đâu ạ 🥰\\nnhanh tay nhanh tay chậm tay hết mất 🥳🥳🥳\\nhãy để lại (.) để bên shop tư vấn thêm cho bạn nhé🔥\\nRủ đồng bọn vào diện thôi nào hết sảy con bà bảy thôi ạ🥴\\n🌵FULL SIZE : 38-65kg\\n🌵FULL MÀU : xanh - cà phê - vàng - hồng\\n🌵Ship cod siêu yêu thương🌗\\nĐịa chỉ sản xuất : xóm 3 - ninh hiệp - gia lâm - hà nội\\nXuất xứ : việt nam\\n\\ntổ chức chịu trách nhiệm : honeybomber store\\nđịa chỉ chịu trách nhiệm : 26 nguyễn thái học - phường đội cung - thành phố vinh - nghệ an\"]',NULL,134,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/d1528cdca169e9f25862bb5b53209dbf_tn\",\"https://down-vn.img.susercontent.com/file/ae095ba6d2e2e2eaa7eb9ef3384b1618_tn\",\"https://down-vn.img.susercontent.com/file/e15946fcda1f8cada91b1d9ad1dcd769_tn\",\"https://down-vn.img.susercontent.com/file/467279c0081de7c79e76ddb2d11ae960_tn\",\"https://down-vn.img.susercontent.com/file/71a1047d24d63c3cf99c5daf761dff61_tn\"]',8630,NULL,461,'2024-02-11 15:01:59','2024-02-11 15:01:59');
