INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (280,'Bộ quần đùi áo thun unisex nữ tay lỡ form rộng chất cotton su in chữ CUTE THU LÊUNISEX B30','[\" CAMA STORE ❤️\",\"🎁THÔNG TIN SẢN PHẨM : Bộ quần đùi áo thun unisex nữ tay lỡ form rộng chất cotton su in chữ CUTE CATHU LÊUNISEX B30\",\"🕸️🕸️🕸️🕸️🕸️🕸️\",\"Chất cotton loại 1---Siêu dày đẹp,mát mịn.\",\"Đường may kỹ,chắc chắn, tinh tế, sắc xảo\",\"Form Từ 40kg đến <55kg tùy chiều cao. \",\"Tay lỡ qua khuỷu. \",\"Hình thêu vi tính chỉ dày nét đẹp.\",\"Hàng có trần nẹp cổ---phối bo cổ xịn sò\",\"Quần đùi đè cạp, form to. chất cotton loại 1 luôn ạ\",\"🌀 Màu sắc ( lưu ý ) :\",\" ● Do ánh sáng góc chụp, màn hình khác nhau, hàng thật có thể khác với hình ảnh. Vui lòng lấy sản phẩm thật làm tiêu chuẩn!\",\"🌀 Form chuẩn Unisex Nam Nữ Couple đều mặc được.\",\"🌀 Cam kết: Chất lượng và Mẫu mã Sản phẩm giống với Hình ảnh.\",\"🔥Lưu ý : \",\"+ Giao hàng tận nơi. Nhận hàng thanh toán.\",\"(Nếu Sản phẩm bị lỗi Quý khách vui lòng inbox liên hệ Shop để được hỗ trợ đổi hàng hoặc Trả hàng/Hoàn tiền cho Khách ạ. Rất mong Quý Khách đừng vì lỗi nhỏ mà cho Shop 1 - 2 sao tội nghiệp Shop! Và đồng nghĩa Quý khách sẽ mất đi quyền lợi đổi hàng nha!)\",\"+ Tiết kiệm hơn khi mua nhiều\",\"🌱 Quý Khách vui lòng đọc kỹ Thông Tin Sản Phẩm trước khi đặt hàng, tránh đặt rồi hủy hàng nhé, hoặc có hủy thì hủy sớm trước khi đơn hàng đưa vận chuyển nhé. Vì sau khi đặt hàng, hàng sẽ được Shop gói và gửi đi liền trong ngày hoặc ngày hôm sau. Vì thế việc hủy hàng sẽ gây nhiều khó khăn cho Shop. Rất mong Quý Khách cảm thông và đắn đo giúp Shop!!!\",\"📌 Theo quy định của Shopee Khách hàng sẽ KHÔNG ĐƯỢC XEM HÀNG trước khi thanh toán nhưng được đổi trả sau 24h nếu sản phẩm bị lỗi tính từ thời điểm nhận được hàng. Hãy chắc chắn nhận hàng và để thông tin chính xác khi ấn Mua hàng tránh trường hợp giao đi rồi lại quay về.\",\"📌 Hàng sẽ được Shop giao cho vận chuyển trong 1 ngày kể từ khi đặt  hàng. Vì vậy, nếu có yêu cầu hủy đơn hàng vui lòng inbox Shop và quyết định trước khi shop giao cho vận chuyển. Vận chuyển của Shopee sẽ liên hệ quý khách để giao hàng. (Thanh Hóa 1-2 ngày, các Tỉnh TP khác 3-5 ngày)\",\"\\n\",\"🌱 HƯỚNG DẪN CÁCH ĐẶT HÀNG:\",\"- Cách chọn màu: Shop đã phân bảng  Màu. Vui lòng chọn Màu phù hợp.\",\"- Cách đặt hàng qua Shopee: Nếu mua 1 sản phẩm thì bạn chọn  Màu rồi ấn MUA HÀNG. Nếu bạn muốn mua 2-3 Sản phẩm khác nhau :\",\"+ Bạn chọn từng Sản phẩm rồi thêm vào Giỏ hàng.\",\"+ Khi giỏ hàng đã có đầy đủ các sản phẩm cần mua bạn mới tiến hành \\\"Thanh toán\\\".\",\"------------------------------------------\",\"#bodo #bodui #bophanquang #bomacnha #bophanquangunisex #boduicotton #bodocotton #pizama\",\"#aothun #aounisex #aotaylo #aoformrong #aophong #aohe #aomacnha #aobosua #aoloang #aoformto #taylo #aooversize #aonhom #aolop #aocotton #aoloai1\"]',NULL,151,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-lj2y7tmgk2do7e_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-lj2y7tmglgy49d_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-lj2y7tmgmvik36_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-lj2y7tmgr37w57_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7qukw-lj2y7tmgoa303a_tn\"]',4165,NULL,1063,'2024-02-11 15:01:59','2024-02-11 15:01:59');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (281,'CHUMIAN Bộ Đồ Ngủ Áo Tay Ngắn Cổ Tròn Phối Quần Short Vải Cotton In Hoạt Hình Dễ Thương Thời Trang Xuân Hè Cho Nữ','[\"Product Description: \",\"\\n\",\"Giới thiệu sản phẩm:\",\"\\n\",\"Sản phẩm là bộ đồ ngủ cực kỳ thoải mái và mềm mại của thương hiệu chất lượng cao CHUMIAN. Thiết kế với hình ảnh đáng yêu, tươi sáng như một chú ong hoa, tất cả các bộ đồ ngủ trong bộ sưu tập đều được làm từ chất liệu vải 100% cotton cao cấp và chất lượng tốt nhất. Bộ đồ ngủ này rất thích hợp để mặc khi ngủ, nghỉ ngơi hoặc ở nhà trong những ngày dễ chịu và thư giãn. \",\"\\n\",\"Tính năng sản phẩm:\",\"\\n\",\"Bộ đồ ngủ có đặc điểm là thoải mái và mềm mại để dành cho giấc ngủ ngon trọn đêm. Vải cotton cao cấp giúp cho việc thấm hút mồ hôi và khí thoát ra được tốt, mang lại sự thoải mái và khô ráo cho người mặc. Chất liệu vải cao cấp này còn giúp chống lại dị ứng và các vấn đề về da, đặc biệt là rất an toàn cho trẻ em. Bộ sưu tập đồ ngủ của thương hiệu 触棉 có một loạt các kiểu dáng đa dạng, phù hợp với nhiều đối tượng khác nhau. \",\"\\n\",\"Cách sử dụng:\",\"\\n\",\"Đây sách là một bộ đồ ngủ đơn giản và dễ sử dụng. Bạn chỉ cần mặc nó vào trước khi đi ngủ hoặc khi ở nhà nghỉ ngơi. Bạn có thể giặt nó bằng tay hoặc bằng máy với nước lạnh để duy trì chất lượng và độ mềm mại của vải bộ đồ ngủ. \",\"\\n\",\"Lưu ý khi sử dụng:\",\"\\n\",\"Không áp dụng chất tẩy rửa mạnh. Ép vải bộ đồ ngủ trước khi phơi giúp vải mềm hơn và giúp cho việc làm sạch dễ dàng hơn. Bạn nên giặt bộ đồ ngủ trước khi sử dụng lần đầu để loại bỏ bất kỳ tạp chất hay dị ứng có thể có ở trên vải. \"]',NULL,197,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/4a3a8436699b021aad4b204c3902141d_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134201-7qukw-lf25rxt6qgrbca_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134201-7qukw-lf25rx33sms750_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134201-7qukw-lf25rx6fp5sa23_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134201-7qukw-lf25rxqeuixj81_tn\"]',747,NULL,98,'2024-02-11 15:01:59','2024-02-11 15:01:59');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (282,'Set Áo Thun Ngắn Tay + Quần Short Ống Rộng Thời Trang Nữ','[\"Phong cách: Quần ống rộng\\nChi tiết vòng eo: Eo cao\\nQuần dài: Quần nữ\\nChiều dài tay áo: Dài tay\\nCác yếu tố phổ biến: Bow\\nVải / Chất liệu: Polyester / Polyester (Sợi Polyester)\\nNội dung thành phần: 30% Và những thứ sau\\n\\n💕💕💕💕Chào mừng đến với Cửa hàng của tôi💕💕💕💕\\nNếu có thắc mắc, bạn có thể hỏi nhân viên chăm sóc khách hàng\\nCung cấp cho bạn dịch vụ tốt nhất\\nNếu bạn không biết làm thế nào để chọn một kích thước\\nVui lòng liên hệ với bộ phận chăm sóc khách hàng của chúng tôi và để lại\\nChiều cao / Cân nặng / Ngực / Eo / Hông\\nChúng tôi sẽ giúp bạn chọn đúng kích thước\\nĐề xuất kích thước: \\nSize S: cân nặng 35kg-40kg, cao 145-150cm\\nSize M: cân nặng 40kg-50kg, cao 155-165cm\\nSize L: cân nặng 50-60kg, cao 165-175cm\\nSize XL: cân nặng 60-70kg, chiều cao 170-175cm\\nSize 2XL: cân nặng 70-80kg, cao 175-180cm\\nSize 3XL: cân nặng 80-90kg, cao 175-180cm\\nSize 4XL: cân nặng 90-100kg, cao 175-180cm\\n\\nTất nhiên, cũng có các kích thước lớn cho bạn lựa chọn!\\nVui lòng để lại kích thước và nhận xét kiểu dáng khi đặt hàng.\\nCác sản phẩm trong cửa hàng đều có trong kho.\\nSản phẩm mới trong cửa hàng!!!\\nVì nó là một doanh nghiệp ở nước ngoài, thời gian giao hàng chung là 8-15 ngày.\\n1. Do đo lường thủ công, xin vui lòng cho phép 1-3 CM là khác nhau, các kích thước trên chỉ là để tham khảo.\\n2. Vì các máy tính khác nhau hiển thị màu sắc khác nhau, màu sắc thực tế của dự án có thể hơi khác so với hình ảnh trên, cảm ơn bạn đã thông cảm.\\n3. Hình chỉ hiển thị mẫu, do ánh sáng, môi trường, máy ảnh, các hiệu ứng khác nhau và các yếu tố khác, hình ảnh hơi khác so với thực tế.\\nCảm ơn bạn!\"]',NULL,64,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/sg-11134201-22090-5fh6qmz1vuhved_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-22100-dul5ywqb7liv34_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-22100-pns39wqb7liv3b_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-22100-58749wqb7livb4_tn\",\"https://down-vn.img.susercontent.com/file/f29fe7107c5808081b6d11bb24e2a2d8_tn\"]',8985,NULL,1946,'2024-02-11 15:01:59','2024-04-10 07:33:31');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (283,'CRLNHC Bộ Đồ Ngủ 2 Món Áo Thun Tay Ngắn In Hoạt Hình + Quần Short Thời Trang Cho Nữ','[\"Thông tin chi tiết:\",\"\\n\",\"100% hàng mới với chất lượng cao.\",\"\\n\",\"Dành cho: Phụ nữ\",\"\\n\",\"Chất liệu: Polyester\",\"\\n\",\"Màu sắc: Như hình\",\"\\n\",\"Kích thước: Như hình ảnh\",\"\\n\",\"Giặt: Rửa tay\",\"\\n\",\"Mùa thích hợp: Xuân, Hạ, Thu\",\"\\n\",\"Gói bao gồm: 1 x Bộ đồ ngủ nữ\",\"\\n\",\"Xin hãy chú ý:\",\"1.Do màn hình và hiệu ứng ánh sáng khác nhau, màu sắc thực tế có thể hơi khác so với màu sắc hình ảnh.\",\"\\n\",\"2.Xin vui lòng cho phép sai số 2-3 cm khác biệt do đo lường thủ công.\",\"\\n\",\"3.Kích thước Châu Á nhỏ hơn kích thước EU / US / UK, Vui lòng so sánh kích thước chi tiết với kích thước của bạn trước khi mua.\"]',NULL,96,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/sg-11134201-7qvfa-lg4txiqkbsw0ca_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7qvdm-lg4txl6sqoqrce_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7qvd2-lg4txnfjjbpqe2_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7qvdo-lg4txqnsqe8121_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7qvd5-lg4txuit2yo5e0_tn\"]',4677,NULL,420,'2024-02-11 15:01:59','2024-02-11 15:01:59');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (284,'Set đồ UIOWOO gồm áo thun ngắn tay và chân váy thời trang mùa hè cho nữ','[\"Thời gian giao hàng dự kiến cho sản phẩm này là từ 7-9 ngày\",\"\\n\",\"\\n\",\"👗👗 Chúng tôi sẽ bao gồm tên sản phẩm khi vận chuyển!!!\",\"\\n\",\"👗👗 Tất cả sản phẩm tại shop chúng tôi đều là hàng thật và được giao ngay trong ngày.\",\"\\n\",\"👗👗 Thời gian giao hàng nhanh nhất có thể..\",\"\\n\",\"Đảm bảo giá rẻ nhất\",\"\\n\",\"Cam kết của chúng tôi\",\"\\n\",\"💌💌 Về chất lượng sản phẩm: \",\"\\n\",\"Chúng tôi cam kết mô tả phong cách và chất liệu (hình ảnh, video và Hình ảnh chụp từ sản phẩm thực tế được cửa hàng chụp để tự tham khảo).\",\"\\n\",\"💌💌 Về dịch vụ: \",\"\\n\",\"Chúng tôi sẽ trả lời tất cả các câu hỏi của bạn trong thời gian sớm nhất.\",\"\\n\",\"💄💄💄 Lưu ý khi sử dụng sản phẩm của chúng tôi\",\"\\n\",\"- Đối với những sản phẩm có thể giặt bằng máy thường, hãy chú ý phân loại sản phẩm có cùng màu sắc và chất liệu khi giặt.\",\"\\n\",\"- Đối với sản phẩm sang trọng có chất liệu và kiểu dáng khác nhau, chăm sóc tốt nhất là giặt bằng tay với chất tẩy rửa nhẹ (hoặc nước) để tránh phai màu. Thật khác biệt.\",\"\\n\",\"-Sản Phẩm nên để khô ở nơi thoáng mát để tránh bị ảnh hưởng bởi ẩm ướt trong thời gian dài, cần sấy khô ở nơi có gió để duy trì màu sắc của vải tốt hơn.\"]',NULL,106,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/430d8a55515b5c24975f9f2b4b8d018b_tn\",\"https://down-vn.img.susercontent.com/file/cn-11134211-7qukw-lfva9hpnecu604_tn\",\"https://down-vn.img.susercontent.com/file/17f018e2c761bdac9f6fc13e8ca7414d_tn\",\"https://down-vn.img.susercontent.com/file/b3eb641f529b6e8e5d9f49ca711867c0_tn\",\"https://down-vn.img.susercontent.com/file/ac69aaf4904affe69c41a24c46446513_tn\"]',3253,NULL,447,'2024-02-11 15:01:59','2024-02-11 15:01:59');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (285,'Bộ áo thun mỏng + quần yếm ống rộng thời trang mùa hè phong cách Hàn Quốc cho nữ，jumpsuit nữ，yếm nữ，yếm quần，Sét phối quần ống rộng，đồ yếm，yếm quần bigsize，áo yếm nữ','[\"Chào mừng bạn đến với cửa hàng của tôi!\",\"Theo dõi cửa hàng để nhận phiếu giảm giá!\",\"Tôi rất vui vì bạn có thể chú ý đến cửa hàng của chúng tôi và hy vọng bạn có thể chọn được sản phẩm yêu thích của mình!\",\"\\n\",\"Phong cách: Ngọt ngào và tươi mát / Cao đẳng\",\"Yếu tố phổ biến: ren in đặc\",\"Phong cách: Quần suit\",\"Chiều dài tay áo: Tay ngắn\",\"Vải / Chất liệu: Bông / Bông\",\"Hàm lượng thành phần: 31% (bao gồm) - 50% (bao gồm)\",\"Sang trọng hay không: Không sang trọng\",\"\\n\",\"Về phương tiện đi lại:\",\"Tất cả các cổ phiếu, 100% thương hiệu mới, chất lượng cao!\",\"Vì chúng tôi là người bán ở nước ngoài, tất cả các đơn đặt hàng sẽ được chuyển đến kho quốc tế trong vòng 2-3 ngày\",\"Theo địa chỉ giao hàng, thời gian vận chuyển thường mất từ 7 đến 12 ngày!\",\"Nếu bạn có bất kỳ câu hỏi nào trước hoặc sau khi mua sản phẩm, vui lòng liên hệ với chúng tôi!\",\"Sau khi nhận hàng, nếu bạn hài lòng, xin vui lòng cho tôi năm sao!\",\"Sự hài lòng của bạn là động lực của tôi!\"]',NULL,184,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/1c050ea8ad32f4dc7dd661e38ee60907_tn\",\"https://down-vn.img.susercontent.com/file/803d7ae68365900f7ef7b4585c85cfe4_tn\",\"https://down-vn.img.susercontent.com/file/d85ebef507ea6553e7dd221e222da3d7_tn\",\"https://down-vn.img.susercontent.com/file/0587c71fd1735370f9716accf7c2c961_tn\",\"https://down-vn.img.susercontent.com/file/fe77cc8a52c26d1ad55d283eb8145d40_tn\"]',1005,NULL,322,'2024-02-11 15:01:59','2024-02-11 15:01:59');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (287,'Đồ bộ nữ mặc nhà quần đùi hoạt hình bigsize chất thun sữa mỏng','[\"THÔNG TIN VỀ SẢN PHẨM:\",\"-Đồ bộ nữ mặc nhà cộc đùi chất thun sữa\",\"-Thành phần vải: 95% sợi polyester\",\"-Tính chất vải: mềm và co dãn nhẹ\",\"-Độ dày vải: mỏng (121-140g/mét vuông)\",\"*Lưu ý: sản phẩm có chất vải MỎNG ạ\",\"L: cao 150-160cm, nặng 40-48kg\",\"XL: cao 160-170cm, nặng 48-55kg\",\"XXL: cao 162-173cm, nặng 55-64kg\",\"----------------------------------------\",\"HƯỚNG DẪN BẢO QUẢN:\",\"-Giặt sản phẩm với nước ở nhiệt độ thường. \",\"-Không ngâm quá lâu hoặc sử dụng các chất có tính tẩy mạnh, tránh chà xát bằng bàn chải.\",\"-Không xoắn vắt mạnh.\",\"-Nên phơi sản phẩm ở nơi khô ráo, thoáng mát, hạn chế ánh nắng trực tiếp.\",\"---------------------------------------\",\"QUYỀN LỢI CỦA KHÁCH HÀNG \",\"-Khách sẽ được đổi/trả/hoàn tiền khi shop gửi sai mẫu khách đặt/gửi thiếu hàng/sản phẩm bị hư hỏng. \",\"-Khi gặp các trường hợp trên khách hãy liên hệ shopee hoặc ZL:0583744852 để được shop hỗ trợ ạ.\",\"\\n\"]',NULL,118,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/d0efb7143a153517d9b9af1c072bd6f3_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-llai8wovl9rq3d_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-llai8wovmoc693_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-llai8wovo2wm1f_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-llai8wovphh2ef_tn\"]',4974,NULL,102,'2024-02-11 15:01:59','2024-02-11 15:01:59');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (288,'Bộ ngủ lông gấu hồng túi đào đính nơ dễ thương form rộng, Sét đồ pyjama mặc nhà mùa đông','[\"Bộ ngủ lông gấu hồng túi đào đính nơ dễ thương form rộng, Sét đồ pyjama mặc nhà mùa đông lông cừu cute mũ tai thỏ ulzzan\",\"Thời trang đồ bộ là một trong những lựa chọn hàng đầu của chị em phái đẹp hiện đại, nếu chưa biết chọn ở đâu hãy ghé thăm các mẫu đồ bộ của Shop nhé các bạn.\",\"Hiện nay, rất nhiều những mẫu đồ bộ phát triển thịnh hành, người ta từng nói rằng nếu biết cách chăm sóc bản thân mình, điều đầu tiên đó là phải tôn trọng cơ thể của bản thân qua năm tháng. Hiểu được tâm lý các chị em phụ nữ thời hiện đại, chúng tôi sẽ giúp bạn những bí quyết nhỏ xinh để lựa chọn cho mình những bộ đồ ngủ sành điệu và quyến rũ. Tại SHOP có vô vàn những mẫu để bạn có thể tự tin chọn lựa.\",\"Bộ ngủ lông cừu cổ sen viền bèo quần bo chun form rộng, sét đồ bộ pyjama mặc nhà tiểu thư dễ thương lông gấu đính nơ\",\"-màu sắc:màu tươi tắn như hình\",\"-chất liệu: lông nhung 2 mặt\",\"-mẫu :nhiều mẫu hình thú\",\"-kích thước: s M, L, XL,\",\"S dưới 45kg\",\"M: dưới 50kg\",\"L: 51-57kg\",\"Xl : 57-61kg\",\"-họa tiết: hình thú\",\"-hoàn cảnh: mặc nhà, mặc ngủ, đi bộ,....\",\"-đặc điểm: k ngứa, k dị ứng, k rụng lông, có thể giặt máy\",\"\\n\",\"#domacnha #domacnhanu #bomacnha #bomacnhanu #dongu #dongunu #dongubong #dongulong #dongumuadong #bongu #bongunu #bongubong #bongulong #PIJAMA #domacngu #bobong #bolong\",\"#aoni #aogau #aonilong #aonu #aonibong #aothudong #aoniday\",\"#hot #aoret #aothoitrang #thoitrangnu #freeship #long #lot_long #khoac_long #si #kho_si #unisex #ulzzang #hoodie #sweet #freesize #hottrend    #aodoi #aodaitay #phanquang\",\"#cadigan #quan #set_nu #set_do_nu #set_trang_phuc\",\"#aophong #aolop #phanquang #freeship #taylo #formthung #nam #nu #unisex #7mau #aolop #phongrongnam #aonu #thời #trang #aonam #aothun domacnha #bolong #bonu #longcuu #đồbộ #đồngủ #bộngủ #bộmặcnhà #đồbộmặcnhà #bộnhung #bộstudio #mẹvàbé\",\"#đồ_bộ #đồ_ngủ #bộ_ngủ #bộ_mặc_nhà #đồ_bộ_mặc_nhà #bộ_nhung #bộ_studio #D.studio #Hoodie #hoodielotlong #hoodietron #hoodienam #hoodienu #aohoodie #aohoodietron #aohoodienibong #hoodienibong #aoni #aođoi\",\"#bo_nu #bo_ni_nhung #bo_thu_dong #bo_lot_long #bo_ngu\",\" #bộ nỉ nhung cao cấp #bộ nhung\",\"#bộ_nỉ\",\"#bộ_nỉ_nữ_mùa_đông\",\"#bộ_nỉ_bông\",\"#bộ_nỉ_bông_nữ\",\"#bộ_đồ_nỉ_nữ_mùa_đông\",\"#đồ_bộ_nỉ_nữ\",\"#bộ_nỉ_mặc_nhà_cho_nữ\",\"#bộ_nỉ_mặc_nhà_nữ\",\"#bộ_nỉ_nữ_mặc_ở_nhà\"]',NULL,82,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-llt0hqkw4hr321_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-llt0hqkw336na7_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-llt0hqkw5wbj0a_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-llt0hqkw7avz17_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-llt0hqkwa40vbe_tn\"]',909,NULL,394,'2024-02-11 15:01:59','2024-02-11 15:01:59');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (289,'Set Áo Thun Ngắn Tay + Quần Short Ống Rộng Thời Trang Nữ','[\"Phong cách: Quần ống rộng\\nChi tiết vòng eo: Eo cao\\nQuần dài: Quần nữ\\nChiều dài tay áo: Dài tay\\nCác yếu tố phổ biến: Bow\\nVải / Chất liệu: Polyester / Polyester (Sợi Polyester)\\nNội dung thành phần: 30% Và những thứ sau\\n\\n💕💕💕💕Chào mừng đến với Cửa hàng của tôi💕💕💕💕\\nNếu có thắc mắc, bạn có thể hỏi nhân viên chăm sóc khách hàng\\nCung cấp cho bạn dịch vụ tốt nhất\\nNếu bạn không biết làm thế nào để chọn một kích thước\\nVui lòng liên hệ với bộ phận chăm sóc khách hàng của chúng tôi và để lại\\nChiều cao / Cân nặng / Ngực / Eo / Hông\\nChúng tôi sẽ giúp bạn chọn đúng kích thước\\nĐề xuất kích thước: \\nSize S: cân nặng 35kg-40kg, cao 145-150cm\\nSize M: cân nặng 40kg-50kg, cao 155-165cm\\nSize L: cân nặng 50-60kg, cao 165-175cm\\nSize XL: cân nặng 60-70kg, chiều cao 170-175cm\\nSize 2XL: cân nặng 70-80kg, cao 175-180cm\\nSize 3XL: cân nặng 80-90kg, cao 175-180cm\\nSize 4XL: cân nặng 90-100kg, cao 175-180cm\\n\\nTất nhiên, cũng có các kích thước lớn cho bạn lựa chọn!\\nVui lòng để lại kích thước và nhận xét kiểu dáng khi đặt hàng.\\nCác sản phẩm trong cửa hàng đều có trong kho.\\nSản phẩm mới trong cửa hàng!!!\\nVì nó là một doanh nghiệp ở nước ngoài, thời gian giao hàng chung là 8-15 ngày.\\n1. Do đo lường thủ công, xin vui lòng cho phép 1-3 CM là khác nhau, các kích thước trên chỉ là để tham khảo.\\n2. Vì các máy tính khác nhau hiển thị màu sắc khác nhau, màu sắc thực tế của dự án có thể hơi khác so với hình ảnh trên, cảm ơn bạn đã thông cảm.\\n3. Hình chỉ hiển thị mẫu, do ánh sáng, môi trường, máy ảnh, các hiệu ứng khác nhau và các yếu tố khác, hình ảnh hơi khác so với thực tế.\\nCảm ơn bạn!\"]',NULL,200,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/sg-11134201-22090-5fh6qmz1vuhved_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-22100-dul5ywqb7liv34_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-22100-pns39wqb7liv3b_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-22100-58749wqb7livb4_tn\",\"https://down-vn.img.susercontent.com/file/f29fe7107c5808081b6d11bb24e2a2d8_tn\"]',6395,NULL,234,'2024-02-11 15:01:59','2024-02-11 15:01:59');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (290,'Set Áo Thun Tay Ngắn Dáng Rộng Phối Chân Váy Siêu Nữ Tính Thời Trang Hè Phong Cách Hàn Quốc 2023','[\"Xuất xứ: Tỉnh Quảng Đông; \\nPhong cách: Đơn giản đi lại / Phiên bản Hàn Quốc; \\nCác yếu tố phổ biến: Dây đai màu rắn không đối xứng; \\nKiểu dáng: Váy phù hợp; \\nChiều dài tay áo: Tay áo ngắn; \\nVải / chất liệu: Polyester / Polyester (Sợi Polyester); \\nNội dung thành phần: 31% (Bao gồm) -50% (Bao gồm); \\nĐộ tuổi áp dụng: Thanh niên (18-25 tuổi); \\nCó thêm nhung: Không có nhung; \\nMùa niêm yết: Mùa hè 2022;\"]',NULL,166,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/sg-11134201-23020-cw8pdlq0d0mv07_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-23020-mmlbdvq0d0mv4f_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-23020-pnky76q0d0mv88_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-23020-5lyhmfr0d0mv04_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-23020-k4r6xnr0d0mv2b_tn\"]',2106,NULL,619,'2024-02-11 15:01:59','2024-02-11 15:01:59');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (291,'Set áo khoác ghi lê + áo sơ mi kèm quần jean lưng cao thời trang cho nữ','[\"Thời gian giao hàng dự kiến cho sản phẩm này là từ 7-9 ngày\\n\\nPhong cách: văn học và nghệ thuật retro/ tươi mát nhỏ nhắn;\\nCác yếu tố phổ biến: kiểu bạc màu;\\nKiểu dáng: set quần áo;\\nChiều dài tay áo: dài tay;\\nVải/ chất liệu: khác/ polyester (sợi polyester);\\nHàm lượng thành phần: 51% (bao gồm) -70% (bao gồm);\\nĐộ tuổi phù hợp: thanh niên (18-25 tuổi);\\nCó thêm cashmere không: không có cashmere;\\nMùa ra mắt: mùa thu năm 2021;\"]',NULL,111,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/c1e1d95c2e5f556de49dfe872ff8d19b_tn\",\"https://down-vn.img.susercontent.com/file/7b3996232caa8f26043987abaa1e8051_tn\",\"https://down-vn.img.susercontent.com/file/a483b1370526a6d3b003c5aad9d2d3c5_tn\",\"https://down-vn.img.susercontent.com/file/3d28b13bc3c637b3cd2c1ba302527c0d_tn\",\"https://down-vn.img.susercontent.com/file/6ac727e0611f0c3755608ab8ca3ec47a_tn\"]',3444,NULL,480,'2024-02-11 15:01:59','2024-02-11 15:01:59');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (292,'(CÓ SẴN) Set quần áo đi học/ set gile xanh lá + quần jeans thời trang phong cách Hàn Quốc dành cho nữ (có ảnh thật)','[\"Set quần áo đi học/ set gile xanh lá + quần jeans thời trang phong cách Hàn Quốc dành cho nữ\\n\\n MÔ TẢ SẢN PHẨM : \\n- Chi tiết sản phẩm: Set đồ đi học bao gồm: 1 gile xanh lá, 1 áo sơ mi tay bồng và 1 quần jeans rách gối\\n\\nKích thước:\\n- Áo gile:\\nS Chiều dài: 66 Ngực: 110 \\nM Chiều dài: 67 Ngực: 112 \\nL Chiều dài: 68 Ngực: 114\\nXL Chiều dài: 69 Ngực: 116\\n- Áo sơ mi tay bồng\\n- Quần jeans rách gối\\nS: dài 98/ eo 64/ hông 94/ đùi 54cm\\nM: dài 99/ eo 68/ hông 98/ đùi 56cm\\nL: dài 100/ eo 70/ hông 100/ đùi 58cm\\nXL: dài 101/ eo 72/ hông 102/ đùi 60cm\\n\\nGIỚI THIỆU CHUNG \\nĐơn giản mà nổi bật, áo gile xanh lá chắc chắn là một trong những item xinh xắn nhất để diện đi học. Cách diện dễ mà đẹp nhất với item này chính là mix cùng quần jeans màu xanh cơ bản đóng thùng và phối thêm áo sơ mi trắng. Nếu muốn nổi hơn nữa, các cô nàng có thể nhấn nhá thêm một chiếc mũ lưỡi trai rực rỡ hoặc đôi giày sneaker.\\n\\nHƯỚNG DẪN BẢO QUẢN\\nĐối với set đồ 3 món không nên giặt chung áo sơ mi cùng với 2 món đồ còn lại vì rất dễ phai màu.\\nĐối với quần jeans nên lộn trái khi giặt để giữ màu lâu hơn\\nĐối với áo gile xanh lá nên cho túi giặt giúp áo không mất form.\\n\\nHàng bên June order từ 7-15 ngày. Khi nào hàng về, bên June sẽ giao liền ạ.\\nQuý hàng order cần lưu ý:\\n+ Hàng không sẵn bên June sẽ để tên sản phẩm là ORDER\\n+ Hàng có sẵn bên June sẽ để tên sản phẩm là CÓ SẴN nên các nàng đặt hàng để ý giúp June \\n\\nQuy định bảo hành, đổi trả\\n - June chấp nhận đổi trả nếu do lỗi bên June: nhầm size, nhầm màu hay bị rách mà nhân viên chưa kiểm tra trước\\n\\nLƯU Ý : \\n⚡️Khách hàng mua sản phẩm có thắc mắc thêm về sản phẩm vui lòng inbox với shop để được tư vấn và chọn size đúng ý nhé!.\\n⚡️June luôn có NHIỀU ƯU ĐÃI dành cho khách hàng nên hãy nhấn FOLLOW để có voucher nha.\\n\\n..............................................................\\n\\nXUẤT XỨ: TRUNG QUỐC\\nTHÔNG TIN CỦA TỔ CHỨC, CÁ NHÂN CHỊU TRÁCH NHIỆM VỀ HÀNG HOÁ:\\n- Đại lý phân phối: Quảng Châu, Quảng Đông, Trung Quốc\\n- Cá nhân kinh doanh: toà 1A vinaconex 7, 136 Hồ Tùng Mậu, Phú Diễn, Bắc Từ Liêm, Hà Nội\"]',NULL,187,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/d9a8bea3b5d43a8b25b688b1565f84b6_tn\",\"https://down-vn.img.susercontent.com/file/66cf77a415f77625ed1b9baf84fc7804_tn\",\"https://down-vn.img.susercontent.com/file/b5570bedf13aefbb9e7f238cba7d41b5_tn\",\"https://down-vn.img.susercontent.com/file/d25c8e099ec177357b55c838031eb463_tn\",\"https://down-vn.img.susercontent.com/file/148729441be75c8462d270eb44052560_tn\"]',3839,NULL,1785,'2024-02-11 15:01:59','2024-02-11 15:01:59');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (293,'Set đồ nữ đi chơi đồ bộ nữ bigsize Bộ Gió Thể Thao Áo Sơ Mi + Quần thể thao','[\"Phong cách: du lịch đơn giản / phiên bản Hàn Quốc\",\"Các yếu tố phổ biến: Khâu, In, Màu đồng nhất\",\"Phong cách: Bộ quần\",\"Chiều dài tay áo: tay áo ngắn\",\"Độ tuổi áp dụng: thanh niên (18-25 tuổi)\",\"Có thêm cashmere hay không: Không cashmere\",\"Vui lòng đọc trước khi đặt hàng.\",\"Sản phẩm được vận chuyển từ Trung Quốc. Thời gian giao hàng là khoảng 7-15 ngày.\",\"1. Nếu bạn có bất kỳ câu hỏi nào, bạn có thể tìm kiếm dịch vụ khách hàng trực tuyến và bộ phận chăm sóc khách hàng sẽ kiên nhẫn trả lời bạn.\",\"1.1 Tất cả các loại sản phẩm đã sẵn sàng để vận chuyển trong kho. Nếu sản phẩm hết hàng, có nghĩa là sản phẩm đã hết hàng.\",\"1.2 Không thể chỉnh sửa đơn hàng qua trò chuyện và ghi chú.\",\"1.3 Nếu khách hàng muốn sửa đổi đơn hàng Khách hàng phải hủy đơn hàng và chỉ đặt hàng mới.\",\"* Chỉ hủy nếu không có số gói *\",\"------------------------\",\"2. Bảo HÀNH sản phẩm\",\"2.1 Sản phẩm miễn phí không mang theo bất kỳ bảo hành nào.\",\"2.2 Màu sắc / kích thước / mẫu có thể thay đổi một chút.\",\"2.3 Vì trường hợp có thể được\"]',NULL,69,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/tw-11134201-23020-9klgbohs21nvaf_tn\",\"https://down-vn.img.susercontent.com/file/tw-11134201-23020-m30o2q93m2nvdf_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-23020-0hzynnpmwznv1e_tn\",\"https://down-vn.img.susercontent.com/file/my-11134201-23020-dr8yx0ow9qnv67_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-23030-6c1hdbm487nv56_tn\"]',3820,NULL,1157,'2024-02-11 15:01:59','2024-02-11 15:01:59');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (294,'Set đồ bộ nữ mặc nhà lông nhung san hô trà hoạt hình siêu ấm SH001 (có ảnh thật)','[\"💁Hàng có sẵn tại shop\\n💁Chất liệu: Nhung san hô\\n💁Màu sắc: Như Hình\\n\\n❗❗❗LƯU Ý: Sản phẩm không có túi chỉ gồm quần và áo\\nShop chỉ ĐỔI HÀNG khi shop gửi sai mẫu,sai màu,ko đúng mẫu,nhầm mẫu. Ko đổi trả khi khách mặc không hợp,không đẹp!!!!!!!\\n☘️💎☘️☘️💎☘️☘️💎☘️☘️💎\\n💗 Hàng có sẵn- Giá tốt\\n💗 Cam kết chất lượng sản phẩm.Ảnh sao hàng vậy Chuẩn đẹp\\n💗 Giao hàng tận nhà trên toàn quốc. Có thanh toán ship COD\\n💗 Buôn sỉ ib Shop\"]',NULL,183,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/vn-11110107-7r98o-lq32a6tp74x57d_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-loxm1qq0pyku0c_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-loxm1qq0rd5ae1_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-loyu0fn7mdzib4_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-loxmt1lyjh3i49_tn\"]',2954,NULL,433,'2024-02-11 15:01:59','2024-02-11 15:01:59');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (295,'2024 bộ quần áo dài tay dài tay mới mùa thu đông đồ ngủ cho nữ bộ quần áo mặc ở nhà mùa thu đông bộ đồ mặc ở nhà ngọt ngào và dễ thương khi đi chơi giải trí có thể mặc bên ngoài','[\" \",\"🔹🔸🔹🔸🔹🔸🔹🔸🔹🔸🔹🔸🔸🔸🔹🔸🔸🔸🔸🔸🔸🔸🔸🔸🔸🔸🔸🔸🔸🔸🔸🔸🔸🔸🔸🔸🔸🔸🔸🔸🔹🔸\",\"💕 Chào mừng đến với cửa hàng của chúng tôi🎗\",\"💌 Nếu bạn có bất kỳ câu hỏi nào về việc mua hàng của mình, vui lòng liên hệ với chúng tôi và chúng tôi sẽ trả lời theo sự hài lòng của bạn.\",\"✅ Sản phẩm của chúng tôi là 100% mới.\",\"✅ Tôi hy vọng sẽ cung cấp cho bạn trải nghiệm mua sắm tốt nhất.\",\"✅ Chúng tôi có kinh nghiệm phong phú và sản phẩm chất lượng cao.\",\"✅ Chúng tôi tập trung vào các sản phẩm chất lượng cao và chi phí thấp!\",\"✅ Luôn có sản phẩm mới. Vui lòng lưu giữ thông tin cập nhật mới nhất của chúng tôi.\",\"✅Nếu bạn thích sản phẩm của chúng tôi, vui lòng thêm vào giỏ hàng của bạn, cảm ơn bạn!!\",\"✅Chúng tôi mong muốn được xếp hạng năm sao của bạn.\",\"💕 Hy vọng bạn có thể tìm thấy sản phẩm yêu thích của bạn trong cửa hàng của tôi.\"]',NULL,189,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/vn-11110105-7r98o-loz9jopfdf8x38_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbm4-loz8flu4sdp39b_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rblr-loz8fmb250qm78_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rbkr-loz8fmu7blyre0_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7rblw-loz8fn8csavcf1_tn\"]',546,NULL,132,'2024-02-11 15:01:59','2024-02-11 15:01:59');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (296,'One Set Áo Nỉ Dài Tay + Quần Jeans Dài Ống Rộng Thời Trang Nữ','[\"💖Chào mừng đến với Bảo tàng thời trang Muxi Pavilion!\",\"Sự ủng hộ của bạn là lực lượng lái xe lớn nhất của chúng tôi, Tất cả các sản phẩm trong cửa hàng này được bán với giá thấp và chất lượng được đảm bảo. Nếu Bạn Cần, Hãy Yên Tâm Mua Hàng, Chúng Tôi Chắc Chắn Sẽ Mang Đến Cho Bạn Trải Nghiệm Mua sắm Thoải mái Nhất!\",\"📷Tất Cả Ảnh Hàng Ở Cửa Hàng Này Được Chụp Bằng Các Nhiếp Ảnh Chuyên Nghiệp Và Chúng Được Sửa Đổi Và Điều Chỉnh Màu Sân Sau Trong Sân Tùng, Cũng Có Thể Có Thể Phù Hợp Với Hàng Thực Tế, Nhưng Do Để Sự Khác Biệt Về Ánh Sáng, Góc, Độ lệch Màu Sự Khi Chụp Và Nhận Màu Cá Nhân, Sản Phẩm Thực Tế Có Thể Có Một Số Khác Biệt Màu Sắc Với Các Ảnh Và Màu Cuối Của Tùy Theo Sản phẩm thực tế. Vui lòng lựa chọn cẩn thận sau khi giao tiếp hoàn toàn với dịch vụ khách hàng của chúng tôi trước khi mua hàng. Vấn đề khác biệt về màu sắc sẽ không được chúng tôi công nhận là lý do trả lại!\",\"📢Cửa hàng của chúng tôi cung cấp các sản phẩm chất lượng cao, dịch vụ sau bán hàng hoàn hảo, vì vậy bạn có thể tự tin mua hàng và mua hàng thoải mái!Tất cả giá mặt hàng đã thấp nhất, vui lòng không mặc cả!Nếu bạn có bất kỳ câu hỏi nào, vui lòng liên hệ với bộ phận chăm sóc khách hàng, chúng tôi sẽ cung cấp cho bạn câu trả lời kiên nhẫn!❣\",\"Phong cách: Đơn giản đi lại / Phiên bản Hàn Quốc\",\"Các yếu tố phổ biến: Cũ, Các nút, In ấn\",\"Phong cách: Quần Suit\",\"Chiều dài tay áo: dài tay\",\"Vải / Chất liệu: Bông / Bông\",\"Hàm lượng chất liệu: 30% trở xuống\",\"Có thêm nhung: Không lót nhung\"]',NULL,104,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/sg-11134201-22120-cdekdyb1pplvd7_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-22120-yfj3r90zpplva0_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-22120-o9h1ybc1pplv86_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-22120-fazrshc1pplv5c_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-22120-k0k21xa1pplvf6_tn\"]',6494,NULL,1640,'2024-02-11 15:01:59','2024-02-11 15:01:59');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (297,'Sét Bộ Đồ Quần Áo Nữ Đẹp Xinh Cute Áo Trắng In Hoạt Hình Nằm Mơ Mix Quần Thun Hồng Bo Gấu','[\"Thông Tin Về Sản Phẩm:\\nSét Bộ Đồ Quần Áo Nữ Đẹp Xinh Cute Áo Trắng In Hoạt Hình Nằm Mơ Mix Quần Thun Hồng Bo Gấu\\nMàu sắc: Sét Bộ Như Hình\\nSize: S; M; L\\n- Size S: Cân Nặng: 35 - 42kg; Chiều Cao: m40 - m45\\n- Size M: Cân Nặng: 43 - 47kg; Chiều Cao: m46 - m52\\n- Size L: Cân Nặng: 48 - 52kg; Chiều Cao: m53 - m60\\n- Chất liệu: Áo cotton, Q Thun\\n=============================\\nYEGO Fashion LUỐN ĐẶT UY TÍN LÊN HÀNG ĐẦU\\n️Cập nhập mẫu mã liên tục giá tốt nhất\\n️ Shop up ảnh thật tự chụp\\n=>> Lưu ý:\\n+ Khách đặt hàng sẽ nhận được hàng sau khoảng 3-5 ngày làm việc tùy theo khoảng cách và đơn vị vận chuyển.\\n+ Mọi thắc mắc, góp ý về sản phẩm, giao hàng vui lòng nhắn tin với để được hỗ trợ trực tiếp và nhanh nhất.\\nXin chân thành cảm ơn các bác\\n==============================\\nYEGO Fashion Chuyên Sỉ Lẻ thời trang Nam Nữ bốn mùa.\\n️Các Sản phẩm đều là thời trang Hot của giới trẻ, mẫu mã được cập nhật thường xuyên.\\n️Thiết kế kiểu dáng đa dạng phong cách, hợp thời trang.\\n️Áo được may tinh tế sắc sảo, thiết kế đẹp, chuẩn form, vải cotton dày, mịn thấm hút mồ hôi, thoáng mát\\n️Dễ dàng phối sét trang phục, thích hợp đi chơi, đi làm hay dạo phố. Đặc biệt cho các bạn trẻ năng động cá tính.\\nSự kết hợp hoàn hảo giữa áo  với quần Jean; quần sooc; quần Jogger cực kì cute, sang chảnh\\n️Cảm ơn các bạn đã dành thời gian ghé thăm gian hàng và ủng hộ Shop! Chúc các bạn luôn vui vẻ hạnh phúc\\\"\\n==============================\\n#Setbodonumacdichoi, #setbodonumaconha, #setaonuthoitrang, #boquanaonudichoi, #boquanaonudihoc, #boquanaonumuahe, #setdonudep, #setdonudepaothun\"]',NULL,75,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/11f4901c678e50c40233faa5a5f63566_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lmqy27sc997jf2_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7qve5-ljz3k9ene2ny72_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7qvev-ljz3kaau8l9314_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-7qvea-ljz3kb66t2uvc5_tn\"]',1204,NULL,308,'2024-02-11 15:01:59','2024-02-11 15:01:59');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (298,'Set Áo Lửng + Áo Hai Dây + Quần Yếm Ống Rộng Thời Trang Nữ Tính','[\"Phong cách: Đi làm đơn giản / Phiên bản Hàn Quốc\",\"Các yếu tố phổ biến: In ấn\",\"Phong cách: Bộ quần áo\",\"Chiều dài tay áo: Dài tay\",\"Vải / chất liệu: Sợi hóa học / Polyester (Sợi Polyester)\",\"Nội dung thành phần: 31% (Bao gồm) -50% (Bao gồm)\",\"\\n\",\"Đẹp!\",\"Một nửa từ cuộc sống tinh tế\",\"Một nửa từ việc mặc trang phục\",\"Thay vì nhìn lên thời trang, tốt hơn hết bạn nên mặc nó trên cơ thể!\",\"\\n\",\"Tinh tế không phải là tư thế giả vờ\",\"Nhưng nó trông giống như cuộc sống\",\"Đó là một trạng thái khác của cuộc sống được mở rộng từ việc kết hợp trang phục!\",\"\\n\",\"Không có thiếu sót ở con người, chỉ có tính năng\",\"Quần áo của bạn phải làm nổi bật đặc điểm riêng của chúng!\",\"Theo dõi cửa hàng của tôi, có các sản phẩm mới khác nhau mỗi ngày!\",\"Hãy là một người phụ nữ cá tính, xinh đẹp và tự tin!!!\",\"\\n\",\"◆◆◆Vận chuyển nhanh 7-10 ngày đến nơi◆◆◆ \",\"Hoạt động một: Bất kỳ lời khen ngợi năm sao nào + Tải lên một chương trình người mua đẹp, bạn có thể trò chuyện và được giảm giá khi mua lại ~ \",\"Hoạt động hai: Hoạt động giảm giá đầy đủ (Sao chép và nhận trên trang chủ của cửa hàng mã giảm giá.)\",\"Sự kiện ba: Khen ngợi năm sao sau khi nhận hàng, trả lại phiếu giảm giá lớn\",\"Hoạt động thứ tư: Khách hàng mới theo dõi cửa hàng và thích hơn năm sản phẩm có thể được giảm giá\",\"\\n\",\"[Thông báo của người mua]\",\"1 Các Cửa Hàng Còn Hàng, Gửi Từ Thâm Quyến, Trung Quốc, Và Đơn Hàng Sẽ Hết Hàng Trong 48 Giờ, Thông Thường 7-10 Ngày Sẽ Đến!\",\"2 Quần áo được niêm phong ngay khi ra khỏi nhà máy, và có thể còn lại một chút mùi, đó là hiện tượng bình thường và không phải là vấn đề chất lượng. Nếu bạn phiền, xin vui lòng đặt hàng một cách cẩn thận!\",\"3 Do các phương pháp đo lường khác nhau, cho phép sai số 3-5CM và phạm vi lỗi không phải là vấn đề chất lượng!\",\"4 Vì Lý Do Chụp Và Màn Hình Khác Nhau, Nó Có Thể Khác Với Màu Hình Ảnh, Vui Lòng Tham Khảo Sản Phẩm Thực Tế!\",\"5 Cửa Hàng Này Là Lô Hàng Ở Nước Ngoài, Hỗ Trợ Thời Gian Đánh Giá Cao Bảy Ngày. Nếu Có Vấn Đề Sau Khi Nhận Hàng, Giao Hàng Ít, Giao Hàng Chậm Và Khiếm Khuyết, Vui Lòng Liên Hệ Với Chúng Tôi Để Giải Quyết, Cảm ơn bạn.\",\"\\n\",\"[Thông báo quan trọng]\",\"1.Các mặt hàng đã bán không thể được trả lại hoặc hoàn lại tiền trừ khi bạn nhận được các sản phẩm không chức năng.\",\"2.Sản phẩm sẽ được kiểm tra sau khi sản phẩm ra khỏi nhà máy để đảm bảo rằng tất cả các sản phẩm đều hoạt động tốt.\",\"3.Vui lòng kiểm tra ngay sau khi nhận được sản phẩm, nếu đơn hàng hoàn tất, chúng tôi không cung cấp bất kỳ dịch vụ sau bán hàng nào.\",\"Yêu thích + theo dõi cửa hàng của chúng tôi để nhận được phiếu giảm giá!\",\"⭐Nếu bạn hài lòng với dịch vụ của chúng tôi, vui lòng cho chúng tôi đánh giá 5 sao!\",\"?Cảm ơn bạn đã mua sắm với chúng tôi!\"]',NULL,111,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/tw-11134201-7r98p-lm4e1k5ydxnfa7_tn\",\"https://down-vn.img.susercontent.com/file/tw-11134201-7r990-lm4e1hw3ppqz87_tn\",\"https://down-vn.img.susercontent.com/file/tw-11134201-7r98z-lm4e1izi42ah60_tn\",\"https://down-vn.img.susercontent.com/file/tw-11134201-7r992-lm4e1ej527bt37_tn\",\"https://down-vn.img.susercontent.com/file/tw-11134201-7r98x-lm4e1fm91huj5d_tn\"]',6291,NULL,1014,'2024-02-11 15:01:59','2024-02-11 15:01:59');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (299,'Set Áo Sơ Mi Phối Quần Denim Ống Rộng Plus Size Cho Nữ Lên Đến 100KG','[\"Xuất xứ: Trung Quốc\",\"Phong cách: Quần loe\",\"Loại eo: Eo cao\",\"Chiều dài quần: Quần dài\",\"Chiều dài tay áo: Tay áo năm điểm / Tay áo giữa\",\"Các yếu tố phổ biến: Các nút màu rắn\",\"Vải / chất liệu: Khác / Polyester (Sợi Polyester)\",\"Hàm lượng chất liệu: 30% trở xuống\",\"\\n\",\"Đẹp quá!\",\"Nửa từ cuộc sống một cách tinh xảo\",\"Một nửa từ khi mặc quần áo\",\"Thay vì nhìn lên thời trang, tốt hơn là bạn nên đeo nó trên cơ thể của bạn!\",\"\\n\",\"Tinh tế không phải là một mẩu thuốc giả để trở thành\",\"Nhưng trông giống như cuộc sống\",\"Đó là một trạng thái sống khác được mở rộng từ phù hợp mặc quần áo!\",\"\\n\",\"Không có thiếu sót trong con người, chỉ có tính năng\",\"Quần áo của bạn đang để đánh dấu Đặc điểm của riêng họ!\",\"Theo dõi cửa hàng của tôi, có các sản phẩm mới khác nhau mỗi ngày!Hãy là một người phụ nữ cá tính, đẹp, đẹp và tự tin!!!\",\"\\n\",\"◆◆◆Vận chuyển nhanh 7-10 ngày đến nơi◆◆◆ \",\"\\n\",\"Hoạt động một: Bất kỳ lời khen ngợi năm sao nào + Tải lên chương trình Người mua đẹp mắt, bạn có thể trò chuyện và được giảm giá khi mua lại ~ \",\"\\n\",\"Hoạt động hai: Hoạt động giảm giá đầy đủ (Sao chép và Nhận trên Trang chủ của Cửa hàng Mã Giảm giá.)\",\"\\n\",\"Sự kiện Ba: Khen ngợi năm sao sau khi nhận hàng, trả lại phiếu giảm giá lớn\",\"\\n\",\"Hoạt động Bốn: Khách hàng mới theo dõi cửa hàng và thích nhiều hơn năm sản phẩm có thể được giảm giá\",\"\\n\",\"[Thông Báo người mua]\",\"\\n\",\"1 các cửa hàng đều còn hàng, được gửi từ Thâm Quyến, Trung Quốc đại lục và được vận chuyển trong vòng 48 giờ kể từ khi đặt hàng, thông thường 7-10 ngày đến!\",\"\\n\",\"2 Quần Áo Được Niêm phong Trong Thời Gian Ngay Khi Họ Hết Hàng, Và Có Thể Còn Có Mùi Nhỏ, Đây Là Phenomenon Bình thường Và Không Phải Là Vấn Đề Về Chất Lượng. Nếu bạn phiền, vui lòng đặt hàng một cách cẩn thận!\",\"\\n\",\"3 Do các phương pháp đo khác nhau, sai số 3-5CM được phép và phạm vi lỗi không phải là vấn đề chất lượng!\",\"\\n\",\"4 Do các lý do ánh sáng chụp khác nhau và màn hình, nó có thể khác với màu sắc hình ảnh, vui lòng tham khảo sản phẩm thực tế!\",\"\\n\",\"Cửa hàng này là một lô hàng ở nước ngoài, hỗ trợ thời gian đánh giá cao bảy ngày, nếu có vấn đề gì sau khi lấy hàng, giao hàng ít, hậu cần chậm và khiếm khuyết, vui lòng liên hệ với chúng tôi để xử lý, Cảm ơn bạn.\",\"\\n\",\"[Thông Báo quan trọng]\",\"\\n\",\"1.Các mặt hàng được bán Không thể được trả lại hoặc hoàn lại tiền trừ khi bạn nhận được các sản phẩm không chức năng.\",\"\\n\",\"2.Sản phẩm sẽ được kiểm tra sau khi ra khỏi nhà máy để đảm bảo rằng tất cả các sản phẩm đều hoạt động tốt.\",\"\\n\",\"3.Vui lòng kiểm tra ngay sau khi nhận được sản phẩm, nếu đơn hàng hoàn tất, chúng tôi không cung cấp bất kỳ dịch vụ sau bán hàng nào.\",\"\\n\",\"Yêu + theo dõi cửa hàng của chúng tôi để nhận phiếu giảm giá!\",\"\\n\",\"⭐Nếu bạn hài lòng với dịch vụ của chúng tôi, vui lòng đánh giá 5 sao cho chúng tôi!\",\"\\n\",\"💖Cảm ƠN ĐÃ ĐI MUA SẮM VỚI CHÚNG TÔI!\"]',NULL,96,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/b008d9410b6e5892c887c74ed2cd536f_tn\",\"https://down-vn.img.susercontent.com/file/079e613ba320539236e7ca595f8aaf52_tn\",\"https://down-vn.img.susercontent.com/file/95e3109fe847ee8669dbbc590cc2d612_tn\",\"https://down-vn.img.susercontent.com/file/e76a55fb4f16515979bac6c2f1a7a446_tn\",\"https://down-vn.img.susercontent.com/file/f9ed54c5a610ce08b37e4ad1df2ae5a8_tn\"]',1742,NULL,465,'2024-02-11 15:01:59','2024-02-11 15:01:59');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (300,'Bộ Áo Quần Jeans Ba Món Chống Nắng Mùa Hè Kích Thước Lớn Phong Cách Phương Tây Mới 2022 Cho Nữ','[\"Phong cách: Quần ống rộng\\nChi tiết vòng eo: Eo cao\\nQuần dài: Quần nữ\\nChiều dài tay áo: Dài tay\\nCác yếu tố phổ biến: Màu đồng nhất, Bảng điều khiển\\nVải / Chất liệu: Loại khác / Polyester (Sợi Polyester)\\nNội dung thành phần: 71% (Với) —80% (Với)💕💕💕💕Chào mừng đến với cửa hàng của chúng tôi💕💕💕💕\\nNếu có thắc mắc, bạn có thể hỏi nhân viên chăm sóc khách hàng\\nCung cấp cho bạn dịch vụ tốt nhất\\nNếu bạn không biết làm thế nào để chọn một kích thước\\nVui lòng liên hệ với bộ phận chăm sóc khách hàng của chúng tôi và để lại\\nChiều cao / Cân nặng / Ngực / Eo / Hông\\nChúng tôi sẽ giúp bạn chọn đúng kích thước\\nĐề xuất kích thước: \\n\\nNếu bạn không thể tìm ra kích thước phù hợp với mình, bạn phải đến bộ phận chăm sóc khách hàng và đặt hàng mà không yêu cầu kích thước. Chúng tôi sẽ không chấp nhận trả lại hàng và hoàn lại tiền nếu hàng hóa không phù hợp sau khi nhận được chúng!\\n\\nTất nhiên, cũng có các kích thước lớn cho bạn lựa chọn!\\nVui lòng để lại kích thước và nhận xét kiểu dáng khi đặt hàng.\\nCác sản phẩm trong cửa hàng đều có trong kho.\\nSản phẩm mới trong cửa hàng!!!\\nVì nó là một doanh nghiệp ở nước ngoài, thời gian giao hàng chung là 8-15 ngày.\\n1. Do đo lường thủ công, xin vui lòng cho phép 1-3 CM là khác nhau, các kích thước trên chỉ là để tham khảo.\\n2. Vì các máy tính khác nhau hiển thị màu sắc khác nhau, màu sắc thực tế của dự án có thể hơi khác so với hình ảnh trên, cảm ơn bạn đã thông cảm.\\n3. Hình chỉ hiển thị mẫu, do ánh sáng, môi trường, máy ảnh, các hiệu ứng khác nhau và các yếu tố khác, hình ảnh hơi khác so với thực tế.\\nCảm ơn bạn!\"]',NULL,147,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/6021ff6cc327bd34a0665de3fb1d4001_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-22100-ksp14w96obivee_tn\",\"https://down-vn.img.susercontent.com/file/29beb947c3468d97e966f3127f8c37f9_tn\",\"https://down-vn.img.susercontent.com/file/136a3e9d0a49a1fd62afc48193a2fe5f_tn\",\"https://down-vn.img.susercontent.com/file/f11b3e2d4894beb6dda0aa5b96698bd4_tn\"]',6252,NULL,62,'2024-02-11 15:01:59','2024-02-11 15:01:59');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (301,'[ Rẻ Vô Địch ] Sét Bộ Quần Áo Mùa Hè Thể Thảo Áo Phông Số 91 + Quần Đùi Trơn','[\"- Mọi thắc mắc hãy chat với shop để được tư vấn kỹ hơn\",\"\\n\",\"Sản phẩm giống hình 100%.\",\"\\n\",\"- Chất liệu cotton cao cấp dày và đẹp, vải mặc mát chống nhăn ,xù lông\",\"\\n\",\"- Có độ co giãn tốt\",\"\\n\",\"- form đầm phù hợp với người <58kg , tuỳ chiều cao cân nặng mỗi người\",\"\\n\",\"Hướng dẫn bảo quản:\",\"\\n\",\"- Giặt riêng sản phẩm màu sáng và tối\",\"\\n\",\"- Giặt với nước ở nhiệt độ thường\",\"\\n\",\"- Là/ủi ở nhiệt độ trung bình\",\"\\n\",\"- Nên phơi mặt trái sản phẩm , tránh phơi dưới ánh nắng trực tiếp\",\"\\n\",\"- không nên sử dụng chất tẩy, không xoắn vắt mạnh.\",\"\\n\",\"Cam kết sản phẩm:\",\"\\n\",\"- Sản phẩm giống mô tả 100%\",\"\\n\",\"- Hình ảnh sản phẩm là ảnh thật (shop chụp)\",\"\\n\",\"- Đảm bảo chất lượng vải cũng như hình in\",\"\\n\",\"- Sản phẩm được kiểm tra kĩ càng , cẩn thận trước khi đóng gói hàng giao cho khách\",\"\\n\",\"- Hàng sẵn, giao hàng ngay khi nhận đơn\",\"\\n\",\"- Hoàn tiền ngay nếu sản phẩm không giống với mô tả\",\"\\n\",\"Quy chế đổi trả hàng:\",\"\\n\",\"1) Điều kiện áp dụng ( trong vòng 07 ngày kể từ khi nhận sản phẩm) : Hàng hoá bị rách, in lỗi, bung chỉ, và các lỗi vận chuyển hoặc do nhà sản xuất\",\"\\n\",\"2) Trường hợp được chấp nhận đổi hàng : Hàng giao sai khách đã đặt, giao thiếu hàng\",\"\\n\",\"3) Trường hợp không đủ điều kiện áp dụng chính sách: Quá 07 ngày kể từ khi khách nhận hàng,\",\"\\n\",\"+ gửi lại hàng không đúng mẫu mã,\",\"\\n\",\"+ không phải sản phẩm của shop,\",\"\\n\",\"+ Không thích, không hợp, đặt nhầm mã, nhầm màu,\",\"\\n\",\"✂✂ Chất liệu vải chuẩn shop, mềm mịn, không nhăn không xù, không phai màu, vải shop xấu hoàn tiền lại.\",\"\\n\",\"- Thiết kế đẹp mắt với kiểu dáng hiện đại, giúp tôn lên vẻ đẹp quý phái ,sang trọng và quyến rũ.\",\"\\n\",\"- Đường may tỉ một, sắc sảo, chính xác.\",\"\\n\",\"- Dễ mix phụ kiện đi kèm khác nhau vừa gợi cảm vừa kín đáo\",\"\\n\",\"⛔️ Giao hàng toàn quốc, thanh toán khi nhận hàng\",\"\\n\",\"- Nếu sản phẩm có bất kỳ vấn đề gì về chất lượng, xin vui lòng liên hệ shop , shop sẽ hỗ trợ giải quyết vấn đề nhanh chóng và đúng theo chính sách nhé.\",\"\\n\",\"#damdutiec#ao#aothun#aokieu#aodep#aosexy#aobalo#damhotgirl#aosomi#aonu#aomat#aomuahe#áoong#setbohaiday#domacnha#dodibien#aosominutayngan#aohaiday#aosomikieu#aodihoc#aosomicongso#aosomihanquoc#aosomidep\"]',NULL,82,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lpymdugerupjc6_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lpymdugexgzbb3_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lpymduhiq88n01_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lpymduimolrr3a_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-lpymduh8qmkyc0_tn\"]',4902,NULL,1057,'2024-02-11 15:01:59','2024-02-11 15:01:59');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (302,'Quần Jogger Nữ Trơn Bo Gấu 3 Màu BOM HOUSE Ullzang Unisex Nam Nữ','[\"THÔNG TIN SẢN PHẨM : Quần Jogger Nữ Trơn Bo Gấu 3 Màu BOM HOUSE Ullzang Unisex Nam Nữ\\n\\nChất Liệu : Ni Da Cá, Vải Mềm Mịn, Không Xù Lông\\n+ Đường may chuẩn chỉnh, tỉ mỉ, chắc chắn.\\n+ Mặc đi chơi hoặc khi vận động thể thao. Phù hợp khi mix đồ với nhiều loại.\\n+ Thiết kế hiện đại, trẻ trung, năng động. Dễ phối đồ.\\n\\nBOM HOUSE đảm bảo: \\n- Hình ảnh sản phẩm giống 100%.\\n- Chất lượng sản phẩm tốt 100%.\\n- Sản phẩm được kiểm tra kĩ càng, nghiêm ngặt trước khi giao hàng.\\n- Sản phẩm luôn có sẵn trong kho hàng. \\n- Giao hàng ngay khi nhận được đơn hàng.\\n- Hoàn tiền ngay nếu sản phẩm không giống với mô tả.\\n- Đổi trả ngay nếu bất kì lí do gì khiến quý khách không hài lòng.\\n- Giao hàng toàn quốc, nhận hàng thanh toán. \\n- 1 đổi 1 nếu lỗi NSX hoặc hư hỏng do vận chuyển\\n- Hỗ trợ đổi trả theo quy định.\\n- Gửi hàng siêu tốc : Với đội ngũ hơn 10 nhân viên BOM HOUSE cam kết dịch vụ đóng gói siêu nhanh.\\n\\n🍓 Bảng SIZE: Quần / Áo form châu Âu rộng rộng nhé các cậu\\n(Bảng size mang tính chất tham khảo và phù hợp 80-90% sở thích các cậu ạ. Các bạn muốn chọn size phù hợp có thể xem hình feedback các khách đã mua hoặc inbox cho BOM HOUSE nhé ^^)\\n\\n-Size M: dưới 55kg, Cao dưới 1m60\\n-Size L: từ 56 - 63kg , Cao 1m60 - 1m68\\n-Size XL: từ 63- 69kg, Cao dưới 1m73\\n- Size XXL : từ 69 - 75kg Cao dưới 1m78\\n\\n -- CHIỀU DÀI SIZE QUẦN --\\nSize M: dài 91cm, đùi 58cm\\nSize L: dài 93cm, đùi 60cm\\nSize XL: dài 96cm, đùi 62cm\\nSize XXL : dài 102cm, đùi 64cm\\n\\n💥 Hướng dẫn sử dụng, bảo quản đối với sản phẩm:\\n    - Không nên giặt chung với những loại áo khác, nên lột trái áo khoác khi giặt\\n    -Nên giặt áo khoác bằng tay, giặt bằng máy sẽ dễ làm hỏng vải áo. \\n    -Không ngâm đồ trong xà phòng quá lâu, không nên sử dụng các chất tẩy rửa\\n    - Không nên để áo ở những nơi ẩm ướt, với tính chất hút ẩm, hút nước tốt, áo thun dễ bị ẩm mốc, thậm chí để lại những vết ố trên vải áo\\n\\n1. Điều kiện áp dụng đổi sản phẩm (trong vòng 07 ngày kể từ khi nhận sản phẩm) \\n- Hàng hoá vẫn còn mới nguyên tem mác, chưa qua sử dụng.\\n- Lỗi do nhà sản xuất, đơn vị vận chuyển.\\n- Lỗi do Shop tư vấn sai về size\\n- Lỗi do Shop thiếu số lượng, mẫu mã\\n\\n2. Trường hợp không đủ điều kiện áp dụng chính sách: \\n- Quá 07 ngày kể từ khi Quý khách nhận hàng từ shopee.\\n- Gửi lại hàng không đúng mẫu mã, không phải sản phẩm của BOM\\n- Không thích, không hợp, đặt nhầm mã, nhầm màu, yêu cầu kiểm tra hàng trước khi thanh toán.\\n\\nDo màn hình và điều kiện ánh sáng khác nhau, màu sắc thực tế của sản phẩm có thể chênh lệch khoảng 5-10%\\n\\n#quanongrong #quan #quansuongongrong #quanjogger #quanongsuongnu #quanvaiongrong #quanjoggernu #joggernu #joggernam #quanjoggerthunbogau #quanjoggerthun #quanjoggerongrong #quanjoggernutapgym #ullzang #unisex #unisexnamnu\"]',NULL,127,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/e6b879e21ff7171190e103c664e28033_tn\",\"https://down-vn.img.susercontent.com/file/6a28223fd25c972dd1b3dd30bdc37fb1_tn\",\"https://down-vn.img.susercontent.com/file/sg-11134201-22110-79c7tx7cv6jv36_tn\",\"https://down-vn.img.susercontent.com/file/18b7ee29cbaa7972b94ddc6f81075bec_tn\",\"https://down-vn.img.susercontent.com/file/2560422584c1a8bce98d220022a859a6_tn\"]',9548,NULL,20,'2024-02-11 15:01:59','2024-02-11 15:01:59');
INSERT INTO `products_data` (`id`,`title`,`description`,`star`,`price`,`categoryCode`,`priceCode`,`images`,`quantity`,`sale`,`quantitySold`,`createdAt`,`updatedAt`) VALUES (303,'Áo baby tee thun nữ cotton tay ngắn thêu họa tiết màu sắc tương phản thời trang mùa hè Ma040','[\"\\n\",\"\\n\",\"\\n\",\"\\n\",\"\\n\",\"\\n\",\"\\n\",\"\\n\",\"\\n\",\"\\n\",\"\\n\",\"\\n\",\"\\n\",\"BẢO HÀNH 7 NGÀY THEO CHÍNH SÁCH CỦA SHOPEE\",\"\\n\",\"- Khi mẫu lỗi do nhà sản xuất\",\"\\n\",\"- Khi giao sai size/ Sai mẫu khách đã đặt hàng\",\"\\n\",\"- Khi giao thiếu hàng\",\"\\n\",\"- Hỗ Trợ đổi trả nếu sản phẩm không giống hình\",\"👩 MÔ TẢ SẢN PHẨM \",\"\\n\",\"Áo baby tee thun cotton ngắn tay cổ tròn mỏng vừa vặn màu trắng phong cách mới mùa hè Mophus Là loại vải có đặc điểm mềm mịn, độ co giãn cao, khả năng thấm hút tốt và được dệt hoàn toàn từ sợi cây bông tự nhiên. Chất vải cotton cực kỳ thân thiện với làn da.\",\"\\n\",\"- Áo thun nam nữ form rộng cổ tròn thoải mái\",\"\\n\",\"- Áo baby tee thun nữ dễ phối đồ. Bạn có thể phối với quần jean, chân váy, … kết hợp với một đôi sneaker cho bạn tự tin xuống phố\",\"\\n\",\"📣 HƯỚNG DẪN BẢO QUẢN Áo baby tee thun nữ\",\"\\n\",\"- Lộn trái Áo baby tee tay ngắn khi giặt, không giặt chung áo Áo baby tee với quần áo tối màu. \",\"\\n\",\"- Sử dụng xà phòng trung tính, không sử dụng xà phòng có chất tẩy mạnh cho Áo baby tee\",\"\\n\",\"- Không sử dụng chất tẩy, không ngâm Áo baby tee\",\"\\n\",\"- Phơi ngang, không treo móc khi áo thun unisex ướt, không phơi trực tiếp dưới ánh nắng mặt trời. \",\"\\n\",\"\\n\",\"\\n\",\"️🎯 Giao hàng đúng size, lỗi 1 đổi 1 \",\"\\n\",\"️🎯 Giao COD toàn quốc \",\"\\n\",\"⚠️ LƯU Ý: Khi mở sản phẩm, khách yêu vui lòng quay lại video quá trình mở sản phẩm để được đảm bảo 100% đổi lại sản phẩm mới nếu Áo thun Mophus giao bị lỗi.\",\"\\n\",\"\\n\",\"\\n\",\"#ao #thun #phong #cotton #unisex #nam #nu #from #rong #tay #ngan \",\"\\n\",\"#Mophus #Streetwear #babytee #Mophus\",\"BẢO HÀNH 7 NGÀY THEO CHÍNH SÁCH CỦA SHOPEE\",\"\\n\",\"- Khi mẫu lỗi do nhà sản xuất\",\"\\n\",\"- Khi giao sai size/ Sai mẫu khách đã đặt hàng\",\"\\n\",\"- Khi giao thiếu hàng\",\"\\n\",\"- Hỗ Trợ đổi trả nếu sản phẩm không giống hình\"]',NULL,200,'WMC',NULL,'[\"https://down-vn.img.susercontent.com/file/628c0d8ce1cc6af4cc97197bdad81e3e_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134201-23030-kq8pb052cqov32_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134201-23030-o0kofa62cqovbc_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134201-23030-sgxx2452cqov3c_tn\",\"https://down-vn.img.susercontent.com/file/vn-11134207-7r98o-loxj5whnbt5a25_tn\"]',6474,NULL,929,'2024-02-11 15:01:59','2024-02-11 15:01:59');
